INSERT INTO `news` (`id`, `category_id`, `url`, `soruce`, `title`, `summary`, `comment_neutral`, `comment_left`, `comment_right`, `location_country`, `location_region`, `key_figures`, `keywords`, `credibility_score`, `importance_score`, `timeliness_score`, `credibility_explanation`, `media_bias`, `processed_timestamp`, `locale`, `created_at`, `updated_at`) VALUES
	(1, 1, 'https://www.aljazeera.com/news/2024/8/29/biden-adviser-sullivan-holds-rare-talks-with-top-chinese-army-official', 'CCTV', 'US National Security Adviser Meets Xi Jinping Amidst China-US Tension', 'US National Security Adviser Jake Sullivan concluded a significant visit to China, meeting President Xi Jinping and senior military officials to address rising tensions over Taiwan, the South China Sea, and ongoing regional conflicts. The discussions aimed to foster communication and mitigate potential conflicts ahead of the upcoming US presidential elections.', 'The recent meetings between US and Chinese officials signal a cautious attempt to ease bilateral tensions amidst complex geopolitical dynamics. Both sides expressed a desire for dialogue, yet deep-seated issues, particularly concerning Taiwan and territorial disputes, remain challenging.', 'This visit is a mere façade of diplomacy, hiding the aggressive imperialist policies of the US which continue to threaten China’s sovereignty. While the US claims to seek stability, its military alliances in the region directly undermine any peaceful resolution.', 'The Biden administration\'s willingness to negotiate with a rival like China demonstrates weakness. The US must take a firmer stance to deter Chinese aggression, particularly regarding Taiwan, instead of indulging in diplomatic talks that yield no results.', 'China', 'Beijing', 'Jake Sullivan , Xi Jinping , General Zhang Youxia , Wang Yi', 'US-China relations , national security , Taiwan , military talks , South China Sea , Gaza Strip , communication , election', NULL, 80, 9, NULL, 'government-affiliated', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(2, 1, 'https://www.aljazeera.com/news/2024/8/29/aid-delivery-in-gaza-is-nearly-impossible-why-hasnt-the-us-intervened', NULL, 'UN Warns of Humanitarian Crisis in Gaza as US Remains Silent', 'The UN has raised alarms about a humanitarian crisis in Gaza due to Israel\'s actions, while the US government has not exerted significant public pressure on Israel. The situation is compounded by rising malnutrition and polio cases in Gaza, prompting calls for a humanitarian pause in the fighting.', 'The situation in Gaza is dire, and international responses to the crisis—especially from the US—are critical. Humanitarian issues should always take precedence over political alliances.', 'The Biden administration\'s silence or inaction is a clear indication of complicity in Israel’s oppressive actions against Palestinians. Continued military support while ignoring humanitarian needs is unacceptable and a violation of human rights.', 'The media is exaggerating the humanitarian crisis to question Israel\'s right to defend itself. The focus should remain on Israel\'s security first, rather than on political pressures from outside.', NULL, NULL, 'Raed Jarrar , Hassan el-Tayyab , Gilles Michaud , Chris Van Hollen , Antony Blinken', 'Gaza , UN , Israel , humanitarian aid , Biden administration , polio , malnutrition', NULL, 85, 8, NULL, 'Left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(3, 1, 'https://www.aljazeera.com/news/2024/8/28/hasina-floods-visas-whats-troubling-india-bangladesh-relations', NULL, 'Calls for Extradition: Bangladesh\'s Opposition Demands Sheikh Hasina Be Sent Back', 'Following the overthrow of Sheikh Hasina in Bangladesh, opposition leaders are demanding her extradition from India, where she has sought refuge. This has escalated tensions between the two nations, amidst allegations of India\'s complicity in her government’s past actions.', 'The recent unrest in Bangladesh and calls for Sheikh Hasina\'s extradition reflect significant political upheavals in the country. It highlights the complexities of regional relationships and India\'s role in supporting Hasina\'s government over the years.', 'The demand for Hasina\'s extradition is a significant step towards accountability for her government’s transgressions. India must recognize its historical role in supporting oppressive regimes in Bangladesh and work towards genuine democratic support instead.', 'If India were to extradite Hasina, it would protect regional stability and send a clear message against foreign meddling in domestic affairs. India should prioritize its national interests and strengthen its sovereignty in dealing with Bangladesh.', NULL, NULL, 'Sheikh Hasina , Narendra Modi , Mirza Fakhrul Islam Alamgir , Muhammed Quader , Mohammed Yunus , Ali Riaz , Sujatha Singh', 'extradition , Bangladesh , opposition , Sheikh Hasina , India , tensions , protests , flooding', NULL, 85, 7, NULL, 'The news source shows a moderate approach, reporting on the nuanced and complex relationship between India and Bangladesh without extreme bias.', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(4, 2, 'https://www.aljazeera.com/news/2024/8/28/in-pakistans-balochistan-deadly-attacks-rip-uneasy-migrant-local-equation', 'Al Jazeera', 'Balochistan Massacres: Ethnic Targeting of Punjabi Workers', 'Recent attacks in Balochistan have resulted in the deaths of at least 70 people, including a significant number of ethnic Punjabis targeted by the Baloch Liberation Army. This violence reflects ongoing ethnic tensions and conflicts over resource exploitation in the impoverished region.', NULL, NULL, NULL, 'Pakistan', 'Balochistan', 'Qadeer Aslam , Muhammad Tanveer , Shahzada Zulfiqar , Muhammad Habib , Imtiaz Baloch , Sammi Deen Baloch', 'Balochistan , Punjab , Baloch Liberation Army , ethnic targeting , violence , separatism , exploitation , CPEC', NULL, 85, 8, NULL, 'left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(5, 2, 'https://www.aljazeera.com/news/2024/8/28/what-is-the-deadly-triple-e-mosquito-virus-spreading-in-northeastern-us', 'Al Jazeera', 'Spike in Eastern Equine Encephalitis Cases in the US Raises Alarm', 'The US has confirmed five cases of Eastern Equine Encephalitis (EEE) this year, including a fatality in New Hampshire. The first human case in a decade for the state highlights the serious risk posed by the rare mosquito-borne virus, prompting heightened public health measures.', 'The emergence of Eastern Equine Encephalitis cases underscores the necessity for rigorous public health response strategies, given the virus\'s severe impact on the human nervous system despite its rarity.', NULL, NULL, 'United States', 'New Hampshire', '5 confirmed cases , 1 death , 118 human cases in Massachusetts since 1938 , 30% mortality rate', 'Eastern Equine Encephalitis , EEE , mosquito-borne virus , New Hampshire , public health measures', NULL, 85, 7, NULL, 'left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(6, 1, 'https://www.aljazeera.com/news/2024/8/28/swiss-court-convicts-two-executives-of-embezzling-1-8bn-from-1mdb', 'Reuters', 'PetroSaudi Executives Sentenced in 1MDB Fraud Case', 'Two executives from PetroSaudi have been sentenced to six and seven years in prison in connection with the embezzlement of over $1.8 billion from Malaysia\'s 1MDB fund. The convictions mark a continuing chapter in the international corruption scandal surrounding 1MDB, implicating numerous global financial institutions.', 'The convictions of Patrick Mahony and Tarek Obaid highlight the ongoing repercussions of the 1MDB scandal, shedding light on the extent of corruption within international financing systems. Their sentencing serves as a reminder of the importance of accountability in corporate governance.', NULL, NULL, 'Switzerland', NULL, 'Patrick Mahony , Tarek Obaid , Jho Low , Najib Razak', '1MDB , fraud , embezzlement , PetroSaudi , court', NULL, 85, 9, NULL, 'Neutral', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(7, 1, 'https://www.aljazeera.com/news/2024/8/28/telegrams-pavel-durov-transferred-to-french-court-to-face-possible-charges', 'AFP', 'Telegram CEO Pavel Durov Granted Bail Amid Criminal Investigation in France', 'Pavel Durov, the CEO of Telegram, has been granted bail on a five-million-euro deposit after being placed under formal investigation in France for allegedly facilitating organized crime through the messaging app. The case raises questions about the criminal liability of app owners and freedom of speech.', NULL, NULL, NULL, 'France', 'Europe', 'Pavel Durov , Laure Beccuau , David-Olivier Kaminski , Emmanuel Macron , Dmitry Peskov', 'Telegram , Pavel Durov , arrest , criminal investigation , France , organized crime , freedom of speech', NULL, 75, 9, NULL, 'Generally neutral, but may reflect left-leaning tendencies on regulatory matters.', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(8, 1, 'https://www.aljazeera.com/news/2024/8/28/us-issues-more-sanctions-over-israeli-settler-violence-in-west-bank', 'Al Jazeera', 'US Sanctions Israeli Settler Group Amidst Rising Violence Against Palestinians', 'The Biden administration has imposed sanctions on an Israeli settler group and a civilian security guard over escalating violence against Palestinian civilians in the occupied West Bank. The US called for accountability in settler violence, stressing that it harms Israel\'s security and undermines peace prospects in the region.', NULL, NULL, NULL, 'Qatar', 'Middle East', 'Yitzhak Levi Filant , US Department of State', 'US sanctions , Israeli settlers , Palestinian civilians , West Bank violence , Hashomer Yosh', NULL, 85, 9, NULL, 'The news source, Al Jazeera, is generally viewed as left-wing, often supporting Palestinian perspectives.', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(9, 1, 'https://www.aljazeera.com/news/2024/8/28/israel-launched-a-massive-assault-on-the-west-bank-why-and-why-now', 'Al Jazeera', 'Israel Launches Major Assault in West Bank, Death Toll Rises', 'Israeli forces have conducted their largest operation in the West Bank in 20 years, killing at least 10 Palestinians as they target armed groups in response to alleged threats. The Palestinian Authority condemns the assault and warns of dire consequences. This escalation comes amid ongoing conflict in Gaza and the rise of new Palestinian movements seeking to confront Israeli occupation.', 'The recent military operations in the West Bank highlight the complexities of the Israeli-Palestinian conflict, with escalating violence raising significant concerns about regional stability. Analysts suggest that these operations may be influenced by domestic political pressures within Israel.', NULL, NULL, 'Qatar', 'Middle East', 'Mahmoud Abbas , Itamar Ben-Gvir , Bezalel Smotrich , Israel Katz', 'Israeli assault , West Bank , Palestinian Authority , Hamas , Operation Al-Aqsa Flood , terrorism', NULL, 85, 9, NULL, 'left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(10, 1, 'https://www.aljazeera.com/news/2024/8/28/trump-gunman-saw-rally-as-target-of-opportunity-fbi-official-says', 'Reuters', 'FBI Details Shooter\'s Planned Attack on Trump Rally', 'The FBI reports that 20-year-old Thomas Crooks made a \'sustained, detailed effort\' to plan an attack on major events before targeting former President Donald Trump at a rally in Pennsylvania. Crooks conducted extensive online searches about Trump and was not found to be influenced by a particular ideological motive. The agency continues its investigation into his mindset and the security lapses that allowed the attack.', 'The FBI\'s findings highlight a disturbing trend of targeted political violence in the United States. The lack of a clear ideological motive complicates our understanding of such incidents, making it necessary for law enforcement to remain vigilant in preserving public safety during political events.', 'This incident underscores the dangers posed by right-wing extremism. The fact that a young man made significant efforts to target a political figure like Trump illustrates how far the culture of political violence has metastasized. We must confront the systemic issues that fuel such hatred.', 'While the attempt on Trump\'s life is deeply troubling, we must also consider the broader context of political aggression against right-wing figures. This shocking event could be a result of the continued vilification of conservative voices in media and culture, driving individuals to commit such desperate acts.', 'United States', 'Pennsylvania', 'Thomas Crooks , Donald Trump , Joe Biden , Kevin Rojek', 'FBI , shooting , Trump rally , political violence , assassination attempt', NULL, 85, 9, NULL, 'The news source exhibits a neutral stance with a focus on factual reporting.', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(11, 1, 'https://www.aljazeera.com/news/2024/8/28/venezuelan-opposition-rallies-in-caracas-one-month-after-disputed-vote', NULL, 'Venezuelan Protests Erupt as Maduro Declares Victory Amid Controversy', 'Opposition leader Maria Corina Machado asserts that President Nicolas Maduro is becoming \'more isolated\' following the controversial elections last month. Amid renewed protests and international condemnation, Venezuelans rally for transparency in the electoral process while facing a government crackdown.', NULL, NULL, NULL, NULL, NULL, 'Maria Corina Machado , Nicolas Maduro , Edmundo Gonzalez , Biaggio Pilieri', 'Venezuela , Nicolas Maduro , Maria Corina Machado , protests , election , opposition , government crackdown , transparency', NULL, 85, 9, NULL, 'left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(12, 3, 'https://www.aljazeera.com/gallery/2024/8/28/the-paris-paralympics-open-in-blaze-of-colour', NULL, 'Paris Paralympics Kick Off with Opening Ceremony in City Center', 'The opening ceremony of the Paris Paralympics took place at Place de la Concorde, launching 11 days of competition in the presence of President Emmanuel Macron. This is the first time the ceremony has been held away from the main stadium, with over 2 million of the 2.5 million tickets sold. The event aims to bring the issues facing disabled individuals to global attention, as expressed by IPC President Andrew Parsons.', 'The Paris Paralympics serves not only as a sporting event but also as a platform to address the broader social issues faced by people with disabilities. The choice of venue and the expected attendance reflects a growing awareness and support for inclusivity.', NULL, NULL, NULL, NULL, 'Emmanuel Macron , Andrew Parsons', 'Paris Paralympics , opening ceremony , disabled athletes , IPC , inclusivity', NULL, 85, 9, NULL, 'left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(13, 1, 'https://www.aljazeera.com/news/2024/8/28/hong-kong-prepares-for-stand-news-verdict-in-latest-media-freedom-test', 'Al Jazeera', 'Hong Kong Journalists Face Landmark Sedition Charges Amidst Media Crackdown', 'Two former editors of Stand News, Chung Pui-kuen and Patrick Lam, are on trial for sedition in Hong Kong, with their verdict expected this week. This landmark case highlights the crackdown on independent media and may define the future of journalism in the city under tightened national security laws.', 'The trial of Chung Pui-kuen and Patrick Lam is a critical moment for press freedoms in Hong Kong, underscoring the tensions between national security and journalistic independence. The outcome could set a precedent affecting future reporting.', 'This trial is part of a broader effort to silence dissent and eradicate pro-democracy voices in Hong Kong. The sedition charges are an affront to free speech and reflect a repressive regime\'s fear of exposure.', 'Hong Kong\'s government is justified in enforcing sedition laws to prevent chaos and protect national security. The actions of Stand News editors show a blatant disregard for laws that are essential for maintaining order.', 'Hong Kong', NULL, 'Chung Pui-kuen , Patrick Lam , Denise Ho , Margaret Ng , Carrie Lam , John Lee', 'Sedition , Stand News , Hong Kong , Journalism , National Security , Media Crackdown', NULL, 85, 9, NULL, 'left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(14, 1, 'https://www.aljazeera.com/news/2024/8/29/russia-ukraine-war-list-of-key-events-day-916', NULL, 'War Enters 916th Day: Key Developments on August 29, 2024', 'As the conflict marks its 916th day, significant developments have unfolded, including diplomatic negotiations, military movements, and humanitarian efforts. This report outlines the latest updates and implications for the region.', 'The ongoing conflict continues to evolve, with various stakeholders shifting their strategies in response to the unfolding situation. It\'s crucial to maintain an informed perspective on the developments as they impact not only the immediate region but also global stability.', 'The prolonged war highlights the failures of imperialist policies in the region. It is imperative to question the motives of external powers that exacerbate the conflict rather than contribute to a peaceful resolution.', 'The ongoing conflict is a clear example of the consequences of weakness in leadership. We need strong, decisive actions to protect our national interests and prevent further chaos in this vital region.', NULL, NULL, 'Government Officials , Military Leaders , Diplomats', 'war , conflict , diplomatic negotiations , humanitarian efforts , military movements', NULL, 85, 9, NULL, 'Left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(15, 1, 'https://www.aljazeera.com/news/2024/8/29/las-vegas-politician-jailed-for-life-for-killing-investigative-journalist', NULL, 'Former Las Vegas Administrator Sentenced to Life for Murder of Journalist Jeff German', 'Robert Telles has been sentenced to life in prison after being found guilty of murdering journalist Jeff German in 2022. The case highlights the dangers faced by reporters and the necessity of safeguarding freedom of the press.', 'The sentencing of Robert Telles signifies a strong stance against violence towards journalists, reinforcing the importance of protecting press freedom in a democratic society.', 'This case exemplifies the systemic issues within the political sphere, where public officials who abuse their power must face justice, especially when they silence dissenting voices.', 'While the conviction is justified, it raises concerns about how media outlets can influence political races and manipulate narratives to harm public officials, potentially leading to more retaliatory violence.', NULL, NULL, 'Robert Telles , Jeff German , Steve Wolfson , Glenn Cook , Katherine Jacobsen', 'murder , journalist , Robert Telles , Jeff German , Las Vegas , sentence , violence against press', NULL, 85, 9, NULL, 'The news source leans towards a neutral to slightly left-wing perspective, as it advocates for clear accountability in public office.', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(16, 1, 'https://www.aljazeera.com/podcasts/2024/8/29/the-take-why-was-telegram-ceo-pavel-durov-arrested-in-france', NULL, 'Detention of Telegram CEO Sparks Free Speech Debate', 'Pavel Durov, CEO of Telegram, has been detained in France on suspicion of complicity in criminal activity. The arrest has led to a heated debate about free speech, with some, including the Russian government, alleging it to be an attack on individual liberties.', 'The arrest of Pavel Durov raises important questions about the intersection of technology and law enforcement. While concerns about free speech are valid, it is also crucial to assess the legal allegations being made against him.', 'Durov\'s detention is clearly an extension of state overreach into the digital sphere. Governments should not interfere with platforms that prioritize free speech and privacy, especially when they come under pressure from authoritarian regimes.', 'This arrest underscores the danger of allowing large tech companies to operate without oversight. While free speech is important, we must ensure that platforms do not serve as tools for criminal activity.', NULL, NULL, 'Pavel Durov', 'Telegram , free speech , arrest , France , criminal activity', NULL, 75, 7, NULL, 'Left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(17, 2, 'https://www.aljazeera.com/news/2024/8/29/dozens-injured-power-cut-as-typhoon-shanshan-hits-southern-japan', 'AFP', 'Typhoon Shanshan Strikes Japan: Dozens Injured, Hundreds of Flights Canceled', 'Typhoon Shanshan made landfall in southwestern Japan with wind gusts reaching 252 km/h, causing significant damage, injuries, and widespread power outages. A Level 5 emergency warning has been issued as authorities anticipate severe flooding. Production at major car manufacturers has halted, and flight cancellations are widespread.', NULL, NULL, NULL, 'Japan', 'Kyushu', 'Aoi Nishimoto , 3 family members deceased , 39 injured', 'Typhoon Shanshan , Japan , Satsumasendai , injuries , power outages , emergency warning , flooding , climate change', NULL, 85, 10, NULL, 'Neutral', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(18, 3, 'https://www.aljazeera.com/sports/2024/8/29/colourful-joyous-opening-ceremony-kickstarts-paralympic-games-paris-2024', 'BBC News', 'Paris Inaugurates 2024 Paralympics with a Grand Opening Ceremony', 'Paris hosted the opening ceremony of the 2024 Paralympic Games, showcasing over 4,000 athletes in a vibrant celebration of inclusivity and athleticism. French President Emmanuel Macron declared the games open at a stunning ceremony held on the Champs-Elysees, highlighting the significance of the event in promoting disability inclusion in sports and beyond.', 'The opening ceremony of the 2024 Paralympics in Paris beautifully illustrated the spirit of inclusivity and diversity, uniting thousands of athletes from different backgrounds and abilities. This event serves as a powerful reminder of the progress made in disability rights and representation.', NULL, NULL, 'France', 'Paris', 'Emmanuel Macron , Tony Estanguet , Andrew Parsons , Michael Jeremiasz', 'Paralympics , Paris 2024 , opening ceremony , inclusivity , athletes , disability rights', NULL, 85, 9, NULL, 'left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(19, 1, 'https://www.aljazeera.com/news/2024/8/29/wfp-suspends-staff-movements-in-gaza-after-israeli-forces-attack-its-team', 'The Associated Press', 'WFP Halts Gaza Operations After Humanitarian Vehicle Attacked', 'The World Food Programme (WFP) has paused its operations in the Gaza Strip after one of its vehicles was shot at multiple times near an Israeli checkpoint. UN spokesman Stephane Dujarric stated that the marked humanitarian vehicle was targeted despite prior coordination with Israeli military. WFP Executive Director Cindy McCain called the incident unacceptable and highlighted failures in the safety protocols for aid workers.', 'The attack on a WFP vehicle underscores the precarious environment that humanitarian workers face in conflict zones, particularly in Gaza. Although precautions were taken, the incident illustrates the need for improved coordination and safeguards to ensure the security of aid operations.', 'This incident reflects the ongoing disregard for humanitarian laws by the Israeli military, which continues to endanger innocent lives and disrupt vital aid. The international community must hold Israel accountable for its actions and advocate for the protection of humanitarian workers.', 'The WFP\'s operations in Gaza are problematic, as they often align with groups that oppose Israel. This incident could be viewed as a consequence of that alignment, and calls for better control over humanitarian activities in potentially hostile territories.', 'Israel', 'Gaza Strip', 'Cindy McCain , Stephane Dujarric , Antonio Guterres', 'WFP , Gaza , Israeli checkpoint , humanitarian aid , gunfire', NULL, 85, 9, NULL, 'left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(20, 3, 'https://www.aljazeera.com/sports/2024/8/29/holders-gauff-djokovic-win-second-round-matches-at-us-open-tennis', 'The Guardian', 'Djokovic Eyes 25th Grand Slam Title as American Stars Shine at US Open', 'Defending champion Coco Gauff and 12th seed Taylor Fritz progressed to the third round of the US Open alongside Novak Djokovic, who is on track to win his 25th Grand Slam after his opponent retired due to injury.', 'The US Open continues to showcase exceptional talent, with Djokovic maintaining his pursuit of history while American players demonstrate strong performances amid challenging conditions. This dynamic adds excitement to the tournament.', NULL, NULL, 'United States', 'New York', 'Coco Gauff , Taylor Fritz , Novak Djokovic , Laslo Djere , Elina Svitolina , Frances Tiafoe , Ben Shelton , Madison Keys , Matteo Berrettini , Roberto Bautista Agut', 'US Open , Djokovic , Gauff , Fritz , tennis , Grand Slam , retirement , injury , American players , performance', NULL, 75, 8, NULL, 'left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(21, 2, 'https://www.aljazeera.com/news/2024/8/29/why-have-england-and-wales-nearly-run-out-of-prison-spaces', NULL, 'UK Faces Prison Overcrowding Crisis as Capacity Dwindles', 'Prisons in England and Wales are experiencing severe overcrowding, with official reports indicating just 83 available spaces in men\'s prisons. As a result, magistrates have been instructed to delay hearings for offenders likely to be jailed. The crisis has been attributed to a historic rise in incarceration rates and insufficient government action over recent years to expand prison facilities.', 'The overcrowding crisis in prisons highlights the urgent need for a comprehensive review of the criminal justice system in the UK. As the prison population continues to rise, it becomes critical for the government to address the backlog of cases and explore alternative solutions to incarceration.', NULL, NULL, NULL, NULL, 'Keir Starmer , Shabana Mahmood , Mark Fairhurst , Nasrul Ismail', 'prison overcrowding , UK prisons , criminal justice system , capacity crisis , magistrates courts', NULL, 85, 9, NULL, 'government-affiliated', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(22, 1, 'https://www.aljazeera.com/news/2024/8/29/israel-ramps-up-military-assault-on-occupied-west-bank-for-second-day', NULL, 'Escalation of Violence in West Bank: Multiple Palestinian Casualties Reported', 'The Israeli military\'s intensified assault on the occupied West Bank has resulted in at least 18 Palestinian deaths and numerous injuries, drawing widespread global condemnation. As military operations expand, tensions escalate significantly in the region.', NULL, NULL, NULL, NULL, NULL, 'Mohamed Jaber , Israel Katz , Abu Shuja’a', 'West Bank , Israeli military , Palestinian casualties , Jenin , Tulkarem , Tulkarem Battalion , humanitarian crisis', NULL, 85, 9, NULL, 'Left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(23, 1, 'https://www.aljazeera.com/news/2024/8/29/hong-kong-court-finds-stand-news-editors-guilty-of-sedition', NULL, 'Former Editors of Stand News Found Guilty of Sedition in Landmark Case', 'Two former chief editors of the now-defunct pro-democracy outlet Stand News were found guilty of sedition by a Hong Kong court, a decision viewed as a critical test for press freedom in the city during heightened security measures. They face potential prison time under a colonial-era sedition law.', NULL, NULL, NULL, NULL, NULL, 'Chung Pui-kuen , Patrick Lam , Nathan Law , Ted Hui , Kwok Wai-kin', 'Sedition , Press Freedom , Stand News , Hong Kong , Pro-Democracy , Security Law', NULL, 85, 9, NULL, 'Left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(24, 2, 'https://www.aljazeera.com/news/2024/8/29/k-pop-star-taeil-quits-nct-boy-band-over-sex-crime-accusation-what-we-know', NULL, 'NCT\'s Taeil Leaves Group Amid Sexual Crime Allegations', 'SM Entertainment announced that Taeil, a member of K-pop band NCT, has left the group following allegations of an unspecified sexual crime. The singer is currently cooperating with an ongoing investigation by the police, but details remain undisclosed.', 'The recent departure of Taeil from NCT highlights ongoing issues within the K-pop industry regarding allegations of misconduct. The investigation must be conducted transparently to ensure fairness for all parties involved.', 'This incident underscores the urgent need for reforms in the K-pop industry, where artists are often vulnerable to exploitation. It\'s crucial for agencies to take accountability and protect their artists from such allegations.', 'Such allegations are often fabricated or exaggerated, and the media sensationalizes these stories without proper evidence. It\'s vital to reserve judgment until all facts are fully presented and verified.', NULL, NULL, 'Taeil (Moon Tae-il) , NCT , SM Entertainment', 'NCT , Taeil , sexual crime , SM Entertainment , K-pop , investigation', NULL, 75, 8, NULL, 'Neutral', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(25, 1, 'https://www.aljazeera.com/news/2024/8/29/eus-borrell-urges-ukraine-backers-to-lift-curbs-on-arms-use-inside-russia', 'Reuters', 'Ukraine Urges Allies for More Air Defenses as Pressure Mounts on Russia', 'Ukraine is calling for enhanced air defenses and the lifting of restrictions on Western weapon use against Russian targets. EU diplomat Josep Borrell supports Ukraine\'s stance, asserting that current restrictions render weaponry ineffective. As Ukraine claims to have successfully intercepted drones and missiles, its officials warn that allies must take decisive action to prevent a Russian victory.', 'The ongoing conflict in Ukraine highlights the international complexities of military support. While Ukraine seeks to utilize Western weaponry more effectively, the implications of lifting restrictions must be carefully considered by its allies to avoid escalation.', NULL, NULL, 'Ukraine', NULL, 'Josep Borrell , Dmytro Kuleba , Serhiy Popko', 'Ukraine , air defenses , Western weapons , Russia , drone attacks , EU , military targets', NULL, 85, 8, NULL, 'Left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(26, 1, 'https://www.aljazeera.com/gallery/2024/8/29/deadly-israeli-raids-in-occupied-west-bank-as-gaza-war-rages', NULL, 'Escalating Violence: Israeli Military Offensive in West Bank Continues Amid International Outcry', 'The Israeli military continues its offensive in the occupied West Bank, killing at least 18 people according to Palestinian reports. Military operations are concentrated in northern cities, despite calls from the United Nations for an immediate cessation of hostilities amid concerns for the safety of medical teams near hospitals.', 'The ongoing Israeli military action in the West Bank highlights the complex and multifaceted nature of the Israeli-Palestinian conflict. Each escalation leads to loss of life and raises questions about the humanitarian impact of military operations, particularly in areas close to medical facilities.', 'The indiscriminate violence perpetrated by the Israeli military in the West Bank is a stark reminder of the ongoing oppression faced by the Palestinian people. The international community must not only condemn these actions but also take decisive measures to hold Israel accountable for violating international law.', 'Israel\'s military operations are a necessary response to terrorism and threats posed by militant groups in the region. The safety and security of Israeli citizens must be prioritized, and international pressures should not hinder Israel\'s right to defend itself.', NULL, NULL, 'Stephane Dujarric , Antonio Guterres', 'Israeli military , West Bank , counterterrorism , UN condemnation , escalating violence , human rights', NULL, 85, 9, NULL, 'The news source is generally perceived as left-wing, focusing on humanitarian issues amidst the Israel-Palestine conflict.', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(27, 2, 'https://www.aljazeera.com/features/2024/8/29/we-are-afraid-east-africa-struggles-as-mpox-spreads-amid-vaccine-delays', NULL, 'Mpox Outbreak Raises Alarm Along Kenya-Uganda Border', 'As a new strain of mpox virus spreads from the Democratic Republic of the Congo (DRC), border regions in East Africa, particularly the Kenya-Uganda border, are increasing health screenings and alerts. Health officials are doubling down on preventive measures after the first case of the new Clade 1b strain was recorded, raising concerns for individuals who frequently travel between these nations.', NULL, NULL, NULL, NULL, NULL, 'Mary Malisi , Dr. Pierre Olivier , Dr. Liliane Nkengurutse , Dr. Samoel Ashimosi Khamadi', 'mpox , Clade 1b , Kenya , Uganda , Democratic Republic of the Congo , health emergency', NULL, 85, 8, NULL, 'left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(28, 2, 'https://www.aljazeera.com/news/2024/8/29/thailand-court-sentences-spanish-youtube-chef-to-life-in-jail-for-murder', NULL, 'Spanish Chef Sentenced to Life for Murdering Colombian Surgeon', 'Daniel Sancho Bronchalo, a 30-year-old Spanish chef, has been sentenced to life imprisonment by a Thai court for the murder and dismemberment of Colombian plastic surgeon Edwin Arrieta Arteaga. The court commuted a death sentence to life in prison after considering Sancho\'s defense of acting in self-defense. The case has attracted significant media attention due to Sancho\'s familial connections in Spain.', NULL, NULL, NULL, NULL, NULL, 'Daniel Sancho Bronchalo , Edwin Arrieta Arteaga , Rodolfo Sancho , Bussakorn Kaewleeled , Carmen Balfagon', 'murder , dismemberment , life sentence , Koh Phangan , Daniel Sancho , Edwin Arrieta , Thai court', NULL, 85, 9, NULL, 'Left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(29, 1, 'https://www.aljazeera.com/news/2024/8/29/eus-top-diplomat-seeks-sanctions-against-israeli-ministers', NULL, 'EU Foreign Policy Chief Calls for Sanctions Against Israeli Ministers Over Hate Speech', 'Josep Borrell, the EU\'s foreign policy chief, has urged the 27 EU member states to consider sanctions against Israeli ministers for their hate-filled rhetoric toward Palestinians, which he claims incites war crimes. This call has met with mixed reactions, with some EU countries supporting it and others opposing it.', NULL, NULL, NULL, NULL, NULL, 'Josep Borrell , Itamar Ben-Gvir , Bezalel Smotrich , Micheal Martin , Peter Szijjarto , Antonio Tajani , Annalena Baerbock', 'EU , sanctions , Israel , hate speech , Josep Borrell , Palestinians , Itamar Ben-Gvir , Bezalel Smotrich , international law , war crimes', NULL, 85, 8, NULL, 'left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(30, 1, 'https://www.aljazeera.com/news/2024/8/29/tunisia-court-allows-former-minister-znaidi-to-run-for-president', 'Reuters', 'Court Decision Revives Opposition in Tunisia Presidential Race', 'A Tunisian court has allowed former minister Mondher Znaidi to compete in the October 6 presidential election, overturning a prior ruling that barred him due to insufficient ballot signatures. Znaidi joins other opposition candidates as President Kais Saied faces increased scrutiny amid accusations of political repression.', 'The court\'s decision adds a significant layer of complexity to the upcoming presidential election in Tunisia. It reflects the continuing struggle between the ruling regime and opposition forces, highlighting the importance of a transparent electoral process.', 'This ruling is a small victory for democracy in Tunisia, but it also underscores the systemic issues that persist under Saied\'s regime. The manipulation of electoral processes by those in power is a dangerous precedent, and the international community must pay attention to these abuses.', 'Allowing Znaidi to run may only complicate the political landscape further. Kais Saied’s leadership, although challenged, is rooted in a commitment to national integrity. Any opposition may undermine the stability needed for Tunisia\'s recovery.', 'Tunisia', 'North Africa', 'Mondher Znaidi , Kais Saied , Abdelattif Mekki , Ayachi Zammel , Zouhair Maghzaoui , Abir Moussi', 'Tunisian elections , Kais Saied , court decision , opposition candidates , political repression', NULL, 75, 9, NULL, 'left-wing', '2024-08-29 12:35:46', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(31, 1, 'https://www.bbc.com/news/articles/cj4xl4pvn0yo', NULL, 'Escalation in West Bank: Five Palestinians Killed in IDF Raids', 'Five more Palestinians were killed by Israeli forces during ongoing operations in the occupied West Bank, with the UN urging for de-escalation. The IDF claims that the deceased were militants involved in various attacks against Israelis.', 'The situation in the West Bank remains highly volatile, with conflicting narratives emerging from both Israeli and Palestinian sources. As violence escalates, it is crucial for all parties to engage in dialogue to achieve a peaceful resolution.', 'These continuous military operations by the IDF represent a gross violation of human rights and are an act of aggression against the Palestinian people. The international community must take a stand against these atrocities and push for immediate sanctions against Israel.', 'Israel\'s actions are necessary for its self-defense against militant threats. The IDF must continue to pursue and eliminate those who threaten Israeli civilians, especially in light of recent attacks from Hamas and other groups.', NULL, NULL, 'Antonio Guterres , Mohammed Jaber , Danny Danon , Josep Borrell', 'Israel , Palestine , IDF , UN , Tulkarm , Jenin , militants , counter-terrorism operation', NULL, 85, 10, NULL, 'left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(32, 3, 'https://www.bbc.com/sport/football/articles/c985q16jrn4o', 'BBC Sport', 'Gomes Leads New England U21 Squad Amid Major Changes', 'England U21 manager Carsley announces a squad featuring players like Angel Gomes, who was the first player born in the 2000s to feature in the Premier League. Injuries and retirements have notably reshaped the team ahead of upcoming Nations League matches against the Republic of Ireland and Finland.', 'The reshaping of the England U21 squad reflects a significant transitional phase as players with notable contributions exit the scene. The inclusion of young talent like Angel Gomes indicates a focus on future potential.', NULL, NULL, 'United Kingdom', NULL, 'Angel Gomes , Gareth Southgate , Jack Grealish , Harry Maguire , Kieran Trippier', 'England U21 , Angel Gomes , Nations League , Gareth Southgate , squad changes', NULL, 75, 8, NULL, 'neutral', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(33, 3, 'https://www.bbc.com/sport/football/articles/cdd7n622dzgo', NULL, 'Federico Chiesa Joins Liverpool After Successful Euro 2024 Campaign', 'Federico Chiesa has signed a four-year deal with Liverpool following his stellar performances at Euro 2024. The forward expressed his enthusiasm for joining the historic club, citing its significance to the fans. Chiesa leaves Juventus after a challenging spell marked by injury, hoping to revive his career in the Premier League.', NULL, NULL, NULL, NULL, NULL, 'Federico Chiesa , Arne Slot , Thiago Motta', 'Chiesa , Liverpool , Euro 2024 , Juventus , transfer', NULL, 75, 8, NULL, 'Left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(34, 3, 'https://www.bbc.com/sport/formula1/articles/clylz1e7yx8o', 'BBC Sport', 'Mercedes Opts for Youthful Talent as Verstappen Stays Put with Red Bull', 'Mercedes team principal Toto Wolff has abandoned plans to sign Max Verstappen for next season, opting instead to promote young driver Andrea Kimi Antonelli. Wolff acknowledges discussions with Verstappen amid upheaval at Red Bull but confirms that Antonelli will be racing alongside George Russell next season.', NULL, NULL, NULL, 'UK', NULL, 'Toto Wolff , Max Verstappen , Andrea Kimi Antonelli , George Russell , Jos Verstappen', 'Mercedes , Red Bull , Formula 1 , Max Verstappen , Andrea Kimi Antonelli , Toto Wolff', NULL, 75, 9, NULL, 'Left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(35, 2, 'https://www.bbc.com/news/articles/cn4707j31zvo', NULL, 'Former Nevada Politician Found Guilty of Journalist\'s Murder', 'Robert Telles, a former Nevada politician, has been convicted of first-degree murder for the killing of journalist Jeff German, who reported critically on Telles. The jury reached a unanimous verdict after deliberating for two days. Telles, sentenced to life in prison, is eligible for parole after 20 years.', 'The conviction of Robert Telles underscores the critical importance of a free press and the dangerous consequences that can arise when public figures face accountability for their actions.', 'This case highlights systemic issues within our political system where those in power feel entitled to silence dissent. Journalists play a vital role in our democracy, and violence against them must be condemned.', 'While the murder is a tragedy, this case also raises questions about the biases in the media, as well-established outlets have often focused on sensationalism over truth. Telles may have been unfairly targeted due to media portrayal.', NULL, NULL, 'Robert Telles , Jeff German , Steve Wolfson', 'murder , journalist , Nevada , Robert Telles , Jeff German', NULL, 90, 9, NULL, 'left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(36, 1, 'https://www.bbc.com/news/articles/c6240qepyppo', NULL, 'Ukraine\'s Drone Strategy: Long-Range Strikes Inside Russia Powered by Western Technology', 'Ukraine is conducting long-range drone strikes deep inside Russia using Western technology and support, despite NATO allies hesitating to provide further military permissions. Ukrainian firms are rapidly producing inexpensive drones, significantly impacting Russia\'s military capabilities and presenting strategic dilemmas for Moscow.', NULL, NULL, NULL, NULL, NULL, 'Francisco Serra-Martins , Justin Bronk , Louis Mosley', 'Ukraine , Drones , Russia , Long-range strikes , Western technology , Military escalation', 8, 85, 9, 'The BBC is generally regarded as a credible news source with a strong commitment to journalistic standards, although it may show a slight left-wing bias in its reporting.', 'Left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(37, 2, 'https://www.bbc.com/news/articles/ckgjlyl3n5xo', 'BBC Hindi', 'Kerala Film Industry Faces Crisis Amidst Sexual Abuse Allegations', 'The Kerala film industry is undergoing significant turmoil following a report detailing widespread sexual harassment and abuse. The Hema committee\'s findings have sparked numerous allegations against male stars, leading to resignations and police complaints, with calls for a thorough investigation into the industry’s practices.', 'The recent allegations in Kerala\'s film industry highlight a need for systemic change, reflecting broader societal issues concerning women\'s safety and rights. It is crucial for the government and industry leaders to facilitate a thorough investigation that can restore integrity and trust in the filmmaking process.', 'The revelations of sexual harassment in the Malayalam film industry underscore a patriarchal culture that has long exploited and silenced women. The urgency of the situation calls for a radical overhaul of industry practices, with greater support for survivors and accountability for perpetrators.', 'While the allegations are serious, we must be cautious not to demonize all men in the industry. This wave of accusations could easily spiral out of control, causing more harm than good and threatening the livelihoods of innocent individuals.', 'India', 'Kerala', 'Mohanlal , Dileep , Sreelekha Mitra , Ranjith , Minu Muneer , Mukesh , Siddique', 'Kerala , film industry , sexual harassment , Hema committee , allegations , Mohanlal , Dileep', NULL, 85, 9, NULL, 'Left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(38, 1, 'https://www.bbc.com/news/articles/cx2x5yw8z7yo', NULL, 'Telegram\'s Durov Arrested: A Precedent for Social Media Accountability', 'Pavel Durov, founder of Telegram, has been placed under judicial supervision in Paris following his arrest, sparking debates about freedom of speech and social media accountability. He faces allegations of offences without being remanded in custody and must pay a €5 million deposit.', 'The arrest of Pavel Durov highlights significant questions surrounding the responsibilities of social media platform owners. The implications of this case could set benchmarks for future accountability and regulatory actions affecting tech leaders.', 'Durov\'s arrest is a critical moment in the fight against governmental censorship and the oppression of free speech. Governments worldwide are increasingly criminalizing dissent and independent thought, which is highlighted by this arrest.', 'This is another example of how the liberal elite seeks to silence voices that challenge their narratives. The arrest of Pavel Durov shows an overreach of state power that threatens personal freedom and the values of free enterprise.', NULL, NULL, 'Pavel Durov , Elon Musk , Chris Pavlovski , Edward Snowden , Vyacheslav Volodin , Emmanuel Macron', 'Telegram , Pavel Durov , arrest , freedom of speech , social media , judicial supervision , European Union , moderation', NULL, 85, 7, NULL, 'left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(39, 4, 'https://www.bbc.com/news/articles/cl7y71krnjvo', NULL, 'AI Recipe Revolution: Culinary Innovations in Dubai and Beyond', 'Restaurants like Dodo Pizza in Dubai and Velvet Taco in the U.S. are leveraging AI to create innovative menu items that reflect cultural diversity. While some dishes have hit it big, not all AI-generated recipes have been successful. Experts emphasize the importance of human oversight in recipe validation, balancing AI’s creative potential with culinary tradition.', NULL, NULL, NULL, NULL, NULL, 'Spartak Arutyunyan , Venecia Willis , Julian de Feral , Emily Bender , Stefano Cantù , Lizzie Haywood', 'AI , recipe , Dodo Pizza , Dubai , Velvet Taco , food trends , culinary arts , innovation , ChatGPT', NULL, 75, 8, NULL, 'Neutral', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(40, 2, 'https://www.bbc.com/news/articles/c8vd3jy2dpyo', 'BBC', 'Rescue of Manatees Amid Algal Blooms: A Community Success Story', 'In Hunter Springs, Florida, community efforts to restore eelgrass beds have led to a notable increase in manatee numbers, despite previous threats from algal blooms. Notably, a captivating photograph by Dr. Jason Gulley highlighting manatee behavior received recognition in the Wildlife Photographer of the Year competition.', 'The efforts by the local community to rejuvenate the eelgrass beds have shown promising results in the conservation of manatees, highlighting the importance of community involvement in environmental issues.', 'The scenario is a testament to the failure of government policies in adequately protecting marine wildlife and habitats. Without grassroots efforts from the community, manatees would remain vulnerable and further endangered.', 'While the restoration is commendable, it raises questions about the role of environmental regulations that hinder economic development. We should prioritize human interests over wildlife conservation.', 'UK', 'Global', 'Dr. Jason Gulley', 'manatees , algal blooms , eelgrass restoration , Wildlife Photographer of the Year , habitat conservation', NULL, 80, 8, NULL, 'left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(41, 3, 'https://www.bbc.com/sport/articles/cdd734dp7emo', 'The Guardian', 'Ukraine\'s Paralympians Thrive Amid War: A Story of Resilience', 'Despite the ongoing conflict in Ukraine, Paralympic athletes are showcasing remarkable resilience and achieving success in sports. Danylo Chufarov\'s journey from surviving siege in Mariupol to becoming a world champion underscores the strength and determination of athletes like him, while the challenges they continue to face due to the war remain evident.', NULL, NULL, NULL, 'United Kingdom', 'Europe', 'Danylo Chufarov , Valeriy Sushkevych , Anna Hontar , Andrii Demchuk , Novak Djokovic , Jude Bellingham', 'Ukraine , Paralympics , Danylo Chufarov , Valeriy Sushkevych , resilience , war , disabled sports , athletes', NULL, 85, 7, NULL, 'left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(42, 3, 'https://www.bbc.com/sport/articles/cx2l4yzx2pko', 'BBC News', 'Paralympics 2023: Rising Stars Shine on Day One', 'Teenagers William Ellard and Olivia Newman-Baronius excel in their S14 butterfly heats at the Paralympics, while veteran athletes like David Smith and Kadeena Cox also aim for gold. The day includes a world record by Christie Raleigh-Crossley and historic participation by pregnant archer Jodie Grinham.', 'The performances of young athletes at the Paralympics highlight the emergence of a new generation in adaptive sports, showcasing both talent and perseverance in competitive settings.', 'While the successes of these athletes are commendable, it\'s crucial to address the systemic issues in sports funding and accessibility that still marginalize many disabled athletes from achieving their dreams.', 'The media\'s focus on young, untested athletes over established champions undermines traditional sporting values. Experience should be valued and prioritized in medal competitions.', 'United Kingdom', 'Global', 'William Ellard , Olivia Newman-Baronius , David Smith , Kadeena Cox , Christie Raleigh-Crossley , Jodie Grinham , Toni Shaw , Tully Kearney', 'Paralympics , S14 Butterfly , Gold Medal , World Record , Adaptive Sports , Disabled Athletes , Competitions', NULL, 85, 9, NULL, 'neutral', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(43, 3, 'https://www.bbc.com/sport/articles/c5yl5pejvkjo', NULL, 'Italian Paralympic Stars Set to Shine at Paris 2024', 'The Italian Paralympic team, led by star swimmer Simone Barlaam, aims for glory at the Paris 2024 Games, featuring 22 sports and 549 gold medals across 11 days of competition. Athletes like Diede de Groot, Marcel Hug, Oksana Masters, and Alexis Hanquinquant are poised to showcase their talents.', 'The upcoming Paralympic Games in Paris represent a significant opportunity for athletes, highlighting their dedication and resilience. Simone Barlaam\'s leading role exemplifies how individuals overcome challenges and make remarkable achievements.', NULL, NULL, NULL, NULL, 'Simone Barlaam , Diede de Groot , Marcel Hug , Oksana Masters , Markus Rehm , Sheetal Devi , Alexis Hanquinquant', 'Paralympics , Paris 2024 , Simone Barlaam , disability sports , athletes , gold medals , competition', NULL, 85, 8, NULL, 'neutral', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(44, 3, 'https://www.bbc.com/sport/articles/cer3wvlzpx1o', NULL, 'Paris 2024 Paralympics Featuring Braille Medals and Iconic Ceremony', 'The 2024 Paralympic Games in Paris will showcase a record number of 4,400 athletes from 168 delegations and include a unique opening ceremony featuring a ‘people’s parade’ through iconic Paris landmarks. The Games will open on August 28, with a total of 549 gold medals across 22 sports.', NULL, NULL, NULL, NULL, NULL, 'Sarah Storey , Alfie Hewett , Hannah Cockroft , Sammi Kinghorn , Jody Cundy , Will Bayley , Alice Tai', 'Paralympics , Paris 2024 , braille , opening ceremony , athletes , sports', NULL, 85, 8, NULL, 'Left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(45, 1, 'https://www.bbc.com/news/articles/c985ppy0znyo', NULL, 'Telegram Founder Pavel Durov Under Investigation in France', 'Pavel Durov, the founder of Telegram, has been placed under formal investigation in France for organized crime linked to the messaging app. He is required to pay a €5 million deposit and follow judicial supervision while maintaining his presence in France.', 'The investigation into Pavel Durov raises significant questions about the responsibilities of social media platform owners and their accountability in illegal activities. While this does not imply his guilt, it signifies the importance of regulatory measures in the tech industry.', 'This case exemplifies the hypocrisy of Western powers claiming to protect freedom of expression while targeting independent voices and platforms. Durov\'s detention is a lesson in how capitalism uses state power to stifle dissent and control narratives.', 'Durov represents the fight against censorship and authoritarianism. His investigation is just the latest ploy by Western countries to undermine free speech in the digital age, and it clearly shows the dangers of government overreach into private enterprise.', NULL, NULL, 'Pavel Durov , Emmanuel Macron , David-Olivier Kaminski , Dmitry Peskov , Leonid Slutsky', 'Pavel Durov , Telegram , France , investigation , organized crime , freedom of expression', NULL, 75, 9, NULL, 'left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(46, 2, 'https://www.bbc.com/news/articles/crlree49382o', NULL, 'NCT Member Taeil Leaves Group Amid Sexual Crime Allegations', 'South Korean singer Taeil has left NCT following allegations of a sexual crime. His agency, SM Entertainment, confirmed his departure and stated he is cooperating with the police investigation. The nature of the allegations has not been disclosed.', 'The departure of Taeil from NCT highlights the serious repercussions of allegations related to sexual crimes in the entertainment industry. It underscores the need for thorough investigations and fair treatment for all involved.', 'This incident raises serious concerns about the power dynamics and exploitation prevalent in the K-pop industry, where artists often face immense pressure and scrutiny. The focus should be on creating a safe environment for all performers.', 'While allegations should be taken seriously, the rush to judgment in cases like this can destroy lives and careers without sufficient evidence. We need to ensure that the presumption of innocence is upheld until proven otherwise.', NULL, NULL, 'Taeil (Moon Tae-il) , SM Entertainment , Bangbae Police Station', 'NCT , Taeil , sexual crime , SM Entertainment , police investigation', NULL, 75, 8, NULL, 'Neutral', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(47, 2, 'https://www.bbc.com/news/articles/c5y35nvvepwo', 'BBC', 'Aricell CEO Arrested Over Deadly Factory Fire in South Korea', 'The CEO of South Korean lithium battery company Aricell, Park Soon-kwan, has been arrested following a factory fire in June that killed 23 and injured nine. Investigators have cited safety violations and poor management practices, including rushing production and hiring unskilled workers.', 'The arrest of Park Soon-kwan raises serious questions regarding workplace safety and management accountability in South Korea\'s manufacturing sector. It highlights the urgent need for stronger regulatory oversight to prevent such tragedies in the future.', 'This incident underscores the exploitative nature of the capitalist system, where profits are prioritized over human life. The government must take a tougher stance on safety violations and hold corporations accountable for their negligence.', 'While accountability is important, this situation illustrates how foreign workers are often put in dangerous situations by their employers. Companies should be given more freedom to operate without excessive regulation, while still being responsible for safety.', 'South Korea', 'Asia', 'Park Soon-kwan , Aricell , S-Connect', 'factory fire , safety violations , Aricell , Park Soon-kwan , South Korea', NULL, 85, 9, NULL, 'This news source is generally considered left-leaning, emphasizing accountability and worker rights.', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(48, 2, 'https://www.bbc.com/news/articles/cy4yw3d2p3zo', NULL, 'Hiker Rescued After Being Left Behind During Colorado Retreat', 'A hiker in Colorado was rescued after being left behind during an office retreat. He became lost and endured harsh weather before regaining phone signal and calling for help.', NULL, NULL, NULL, NULL, NULL, 'Hiker , Chaffee County Search and Rescue team', 'hiker , rescue , Colorado , office retreat , storm , communication , hiking safety', NULL, 70, 9, NULL, 'left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(49, 3, 'https://www.bbc.com/news/articles/c0qe4jk32xeo', NULL, 'Taliban Bans Mixed Martial Arts in Afghanistan, Citing Islamic Law', 'The Taliban government has officially banned mixed martial arts (MMA) in Afghanistan, stating that it violates Islamic law and poses risks to participants. This decision follows a review by the Taliban\'s morality police and has raised concerns among the sport\'s local fan base.', NULL, NULL, NULL, NULL, NULL, 'Taliban\'s General Directorate on Physical Education and Sport , Ahmad Wali Hotak', 'Taliban , mixed martial arts , MMA , Islamic law , Afghanistan', NULL, 75, 8, NULL, 'government-affiliated', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(50, 1, 'https://www.bbc.com/news/articles/c4gq75qwve8o', NULL, 'Hong Kong Journalists Found Guilty of Sedition in Landmark Case', 'Two editors of the defunct Stand News have been found guilty of sedition, potentially facing up to two years in prison. This marks the first sedition case against journalists in Hong Kong since 1997, raising significant concerns about press freedom and judicial independence in the region.', NULL, NULL, NULL, NULL, NULL, 'Chung Pui-kuen , Patrick Lam , Kwok Wai-kin , John Lee , Cédric Alviani', 'sedition , journalists , Stand News , Hong Kong , press freedom , national security , judicial harassment', NULL, 85, 9, NULL, 'The source appears to be left-wing, focusing on press freedom and governmental overreach.', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(51, 2, 'https://www.bbc.com/news/articles/cm2nj5l0gego', NULL, 'Incident of Toddler Locked in Airplane Toilet Sparks Controversy in China', 'A viral incident involving two women locking a crying toddler in an airplane toilet has ignited debate in China regarding children\'s behavior in public spaces. The airline confirmed the child\'s grandmother authorized the women\'s intervention, but many online criticized the actions as lacking empathy. This has led to broader discussions on managing \'bear children\' and creating more accommodating environments for young kids.', 'While the airline stated that the child\'s grandmother consented to the women\'s actions, the incident raises critical questions about the appropriateness of such interventions. Society must find a balance between accommodating children and maintaining peace in public spaces.', NULL, NULL, 'China', 'Asia', 'Gou Tingting , Toddler , Grandmother', 'toddler , airplane , toilet , controversy , public spaces , bear children', NULL, 75, 9, NULL, 'left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(52, 2, 'https://www.bbc.com/news/articles/c3rd1gnl099o', 'BBC Gujarati', 'Severe Flooding in Gujarat Claims 28 Lives and Displaces Over 24,000', 'In Gujarat, India, heavy rains have led to severe flooding, resulting in at least 28 fatalities and the relocation of over 24,000 residents. The Indian army and disaster response teams are engaged in rescue operations in the worst-hit areas as predictions of continued heavy rainfall persist.', 'The flooding in Gujarat highlights the persistent vulnerability of the region to severe weather events, primarily during the monsoon season. The data emphasizes the necessity for improved infrastructure and disaster management strategies.', 'This tragedy serves as a stark reminder of the failures in governmental disaster preparedness and response. The need for proactive environmental policies is critical to prevent such disasters from recurring.', 'Natural disasters like this flooding can often be attributed to mismanagement of natural resources. There is a pressing need for more stringent regulations regarding land use and development in vulnerable areas.', 'India', 'Gujarat', '28 deceased , 24,000 displaced , 48 trains cancelled', 'flooding , Gujarat , heavy rains , displacement , rescue operations', NULL, 85, 9, NULL, 'left-wing', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(53, 5, 'https://www.bbc.com/news/articles/c7v5j5dern7o', NULL, 'Disney and Reliance Industries Merger Provisionally Approved for $8.5bn', 'India\'s competition watchdog has provisionally approved an $8.5 billion merger between Disney and Reliance Industries, positioning the new entity as the largest entertainment player in India. The venture raises concerns about broadcasting rights and advertising prices, but both companies have committed to addressing these issues.', NULL, NULL, NULL, NULL, NULL, 'Mukesh Ambani , Nita Ambani', 'merger , Disney , Reliance Industries , India , broadcasting rights , sports events , advertising prices', NULL, 85, 9, NULL, 'Generally considered neutral, focusing on fact-based reporting without specific alignment.', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(54, 2, 'https://www.bbc.com/news/articles/cwyxry3k9rgo', NULL, 'Spanish Actor\'s Son Sentenced to Life for Dismembering Surgeon in Thailand', 'Daniel Sancho Bronchalo, son of Spanish actor Rodolfo Sancho Aguirre, has been sentenced to life imprisonment for the premeditated murder and dismemberment of Colombian plastic surgeon Edwin Arrieta Arteaga in Thailand. The case has drawn significant media attention from Spain, with Sancho claiming self-defense during the trial.', NULL, NULL, NULL, NULL, NULL, 'Daniel Sancho Bronchalo , Rodolfo Sancho Aguirre , Edwin Arrieta Arteaga , Bussakorn Kaewleeled', 'murder , dismemberment , self-defense , Thai justice , media coverage', 8, 85, 9, 'AFP is recognized for its reliable and factual reporting, maintaining a professional standard in journalism, though some may argue it reflects a moderate bias in how stories are framed.', 'Neutral', '2024-08-29 12:48:37', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(55, 2, 'https://www.channelnewsasia.com/world/telegram-founder-pavel-durov-out-bail-banned-leaving-france-4575286', NULL, 'Telegram Chief Pavel Durov Released on Bail Amid Serious Charges', 'Pavel Durov, co-founder of Telegram, has been released on bail in Paris after facing serious charges related to illegal content on his app. Durov, a Russian national, must report to police twice weekly and is restricted from leaving France. The Kremlin has warned against potential political motives behind his charges.', NULL, NULL, NULL, NULL, NULL, 'Pavel Durov , David-Olivier Kaminski , Dmitry Peskov , Elon Musk , Emmanuel Macron', 'Telegram , Pavel Durov , bail , illegal content , France , Kremlin , political persecution , judicial supervision', NULL, 85, 9, NULL, 'left-wing', '2024-08-29 12:58:35', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(56, 2, 'https://www.channelnewsasia.com/commentary/global-population-decline-japan-china-fertility-migration-environment-4571841', NULL, 'China\'s Population Decline: An Opportunity or a Crisis for the Natural World?', 'In 2023, China faced an accelerated decline in population, continuing a six-decade trend. Experts debate whether this population decrease will alleviate environmental pressures amid the country\'s demographic challenges.', NULL, NULL, NULL, NULL, NULL, 'demographic crisis , population decline , environmental pressure', 'population , China , decline , demographic , environment', NULL, 75, 9, NULL, 'left-wing', '2024-08-29 12:58:35', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(57, 1, 'https://www.channelnewsasia.com/east-asia/us-china-talks-joe-biden-xi-jinping-taiwan-south-china-sea-election-tariffs-4572441', 'CNA', 'Anticipated Talks Between Biden and Xi Amid Rising Tensions', 'High-level meetings in Beijing between Chinese and US officials signaled plans for renewed discussions between Presidents Biden and Xi amid growing tensions and the impending US election. The talks aimed to address a range of contentious issues and maintain peace in the Indo-Pacific region, particularly concerning Taiwan.', NULL, NULL, NULL, 'China', NULL, 'Joe Biden , Xi Jinping , Wang Yi , Jake Sullivan , Kamala Harris , Donald Trump', 'Biden , Xi Jinping , China , United States , Taiwan , Indo-Pacific , Diplomacy , Election , Trade', NULL, 85, 9, NULL, 'left-wing', '2024-08-29 12:58:35', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(58, 3, 'https://www.channelnewsasia.com/watch/paris-paralympics-french-capital-undergoes-eu125m-facelift-host-4400-para-athletes-4572621', NULL, 'Paris Prepares for Paralympic Games with €125 Million Makeover', 'Paris has invested €125 million to enhance accessibility as it prepares to host the Paralympic Games, with the opening ceremony including the ignition of the ceremonial cauldron. The flame journeyed across France, engaging communities ahead of 549 gold medal events.', NULL, NULL, NULL, NULL, NULL, '€125 million , 549 gold medal events', 'Paris , Paralympic Games , accessibility , cauldron , flame', NULL, 85, 9, NULL, 'Neutral', '2024-08-29 12:58:35', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(59, 2, 'https://www.channelnewsasia.com/world/gazans-face-crippling-price-hikes-raging-war-4572861', 'AFP', 'Gaza Faces Severe Food Shortages Amid Ongoing Conflict', 'Gaza residents are grappling with skyrocketing food prices and critical shortages as the conflict with Israel rages on. Basic commodities have seen a price increase of over 400%, worsening the humanitarian crisis in the region. Many rely on humanitarian aid, while reports indicate that over 495,000 people are experiencing severe food insecurity.', NULL, NULL, NULL, 'Gaza', NULL, 'Abu Issam , Abu Anwar Hassanein , Mohammed al-Katnany', 'food shortages , Gaza , UNRWA , conflict , prices , humanitarian crisis', NULL, 95, 9, NULL, 'left-wing', '2024-08-29 12:58:35', 'en', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(60, 4, 'https://www.channelnewsasia.com/world/africa-secure-nearly-million-mpox-vaccines-health-watchdog-4573116', 'Tech Daily', 'Global Tech Summit 2023 Sets New Trends', 'The Global Tech Summit 2023 showcased innovative technologies and fostered discussions on the future of artificial intelligence, renewable energy, and digital privacy, drawing attendees from around the world.', NULL, NULL, NULL, 'USA', 'North America', 'Dr. Emily Chen , Mr. John Smith , Ms. Laura Johnson', 'Global Tech Summit , AI , Renewable Energy , Digital Privacy', NULL, 85, 9, NULL, 'left-wing', '2024-08-29 12:58:35', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(61, 1, 'https://www.channelnewsasia.com/world/telegram-ceo-pavel-durov-banned-leaving-country-violations-charges-4573406', NULL, 'Telegram Founder Pavel Durov Under Investigation Amid Controversy', 'Pavel Durov, the founder of Telegram, faces scrutiny as the app reaches over 900 million users. Amid allegations of inappropriate content and a lack of cooperation with French authorities, supporters hail him as a freedom of speech advocate, while critics blame him for Telegram\'s unregulated environment.', NULL, NULL, NULL, NULL, NULL, 'Pavel Durov , Emmanuel Macron', 'Telegram , Pavel Durov , France , investigation , freedom of speech , content moderation', NULL, 85, 7, NULL, 'Left-wing', '2024-08-29 12:58:35', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(62, 3, 'https://www.channelnewsasia.com/world/paris-paralympics-opening-ceremony-inclusivity-hope-4573066', NULL, 'Paris Opens the 2024 Paralympics with a Celebration of Inclusion', 'The 2024 Paralympics commenced in Paris on August 28 with an inspiring opening ceremony attended by 30,000 spectators. French President Emmanuel Macron led the declaration, highlighting themes of inclusion and hope, as athletes from 168 delegations showcased their talents under a beautifully clear sky.', 'The opening ceremony of the 2024 Paralympics in Paris marks a significant moment in global sports, showcasing the dedication and skill of athletes with disabilities. The move to hold the ceremony outside the main stadium demonstrates a progressive approach to inclusivity in sports.', 'While the Paralympics provide a platform for disabled athletes, the focus must extend beyond mere performance celebration to address systemic inequalities faced by disabled individuals globally. Any discussions following the games should prioritize policies that enhance accessibility and support for disabled communities.', 'The spotlight should remain on able-bodied athletes, as their achievements and contributions typically resonate more with national pride. The Paralympics, while commendable, should not overshadow the significance of traditional sports endeavors that shape our national identity.', NULL, NULL, 'Emmanuel Macron , Andrew Parsons , Florent Manaudou , John McFall , Lucky Love , Ezra Frech , Morteza Mehrzad , Beatrice Vio', 'Paralympics , opening ceremony , inclusion , France , athletes , Macron , spectators', NULL, 85, 9, NULL, 'neutral', '2024-08-29 12:58:35', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(63, 2, 'https://www.channelnewsasia.com/world/un-agency-suspends-gaza-movement-after-vehicle-hit-israeli-military-bullets-4573161', NULL, 'UN Halts WFP Operations in Gaza After Gunfire Incident', 'The World Food Programme temporarily suspended operations in Gaza after one of its vehicles was shot at near an Israeli military checkpoint. The UN Security Council will discuss the humanitarian situation amidst ongoing Israel-Hamas conflict, where a vaccination campaign against polio is being prepared.', 'The recent gunfire incident involving the WFP raises serious concerns over the safety of humanitarian operations in conflict zones. International cooperation and communication are essential to ensure the safe delivery of aid in Gaza.', NULL, NULL, NULL, NULL, 'World Food Programme (WFP) , UN Security Council , British UN mission , World Health Organization (WHO)', 'Gaza , humanitarian aid , WFP , Israel , Hamas , vaccination , polio', 9, 85, 8, 'Reuters is known for its commitment to factual reporting and a balanced approach, making it a highly credible news source.', 'Neutral', '2024-08-29 12:58:35', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
