	(68, 1, 'https://www.aljazeera.com/news/2024/8/30/libyas-central-bank-chief-flees-country-over-militia-threats-report', 'Financial Times', 'Libya\'s Central Bank in Crisis Amid Armed Threats', 'Libya\'s Central Bank is facing a leadership crisis, with Governor Sadiq al-Kabir fleeing amid threats from armed militias. Meanwhile, a new board of directors has been appointed, leading to the suspension of banking operations and widespread confusion among staff and citizens.', NULL, NULL, NULL, 'United Kingdom', 'Global', 'Sadiq al-Kabir , Abdul Hamid Dbeibah , Osama Hammad , Khalifa Haftar', 'Central Bank of Libya , armed militias , political crisis , banking operations , oil revenue', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(69, 1, 'https://www.aljazeera.com/news/2024/8/30/new-zealands-maori-king-tuheitia-dies-aged-69', NULL, 'Māori King Kiingi Tuheitia Pootatau Te Wherowhero VII Passes Away at 69', 'Kiingi Tuheitia Pootatau Te Wherowhero VII, the Māori King of New Zealand, has died at the age of 69 following complications from heart surgery. His death has prompted national mourning, with tributes from politicians including Prime Minister Christopher Luxon and Britain’s King Charles III. The king was a significant figure in Māori culture and politics, advocating for the rights and dignity of the Māori people.', NULL, NULL, NULL, NULL, NULL, 'Kiingi Tuheitia Pootatau Te Wherowhero VII , Christopher Luxon , King Charles III', 'Kiingi Tuheitia , Māori King , heart surgery , tributes , colonialism', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(70, 1, 'https://www.aljazeera.com/news/longform/2024/8/29/in-venezuelas-diaspora-protests-erupt-against-maduros-contested-election', NULL, 'Venezuelan Diaspora Demands Election Transparency Amidst Political Turmoil', 'Venezuelan citizens living abroad are mobilizing to demand transparency in the election results, accusing the Maduro government of electoral fraud. With a significant diaspora of nearly 8 million people, they are lobbying foreign governments and rallying protests to push for a full release of voting data.', 'The situation in Venezuela highlights the critical role of the diaspora in advocating for democratic processes. Their collective actions are drawing international attention, which may pressure the Maduro government to provide clearer election results.', NULL, NULL, NULL, NULL, 'Gaby Arellano , Nicolas Maduro , Edmundo Gonzalez , Carolina Jimenez Sandoval , Gustavo Petro , Luiz Inacio Lula da Silva , Maria Corina Machado , William Clavija , Gabriel Hernandez', 'Venezuela , diaspora , election , transparency , Maduro , protests , political refugee , foreign governments , human rights', NULL, 80, 7, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(71, 1, 'https://www.aljazeera.com/news/2024/8/29/why-jenin-what-does-israel-have-against-the-refugee-camp', 'Al Jazeera', 'Renewed Violence in Jenin: Israeli Assault Escalates Amidst Longstanding Conflict', 'Amid the largest Israeli military assault on the West Bank since the second Intifada, the city of Jenin and its refugee camp face severe attacks resulting in casualties and blocked access to medical facilities. This situation reflects a prolonged cycle of violence and the dire humanitarian conditions faced by Palestinians in the region.', 'The ongoing military actions in Jenin highlight the complex layers of the Israeli-Palestinian conflict, which include humanitarian crises, political strife, and systemic violence. Understanding these dynamics is essential for any dialogue aimed at resolution.', NULL, NULL, 'Israel', 'West Bank', 'Zaid Shuabi , Tahani Mustafa , Itamar Ben-Gvir , Bezalel Smotrich , Mahmoud Abbas', 'Jenin , Israeli military , West Bank , refugee camp , violence , casualties , occupation , Palestinian Authority , armed groups', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(72, 1, 'https://www.aljazeera.com/news/2024/8/29/before-key-interview-five-questions-kamala-harris-hasnt-answered-yet', 'Axios', 'Kamala Harris Faces Scrutiny Ahead of Major CNN Interview', 'US Vice President Kamala Harris, facing criticism for her ambiguous stance on critical issues like immigration, Gaza, and inflation, is set to give her first major interview with CNN. Critics have labeled her approach cautious and uninformative, especially as she tries to define her agenda ahead of the presidential race.', NULL, NULL, NULL, 'USA', 'National', 'Kamala Harris , Tim Walz , Donald Trump , Martha Joynt Kumar , Benjamin Netanyahu', 'Kamala Harris , CNN interview , Gaza , immigration , inflation , price gouging , Democratic Party', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(73, 3, 'https://www.aljazeera.com/sports/2024/8/29/williams-f1-rookie-franco-colapinto-laughs-off-crazy-messi-comparisons', NULL, 'Franco Colapinto Makes F1 Debut, Dubbed the ‘Messi of F1’', 'Franco Colapinto, a 21-year-old rookie from Argentina, is set to make his Formula One debut at the Italian Grand Prix in Monza. The first Argentinian driver to compete in over 20 years, he dismissed comparisons to football star Lionel Messi, emphasizing that he wants to focus on his performance rather than the expectations. Colapinto replaces the struggling Logan Sargeant for Williams, and the team\'s fans are optimistic about his entry.', 'Franco Colapinto\'s entry into Formula One signifies a new era for Argentinian motorsport. While comparisons to Messi may seem exaggerated, they highlight the excitement surrounding his debut. His cautious approach to the race reflects maturity beyond his years, and fans will be eager to see how he performs under pressure.', NULL, NULL, 'UK', 'Europe', 'Franco Colapinto , Lionel Messi , Logan Sargeant', 'Franco Colapinto , F1 , Italian Grand Prix , Argentina , Williams , debut', NULL, 75, 9, NULL, 'neutral', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(74, 1, 'https://www.aljazeera.com/news/2024/8/29/abba-tells-trump-to-stop-playing-its-songs-at-his-events', NULL, 'ABBA and Other Artists Demand Trump Cease Use of Their Music', 'Numerous artists, including Swedish group ABBA, have protested against Donald Trump\'s unauthorized use of their music during campaign events, demanding its immediate removal. This follows previous instances where other artists\' music, such as Isaac Hayes and Sinead O\'Connor, was similarly used without permission.', NULL, NULL, NULL, 'United States', NULL, 'Donald Trump , ABBA , Isaac Hayes , Sinead O\'Connor', 'unauthorized music , Trump campaign , ABBA , artist rights', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(75, 1, 'https://www.aljazeera.com/news/2024/8/29/un-says-israel-agrees-to-pauses-in-gaza-fighting-for-polio-vaccinations', NULL, 'WHO Secures Vaccination Agreement Amid Gaza Crisis', 'The WHO has announced a temporary humanitarian agreement to allow for the vaccination of 640,000 children against polio in Gaza. Three separate pauses from 6 am to 3 pm over nine days will facilitate the distribution of vaccines in different areas, as deteriorating conditions fuel disease spread.', 'This temporary pause for vaccination signifies a crucial intervention to protect vulnerable children in Gaza, although it underscores the ongoing humanitarian crisis in the region.', 'While the WHO\'s agreement is a step towards addressing the dire health situation, it is a mere band-aid solution in light of Israel\'s continued military actions that exacerbate the humanitarian situation.', 'This vaccination initiative seems to be an overstated response to a non-existent polio crisis; the focus should be on ensuring security rather than humanitarian aid.', NULL, NULL, 'Rik Peeperkorn , Abdel-Rahman Abu El-Jedian , Antony Blinken', 'WHO , vaccination , Gaza , polio , humanitarian pause , Israel , children , health crisis', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(76, 1, 'https://www.aljazeera.com/news/2024/8/29/houthis-release-footage-of-fighters-boarding-greek-oil-tanker-in-red-sea', 'The Guardian', 'Houthi Explosions Threaten Major Oil Spill in Red Sea', 'A video by Yemen’s Houthis shows explosions on the Sounion oil tanker, raising concerns over a potential oil spill. The ship, carrying nearly one million barrels of crude oil, was previously attacked amid the Houthis\' campaign against vessels linked to Israel. The situation poses a serious threat to the Red Sea\'s marine ecosystem and global shipping routes.', NULL, NULL, NULL, 'United Kingdom', 'Middle East', 'Yahya Saree , Patrick Ryder , Mohammed Abdulsalam', 'Houthi , Oil Tanker , Sounion , Red Sea , Explosions , Oil Spill , Israel', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(77, 1, 'https://www.aljazeera.com/news/2024/8/29/serbia-and-france-sign-3bn-deal-for-sale-of-french-fighter-jets', NULL, 'Serbia Signs $3bn Rafale Fighter Jet Deal with France', 'Serbia has entered into a $3bn agreement with France to purchase 12 Rafale fighter jets as part of efforts to strengthen ties with Western nations and reduce reliance on Russia, marking the largest weapons sale to Serbia since 2006.', NULL, NULL, NULL, NULL, NULL, 'Bratislav Gasic , Eric Trappier , Emmanuel Macron , Aleksandar Vucic', 'Serbia , France , Rafale fighter jets , $3bn agreement , Russia , EU , military modernization', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(78, 1, 'https://www.aljazeera.com/economy/2024/8/29/brazil-judge-blocks-starlink-accounts-as-x-suspension-deadline-looms', NULL, 'Elon Musk\'s Starlink Faces Financial Block in Brazil Amid Ongoing Feud with Judge', 'Brazilian judge Alexandre de Moraes has ordered the blocking of financial transactions for Elon Musk\'s Starlink due to ongoing disputes over social media censorship and misinformation. Musk has strongly criticized the judge\'s actions, branding them as unconstitutional and a violation of free speech.', 'The ongoing conflict between Elon Musk and Judge Alexandre de Moraes highlights the complexities of regulating online platforms and free speech worldwide. De Moraes\'s actions may be seen as an attempt to enforce Brazilian law, while Musk\'s response illustrates the tension between corporate interests and governmental authority.', NULL, NULL, NULL, NULL, 'Elon Musk , Alexandre de Moraes', 'Starlink , de Moraes , Elon Musk , censorship , social media , disinformation', 8, 85, 8, 'Reuters is widely recognized for its rigorous journalistic standards and factual reporting, although some may perceive a slight left-leaning bias in certain stories.', 'Left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(79, 1, 'https://www.aljazeera.com/news/2024/8/30/russia-ukraine-war-list-of-key-developments-day-917', NULL, 'War Update: Day 917 - Key Developments', 'As the war enters its 917th day, significant developments have emerged regarding troop movements, peace negotiations, and humanitarian efforts. On August 30, 2024, the situation remains critical with ongoing clashes and efforts to secure a ceasefire.', NULL, NULL, NULL, NULL, NULL, 'Troops , Diplomats , Humanitarian Workers', 'war , troop movements , peace negotiations , humanitarian efforts , ceasefire', 7, 85, 8, 'The source is known for its progressive stance and thorough reporting, but may exhibit bias towards left-wing perspectives.', 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(80, 1, 'https://www.aljazeera.com/economy/2024/8/30/frances-macron-defends-giving-citizenship-to-telegram-ceo-pavel-durov', 'Le Canard Enchaine', 'Macron Defends Fast-Track Citizenship for Indicted Telegram CEO', 'French President Emmanuel Macron has defended the decision to grant fast-track citizenship to Telegram CEO Pavel Durov, despite his recent arrest on multiple charges. Macron claimed he had no prior knowledge of Durov\'s visit and described the arrest as an independent act of justice. The case has raised concerns over freedom of speech and online privacy amid criticism from tech leaders and Russian officials.', 'The situation appears to be a complex interplay between justice and nationality, as Macron emphasizes the importance of learning the French language while facing serious allegations against Durov. The broader implications for freedom of expression and online privacy deserve careful consideration.', 'This incident exemplifies the hypocrisy of Western nations claiming to uphold freedom of speech while actively undermining it through targeted legal actions. Durov\'s arrest is a blatant attack on technological innovation and should be condemned by all who value unrestricted communication.', 'Once again, we see European countries breathing down the necks of successful entrepreneurs, attempting to stifle innovation under the guise of justice. Macron\'s comments reveal the underlying narrative of control and regulation on tech founders, which undermines the very principles of free-market capitalism.', 'France', 'Europe', 'Emmanuel Macron , Pavel Durov , Dmitry Peskov', 'Macron , Durov , citizenship , Telegram , freedom of speech , arrest , France', NULL, 80, 8, NULL, 'Government-affiliated', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(81, 1, 'https://www.aljazeera.com/news/2024/8/30/japans-ruling-party-faces-generational-battle-as-it-chooses-new-leader', NULL, 'Fumio Kishida Announces Resignation Amid Controversy and Call for Reform', 'Fumio Kishida has announced he will step down as Japan\'s Prime Minister after three years of low approval ratings and corruption scandals within the ruling Liberal Democratic Party. His departure aims to signal a need for political reform within the party as it prepares for a leadership election in September.', 'Kishida\'s sudden resignation reflects a broader trend in Japanese politics where leaders face immense pressure from public dissatisfaction and internal party dynamics. The upcoming leadership election will be crucial in determining the future direction of the LDP and its strategies to gain public trust.', 'Kishida\'s inability to address systemic issues such as corruption and the rising cost of living highlights the failures of the ruling elite. The Japanese political landscape demands a radical shift towards transparency and accountability, which the next leader must embody to restore faith in governance.', 'The collapse of political factions within the LDP signals potential instability, which could jeopardize Japan\'s strategic policies internationally. A leaner and stronger party is necessary to maintain national interests amidst global challenges, especially regarding defense policies.', NULL, NULL, 'Fumio Kishida , Shinzo Abe , Seiko Noda , Yoko Kamikawa , Taro Kono , Shigeru Ishiba , Shinjiro Koizumi , Takayuki Kobayashi', 'Fumio Kishida , resignation , political reform , corruption scandal , Liberal Democratic Party , leadership election', NULL, 85, 7, NULL, 'neutral', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(82, 1, 'https://www.aljazeera.com/news/2024/8/30/ukraine-says-us-made-f-16-fighter-jet-crashed-killing-pilot', 'Reuters', 'First F-16 Crash in Ukraine Amid Heavy Russian Bombardment', 'Ukraine\'s first F-16 fighter jet crash occurred while repelling a significant Russian missile and drone attack, resulting in the death of pilot Oleksiy Mes. This incident highlights the ongoing intensity of the conflict as Ukraine\'s air defenses continue to face challenges.', 'The crash of the F-16 underscores the dangers faced by Ukrainian pilots amidst ongoing conflict. Investigations continue to determine the cause, as this incident marks a significant moment in Ukraine\'s military efforts with the newly acquired Western aircraft.', NULL, NULL, 'Ukraine', NULL, 'Oleksiy Mes , Mykola Oleshchuk , Adam Kinzinger', 'F-16 , Ukraine , Russia , pilot , crash , missile attack', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(83, 1, 'https://www.aljazeera.com/news/2024/8/30/donald-trump-pledges-free-ivf-for-women-criticises-six-week-abortion-ban', 'NBC News', 'Trump\'s Shift Towards Moderate Stance on Reproductive Issues', 'Former President Donald Trump has pledged to make in vitro fertilisation (IVF) free for women and criticized a six-week abortion ban in Florida, aiming to present a moderate image on reproductive rights as he campaigns for the presidency.', 'Trump\'s recent comments on reproductive issues may reflect a strategic pivot aimed at gaining more female voters, but his previous actions may complicate this effort.', 'Trump\'s pledge on IVF coverage feels disingenuous given his past anti-abortion stance. This is merely a tactic to appeal to moderate voters while maintaining support among conservatives.', 'Trump\'s comments undermine the core values of the pro-life movement; his shift towards a more liberal position on abortion could alienate the base that got him elected.', 'USA', 'National', 'Donald Trump , Kamala Harris , JD Vance , Ron DeSantis', 'Trump , IVF , abortion , reproductive rights , women\'s rights', NULL, 85, 7, NULL, 'Right-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(84, 1, 'https://www.aljazeera.com/news/2024/8/30/us-army-defends-arlington-cemetery-employee-pushed-during-trump-visit', 'The New York Times', 'Trump\'s Controversial Visit to Arlington National Cemetery Sparks Outrage', 'Former President Donald Trump\'s recent visit to Section 60 of Arlington National Cemetery has provoked significant backlash, particularly due to a video capture of him by his campaign, which is against military protocols in that area. The Army defended an employee who was removed during the event. Concerns grow over the potential politicization of the military amid Trump\'s ongoing presidential campaign.', 'The event illustrates the thin line between honoring military sacrifices and the risks of politicizing such sacred spaces. It\'s vital to maintain respect for those buried in Section 60 while also addressing the potential ramifications of political figures visiting these areas.', NULL, NULL, 'USA', 'Arlington, Virginia', 'Donald Trump , Kamala Harris , James Stavridis', 'Trump , Arlington National Cemetery , political activity , military , Section 60 , wreath-laying ceremony', NULL, 85, 7, NULL, 'Left-wing and independent-focused media neutrality.', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(85, 2, 'https://www.aljazeera.com/features/2024/8/30/a-year-after-johannesburg-building-fire-survivors-feel-abandoned-by-city', NULL, 'Johannesburg Authorities Liable for 2023 Fire that Claimed 76 Lives', 'An inquiry has found the City of Johannesburg liable for neglect following a devastating fire in August 2023 at the Usindiso building that resulted in 76 deaths. Survivors continue to face dire living conditions in makeshift shelters as the city struggles to provide adequate housing.', NULL, NULL, NULL, NULL, NULL, 'Sibongile Majavava , Muhdi , Siyabonga Mahlangu , Edward Molopi , Sibonelo Mtshali , Sithembiso Mdlalose , Thabo Mlangeni', 'Johannesburg , fire , Usindiso building , City of Johannesburg , negligence , housing crisis , homeless shelter , hijacked buildings', NULL, 85, 8, NULL, 'Left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(86, 2, 'https://www.aljazeera.com/news/2024/8/30/mexico-drug-cartel-stronghold-sinaloa-rocked-by-shootings-arson', 'Reuters', 'Renewed Violence in Sinaloa Following Arrests of Drug Lords', 'A resurgence of violence in Sinaloa, Mexico, follows the U.S. arrests of drug lords Joaquin Guzman Lopez and Ismael \'El Mayo\' Zambada. Attacks on military personnel and road blockages were reported, particularly around Culiacan, prompting fears of wider unrest in this stronghold of the Sinaloa cartel.', NULL, NULL, NULL, 'Mexico', 'Sinaloa', 'Joaquin Guzman Lopez , Ismael \'El Mayo\' Zambada , Ruben Rocha', 'violence , drug lords , arrests , Sinaloa , Culiacan , cartel', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(87, 1, 'https://www.aljazeera.com/news/2024/8/30/israel-presses-on-with-assault-on-occupied-west-bank-for-third-day', 'Al Jazeera', 'Escalating Violence: Israeli Forces Withdraw from Tulkarem, Intensify Attacks in Jenin', 'The Israeli army\'s largest military action in two decades in the West Bank has led to severe destruction in Tulkarem and escalated attacks on Jenin, with multiple casualties reported. The military claims to target armed groups, while residents express fears of a strategic push to displace Palestinians.', NULL, NULL, NULL, 'Israel/Palestine', NULL, 'Wassam Hazem , Israel Katz , Hussein al-Sheikh Ali', 'Israeli army , Jenin , Tulkarem , military assault , Palestinian casualties , infrastructure destruction , Hamas , Palestinian Islamic Jihad', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(88, 1, 'https://www.aljazeera.com/news/2024/8/30/germany-deports-28-afghans-for-first-time-since-2021-taliban-takeover', NULL, 'Germany Deports Convicted Criminals to Afghanistan Amid Security Concerns', 'Germany has deported 28 Afghan nationals, all convicted criminals, in a move described by the Interior Minister as crucial for national security. This is the first such operation since the Taliban regained power in 2021, and it was facilitated through secret negotiations with Qatar as Germany cut ties with the Taliban. The deportation follows recent debates on immigration policy, especially after a violent attack in Solingen.', 'The recent deportation of Afghan nationals by Germany raises significant questions about the balance between national security and human rights. It acknowledges the complexities of immigration policy in the context of recent violent incidents and the evolving political landscape in Germany.', NULL, NULL, NULL, NULL, 'Nancy Faeser , Stefan Hebestreit , Olaf Scholz', 'Germany , deportation , Afghan nationals , Taliban , security , immigration', NULL, 80, 9, NULL, 'government-affiliated', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(89, 2, 'https://www.aljazeera.com/news/2024/8/30/why-is-namibia-culling-elephants-and-hippos-for-meat', 'BBC News', 'Namibia Faces Drought Crisis as Thousands of Wild Animals Cull for Food', 'Namibia is experiencing its worst drought in decades, leading to a severe humanitarian crisis. Over 700 wild animals, including elephants and hippos, are being culled to provide meat for the country\'s starving population, with about 84% of food reserves exhausted. The drought, exacerbated by climate change, has led to high levels of food insecurity affecting nearly half of the population.', 'The sheer scale of the humanitarian crisis in Namibia requires urgent attention from both national and international communities. While culling wild animals can provide immediate relief, it also raises complex discussions about wildlife management and sustainable practices. The long-term solutions must focus on improving water resource management and enhancing agricultural resilience.', 'The culling of wildlife in Namibia is a stark representation of systemic failures addressing the climate crisis and its effects on marginalized communities. Instead of turning to destructive measures, the government should prioritize sustainable development and equitable food distribution systems that protect both people and wildlife.', 'This drastic action of culling wildlife reflects the necessity of prioritizing human welfare over the preservation of wildlife. Namibia should be applauded for making tough decisions to ensure food security for its citizens, pushing back against misguided animal rights activists who fail to see the bigger picture.', 'Namibia', 'Southern Africa', '2.5 million population , 700 wild animals culled , 84 percent food reserves exhausted , 30 hippos , 60 buffalos , 50 impalas , 100 blue wildebeest , 300 Zebras , 83 elephants , 100 elands', 'Namibia , drought , humanitarian crisis , culling , wildlife , food insecurity , climate change , food reserves', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 09:41:25', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(90, 1, 'https://www.bbc.com/news/articles/c3ejw1kd7ndo', 'CNN', 'Kamala Harris Defends Shift to Moderate Policies in Presidential Bid', 'In her first interview since announcing her presidential candidacy, Vice-President Kamala Harris defended her changed positions on immigration and climate policy, asserting that her core values remain consistent. As her Republican opponent Donald Trump criticizes her as a fraud, Harris emphasizes a need for consensus and bipartisanship and addresses issues like the economy and the Israel-Palestine conflict.', 'Kamala Harris\' interview highlights the complexity of political positions and the need for adaptation in response to changing circumstances. Her ability to explain her shifting policies may attract both criticism and support from various voter segments.', NULL, NULL, 'USA', 'North America', 'Kamala Harris , Donald Trump , Tim Walz', 'immigration , climate change , bipartisanship , economic policy , Israel-Palestine conflict , Kamala Harris , Donald Trump', NULL, 85, 7, NULL, 'left-wing', '2024-08-30 09:54:05', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(91, 3, 'https://www.bbc.com/sport/football/articles/c0e855epg0po', NULL, 'Ivan Toney\'s Potential Transfer to Al-Ahli Gathers Momentum', 'England forward Ivan Toney is set to complete a move to Saudi club Al-Ahli, with sources indicating a deal is close. Toney, who has not played this season due to an eight-month suspension, was omitted from the England squad for upcoming matches. The Saudi transfer window remains open until September 2.', 'Ivan Toney\'s potential transfer to Al-Ahli could mark a significant change in his career. Despite a tumultuous previous season, his skills as a forward are undeniable, and this move could provide him with not only financial benefits but also a fresh start.', NULL, NULL, NULL, NULL, 'Ivan Toney , Victor Osimhen , Thomas Frank', 'transfer , Al-Ahli , Brentford , England , football', NULL, 75, 9, NULL, 'neutral', '2024-08-30 09:54:05', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(92, 3, 'https://www.bbc.com/sport/cricket/articles/cr7r3z2753do', 'The Guardian', 'Joe Root\'s Resilient Century: A Testament to His Enduring Legacy', 'Joe Root scored a magnificent 143 runs against Sri Lanka, leading England to success on the first day of the second Test. His performance showcases his unyielding determination and skill, reaffirming his status as one of the greatest batsmen in cricket history.', NULL, NULL, NULL, 'United Kingdom', 'England', 'Joe Root , Alastair Cook , Ben Stokes', 'Joe Root , century , England , Sri Lanka , Test cricket , performance', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 09:54:05', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(93, 1, 'https://www.channelnewsasia.com/world/russian-editor-sentenced-jail-criticising-ukraine-campaign-4577156', NULL, 'Russian Journalist Sentenced for Reporting Ukraine Civilian Deaths', 'Russian video journalist Sergey Karelin has been sentenced to prison for \'knowingly spreading fake information\' about the Russian army, following his reports on civilian deaths in Bucha and Mariupol. This case highlights ongoing repression of dissenting voices in Russia regarding the Ukraine conflict.', NULL, NULL, NULL, NULL, NULL, 'Sergey Karelin , Alexei Navalny', 'journalist , fake information , Russian army , Bucha , Mariupol', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(94, 1, 'https://www.channelnewsasia.com/watch/mideast-tensions-eu-official-calls-sanctions-against-israeli-ministers-4575171', NULL, 'EU\'s Borrell Advocates Sanctions Against Israeli Officials', 'EU foreign policy chief Josep Borrell has urged member states to consider imposing sanctions on unnamed Israeli officials for allegedly inciting hate and war crimes, prompting mixed reactions across the bloc. Sarah Coates reports from Tel Aviv.', NULL, NULL, NULL, NULL, NULL, 'Josep Borrell', 'EU , sanctions , Israel , hate speech , war crimes', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(95, 1, 'https://www.channelnewsasia.com/world/germany-announces-tougher-knife-laws-after-deadly-attack-4575841', NULL, 'Germany\'s Government to Tighten Knife Controls After Deadly Solingen Attack', 'In response to a knife attack in Solingen that killed three people, the German government announced stricter knife controls and restrictions on benefits for illegal migrants. The attack, conducted by a Syrian man allegedly linked to the Islamic State, has intensified the immigration debate in Germany ahead of significant regional elections.', NULL, NULL, NULL, NULL, NULL, 'Nancy Faeser , Marco Buschmann , Olaf Scholz , Herbert Reul , Hendrik Wuest , Tim Kurzbach , Mona Neubaur', 'knife attack , Solingen , immigration , German government , Syrian man , Islamic State , security measures , regional elections', NULL, 85, 9, NULL, 'government-affiliated', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(96, 2, 'https://www.channelnewsasia.com/world/israel-hamas-agree-pauses-gaza-polio-vaccinations-un-agency-says-4575976', NULL, 'Polio Resurfaces in Gaza as First Case in 25 Years Reported', 'The World Health Organization (WHO) confirmed that a Palestinian boy, Abdul Rahman Abu Al-Jidyan, is the first person to contract polio in Gaza in 25 years. Amidst ongoing conflict, there are urgent calls for a vaccination campaign to protect over 650,000 children as local and international officials coordinate efforts to combat the outbreak.', 'The emergence of polio in Gaza highlights critical gaps in healthcare access amidst ongoing conflict. It underscores the importance of international cooperation and sustained vaccination efforts to prevent disease outbreaks.', 'This situation exemplifies the dire humanitarian conditions created by the Israeli blockade. The international community must intensify pressure on Israel to allow unfettered access to medical supplies for the besieged Palestinian population.', 'The resurgence of polio is a consequence of Hamas’s neglect of public health priorities while engaging in militant activities. It is crucial for Israel to maintain security while ensuring humanitarian access.', NULL, NULL, 'Abdul Rahman Abu Al-Jidyan , Mike Ryan , Basem Naim , Oren Marmorstein , Robert Wood', 'polio , Gaza , vaccination campaign , WHO , Hamas , public health , humanitarian access', NULL, 85, 9, NULL, 'Left-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(97, 4, 'https://www.channelnewsasia.com/world/telegram-founder-pavel-durov-france-arrest-charge-red-flag-tech-platform-bosses-4575996', NULL, 'Durov\'s Telegram Faces Scrutiny in France Amid Encryption Debate', 'Telegram\'s founder, Pavel Durov, a French citizen, is under scrutiny in France as law enforcement raises concerns over encrypted messaging services. Unlike competitors, Telegram refuses government takedown orders, potentially setting a precedent for future regulations of encrypted platforms.', 'The scrutiny of Telegram in France highlights the ongoing global debate about the balance between privacy and law enforcement access to encrypted communications. This situation reinforces the notion that tech companies must navigate complex regulatory environments, particularly concerning user data security.', NULL, NULL, NULL, NULL, 'Pavel Durov', 'Telegram , Pavel Durov , encryption , France , law enforcement , privacy', NULL, 75, 7, NULL, 'left-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(98, 4, 'https://www.channelnewsasia.com/world/telegram-could-face-greater-eu-scrutiny-4576071', NULL, 'Telegram Faces EU Scrutiny Amid Criminal Charges Against Founder', 'The popular messaging app Telegram is under investigation by EU regulators to determine if its user base in the bloc exceeds its reported figures. This scrutiny follows the arrest of its founder, Pavel Durov, in France for failing to control extremist content. Under the Digital Services Act (DSA), Telegram must provide precise user data every six months.', NULL, NULL, NULL, NULL, NULL, 'Pavel Durov , 45 million average monthly active recipients , 900 million followers', 'Telegram , EU investigation , Pavel Durov , Digital Services Act , extremist content', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(99, 1, 'https://www.channelnewsasia.com/world/israel-says-islamic-jihad-commander-killed-gun-battle-west-bank-mosque-4575916', NULL, 'Israeli Forces Kill Islamic Jihad Commander and Four Militants in West Bank Clashes', 'Israeli military operations in the West Bank resulted in the death of Islamic Jihad commander Muhhamad Jabber and four other militants during a gunfight in Tulkarm. The violence follows months of heightened clashes as Israel responds to militant activities amidst its ongoing conflict with Hamas in Gaza.', NULL, NULL, NULL, NULL, NULL, 'Muhhamad Jabber (Abu Shujaa) , Antonio Guterres , Danny Danon , Israel Katz', 'Israeli troops , Islamic Jihad , Muhhamad Jabber , West Bank , Tulkarm , conflict , violence , Hamas , Iranian-backed', NULL, 85, 9, NULL, 'Right-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(100, 2, 'https://www.channelnewsasia.com/entertainment/taylor-swift-vienna-concert-terror-plot-4574656', 'Associated Press', 'CIA Prevents Mass Attack on Taylor Swift Concert', 'CIA Deputy Director David Cohen announced at the Intelligence and National Security Summit that a foiled plot linked to the Islamic State aimed to kill tens of thousands at Taylor Swift\'s concert in Vienna. The arrests led to the cancellation of three performances, shocking fans and highlighting ongoing threats of terrorism.', 'This incident underscores the persistent threat of terrorism at public events and the necessity for vigilant intelligence operations. The CIA\'s intervention averted potential tragedy, showcasing the importance of international cooperation in security.', 'While the CIA\'s role in preventing terrorist plots is noteworthy, this case also reveals the excessive use of surveillance and intelligence operations by government agencies. Such actions may infringe on individual liberties and disproportionately target certain communities in the name of security.', 'The foiled attack serves as a stark reminder of the ongoing danger posed by radical Islamist groups. It\'s crucial that we bolster our national security measures to protect citizens from such threats, especially at large events like concerts.', 'USA', 'Maryland', 'David Cohen , Gerhard Karner , Taylor Swift', 'CIA , Terrorism , Taylor Swift , Concert , Islamic State , Vienna', NULL, 90, 9, NULL, 'government-affiliated', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(101, 2, 'https://www.channelnewsasia.com/world/who-invites-makers-mpox-tests-emergency-review-push-rapid-access-4575946', NULL, 'WHO Accelerates Access to Mpox Diagnostic Tests Amid Global Concerns', 'The World Health Organization has called for emergency reviews of mpox diagnostic tests to enhance access, particularly in low-income groups, as new virus variants raise alarm. WHO plans to work with manufacturers to procure essential testing products amidst a spike in suspected cases, especially in the Democratic Republic of Congo.', 'The WHO’s initiative to fast-track diagnostic tests for mpox is timely and critical, particularly given the challenges faced in low-income countries. This move could significantly enhance early detection and management of potential outbreaks.', NULL, NULL, NULL, NULL, 'WHO , Labcorp , Roche', 'Mpox , diagnostic tests , WHO , emergency review , global health , Democratic Republic of Congo', NULL, 85, 8, NULL, 'Neutral', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(102, 1, 'https://www.channelnewsasia.com/world/cna-explains-telegram-billionaire-pavel-durov-social-media-app-tech-crime-4575021', NULL, 'Telegram Chief Pavel Durov Indicted in France for Organised Crime Link', 'Pavel Durov, founder of Telegram, has been indicted in France for charges including facilitating child pornography and drug trafficking as part of an investigation into organized crime on the platform. After his detention, he was granted bail but remains in the country. The case raises significant questions about the responsibility of tech executives for user content.', NULL, NULL, NULL, NULL, NULL, 'Pavel Durov , Emmanuel Macron , Dr. Timothy Koskie , Dr. Nasya Bahfen', 'Telegram , Pavel Durov , indictment , organized crime , child pornography , drug trafficking', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(103, 1, 'https://www.channelnewsasia.com/world/harris-says-first-interview-us-ready-turn-page-trump-4574671', NULL, 'Kamala Harris Aims for Centrist Voters in Campaign Push Against Trump', 'Kamala Harris, the Democratic presidential nominee, expressed confidence that Americans are ready to move past Donald Trump as she seeks to appeal to centrist voters during her campaign. She reaffirmed her positions on immigration and fracking while maintaining her liberal values, marking her first interview since entering the race.', NULL, NULL, NULL, NULL, NULL, 'Kamala Harris , Donald Trump , Tim Walz', 'Kamala Harris , Donald Trump , 2024 Election , Immigration , Fracking , Centrist Voters', NULL, 80, 9, NULL, 'left-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(104, 1, 'https://www.channelnewsasia.com/world/pope-defies-expectations-epic-asia-voyage-includes-stops-singapore-indonesia-4574266', NULL, 'Pope Francis Embarks on Extensive Journey Amid Health Concerns', 'Pope Francis begins a 12-day trip to Indonesia, Papua New Guinea, and Timor-Leste, all while managing health issues at 87. This journey marks the farthest he has traveled during his papacy, with increased scrutiny on his ability to fulfill his role amid growing concerns for his health.', NULL, NULL, NULL, NULL, NULL, 'Pope Francis , Former Pope Benedict XVI , Andrea Ungar', 'Pope Francis , health concerns , Indonesia , travel , Catholic Church', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(105, 1, 'https://www.channelnewsasia.com/world/donald-trump-abortion-angers-conservatives-4576576', NULL, 'Trump Faces Backlash from the Right over Abortion Remarks', 'Donald Trump has been accused of abandoning the anti-abortion movement as he claims to support reproductive rights amidst backlash from pro-life conservatives, reflecting tensions within the Republican base ahead of the election.', NULL, NULL, NULL, 'United States', 'Washington', 'Donald Trump , Kamala Harris , Jeremy Boreing , Philip Klein , Marjorie Dannenfelser', 'Donald Trump , abortion , pro-life , reproductive rights , Republican Party , Kamala Harris', NULL, 75, 9, NULL, 'Right-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(106, 1, 'https://www.channelnewsasia.com/world/pacific-leaders-rebuff-call-cut-ties-taiwan-china-tonga-palau-4576991', 'AFP', 'Pacific Islands Forum Reaffirms Taiwan\'s Role Amid China\'s Push for Isolation', 'Leaders of the Pacific Islands Forum meeting in Tonga have reaffirmed Taiwan\'s status as a development partner, resisting efforts from China\'s allies to exclude Taipei. The forum remains divided between pro-Taiwan and pro-China members as Taiwan strives to maintain its influence in the South Pacific.', 'The reaffirmation of Taiwan\'s status within the Pacific Islands Forum highlights the ongoing geopolitical struggle in the region. This decision reflects both the resilience of Taiwanese diplomacy and the persistent pressure from China on Taiwan\'s allies.', 'This continued recognition of Taiwan by the Pacific Islands Forum is problematic, as it serves to undermine China’s legitimate claims. The forum should prioritize collaboration with sovereign nations, rather than catering to a separatist agenda.', 'The Pacific Islands Forum\'s decision to uphold Taiwan\'s role is a necessary stand against Chinese aggression. Countries should embrace alliances with democracies like Taiwan rather than submit to authoritarian pressures from Beijing.', 'Tonga', 'Oceania', 'Tien Chung-kwang , Peter Agovaka', 'Pacific Islands Forum , Taiwan , China , Tonga , diplomatic relations', NULL, 75, 9, NULL, 'The media source is generally regarded as neutral, potentially leaning slightly left due to its focus on international relations.', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(107, 1, 'https://www.channelnewsasia.com/east-asia/japans-military-spend-ai-automation-perks-combat-recruitment-crisis-4577016', NULL, 'Japan Reinforces Defense with AI Amid Recruitment Crisis', 'Japan\'s Defense Ministry plans to invest in AI and automation to tackle a significant recruitment shortfall in the Self Defense Forces, which enrolled only 10,000 personnel last year, half of its goal. The initiative aims to respond to China\'s military ambitions and includes provisions for better living conditions to attract more recruits, especially women.', NULL, NULL, NULL, NULL, NULL, 'Fumio Kishida , 250,000 , 10,000 , ¥8.5 trillion , ¥18 billion , ¥314 billion , ¥16.4 billion', 'Japan , Defense Ministry , AI , recruitment , Self Defense Forces , China , military , budget , women , automation', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(108, 1, 'https://www.channelnewsasia.com/world/israel-hamas-war-air-strike-west-bank-raid-third-day-4577001', 'AFP', 'Israeli Air Strikes Escalate in West Bank, Death Toll Climbs', 'Israeli air strikes in the West Bank have intensified, claiming at least 16 Palestinian lives amid a broader military operation. The UN raises concerns over the humanitarian crisis as both sides suffer casualties. Israel labels its actions as counter-terrorism, while international officials urge for a cessation of hostilities.', NULL, NULL, NULL, 'Palestinian Territories', 'West Bank', 'Kamala Harris , Benjamin Netanyahu , Muhammad Jaber', 'Israeli air strikes , West Bank , Palestinian casualties , UN humanitarian crisis , counter-terrorism operations', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(109, 1, 'https://www.channelnewsasia.com/world/us-donald-trump-lawyers-seek-move-hush-money-trial-case-federal-court-4577111', NULL, 'Trump\'s Hush Money Case: Legal Team Seeks Federal Court Venue', 'Donald Trump\'s legal team is aiming to move his hush money case to federal court, arguing it violates his constitutional rights as the leading candidate in the 2024 presidential election. They cite the Supreme Court\'s ruling on presidential immunity and claim local bias in Manhattan. A decision on this motion is expected soon.', 'The ongoing legal battles surrounding Donald Trump are unprecedented for a former president. The implications of these cases on the political landscape and the upcoming election are significant, raising questions about the intersection of law and politics in America.', 'Trump\'s attempts to move his case to federal court are nothing more than a desperate effort to evade accountability. His actions undermine the rule of law, and it\'s vital that voters understand the serious legal implications of electing someone under multiple criminal investigations.', 'The legal system is being weaponized against Trump, a leading candidate in the upcoming election. These repeated attacks feel politically motivated and threaten the integrity of our electoral system. It\'s crucial to support him against what appears to be a partisan effort to derail his campaign.', NULL, NULL, 'Donald Trump , Todd Blanche , Emil Bove , Stormy Daniels , Judge Juan Merchan', 'hush money , Trump , court case , constitutional rights , presidential election', NULL, 75, 8, NULL, 'Left-wing', '2024-08-30 10:00:32', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(110, 2, 'https://www.japantimes.co.jp/news/2024/08/30/japan/society/women-rural-marriage/', 'Reuters', 'Japan Abandons Controversial Marriage Incentives for Women in Rural Areas', 'The Japanese government has scrapped a proposed plan to incentivize women to marry and relocate from Tokyo to rural areas, which included payments of up to ¥600,000. This decision follows public criticism and reassurances from officials regarding the accuracy of earlier reports on the financial offers.', 'The cancellation of the payment plan reflects a complex challenge that Japan faces concerning demographic trends and rural depopulation. The government needs to address the root causes of this issue rather than relying on financial incentives.', NULL, NULL, 'Japan', 'Tokyo', 'Hanako Jimi', 'Japan , marriage incentives , rural areas , government policy , demographic issues', NULL, 75, 9, NULL, 'neutral', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(111, 1, 'https://www.japantimes.co.jp/news/2024/08/30/world/war-israel-normal-life-beirut/', 'Al Jazeera', 'Escalating Tensions: Israel and Hezbollah Exchange Fire along the Border', 'Recent exchanges of fire between Israel and Hezbollah along the border have raised concerns of a potential broader conflict involving regional and global powers.', 'The ongoing clashes between Israel and Hezbollah highlight the fragile stability in the region and the potential for escalation that could draw in outside forces.', NULL, NULL, 'Israel', 'Middle East', '', 'Israel , Hezbollah , border , dynamics , conflict , security', NULL, 85, 7, NULL, 'left-wing', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(112, 6, 'https://www.japantimes.co.jp/business/2024/08/29/toyota-sales-first-growth-six-months/', 'Reuters', 'Toyota’s Sales See Growth Amid Challenges in US Market', 'Toyota Motor reported a 0.7% increase in global sales in July, marking the first growth in six months, driven by strong demand in Europe and Japan, despite setbacks from recalls in the U.S. The company sold 924,918 units globally, while production rose slightly by 0.6%.', 'The slight resurgence in Toyota’s sales is an encouraging sign for the automotive giant, indicating potential recovery in certain markets, although challenges in the U.S. market present ongoing hurdles.', NULL, NULL, 'Japan', NULL, 'Global Sales , Sales Growth , Production , Production Growth', 'Toyota , sales growth , recalls , global market , production , demand', NULL, 75, 9, NULL, 'neutral', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(113, 3, 'https://www.japantimes.co.jp/sports/2024/08/29/baseball/mlb/shohei-ohtani-exclusive-topps/', 'The Japan Times', 'Shohei Ohtani Signs Exclusive Trading Card Deal with Topps', 'Los Angeles Dodgers superstar Shohei Ohtani has signed an exclusive long-term global trading card deal with Topps, a division of Fanatics Collectibles. The announcement highlights Ohtani\'s status as a global superstar in baseball, with the deal commencing immediately.', NULL, NULL, NULL, 'Japan', 'Asia', 'Shohei Ohtani , David Leiner', 'Ohtani , Topps , trading card , exclusive deal , Fanatics Collectibles', NULL, 75, 9, NULL, 'Neutral', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(114, 2, 'https://www.japantimes.co.jp/news/2024/08/29/japan/typhoon-shanshan-thursday/', NULL, 'Typhoon Shanshan Hits Japan, Causing Fatalities and Severe Disruption', 'Typhoon Shanshan has been downgraded to a severe tropical storm after making landfall in Kagoshima Prefecture, Japan, on Thursday. The storm has resulted in at least four fatalities and 94 injuries, with flooding and landslides posing significant risks across western and eastern Japan.', NULL, NULL, NULL, NULL, NULL, '4 dead , 94 injured , 144 kph winds , 216 kph gusts', 'Typhoon Shanshan , Kagoshima , heavy rain , landslides , disruption', NULL, 85, 9, NULL, 'government-affiliated', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(115, 1, 'https://www.japantimes.co.jp/news/2024/08/30/world/politics/harris-trump-gap-widen-poll/', NULL, 'Harris Leads Trump in New Poll Ahead of Election', 'A new Reuters/Ipsos poll shows Vice President Kamala Harris leading former President Donald Trump by 4 percentage points, with notable gains among women and Hispanic voters, as the November 5 election approaches.', NULL, NULL, NULL, NULL, NULL, 'Kamala Harris , Donald Trump', 'poll , Harris , Trump , voter support , election', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(116, 2, 'https://www.japantimes.co.jp/news/2024/08/30/japan/crime-legal/murder-suspect-sketches/', NULL, 'Tokyo Police Release Sketches of 2012 Murder Suspect', 'Tokyo police have released new portrait sketches of Shinichi Mitate, a suspect in the 2012 murder of a 31-year-old man, in an effort to gather new information ahead of the incident\'s 12th anniversary. Mitate is currently on the international wanted list.', NULL, NULL, NULL, NULL, NULL, 'Shinichi Mitate , 31-year-old victim', 'Tokyo , police , murder , suspect , sketch , Roppongi', NULL, 75, 7, NULL, 'government-affiliated', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(117, 2, 'https://www.japantimes.co.jp/news/2024/08/30/world/polio-vaccine-gaza-fight-pause/', NULL, 'Israel and Hamas Agree on Temporary Ceasefire for Childhood Vaccination Campaign', 'Israel\'s military and Hamas have agreed to a three-day pause in fighting in Gaza to facilitate a vaccination campaign for 640,000 children against polio, starting Sunday. The World Health Organization has coordinated the pauses from 6 a.m. to 3 p.m., covering central, southern, and northern Gaza.', NULL, NULL, NULL, NULL, NULL, 'Rik Peeperkorn , 640,000 children', 'vaccination , ceasefire , Hamas , Israel , Gaza , polio', NULL, 70, 9, NULL, 'left-wing', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(118, 3, 'https://www.japantimes.co.jp/sports/2024/08/30/more-sports/hamilton-italian-grand-prix-ferrari/', NULL, 'Hamilton to Race for Ferrari Next Season After Emotional Monza Farewell', 'Lewis Hamilton confirmed his departure from Mercedes to join Ferrari, reflecting on the significance of racing at Monza for the last time before his transition. The renowned driver, who has five Italian Grand Prix wins, expressed anticipation for connecting with Italian fans this weekend.', NULL, NULL, NULL, 'UK', 'Europe', 'Lewis Hamilton', 'Hamilton , Ferrari , Mercedes , Monza , Formula One', NULL, 85, 9, NULL, 'neutral', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(119, 1, 'https://www.japantimes.co.jp/news/2024/08/30/asia-pacific/crime-legal/south-korea-climate-law-ruling/', 'Reuters', 'South Korea\'s Top Court Demands Revision of Carbon Neutrality Act', 'South Korea\'s top court has ruled that the country\'s climate change law fails to protect basic human rights and lacks proper targets for future generations. The court has asked lawmakers to revise the carbon neutrality act by February 2026, responding to petitions from climate activists who argue the government isn\'t doing enough against climate change.', 'The court\'s decision highlights the urgent need for legislative action in addressing climate change, indicating the courts may take a more active role in upholding human rights in environmental matters.', NULL, NULL, 'South Korea', 'Asia', 'Supreme Court , young climate activists , infants', 'climate change , carbon neutrality act , human rights , legislation , South Korea', NULL, 85, 7, NULL, 'left-wing', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(120, 1, 'https://www.japantimes.co.jp/news/2024/08/30/asia-pacific/crime-legal/hong-kong-editors-sedition/', NULL, 'Press Freedom Under Siege: Hong Kong Journalists Convicted', 'In a landmark ruling, two journalists from Hong Kong\'s Stand News have been convicted of conspiring to publish seditious materials. This decision underscores the diminishing press freedom in Hong Kong as local outlets self-censor and foreign news organizations withdraw their presence amid heightened national security measures.', 'The conviction of the Stand News journalists reflects the serious challenges faced by the media in Hong Kong today. As press freedom continues to erode, the implications for civil liberties and democratic discourse seem to grow more dire.', NULL, NULL, NULL, NULL, 'Chung Pui-kuen , Patrick Lam', 'press freedom , Hong Kong , journalists , Stand News , conviction , sedition', NULL, 85, 8, NULL, 'left-wing', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(121, 3, 'https://www.japantimes.co.jp/sports/2024/08/30/tennis/osaka-us-open-loss-muchova/', NULL, 'Naomi Osaka’s Emotional Return Ends in Second Round Defeat at U.S. Open', 'Naomi Osaka, a two-time U.S. Open champion, made her return to the tournament after a hiatus but lost in the second round to Karolina Muchova. Despite the defeat, Osaka expressed gratitude for the fan support, highlighting her joy of being back on the court.', NULL, NULL, NULL, NULL, NULL, 'Naomi Osaka , Karolina Muchova , Jelena Ostapenko', 'U.S. Open , Naomi Osaka , Karolina Muchova , tennis , comeback', NULL, 75, 9, NULL, 'Neutral', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(122, 1, 'https://www.japantimes.co.jp/news/2024/08/30/world/ukraine-loss-f16-jet/', 'Ukrainian Military News', 'Ukrainian F-16 Fighter Jet Crashes Amid Russian Aerial Assault, Pilot Killed', 'A Ukrainian F-16 fighter jet, supplied by NATO, crashed while defending against a major Russian aerial assault, resulting in the death of the pilot. The incident is a significant loss for Ukraine, especially given the limited number of these jets delivered and the critical timing following a Ukrainian military incursion into Russia\'s Kursk region.', NULL, NULL, NULL, 'Ukraine', 'Kyiv', 'Ukrainian F-16 , NATO , Pilot', 'F-16 , Ukrainian military , Russian aerial assault , pilot death , NATO support', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(123, 1, 'https://www.japantimes.co.jp/news/2024/08/30/world/politics/harris-center-shift-cnn/', NULL, 'Kamala Harris Appeals to Swing Voters While Maintaining Progressive Values', 'In her first television interview as the Democratic nominee for president, Vice President Kamala Harris stated her intention to appeal to swing voters while affirming her progressive values. She indicated her willingness to appoint a Republican to her Cabinet and refuted Donald Trump\'s claim questioning her identity.', NULL, NULL, NULL, NULL, NULL, 'Kamala Harris , Donald Trump', 'Harris , swing voters , progressive , Republican , identity', NULL, 85, 7, NULL, 'left-wing', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(124, 7, 'https://www.japantimes.co.jp/business/2024/08/30/companies/tencent-netease-japan/', NULL, 'Major Chinese Gaming Firms Scale Back Japanese Investments', 'Tencent and NetEase are reconsidering their investments in Japanese gaming studios after recent years have produced few successful titles amidst a recovery in the Chinese market. NetEase is shutting down Ouka studio in Tokyo while Tencent is scaling back its funding commitments.', 'The decision by Tencent and NetEase to scale back their investments reflects a broader trend in the gaming industry where companies are reassessing their strategies in response to market realities and past performance. It raises questions about the long-term viability of foreign investments in the Japanese gaming sector.', NULL, NULL, NULL, NULL, 'Tencent Holdings , NetEase , Ouka Studio', 'investments , Japanese studios , Tencent , NetEase , video games , funding', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(125, 1, 'https://www.japantimes.co.jp/news/2024/08/30/japan/politics/foreign-ministry-budget-request/', NULL, 'Japan\'s Foreign Ministry Seeks ¥814.6 Billion Budget for 2025 Amid Rising Disinformation Threats', 'Japan\'s Foreign Ministry has announced a budget request of ¥814.6 billion for the fiscal year 2025, marking a 12.3% increase from the previous year\'s budget. This includes ¥66.2 billion aimed at enhancing efforts to counter information warfare, especially against false information, by leveraging artificial intelligence and other technologies.', 'The proposed budget reflects Japan\'s growing concern over information warfare and its potential impact on national security. By investing in advanced technologies, the Foreign Ministry is acknowledging the need for robust defense mechanisms against false information. It will be interesting to see how effectively these funds are utilized.', 'This budget request is an excessive response to a non-issue. Rather than spending billions to combat so-called misinformation, the government should focus on expanding social programs that address the root causes of public disillusionment and the welfare of citizens, not on technologies that surveil and manipulate public opinion.', 'This budget increase is a necessary step to safeguard Japan\'s information landscape from external and internal threats. The rise of disinformation, particularly from foreign adversaries, jeopardizes our national integrity. Investing in AI technologies will empower our Foreign Ministry to protect our sovereignty and maintain information reliability.', NULL, NULL, '¥814.6 billion , ¥66.2 billion , 12.3%', 'Japan , Foreign Ministry , budget request , disinformation , information warfare , artificial intelligence', NULL, 85, 9, NULL, 'Government-affiliated', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(126, 1, 'https://www.japantimes.co.jp/news/2024/08/30/world/politics/far-left-rebel-rocks-german-politics/', 'Deutsche Welle', 'Sahra Wagenknecht Emerges as Key Far-Left Candidate in Germany\'s Upcoming Elections', 'Sahra Wagenknecht, a radical leftist politician, is poised to play a significant role in regional elections in former East Germany. She has called for ending the government’s support for Ukraine and a stringent immigration policy, advocating for negotiations with Putin.', 'Sahra Wagenknecht\'s emergence represents a shift in the political landscape of Germany. Her proposals could attract voters seeking alternatives in a climate of discontent and desire for change.', NULL, NULL, 'Germany', 'Jena', 'Sahra Wagenknecht , Vladimir Putin', 'Germany , politics , Sahra Wagenknecht , Ukraine , immigration , Putin', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(127, 2, 'https://www.japantimes.co.jp/news/2024/08/30/japan/society/nursery-waiting-lists/', 'Japan Times', 'Japan Sees Record Low of Preschool Waiting Lists Amid Declining Birth Rates', 'A government survey revealed that Japan\'s waiting list for nursery schools has dropped to a record low of 2,567 children, a 4.2% decrease from the previous year. This decline is attributed to the country\'s persistently low birth rate, although some areas are experiencing longer waiting lists due to shortages of nursery teachers and population growth in certain regions.', 'The persistent decline in preschool waiting lists reflects Japan\'s ongoing demographic challenges, notably its low birth rate. While this is a positive sign for immediate educational accessibility, it raises concerns about the long-term implications for the workforce and economy.', 'The decreasing number of preschool children illustrates the dire need for the government to rethink its social policies. Instead of focusing solely on economic growth, policies must prioritize family support and child welfare to encourage people to have more children.', 'This drop in preschool numbers indicates a worrying trend in Japanese society where traditional family values are deteriorating. We need policies that uphold and promote cultural values of family and child-rearing to reverse this trend.', 'Japan', 'Asia', '2,567', 'preschool children , nursery waiting lists , low birth rate , Japan , government survey', NULL, 75, 8, NULL, 'Left-wing', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(128, 7, 'https://www.japantimes.co.jp/business/2024/08/30/economy/tokyo-area-inflation/', NULL, 'Tokyo Inflation Speeds Up, Indicating Gradual Rate Hikes Ahead', 'Tokyo\'s consumer prices excluding fresh food rose 2.4% in August, exceeding estimates, highlighting a potential for continued gradual interest rate hikes by the Bank of Japan as the economy shows signs of recovery.', NULL, NULL, NULL, NULL, NULL, '2.4% , 2.2% , Kazuo Ueda', 'Tokyo , inflation , consumer prices , Bank of Japan , interest rates', NULL, 75, 8, NULL, 'neutral', '2024-08-30 10:08:18', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(129, 1, 'https://www.koreatimes.co.kr/www/world/2024/08/683_381600.html', 'AP', 'Japan Requests Record Military Budget Amid Security Concerns', 'Japan\'s Defense Ministry has submitted a record budget request of 8.5 trillion yen ($59 billion) for 2025, part of a five-year military buildup plan aimed at countering China\'s growing military threats. The budget focuses on unmanned weapons and AI as Japan faces a declining servicemember population.', 'Japan\'s increase in military spending is a significant step given the current geopolitical climate. It reflects the government’s recognition of the need for enhanced defense capabilities amidst a backdrop of regional tensions.', NULL, NULL, 'Japan', 'Asia', '8.5 trillion yen , 59 billion USD , 43 trillion yen , 247,000 servicemembers , 19,598 recruiting target , 970 billion yen', 'Japan , military budget , Defense Ministry , China , unmanned weapons , AI , SDF , regional tensions', NULL, 85, 8, NULL, 'neutral', '2024-08-30 10:19:49', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(130, 1, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381537.html', NULL, 'Elon Musk\'s X Faces Shutdown in Brazil Amidst Censorship Battle', 'Brazil\'s Supreme Court is expected to order the shutdown of Elon Musk\'s social media platform, X, due to legal disputes over local compliance and an inability to secure a legal representative in the country. Musk\'s satellite internet venture, Starlink, is also facing repercussions, having its bank accounts blocked amidst the ongoing conflict.', NULL, NULL, NULL, NULL, NULL, 'Elon Musk , Alexandre de Moraes', 'Elon Musk , X , Brazil , Supreme Court , censorship , Starlink , legal dispute', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:19:49', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(131, 1, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381536.html', 'Reuters', 'Harris Gains Lead Over Trump in Latest Poll Ahead of Elections', 'A new Reuters/Ipsos poll shows Kamala Harris leading Donald Trump 45% to 41% among registered voters, marking a significant shift in the U.S. presidential race dynamics. Harris has gained support particularly among women and Hispanic voters following her campaign rallies, as enthusiasm for her candidacy rises.', 'The recent shift in the polling data highlights a competitive landscape as both candidates attempt to sway undecided voters in key battleground states. Harris\'s rise in favorability could reshape strategies for both the Democratic and Republican campaigns as they navigate voter concerns ahead of the election.', NULL, NULL, 'United States', 'U.S.', 'Kamala Harris , Donald Trump , Joe Biden , JD Vance , Tim Walz', 'Kamala Harris , Donald Trump , poll results , 2024 election , voter enthusiasm , battleground states', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 10:19:49', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(132, 1, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381555.html', 'AP-Yonhap', 'F-16 Fighter Jet Crash in Ukraine Amid Ongoing Russian Attacks', 'One of Ukraine\'s newly acquired F-16 fighter jets crashed, resulting in the death of the pilot, during a significant Russian missile and drone assault. This incident marks the first reported loss of F-16s in Ukraine as the military faces ongoing aerial attacks.', 'The crash of the F-16 highlights the precarious situation Ukraine faces in its defense efforts. While new technology is being introduced to counter Russian advances, the overwhelming size of Russian airpower remains a significant challenge.', NULL, NULL, 'Ukraine', 'Eastern Europe', 'U.S. President Joe Biden , Ukrainian President Volodymyr Zelenskyy', 'F-16 , Ukraine , Russia , missile , drone , pilot death , NATO', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:19:49', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(133, 7, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381556.html', 'Reuters', 'Lululemon to Fast-Track Styles After Embarrassing Legging Reviews', 'Lululemon Athletica announces plans to fast-track new clothing styles following deflating customer feedback regarding its Breezethrough leggings, which led to a sales halt. CEO Calvin McDonald acknowledges missed opportunities in the women\'s segment but remains optimistic about the company’s strategy moving forward.', 'Lululemon\'s response to consumer feedback demonstrates a commendable agility to adapt to market demands, particularly after the embarrassment caused by the Breezethrough leggings. Their commitment to fast-tracking new styles could potentially help recover their brand image.', NULL, NULL, 'United States', 'North America', 'Calvin McDonald , Jessica Ramirez , Rick Patel', 'Lululemon , Breezethrough leggings , sales forecast , customer feedback , performance apparel', NULL, 70, 7, NULL, 'Neutral', '2024-08-30 10:19:49', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(134, 1, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381559.html', 'AFP', 'Macron Defends Durov\'s French Citizenship Amid Legal Challenges', 'French President Emmanuel Macron has defended granting French nationality to Telegram CEO Pavel Durov, who is facing serious legal charges related to illegal content on his messaging app. Durov was recently detained in France amid scrutiny over his major contributions to digital communication and accusations about the misuse of his platform.', NULL, NULL, NULL, 'France', NULL, 'Pavel Durov , Emmanuel Macron , David-Olivier Kaminski , Dmitry Peskov , Elon Musk', 'Telegram , Pavel Durov , Emmanuel Macron , French nationality , detention , legal charges', NULL, 80, 7, NULL, 'government-affiliated', '2024-08-30 10:19:49', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(135, 1, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381561.html', NULL, 'Polio Vaccination Campaign Initiated Amid Ongoing Conflict in Gaza', 'Gaza\'s first polio case in 25 years prompts a coordinated vaccination campaign for 640,000 children, with temporary pauses in fighting agreed upon by Israel and Hamas to facilitate the effort, as confirmed by WHO officials.', NULL, NULL, NULL, NULL, NULL, 'Abdul Rahman Abu Al-Jidyan , Rik Peeperkorn , Mike Ryan , Basem Naim , Oren Marmorstein , Robert Wood , Joyce Msuya', 'polio , vaccination , Gaza , Hamas , Israel , WHO , humanitarian crisis', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:19:49', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(136, 1, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381588.html', NULL, 'Germany Begins Deportations of Afghan Convicts Amid Immigration Debate', 'Germany has deported 28 Afghan nationals for the first time since August 2021, describing them as convicted criminals. This move comes amid heightened security concerns following a recent knife attack in Solingen, and ongoing debates about immigration policies ahead of regional elections.', NULL, NULL, NULL, NULL, NULL, 'Steffen Hebestreit , Nancy Faeser , Annalena Baerbock , Olaf Scholz', 'Germany , Afghan nationals , deportation , Taliban , security , immigration , crime , knife attack', NULL, 75, 7, NULL, 'Left-wing', '2024-08-30 10:19:49', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(137, 1, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381589.html', 'Associated Press', 'Kamala Harris Defends Moderate Shift Amid Campaign Rally in Georgia', 'During a campaign rally in Savannah, Georgia, Vice President Kamala Harris defended her shift towards more moderate positions, asserting her core values remain unchanged. She faced questions on her previous stances regarding fracking and immigration while promoting the understanding and consensus needed to tackle issues. The rally occurs in a tight political climate, with growing Democratic enthusiasm ahead of the upcoming election.', 'Harris\'s attempt to recalibrate her message to appeal to moderate voters is a strategic move, particularly given the competitive nature of the upcoming election cycle. Her acknowledgment of past positions indicates a willingness to adapt to the current political landscape, reflecting a typical approach for candidates seeking broader support.', 'Harris\'s shift to the center is disappointing for progressives who expected a candidate willing to fight for bold reforms. By compromising on issues like fracking and immigration, she risks alienating the very voters who are passionate about environmental and social justice.', 'Harris\'s retreat from her previous positions shows that she is willing to say anything to gain votes. Her insistence on consequences for illegal immigration is a hollow promise to conservative voters who need a leader that stands firm on border security and individual liberties.', 'USA', 'Savannah, Georgia', 'Kamala Harris , Tim Walz , Joe Biden , Donald Trump', 'Harris , campaign rally , fracking , immigration , Democratic ticket , enthusiasm , voting , Trump', NULL, 80, 9, NULL, 'left-wing', '2024-08-30 10:19:49', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(138, 1, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381590.html', 'AP', 'Maori King Tuheitia Dies at 69, Leaving a Legacy of Unity and Culture', 'New Zealand\'s Maori King, Kiingi Tuheitia Pootatau Te Wherowhero VII, has died at the age of 69 following heart surgery. His passing marks the end of a significant chapter in the Kiingitanga movement, which aims to preserve Maori culture and unite Indigenous tribes. Prime Minister Christopher Luxon and King Charles III have expressed condolences, highlighting Tuheitia\'s dedication to his people.', 'The death of King Tuheitia represents a significant loss for the Maori community and New Zealand as a whole. His reign was marked by initiatives aimed at preserving Maori culture and fostering unity among Indigenous tribes, crucial for the country\'s social fabric.', 'King Tuheitia\'s death underscores the continued struggle for Maori rights in New Zealand. The implications of his passing should serve as a wake-up call to address the systemic injustices and government policies that undermine Indigenous sovereignty and identity.', 'While King Tuheitia was respected, the focus on Maori kingship should not overshadow the broader New Zealand identity. The government must prioritize policies that unify all citizens rather than catering to specific group interests.', 'New Zealand', 'Ngaruawahia', 'Kiingi Tuheitia Pootatau Te Wherowhero VII , Christopher Luxon , King Charles III', 'Maori King , Tuheitia , Kiingitanga , New Zealand , Indigenous', NULL, 85, 9, NULL, 'neutral', '2024-08-30 10:19:49', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(139, 1, 'https://www.newsbreak.com/cbs-san-francisco-500227/3578795741884-s-f-mission-district-watch-party-gives-harris-walz-interview-mixed-reviews', NULL, 'Mixed Reviews for Harris-Walz CNN Interview from Bay Area Watch Party', 'Bay Area voters gathered at Manny\'s in the Mission District for a watch party of Vice President Kamala Harris and Tim Walz\'s CNN interview. Reviews were mixed, with some praising their performance while others noted they stuck too closely to a script as they addressed key topics ahead of the election.', NULL, NULL, NULL, NULL, NULL, 'Kamala Harris , Tim Walz , Ron Fortgang , Ian Foraker', 'Harris , Walz , CNN interview , mixed reviews , Bay Area , watch party', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(140, 1, 'https://www.newsbreak.com/kron4-news-1589914/3578778550825-california-bills-to-ban-plastic-reusable-shopping-bags-move-forward', 'FOX 5/KUSI', 'California Moves to Ban Plastic Film Bags as a Part of Environmental Initiative', 'California lawmakers have approved two bills that seek to expand the state\'s existing plastic bag ban to include \'recyclable\' plastic film bags. The bills aim to eliminate this loophole, requiring paper bags to be made of 100% recycled material. This move is part of the state\'s efforts to reduce plastic waste and address environmental concerns.', NULL, NULL, NULL, 'USA', 'California', 'Asm. Rebecca Bauer-Kahan , State Sen. Catherine Blakespear , State Sen. Ben Allen , Gov. Gavin Newsom', 'California , plastic bags , Governor Newsom , environment , recycling , legislation , AB 2236 , SB 1053', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(141, 4, 'https://www.newsbreak.com/the-us-sun-513995/3578248662668-millions-of-drivers-will-never-lose-their-license-again-under-new-option-but-loophole-makes-it-useless-at-some-stores', 'California DMV', 'California Launches Digital Driver\'s License Amid Controversy', 'California Governor Gavin Newsom announced the transition of a pilot program allowing digital driver’s licenses through popular apps to a fully accessible law. However, acceptance of these digital licenses remains limited, sparking concerns among residents about usability at various establishments.', NULL, NULL, NULL, 'USA', 'California', 'Gavin Newsom , Steve Gorden', 'digital driver\'s license , California , Gavin Newsom , Google Wallet , Apple Wallet , DMV', NULL, 75, 8, NULL, 'government-affiliated', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(142, 1, 'https://www.newsbreak.com/the-center-square-509740/3577175279604-california-legislature-passes-bill-banning-voter-id-laws', 'The Center Square', 'California Passes Bill Banning Local Voter ID Laws', 'The California legislature has approved a bill that prohibits local governments from enacting voter identification laws for municipal elections. This legislation overrides a recent Huntington Beach ordinance requiring voter ID, which is argued to disenfranchise lawful voters. Attorney General Rob Bonta challenged Huntington Beach\'s law, claiming it contradicts state and federal requirements.', 'The passage of SB 1174 reveals the ongoing debate over voter ID laws in the U.S. Proponents argue these laws maintain election integrity, while opponents contend they suppress voter turnout. California\'s decision to ban local ID requirements underscores the state\'s commitment to voting accessibility.', 'This bill represents a critical victory against the unjust voter suppression efforts that seek to disenfranchise marginalized communities. The overwhelming evidence that voter ID laws disproportionately affect these populations should compel all states to follow California\'s lead in protecting voting rights.', 'By banning local voter ID laws, California continues to undermine election integrity and allow non-citizens to influence local governance. This law could lead to increased election fraud and diminished trust in the democratic process. Voter ID laws are common sense measures to ensure that only eligible voters participate.', 'United States', 'California', 'State Sen. Dave Min , State Assemblymember Bill Essayli , California Attorney General Rob Bonta', 'voter ID law , California legislature , Huntington Beach , municipal elections , non-citizen voting', NULL, 80, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(143, 2, 'https://www.newsbreak.com/cbs-san-francisco-500227/3578089505438-chp-arrest-4-seize-ak-47-assault-rifle-after-freeway-pursuit-from-oakland-to-peninsula', NULL, 'Four Arrested and AK-47 Seized in Oakland Freeway Shootout', 'California Highway Patrol arrested four suspects and seized an AK-47 assault rifle following a pursuit that began after shots were fired on an Oakland freeway. The chase led to San Francisco and ended in Redwood City.', NULL, NULL, NULL, NULL, NULL, 'California Highway Patrol , Suspects , Victims', 'Oakland , Freeway Shootout , Arrest , AK-47 , California Highway Patrol', NULL, 70, 7, NULL, 'Neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(144, 2, 'https://www.newsbreak.com/victorville-daily-press-1590643/3577716960318-patriot-day-2024-events-in-california-s-high-desert-honor-fallen-of-9-11', 'Victorville Daily Press', 'Patriot Day Events Honor 9/11 Victims in High Desert', 'The High Desert will honor the memory of those who died in the 9/11 terrorist attacks with various events, including a flag setup at Victor Valley College and a remembrance ceremony in Barstow. Thousands of flags will be placed in honor of the 2,977 victims, and community members are encouraged to participate.', 'The organized events in the High Desert serve as a poignant reminder of the impact of 9/11 on countless lives. It is crucial that we remember the past to inform our future.', 'While commemorating the victims of 9/11 is important, these events should also focus on preventing future violence and addressing systemic issues in society that lead to such tragedies.', 'These remembrances serve not only to honor the victims but also to promote national unity and resilience against threats to our homeland. We must remain vigilant.', 'USA', 'California', '9/11 victims , Victor Valley College , United States Veterans Support Group', 'Patriot Day , 9/11 , remembrance , flag setup , Victor Valley College', NULL, 85, 9, NULL, 'Neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(145, 1, 'https://www.newsbreak.com/the-associated-press-510077/3577331550362-california-lawmakers-pass-bill-that-could-make-undocumented-immigrants-eligible-for-home-loans', NULL, 'California Bill Allows Undocumented Immigrants State Homebuyer Assistance', 'California\'s Legislature has passed a bill allowing undocumented immigrants to qualify for state assistance in purchasing homes, fueling a heated debate among lawmakers. Author Dr. Joaquin Arambula asserts the bill addresses fairness and the housing crisis, while Republicans argue it should prioritize legal residents. Governor Gavin Newsom faces a decision on the bill by the end of September.', NULL, NULL, NULL, NULL, NULL, 'Dr. Joaquin Arambula , Gavin Newsom , Brian Dahle', 'undocumented immigrants , homebuyer assistance , California , housing crisis , Gavin Newsom', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(146, 1, 'https://www.newsbreak.com/laist-1599686/3577981389653-1-in-6-chp-jobs-are-vacant-despite-historic-raises-and-newsom-s-hiring-campaign', NULL, 'California Highway Patrol Faces Record Vacancy Rates Despite Pay Increases', 'One in six California Highway Patrol officer positions are vacant, exceeding 16% as Gov. Gavin Newsom\'s administration finalizes a $489 million contract with significant pay raises that may not address retention issues. The vacancy rate has skyrocketed since 2019 despite attempts to recruit more officers.', 'The rising vacancy rate in the California Highway Patrol raises concerns about both recruitment strategies and the working conditions of officers. While significant pay raises have been implemented, it is clear that additional strategies are needed to enhance retention.', NULL, NULL, NULL, NULL, 'Gavin Newsom , 7.9% , 6.2% , $489 million , 16%', 'California Highway Patrol , vacancy rate , pay raise , recruitment campaign , CHP 1000', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(147, 8, 'https://www.newsbreak.com/trailer-empire-1653902/3577903695682-jean-smart-s-5-9m-encino-estate-snags-buyer-within-hours-of-listing', NULL, 'Jean Smart Lists Encino Estate for $5.9 Million, Accepts Offer in Under 24 Hours', 'Hollywood actress Jean Smart has swiftly listed her Encino, CA estate for $5.9 million and received an offer in less than 24 hours. The property, renovated while preserving its historic charm, features seven bedrooms and luxurious amenities. Smart reflects on her late husband’s contributions to her career as they part with the home purchased in 2002 for $1.5 million.', NULL, NULL, NULL, NULL, NULL, 'Jean Smart , Richard Gilliland', 'real estate , Jean Smart , Encino , listing , sale , luxury home , historic charm', NULL, 75, 9, NULL, 'Neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(148, 1, 'https://www.newsbreak.com/the-sacramento-bee-1592486/3577965461772-california-lawmakers-plan-to-give-out-500m-in-electric-bill-refunds-streamline-clean-energy', NULL, 'California Lawmakers Propose Bills to Cut Electric Costs and Boost Renewable Energy', 'California lawmakers unveiled new bills aimed at reducing electricity costs for consumers and accelerating renewable energy development. The measures, described as \'California Made,\' come as the state faces rising energy demands and affordability concerns amid ongoing negotiations. Governor Newsom had to compromise on previous proposals due to opposition, leading to a last-minute legislative package expected to benefit millions of residents.', 'The introduction of these bills represents a crucial step in balancing the need for renewable energy and the affordability of services for California consumers. The challenges ahead will revolve around effectively implementing these measures without burdening the taxpayers further.', 'While these measures attempt to address the energy crisis, they do not go far enough. The state must prioritize aggressive investments in community-led renewable projects and truly democratize the energy infrastructure to ensure that all Californians benefit equitably, especially underserved communities.', 'This legislative package is a symbol of government overreach and mismanagement. Rather than wasting taxpayer money on dubious energy projects and rebates, we should focus on deregulation and empowering private sector solutions to lower costs and enhance competition in the energy market.', NULL, NULL, 'Governor Gavin Newsom , Senate Pro Tempore Mike McGuire , Assemblymember Cottie Petrie-Norris', 'California , renewable energy , electric bills , legislation , Governor Newsom', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(149, 2, 'https://www.newsbreak.com/los-angeles-times-521565/3578126403588-the-new-covid-vaccine-is-here-why-these-are-the-best-times-to-get-immunized', 'Los Angeles Times', 'Timing is Key: When Should You Get Your COVID-19 Vaccine This Season?', 'As new COVID-19 vaccinations for the 2024-25 season roll out, experts debate whether September or October is the best time to get vaccinated. Key factors include current infection rates, vaccine effectiveness timing, and individual health conditions. The CDC recommends vaccination for everyone aged 6 months and older.', 'Experts suggest both September and October have their merits for vaccination against COVID-19. Individual health conditions and local infection rates should guide the timing of vaccination.', 'It\'s crucial for public health that the government ensures affordable and accessible vaccine options for all, promoting vaccinations as a collective responsibility rather than an individual choice.', 'The decision to vaccinate should remain a personal choice, free from government coercion. People should decide based on their own risk assessments, not public health officials\' recommendations.', 'USA', 'California', 'Dr. Mandy Cohen , Dr. Peter Chin-Hong , Dr. Elizabeth Hudson , Dr. Demetre Daskalakis , Dr. Eric Topol', 'COVID-19 , Vaccination , CDC , California , Vaccine Timing , Flu Shot , RSV', NULL, 80, 8, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(150, 2, 'https://www.newsbreak.com/the-modesto-bee-1592579/3578148753118-8-out-of-10-worst-cities-for-drunk-driving-are-in-california-lendingtree-says-where-are-they', NULL, 'California Cities Dominate List of Worst for Drunk Driving', 'A report by LendingTree reveals that eight out of the ten U.S. cities with the highest drunk driving rates are located in California, with Raleigh, North Carolina topping the list. The study highlights the problems of impaired driving across various demographics, with significant rates found among younger drivers.', NULL, NULL, NULL, NULL, NULL, 'Mike Salas , Rob Bhatt , Generation Z', 'DUI , drunk driving , California , LendingTree , Generation Z , vehicle make , statistics', NULL, 75, 8, NULL, 'neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(151, 2, 'https://www.newsbreak.com/the-sacramento-bee-1592486/3578223352534-california-dmv-launches-chinese-version-of-license-renewal-test-what-you-need-to-know', 'California Department of Motor Vehicles', 'California DMV Launches Chinese eLearning Course for Driver\'s License Renewal', 'The California Department of Motor Vehicles has introduced a traditional Chinese language version of its fail-safe eLearning course for residents needing to renew their driver\'s licenses. This initiative aims to enhance accessibility for California\'s 1.5 million Chinese Americans, allowing them to utilize a Mandarin audio option while taking the course, which includes quizzes and permits unlimited retakes.', NULL, NULL, NULL, 'United States', 'California', 'Steve Gordon , 1.5 million Chinese Americans', 'California DMV , Chinese eLearning course , driver\'s license renewal , Mandarin audio , accessibility', NULL, 75, 9, NULL, 'government-affiliated', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(152, 1, 'https://www.newsbreak.com/news-channel-312-1276854/3578248118431-bill-to-prohibit-the-use-of-medical-debt-in-credit-reporting-awaits-governor-s-signature-to-become-law', 'News Channel 3-12', 'California Bill to Protect Consumers from Medical Debt Impact on Credit Scores Awaits Governor\'s Signature', 'A bill authored by State Senator Monique Limón that prohibits medical debt from affecting credit scores has passed in California and is awaiting the Governor\'s signature to become law. If enacted, SB 1061 will make California the eighth state to prevent medical debt from appearing on credit reports, offering relief to millions of consumers.', 'The passage of SB 1061 represents a significant advancement in consumer protection, addressing the pervasive issue of medical debt that often hinders individuals\' economic opportunities. This law could set a precedent for other states to follow.', 'This bill is a much-needed step towards dismantling a broken healthcare system that burdens citizens with oppressive medical debt. We must continue to fight against the capitalist structures that prioritize profit over people\'s well-being.', 'While the intention behind SB 1061 is commendable, it may reduce personal responsibility regarding financial choices. Individuals need to take ownership of their medical expenditures rather than expecting the government to step in.', 'United States', 'California', 'State Senator Monique Limón , California Attorney General Rob Bonta', 'medical debt , credit scores , California , SB 1061 , Governor\'s signature', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(153, 2, 'https://www.newsbreak.com/fox-5-san-diego-1589916/3578309566762-california-lawmakers-considers-adding-banana-slug-dungeness-crab-to-official-symbol-list', NULL, 'California Moves to Designate State Slug and Crab', 'California legislature is considering bills to designate the banana slug as the official state slug and the Dungeness crab as the official state crustacean. Proposed by Assemblymembers Gail Pellerin and Jim Wood, these bills recognize symbols important to California\'s identity and economy.', NULL, NULL, NULL, NULL, NULL, 'Gail Pellerin , Jim Wood , Mike McGuire , Gavin Newsom', 'California , banana slug , Dungeness crab , state symbols , legislation', NULL, 65, 7, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(154, 1, 'https://www.newsbreak.com/cbs-la-500220/3578407596838-california-ai-safety-bill-passes-legislature-after-drawing-criticism-from-pelosi-support-from-musk', NULL, 'California Advances AI Accountability Bill', 'The California Legislature has passed Senate Bill 1047 aimed at regulating artificial intelligence technologies, requiring companies to implement safety measures. With support from figures like Elon Musk, the bill has sparked controversy in the tech sector. Governor Gavin Newsom is expected to take action before the end of September.', NULL, NULL, NULL, NULL, NULL, 'Scott Wiener , Gavin Newsom , Elon Musk , Nancy Pelosi', 'AI regulation , California , Senate Bill 1047 , Elon Musk , Governor Newsom', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(155, 2, 'https://www.newsbreak.com/los-angeles-times-521565/3578481020214-h5n1-bird-flu-infections-suspected-in-california-dairy-herds', NULL, 'H5N1 Bird Flu Suspected in California Dairy Herds', 'The California Department of Food and Agriculture is investigating the suspected infection of H5N1 bird flu in three dairy herds in the Central Valley. Although the virus\'s presence is unconfirmed, officials stress that pasteurization effectively eliminates the virus, posing no safety concerns for consumers. If confirmed, this will raise the number of affected states and herds. Experts urge increased testing and surveillance as the flu season approaches.', NULL, NULL, NULL, NULL, NULL, 'Rick Bright , California Department of Food and Agriculture', 'H5N1 , bird flu , California , dairy herds , Central Valley , avian influenza', NULL, 75, 7, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(156, 7, 'https://www.newsbreak.com/kero-23-bakersfield-563644/3578527553142-california-table-grape-season-ramping-up-for-growers-around-kern-county', NULL, 'California Grape Harvest Faces Challenges Amid Climate Change', 'In California, growers are reporting smaller table grapes this harvest season due to a recent heatwave, despite a more stable market compared to previous years. Industry experts are cautiously optimistic as demand remains strong, but farmers emphasize the continued impact of climate on crop yields.', 'The challenges faced by grape farmers highlight the delicate balance between agriculture and climatic conditions. As the market shows signs of stability, it remains to be seen how ongoing climate challenges will affect the overall yield.', 'This situation underscores the urgent need for systemic changes in our agricultural practices and policies. The impacts of climate change are being felt most by those on the frontline—our farmers. We must invest in sustainable farming techniques to mitigate these effects.', 'Farmers should focus on adapting better to these natural events without relying on government intervention or regulations that might hinder production. Resilience in agriculture is paramount and should be built on individual initiative rather than outside help.', NULL, NULL, 'Margaux Hein , Ian LeMay', 'California , table grapes , harvest , heatwave , market demand , climate change', 8, 75, 8, '23ABC is a reputable local news outlet with a good track record of reporting factual news, though localized reporting may not cover every angle.', 'Neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(157, 2, 'https://www.newsbreak.com/the-desert-sun-1590638/3578542538163-california-bill-would-require-child-influencers-to-be-paid', 'Palm Springs Desert Sun', 'California Passes Bill to Protect Child Influencers\' Earnings', 'California lawmakers have passed a bill requiring social media creators to set aside a portion of their earnings into a trust for minors featured in their content. Sponsored by Sen. Steve Padilla, this initiative modernizes financial protections initially established under the Coogan Act for child actors, addressing concerns over exploitation and safety in the growing influencer economy.', NULL, NULL, NULL, 'USA', 'California', 'Steve Padilla , Gavin Newsom', 'child influencers , California bill , financial protection , social media , Coogan Act', NULL, 75, 8, NULL, 'The source appears to have a neutral stance, focusing on reporting legislation without evident political leanings.', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(158, 1, 'https://www.newsbreak.com/news-channel-312-1276854/3578556314604-idle-oil-well-legislation-authored-by-assemblymember-hart-clears-legislature-and-awaits-governor-s-signature-to-become-law', 'News Channel 3-12', 'California Legislature Passes Bill to Tackle Idle Oil Wells', 'A bill authored by Assemblymember Gregg Hart mandating aggressive targets for plugging idle oil wells in California has passed the state\'s legislature and is awaiting the Governor\'s signature. The legislation aims to address over 40,000 idle wells, focusing on those near residential areas and imposing stricter requirements on larger operators.', NULL, NULL, NULL, 'United States', 'California', 'Gregg Hart', 'idle oil wells , California , legislation , environment , taxpayer liability', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(159, 1, 'https://www.newsbreak.com/the-sacramento-bee-1592486/3578555779088-california-lawmakers-approve-banning-synthetic-food-dyes-in-schools-will-newsom-sign-it', 'Los Angeles Times', 'California to Ban Synthetic Food Dyes in Schools Starting 2028', 'California lawmakers have passed a bill to ban schools from selling products containing six synthetic food dyes starting in 2028, citing concerns over their negative effects on children\'s health and learning abilities. The bill received bipartisan support despite opposition from food industry groups.', 'The decision to ban synthetic food dyes in California schools reflects growing concerns about food safety and children\'s health. By focusing on scientific research that links these additives to behavioral issues, lawmakers are taking a proactive approach to protect students.', NULL, NULL, 'United States', 'California', 'Jesse Gabriel , Gavin Newsom', 'synthetic food dyes , California schools , ban , health , children , bipartisan support', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(160, 2, 'https://www.newsbreak.com/times-of-san-diego-555715/3578560813339-current-or-prospective-students-don-t-miss-the-sept-3rd-fafsa-deadline', 'The San Francisco Chronicle', 'California Community Colleges Urges Financial Aid Applications Amid Decline', 'With hundreds of millions in debt-free financial aid going unclaimed, fewer students are applying this year for financial aid, risking their eligibility for vital funding. The California Community Colleges Chancellor’s Office urges students to submit applications by the September 3 deadline for the most available aid.', NULL, NULL, NULL, 'USA', 'California', 'Daisy Gonzales', 'financial aid , California Community Colleges , students , FAFSA , California Dream Act , 2024-2025 academic year', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(161, 2, 'https://www.newsbreak.com/cbs-san-francisco-500227/3578592824422-chp-to-launch-statewide-dui-enforcement-over-labor-day-weekend', NULL, 'California Highway Patrol Initiates DUI Crackdown for Labor Day Weekend', 'The California Highway Patrol will enforce a Maximum Enforcement Period over Labor Day Weekend to combat impaired driving. With a goal to prevent drunk driving incidents, last year saw over a thousand DUI arrests during the same period. Officer Kylie Musselman highlighted the personal impact of DUI incidents, emphasizing the need for personal responsibility and safe transportation options.', NULL, NULL, NULL, NULL, NULL, 'Officer Kylie Musselman , Tara Repka Flores , Alec Flores', 'DUI , California Highway Patrol , Labor Day Weekend , impaired driving , Maximum Enforcement Period', NULL, 85, 9, NULL, 'Government-affiliated', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(162, 1, 'https://www.newsbreak.com/politico-560779/3578598854480-california-is-cracking-down-on-flamin-hot-cheetos-and-twinkies', NULL, 'California Schools Move to Ban Additives in Popular Snacks', 'California lawmakers have voted to prohibit schools from serving snacks containing certain food additives linked to worsened behavior in children with ADHD. The proposal, which aims to protect children\'s health, awaits Governor Gavin Newsom\'s signature.', NULL, NULL, NULL, NULL, NULL, 'Jesse Gabriel , Gavin Newsom', 'California , schools , food additives , Flamin’ Hot Cheetos , Twinkies , ADHD , harmful chemicals', NULL, 75, 9, NULL, 'Left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(163, 1, 'https://www.newsbreak.com/politico-560779/3578614386287-gavin-newsom-is-generating-heat-for-kamala-harris-on-gas-prices', 'POLITICO', 'California\'s Gas Price Dilemma: Newsom\'s Proposal Under Fire', 'California Governor Gavin Newsom\'s proposal to grant regulators more power over oil companies in a bid to reduce high gas prices faces criticism from state Republicans. They argue that the plan will exacerbate supply issues rather than alleviate them, linking it to presidential contender Kamala Harris\'s policies.', 'Governor Newsom\'s effort to regulate gas prices reflects a broader concern over inflation and energy costs. While designed to protect consumers, the effectiveness of these policies remains debated among experts.', 'Newsom\'s regulation proposal is a necessary step against corporate greed. Big Oil\'s manipulation of prices harms ordinary citizens, and strong regulatory measures are essential to protect consumers and promote fair pricing.', 'California\'s energy policies under Newsom are failing. Instead of reducing prices, they threaten to undermine domestic production and harm families. The state should focus on increasing supply and reducing regulations.', 'United States', 'California', 'Gavin Newsom , Kamala Harris , Rep. Vince Fong , Warren Petersen , James Gallagher', 'gas prices , California , Gavin Newsom , Kamala Harris , oil companies , regulators , Republicans', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(164, 2, 'https://www.newsbreak.com/kron4-news-1589914/3577867253360-labor-day-travel-rush-begins-in-the-bay-area', NULL, 'Labor Day Weekend Travel Surge Marks End of Summer', 'As Labor Day weekend approaches, domestic travel is up by 9% compared to last year, with San Francisco being a top destination. Travelers are advised to prepare accordingly for increased airport traffic, with San Jose Mineta International Airport expecting thousands over the next nine days.', 'The rise in domestic travel during Labor Day weekend reflects a recovering tourism sector. However, travelers should be mindful of potential congestion at airports and plan accordingly.', 'While increased travel is celebrated, it underscores the inequality in who gets to enjoy such leisure time. We must consider the impact of rising travel costs on low-income families.', 'As Americans flood airports this Labor Day, it\'s crucial to ensure security measures are strictly enforced to keep citizens safe amidst potential risks.', NULL, NULL, '14,000 fans , 9 percent , 2 percent', 'Labor Day , travel surge , San Francisco , airports , domestic travel', NULL, 75, 9, NULL, 'neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(165, 7, 'https://www.newsbreak.com/cbs-sacramento-500226/3578791757402-allstate-s-plan-to-raise-home-insurance-premiums-by-34-approved-by-california-officials', NULL, 'California Approves 34% Increase in Home Insurance Premiums for Allstate', 'California has authorized Allstate to raise home insurance premiums by 34%, effective November, following similar hikes by State Farm. State officials emphasized that California\'s premiums remain below those of several other states, attributing the rise to the impact of disasters and climate change. Consumers are encouraged to contact officials if they have concerns about their insurance rates.', NULL, NULL, NULL, NULL, NULL, 'Michael Soller , Jamie Court', 'California , Allstate , home insurance , premium increase , climate change , State Farm , wildfire damage', NULL, 75, 8, NULL, 'Left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(166, 1, 'https://www.newsbreak.com/the-marijuana-herald-2222119/3578707717718-california-legislature-approves-bill-allowing-direct-marijuana-sales-at-farmers-markets-sending-it-to-governor-newsom', NULL, 'California Approves Bill for Direct Marijuana Sales at Farmers Markets', 'The California Legislature has granted final approval to Assembly Bill 1111, enabling licensed marijuana growers to directly sell their products at farmers markets. The bill now awaits Governor Gavin Newsom\'s signature and will allow temporary event licenses for cannabis sales starting in 2026.', 'The approval of Assembly Bill 1111 marks a significant step in California\'s approach to cannabis legalization, potentially enhancing the market for small-scale growers while ensuring consumer access to locally produced products.', 'This bill is a victory for grassroots cannabis producers who have long been overshadowed by corporate entities. Direct sales at farmers markets emphasize community and sustainability, and should be expanded further!', 'It\'s concerning to see the government further entrench cannabis in our communities. While farmers markets are about local goods, introducing marijuana into this setting blurs lines and could send the wrong message to our youth.', 'USA', 'California', 'Gavin Newsom , Gail Pellerin', 'Assembly Bill 1111 , marijuana , farmers markets , cannabis sales , California Legislature', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(167, 2, 'https://www.newsbreak.com/huffpost-1592442/3578182298037-a-jail-diagnosed-him-with-hiv-then-denied-him-life-saving-medication-lawsuit-says', NULL, 'Tragic Death of an HIV-Positive Inmate Raises Questions about Prison Healthcare', 'Nicholas Overfield, an HIV-positive man, died after being denied necessary medication during his incarceration at El Dorado County Jail, leading to a lawsuit against the jail\'s healthcare provider, Wellpath. His mother claims systemic neglect resulted in his deteriorating health and eventual death.', NULL, NULL, NULL, NULL, NULL, 'Nicholas Overfield , Lesley Overfield , Marc Goldstone , Elizabeth Warren , Cory Booker', 'HIV , neglect , prison healthcare , Wellpath , lawsuit , El Dorado County', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(168, 9, 'https://www.newsbreak.com/kron4-news-1589914/3578290096312-dancing-with-the-stars-pro-artem-chigvintsev-arrested-for-domestic-violence-in-napa', NULL, 'Dancing With the Stars Pro Artem Chigvintsev Arrested for Domestic Violence', 'Artem Chigvintsev, a professional dancer on \'Dancing With the Stars,\' was arrested in the Bay Area on suspicion of domestic violence, as confirmed by KRON4.com. The 42-year-old was booked into Napa County Jail with felony charges and remains in custody on $25,000 bail.', NULL, NULL, NULL, NULL, NULL, 'Artem Chigvintsev , Nikki Garcia', 'domestic violence , Artem Chigvintsev , Dancing With the Stars , arrest , Napa County Jail', NULL, 75, 8, NULL, 'neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(169, 4, 'https://www.newsbreak.com/san-jos-spotlight-510761/3578196952638-ai-companies-see-san-jose-as-a-place-for-growth', 'San José Spotlight', 'San Jose Positioned as the Next AI Innovation Hub', 'Tech firm Couchbase relocates to San Jose, highlighting the city\'s potential as the heart of AI innovation, with strong support from local universities and city leaders to attract and cultivate tech talent.', 'The relocation of Couchbase to San Jose signifies the city\'s strategic importance in the evolving landscape of AI. As companies flee more traditional tech hubs like San Francisco, San Jose\'s supportive environment may lead to a significant boom in AI innovation.', 'While San Jose emerges as a tech hub, we must question the socio-economic impacts of this migration. Will these corporate giants contribute to the community, or just further inflate housing prices and deepen inequalities? It\'s crucial that city leaders enforce policies that protect local interests over corporate profits.', 'San Jose\'s city leaders should focus on maintaining a pro-business environment that favors local entrepreneurs. We should not allow excessive regulations or taxes to stifle innovation. The influx of tech companies is a positive indicator of economic growth, which benefits all.', 'USA', 'California', 'Fidelma Butler , Ahmed Banafa , Russell Hancock , Vas Bhandarkar , Nanci Klein', 'Couchbase , AI innovation , Silicon Valley , San Jose , venture capital', NULL, 85, 8, NULL, 'Neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(170, 2, 'https://www.newsbreak.com/kron4-news-1589914/3578397300824-14-year-old-killed-in-san-jose-highway-85-crash-identified', 'KRON4', 'Tragic Highway Crash Claims Life of 14-Year-Old Charlie Olsen in San Jose', 'A 14-year-old boy, Charlie George Olsen, died in a tragic car accident involving a wrong-way truck driver in San Jose. Charlie was traveling with his mother, Rebecca, who also lost her life in the crash. The incident highlights the dangers of reckless driving, as the truck driver was hospitalized after the collision, and it remains unclear if he will face charges.', NULL, NULL, NULL, 'United States', 'California', 'Charlie George Olsen , Rebecca Olsen , Duncan McQuarrie , Cameron Olsen', 'San Jose , Highway 85 , car crash , wrong-way driver , Charlie Olsen , Rebecca Olsen', NULL, 85, 9, NULL, 'neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(171, 2, 'https://www.newsbreak.com/kron4-news-1589914/3578403128355-motorcyclist-dies-in-san-jose-after-crashing-with-semi-truck-roads-closed', NULL, 'Motorcyclist Dies After Collision with Semi-Truck in San Jose', 'A motorcyclist was pronounced dead at the scene after a collision with a semi-truck in San Jose on Thursday afternoon. The truck driver is cooperating with the police investigation, and traffic in the area is severely impacted.', NULL, NULL, NULL, NULL, NULL, 'Motorcyclist , Truck driver', 'motorcyclist , semi-truck , collision , San Jose , police investigation', NULL, 75, 9, NULL, 'Neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(172, 2, 'https://www.newsbreak.com/abc7-news-bay-area-560897/3578515686387-ag-bonta-22-arrested-including-bay-area-gang-members-for-stealing-from-ca-cannabis-stores', 'ABC7 News', '22 Arrested in Statewide Cannabis Dispensary Theft Operation', 'California Attorney General Rob Bonta announced the arrest of 22 individuals involved in a coordinated theft operation targeting cannabis dispensaries across the state, from Sonoma County to San Diego. This investigation uncovered links to Oakland street gangs and has resulted in charges of commercial burglary and organized retail theft.', 'The arrests highlight growing concerns about organized crime targeting cannabis dispensaries, a sector that has faced various challenges since legalization. However, the key will be ensuring that effective measures are implemented to prevent such incidents in the future.', NULL, NULL, 'United States', 'California', 'Rob Bonta , Sheng Thao , Frederick Shavies', 'cannabis dispensary theft , arrests , gang violence , organized retail theft , California', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(173, 2, 'https://www.newsbreak.com/houston-herald-2046653/3577851081593-houston-alumni-takes-part-in-stanford-university-summer-internship', 'Houston Herald', 'Houston Graduate Completes Summer Internship at Stanford', 'Andy Durham, a 2023 graduate from Houston High School, interned with The Ahmed Group at the Kavli Institute for Particle Astrophysics and Cosmological Research at Stanford University. He worked on developing code for cryogenic detectors that study the cosmic microwave background, contributing to understanding the universe’s scale, age, and dark matter candidates.', 'This internship showcases the valuable opportunities available to high school graduates interested in physics and astrophysics, promoting early engagement in scientific research.', 'While it\'s commendable for young individuals like Durham to engage in high-level research, such opportunities should be accessible to all, regardless of economic background, to ensure diversity in scientific fields.', 'Durham\'s achievements reflect the importance of traditional education pathways, where dedication and hard work in STEM fields lead to meaningful summer internships at prestigious institutes.', 'United States', 'Houston', 'Andy Durham , Zeeshan Ahmed, Ph.D.', 'Houston High School , Stanford University , internship , cosmic microwave background , cryogenic detectors', NULL, 70, 8, NULL, 'neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(174, 1, 'https://www.newsbreak.com/los-angeles-times-521565/3578574982175-students-kick-off-fall-semester-with-protests-that-adhere-to-uc-csu-zero-tolerance-bans', 'Los Angeles Times', 'UC Berkeley Students Ignite Pro-Palestinian Protests Amid Gaza Conflict', 'Pro-Palestinian demonstrators at UC Berkeley and other Bay Area universities kicked off the fall semester with rallies expressing their ongoing concerns about the war in Gaza. The protests adhered to university regulations but signaled a resolve to continue advocating for Palestinian rights throughout the academic year.', NULL, NULL, NULL, 'United States', 'California', 'Michael V. Drake , Rich Lyons , Mildred A. García , Zainab , Yousuf Abubakr , James Aziz , Jeff Jackanicz', 'pro-Palestinian , UC Berkeley , Gaza war , student protests , free speech , activism , University of California , San Francisco State University', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(175, 2, 'https://www.newsbreak.com/cbs-san-francisco-500227/3578455345018-willow-glen-high-school-in-san-jose-evacuated-following-unverified-bomb-threat-call', 'San José Police Media Relations', 'Unverified Bomb Threat Prompts Evacuation of Willow Glen High School', 'Police in San Jose evacuated Willow Glen High School on Thursday due to an unverified bomb threat. Students were promptly evacuated as a safety measure, and parents were directed to pick them up on Cherry Avenue while authorities investigate the situation.', NULL, NULL, NULL, 'United States', 'California', '', 'bomb threat , evacuation , Willow Glen High School , San Jose , police', NULL, 75, 9, NULL, 'neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(176, 2, 'https://www.newsbreak.com/san-jos-spotlight-510761/3578528022052-east-san-jose-gets-funds-to-clean-lake', NULL, 'Revitalization of Lake Cunningham Park Boosted by Federal Funding', 'Arvind Kumar and Ashok Jethanandani have spent 20 years volunteering to restore Lake Cunningham Park in East San Jose. Their efforts to combat invasive species have received a significant boost with $850,000 in federal funding, aimed at enhancing the park\'s rehabilitation and environmental equity.', 'The revitalization efforts at Lake Cunningham Park highlight the importance of community involvement in environmental restoration projects. The injection of federal funding is a significant step towards improving the park\'s ecological health and accessibility for local residents.', NULL, NULL, NULL, NULL, 'Arvind Kumar , Ashok Jethanandani , Jimmy Panetta , Domingo Candelas , Alice Kaufman', 'Lake Cunningham Park , federal funding , restoration , environment , community', NULL, 75, 7, NULL, 'left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(177, 3, 'https://www.newsbreak.com/awful-announcing-1601134/3578829640171-analyst-s-infuriating-commentary-about-injured-player-frustrates-cfb-fans', NULL, 'TNT Sports Analyst Criticized for Insensitive Commentary During Injury Incident', 'During a college football game between San José State and Sacramento State, TNT Sports analyst Darius Walker faced backlash for poorly timed comments regarding injured player Michael Johnson. As Johnson lay motionless following a hard hit, Walker\'s focus on coaching tips and technique was seen as inappropriate, prompting criticism from viewers.', 'Darius Walker\'s commentary during the injury incident raises questions about the appropriateness of analysts discussing technique in sensitive moments. Although his points on player safety have merit, the timing and context were poorly chosen.', 'The commentary from Darius Walker reflects a broader issue within sports media, where the focus often shifts from athlete welfare to blaming players for their injuries. This underscores the need for a more compassionate approach in sports commentary.', 'Darius Walker\'s insights, however poorly timed, highlight the need for athletes to be trained properly. Rather than coddling players in the aftermath of injuries, we should emphasize accountability and responsibility in sports.', NULL, NULL, 'Darius Walker , Michael Johnson , Jared Greenberg', 'TNT Sports , Michael Johnson , Darius Walker , injury , college football', NULL, 75, 8, NULL, 'Moderate left-wing', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(178, 3, 'https://www.newsbreak.com/usa-today-560565/3578821852368-tcu-vs-stanford-football-predictions-odds-and-how-to-watch-friday', NULL, 'TCU vs. Stanford: College Football Showdown Kicks Off Week 1', 'The college football season is underway with a series of games throughout the weekend, highlighted by the matchup between TCU and Stanford. TCU, the favorite, has won all previous encounters against Stanford, but predictions vary on whether they will cover the spread.', NULL, NULL, NULL, NULL, NULL, 'Josh Hoover , TCU Horned Frogs , Stanford Cardinal', 'TCU , Stanford , college football , predictions , odds', NULL, 75, 9, NULL, 'neutral', '2024-08-30 10:26:33', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(179, 1, 'https://www.reuters.com/world/ukraine-says-us-partners-helping-investigation-f-16-crash-2024-08-30/', 'Reuters', 'Investigation Launched into Ukraine F-16 Crash During Russian Strikes', 'Ukraine\'s air force commander reported that a preliminary investigation report regarding an F-16 crash earlier this week has been shared with U.S. partners, who are assisting in the case. The pilot was killed while engaging targets amidst a major Russian air assault on Monday. Preliminary assessments suggest the crash was not due to Russian fire, but investigations into pilot error and mechanical failure continue.', NULL, NULL, NULL, 'Ukraine', NULL, 'Mykola Oleshchuk , Sabrina Singh', 'F-16 , Ukraine , investigation , crash , Russia', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(180, 2, 'https://www.reuters.com/world/europe/german-authorities-warn-incendiary-devices-packages-dpa-reports-2024-08-30/', 'dpa', 'German Authorities Warn of Incendiary Devices in Packages', 'German authorities have issued a warning regarding unconventional incendiary devices found in packages sent from various European locations, according to the news agency dpa. The domestic intelligence service BfV and federal crime agency BKA have alerted airlines and logistics companies of parcels that caught fire during transit.', 'The recent warning by German authorities highlights ongoing concerns about security in logistics and parcel delivery systems. It raises questions about how these devices were allowed to be sent across borders without detection.', NULL, NULL, 'Germany', 'Europe', '', 'incendiary devices , German authorities , security warning , BfV , BKA', NULL, 75, 8, NULL, 'government-affiliated', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(181, 2, 'https://www.reuters.com/world/asia-pacific/typhoon-shanshan-pounds-japan-with-torrential-rains-severe-wind-2024-08-30/', 'Reuters', 'Typhoon Shanshan Devastates Japan, Causing Floods and Disruptions', 'Typhoon Shanshan has struck Japan, unleashing torrential rain, causing flooding and landslides while halting travel services and factory production. At least four fatalities and 99 injuries have been reported, prompting evacuation orders for over 3.3 million people, particularly in Kyushu and parts of eastern Japan.', NULL, NULL, NULL, 'Japan', 'Fukuoka/Yufu', 'Yu Fukuda , Yoshifumi Matsumura , Lin Yue-Hua', 'Typhoon Shanshan , Japan , flooding , landslides , evacuation , Kyushu , travel disruptions , casualties', NULL, 85, 9, NULL, 'neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(182, 1, 'https://www.reuters.com/world/europe/far-right-afd-track-its-first-win-eastern-german-state-vote-2024-08-30/', 'Reuters', 'Far-Right Surge in Germany Signals Political Instability Ahead', 'The far-right Alternative for Germany (AfD) is projected to lead in upcoming eastern state elections, posing challenges for Chancellor Olaf Scholz\'s coalition amid concerns over the economy, immigration, and Ukraine support. While AfD may not form a government, its rise reflects growing political fragmentation in Germany.', NULL, NULL, NULL, 'Germany', 'Berlin', 'Olaf Scholz , Alice Weidel , Bjoern Hoecke , Sahra Wagenknecht', 'Alternative for Germany , AfD , elections , political instability , immigration , Ukraine , far-left , Sahra Wagenknecht Alliance', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(183, 1, 'https://www.reuters.com/world/europe/russias-attack-kills-one-injures-eight-ukraines-sumy-authorities-say-2024-08-30/', 'Reuters', 'Russian Airstrike Claims Lives in Ukrainian Factory Attack', 'A Russian attack in Sumy, Ukraine has resulted in the deaths of two women and injuries to at least 11 others, damaging a factory that produces packaging for baby food and household products. The assault follows ongoing tensions along the Ukrainian-Russian border, with continuous cross-border incursions by both sides.', 'The recent airstrike in Sumy highlights the ongoing and tragic impact of the conflict on civilian lives and infrastructure in Ukraine as attacks escalate in border regions.', 'This incident underscores the need for immediate international intervention to halt the violence inflicted upon innocent civilians by Russian forces, emphasizing the urgency for global solidarity against aggression.', 'This attack serves as a reminder of the failed security promises made to Ukraine, and emphasizes the need for stronger military support from NATO to defend against ongoing Russian aggression.', 'Ukraine', NULL, 'Ukrainian authorities , Ukrainian Prosecutor General\'s office , Filip Pronin', 'Russian attack , Sumy , airstrike , factory , casualties , Ukraine , Kursk , drone attack , Ukrainian air force , Odesa , Iskander-M missile', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(184, 1, 'https://www.reuters.com/world/europe/kremlin-says-it-made-no-deals-with-telegrams-durov-2024-08-30/', NULL, 'Kremlin Denies Any Deal with Telegram\'s Durov Amid Legal Troubles', 'The Kremlin has refuted claims of any negotiations with Telegram founder Pavel Durov, following his formal investigation in France for alleged complicity in illicit activities via the platform. Kremlin spokesperson Dmitry Peskov emphasized that Durov had never met President Putin and condemned any potential interpretation of the case as political persecution.', 'The ongoing investigation into Pavel Durov highlights the complex interplay between technology and governance. It raises critical questions about accountability in digital platforms, particularly those involved in illegal activities.', 'This investigation into Durov is indicative of a broader trend of state control over free expression and digital platforms. Governments around the world are increasingly using legal pressures to suppress voices that challenge their authority.', 'The Kremlin\'s defense of Durov demonstrates the need for national sovereignty in controlling external influences on Russian technology. The West often uses legal frameworks to undermine non-compliant entrepreneurs.', NULL, NULL, 'Pavel Durov , Dmitry Peskov , Vladimir Putin', 'Kremlin , Telegram , Durov , investigation , political persecution', NULL, 75, 7, NULL, 'Left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(185, 1, 'https://www.reuters.com/world/asia-pacific/disappeared-victims-emerge-bangladesh-seek-justice-despite-hurdles-2024-08-30/', NULL, 'Bangladesh Activist Michael Chakma Reveals Ordeal After Five-Year Abduction', 'Human rights activist Michael Chakma has recounted his five-year ordeal of abduction and torture in Bangladesh, highlighting systemic issues of enforced disappearances under the former government. The interim government is now forming a commission to investigate these cases amidst a backdrop of ongoing protests and political upheaval.', NULL, NULL, NULL, NULL, NULL, 'Michael Chakma , Sheikh Hasina , Muhammad Yunus , Sajeeb Wazed , Meenakshi Ganguly , Nur Khan', 'abduction , disappearances , human rights , Bangladesh , Sheikh Hasina , interim government , torture , activism', NULL, 85, 10, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(186, 1, 'https://www.reuters.com/world/asia-pacific/thai-anti-graft-body-begins-new-investigation-into-opposition-politicians-2024-08-30/', NULL, 'Thailand Probes Move Forward Party Members Over Royal Insult Law Amendments', 'Thailand\'s anti-corruption commission is investigating 44 members of the disbanded Move Forward party, including 25 current parliamentarians, for their support of legislation to amend the royal insult law. This follows the party\'s recent dissolution due to its election pledge to change this law, which critics say suppresses opposition.', 'The investigation into the Move Forward party reflects the ongoing tensions in Thai politics, particularly regarding laws that affect freedom of expression related to the monarchy. It remains crucial for the commission to ensure a fair investigation and uphold democratic principles.', NULL, NULL, NULL, NULL, 'Sarote Phuengrampan , Move Forward Party Members', 'anti-corruption , Move Forward Party , royal insult law , investigation , political opposition', NULL, 75, 8, NULL, 'neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(187, 1, 'https://www.reuters.com/markets/commodities/czechs-will-be-fine-if-druzhba-oil-flow-stops-official-says-2024-08-30/', 'Reuters', 'Czech Republic Prepares for Potential Halt in Russian Oil Supply', 'The Czech Republic\'s energy security envoy, Vaclav Bartuska, stated that any potential cut in oil supplies through the Druzhba pipeline from Russia would not pose a problem for the country. Investments are being made to increase capacity on the TAL pipeline, ensuring energy independence by 2025.', 'The Czech Republic\'s approach to diversify its oil supply routes demonstrates a proactive strategy in energy security. Investing in alternative infrastructure is essential in minimizing the risks associated with geopolitical tensions.', 'While the Czech Republic\'s preparations are commendable, there is still an urgent need to transition towards renewable energy sources instead of merely finding alternatives to Russian fossil fuels. Real energy security can only be achieved through sustainable solutions.', 'The Czech Republic\'s efforts to break free from Russian oil dependency are a commendable move towards national sovereignty. However, reliance on imports from other countries could pose similar risks, and stronger emphasis on domestic energy production is needed.', 'Czech Republic', 'Europe', 'Vaclav Bartuska , Mykhailo Podolyak', 'Czech Republic , oil supply , Druzhba pipeline , Russian oil , energy independence , TAL pipeline', NULL, 75, 8, NULL, 'Neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(188, 1, 'https://www.reuters.com/world/us/students-protests-return-campus-columbia-tries-new-restrictions-leadership-2024-08-30/', 'Reuters', 'Columbia University Protests Resurface Amidst New Leadership', 'Student protests advocating for Palestinian rights have returned to Columbia University as the new school year approaches. Amidst changes in campus security and leadership, the pro-Palestinian coalition CUAD continues to rally for divestment from companies supporting Israel\'s military presence in Palestine. Meanwhile, the university grapples with balancing free speech and safety amidst a climate of heightened tensions.', NULL, NULL, NULL, 'United States', 'New York', 'Dr. Katrina Armstrong , Minouche Shafik , Mahmoud Khalil , Mariam Jallow', 'Columbia University , protests , Palestinian rights , CUAD , divestment , student activism', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(189, 1, 'https://www.reuters.com/world/pacific-islands-boost-regional-policing-after-leaders-meeting-2024-08-30/', 'Reuters', 'Pacific Islands Forum Endorses Regional Police Initiative Amid Rising Tensions', 'The Pacific Islands Forum has approved a plan to increase police presence among its members, reducing reliance on external forces, with strong support from the Solomon Islands. The initiative, backed by Australia, aims to strengthen regional security amidst growing Chinese influence and ongoing strategic rivalry. The forum leaders also discussed a crisis in New Caledonia and reaffirmed their ties with Taiwan, drawing criticism from China.', NULL, NULL, NULL, 'Australia', 'Oceania', 'Mark Brown , Jeremiah Manele , Siaosi Sovaleni , Qian Bo', 'Pacific Islands Forum , regional police , Solomon Islands , Australia , China , Taiwan , New Caledonia , climate change', NULL, 85, 10, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(190, 2, 'https://www.reuters.com/business/environment/schools-pakistans-karachi-closed-rare-august-cyclone-builds-up-2024-08-30/', 'Reuters', 'Rare Cyclone Hits Coastal Regions of India and Pakistan, Thousands Evacuated', 'Authorities in India and Pakistan are evacuating thousands and closing schools as a rare August cyclone threatens coastal towns. Heavy rains and winds led to urban flooding and weather warnings for fishermen, with authorities urging residents to stay indoors.', NULL, NULL, NULL, 'India and Pakistan', 'Karachi/Ahmedabad', 'Ashok Kumar Das , Murtaza Wahab , Amit Arora', 'Cyclone , Evacuations , Heavy rains , Karachi , Gujarat , Urban flooding , Pakistan , India', NULL, 85, 9, NULL, 'Neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(191, 1, 'https://www.reuters.com/world/middle-east/salvage-stricken-oil-tanker-red-sea-expected-coming-days-say-sources-2024-08-30/', NULL, 'Salvage Operation for Greek Tanker in Red Sea Begins Amid Explosive Threats', 'A salvage operation is set to commence in the coming days to recover a Greek tanker, Sounion, stranded in the Red Sea following an attack by Houthi militants. The operation is complicated by explosives rigged to the vessel, posing a significant environmental risk due to its cargo of approximately 1 million barrels of crude oil.', 'The situation surrounding the Sounion highlights the complex challenges of maritime recovery operations in conflict zones, particularly the risks involved with potentially hazardous materials and explosive devices.', NULL, NULL, NULL, NULL, 'Sounion , Houthi militants , Delta Tankers , EU ASPIDES team', 'Salvage operation , Greek tanker , Red Sea , Houthi militants , environmental catastrophe', NULL, 85, 8, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(192, 7, 'https://www.reuters.com/world/asia-pacific/bangladesh-garment-industry-short-cotton-floods-worsen-protest-backlog-2024-08-30/', NULL, 'Bangladesh\'s Garment Industry Faces Crisis Due to Floods and Political Turmoil', 'Bangladesh\'s garment factories are struggling to meet production deadlines due to flooding disrupting cotton supplies. Political unrest has exacerbated the situation, leading to significant losses and potential long-term impacts for the industry.', NULL, NULL, NULL, NULL, NULL, 'Mohammad Hatem , Rubana Huq , Shahidullah Azim , Fazlee Shamim Ehsan , Louis Barbera , Atul Ganatra', 'Bangladesh , garment industry , flooding , cotton supply , political turmoil , production loss , export , manufacturers', NULL, 85, 9, NULL, 'neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(193, 1, 'https://www.reuters.com/world/china/chinas-cabinet-passes-draft-regulations-data-security-management-2024-08-30/', NULL, 'China\'s Cabinet Approves New Data Security Regulations', 'China\'s cabinet has approved draft regulations aimed at improving data security management and ensuring the orderly flow of data, alongside preliminary discussions on amendments to maritime law.', NULL, NULL, NULL, NULL, NULL, '', 'data security , regulations , China , cabinet , maritime law', NULL, 70, 8, NULL, 'government-affiliated', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(194, 1, 'https://www.reuters.com/world/europe/new-swiss-nuclear-dawn-seen-decades-away-best-2024-08-30/', 'Reuters', 'Switzerland Reverses Nuclear Exit: New Plants Likely Decades Away', 'Switzerland\'s government has lifted a ban on new nuclear power stations, reversing a 2017 decision to exit nuclear energy. However, experts argue that political and financial hurdles will delay construction for decades, with estimates suggesting operations may not begin until the mid-2040s or even the 2060s.', NULL, NULL, NULL, 'Switzerland', 'Europe', 'Stephanie Eger , Andreas Pautz , Roger Nordmann , Marianne Zünd , Nathan Solothurnmann', 'nuclear energy , Switzerland , energy policy , climate goals , geopolitical uncertainties', NULL, 75, 7, NULL, 'center-left', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(195, 1, 'https://www.reuters.com/world/asia-pacific/pakistan-military-launches-intelligence-operation-response-militant-attacks-army-2024-08-30/', NULL, 'Pakistan Launches Military Operations in Balochistan After Deadly Insurgents\' Attacks', 'In response to recent insurgent attacks that claimed over 50 lives in Balochistan, Pakistan\'s military has initiated intelligence-based operations. Five insurgents were killed and three wounded during the operations, with an ongoing commitment to bringing all perpetrators to justice. The attacks, claimed by the Baloch Liberation Army, are believed to target projects associated with the China-Pakistan Economic Corridor.', NULL, NULL, NULL, NULL, NULL, 'Shahbaz Sharif , Baloch Liberation Army', 'Balochistan , insurgents , military operations , Baloch Liberation Army , China-Pakistan Economic Corridor', NULL, 85, 9, NULL, 'Left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(196, 1, 'https://www.reuters.com/world/africa/tunisian-court-allows-prominent-politician-daimi-run-presidential-election-2024-08-30/', NULL, 'Tunisian Court Allows Imed Daimi to Rejoin Presidential Election Race', 'The Tunisian administrative court ruled in favor of politician Imed Daimi, allowing him to participate in the upcoming presidential elections scheduled for October 6. Daimi is the third candidate to have his candidacy restored after the court\'s intervention, alongside Abdellatif Mekki and Mondher Znaidi.', 'The ruling by the Tunisian administrative court signifies a critical step toward democratic integrity, enabling multiple voices in the electoral process that reflects a more diverse representation in politics.', NULL, NULL, NULL, NULL, 'Imed Daimi , Abdellatif Mekki , Mondher Znaidi', 'Tunisian court , Imed Daimi , presidential election , candidacy restored', NULL, 70, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(197, 1, 'https://www.reuters.com/world/countries-still-far-apart-cop29-finance-goal-2024-08-30/', NULL, 'Countries Struggle to Set New Climate Funding Target Ahead of COP29', 'With COP29 approaching in November, nations are in disagreement over how much funding to provide to developing countries for climate change, with proposals ranging from $441 billion to over $1 trillion. Major disagreements persist regarding which nations should contribute, particularly involving China.', NULL, NULL, NULL, NULL, NULL, '$100 billion , $441 billion , $1 trillion , China , EU , Canada', 'COP29 , climate funding , developing countries , emissions , financial targets', NULL, 85, 7, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(198, 1, 'https://www.reuters.com/world/europe/kremlin-says-military-corruption-investigations-will-lead-trial-2024-08-30/', NULL, 'Russia\'s Defence Officials Under Corruption Investigation', 'The Kremlin has confirmed serious corruption investigations into defence officials, with former deputy minister Pavel Popov detained over fraud allegations linked to the defence ministry. This scandal marks the largest corruption probe in Russia\'s military sector in years, leading to multiple arrests and significant changes in leadership.', 'The ongoing corruption investigations signify a critical moment for Russia\'s defence sector, potentially indicating an effort to resolve long-standing issues of mismanagement and fraud within the military establishment.', 'These investigations may just be a facade, an attempt by the elite to shift blame and conceal the systemic flaws within the military-industrial complex that have been exacerbated by opportunistic corruption.', 'The arrest of these officials is a necessary step towards purging the weak links in Russia\'s military and ensuring that the defence budget is managed more effectively for the nation\'s security.', NULL, NULL, 'Pavel Popov , Dmitry Peskov , Sergei Shoigu , Vladimir Putin , Andrei Belousov', 'corruption , defence ministry , investigation , Pavel Popov , Sergei Shoigu , Vladimir Putin', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(199, 1, 'https://www.reuters.com/business/aerospace-defense/eu-must-step-up-arms-production-play-stronger-role-defence-commission-chief-says-2024-08-30/', 'Reuters', 'EU Urged to Enhance Arms Production Amid Geopolitical Threats', 'European Commission President Ursula von der Leyen emphasized the need for the EU to boost its arms production in response to geopolitical threats, notably Russia\'s war on Ukraine, stating that Europe must prioritize security as a central duty.', 'The call for increased arms production reflects a growing awareness in the EU of the need to enhance its defense capabilities in a volatile geopolitical landscape. This suggests a significant shift in how security is perceived within Europe.', NULL, NULL, 'Czech Republic', 'Europe', 'Ursula von der Leyen', 'EU , arms production , geopolitical threats , Russia , Ukraine', NULL, 85, 9, NULL, 'Government-affiliated', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(200, 1, 'https://www.reuters.com/world/asia-pacific/taiwan-ministry-says-china-lacks-ability-invade-has-other-options-2024-08-30/', NULL, 'China Lacks Full Invasion Capability for Taiwan, Says Taipei\'s Defense Ministry', 'Taiwan\'s defense ministry asserts that while China is developing advanced military capabilities, it still lacks full invasion capabilities due to insufficient logistics and equipment. However, China continues to pressure Taiwan through military exercises and increased threats.', NULL, NULL, NULL, NULL, NULL, 'Lai Ching-te , Wu Qian', 'Taiwan , China , military , defense , invasion capability', NULL, 85, 9, NULL, 'The news source, Reuters, is generally considered to have a center-left bias, focusing on factual reporting but sometimes skewing towards liberal perspectives.', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(201, 2, 'https://www.reuters.com/world/asia-pacific/indonesia-reform-tourism-tropical-island-bali-senior-minister-says-2024-08-30/', NULL, 'Indonesia Plans Tourism Audit to Preserve Bali\'s Culture and Quality', 'Indonesia\'s government will conduct an audit of tourism on Bali to improve quality and preserve local culture. Senior Minister Luhut Pandjaitan highlighted issues like crime and over-development linked to foreign tourists, pledging to deport troublemakers and tackle trash problems.', NULL, NULL, NULL, NULL, NULL, 'Luhut Pandjaitan , Sandiaga Uno', 'Bali , tourism , audit , foreigners , cultural preservation , crime , over-development', NULL, 75, 8, NULL, 'The source is generally considered neutral with a slight tendency to report on government initiatives positively.', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(202, 1, 'https://www.reuters.com/world/middle-east/israeli-forces-say-they-kill-local-hamas-commander-west-bank-2024-08-30/', NULL, 'Israeli Forces Kill Hamas Commander in West Bank Operations', 'Israeli forces killed Wassem Hazem, a local commander of Hamas, during a large-scale operation in Jenin. The operation has seen escalating violence and civilian casualties, raising concerns worldwide.', 'The ongoing conflict in the West Bank presents a complex scenario where security operations by Israel coincide with a rising death toll among Palestinians, complicating the prospects for peace.', NULL, NULL, NULL, NULL, 'Wassem Hazem', 'Israeli forces , Hamas , Jenin , occupation , casualties', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(203, 1, 'https://www.reuters.com/world/india/modis-populism-after-india-election-reversal-puts-public-finances-risk-2024-08-30/', 'Reuters', 'Modi\'s Coalition Turns to Cash Handouts Amid Political Challenges', 'Facing electoral setbacks, Indian Prime Minister Narendra Modi\'s coalition is boosting cash handouts and freebies to retain popularity ahead of state elections. Analysts warn that this populist strategy could disrupt fiscal balance and funding for urban development projects.', 'The shift towards cash handouts by Modi\'s government highlights a significant political strategy aimed at regaining public favor, especially after losses in recent elections. However, this approach raises concerns about long-term fiscal sustainability.', NULL, NULL, 'India', 'New Delhi', 'Narendra Modi , Madhavi Arora , Yashwant Deshmukh , Christian de Guzman', 'cash handouts , debt waivers , BJP , state elections , populism , fiscal deficit , inflation , unemployment , Hindu nationalism', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(204, 1, 'https://www.reuters.com/world/europe/un-releases-100-mln-support-10-underfunded-crises-2024-08-30/', NULL, 'UN Releases $100 Million to Address Humanitarian Crises Worldwide', 'The United Nations has allocated $100 million to assist ten underfunded humanitarian crises in various regions, with significant portions directed to Yemen and Ethiopia. The UN emphasizes the urgent need for sustained financial support to address issues such as hunger, displacement, and climate challenges.', 'The allocation of funds by the UN highlights the urgent humanitarian needs in various regions. It is crucial for donor countries to remain committed to supporting these vulnerable populations who are suffering from multiple socio-economic challenges.', NULL, NULL, NULL, NULL, '100 million dollars , 20 million for Yemen , 15 million for Ethiopia , 12 million for Myanmar , 11 million for Mali , 10 million for Burkina Faso , 9 million for Haiti , 7 million for Cameroon , 7 million for Mozambique , 5 million for Burundi , 4 million for Malawi', 'United Nations , humanitarian aid , funding , Yemen , Ethiopia , crisis , donor support', NULL, 85, 7, NULL, 'Left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(205, 2, 'https://www.reuters.com/business/healthcare-pharmaceuticals/12-mln-polio-vaccine-doses-delivered-gaza-ahead-sept-1-campaign-who-says-2024-08-30/', NULL, 'Gaza Prepares for Polio Vaccination Campaign with 1.2 Million Doses Delivered', 'Ahead of a Sept. 1 campaign to vaccinate over 640,000 children against polio, 1.2 million vaccine doses have been delivered to Gaza, with an additional 400,000 doses en route, according to the WHO.', NULL, NULL, NULL, NULL, NULL, '1.2 million , 640,000 , 400,000', 'Gaza , Polio , Vaccine , WHO , Children', NULL, 85, 9, NULL, 'Left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(206, 2, 'https://www.reuters.com/business/environment/wine-wins-crops-lose-farmers-grapple-with-record-balkans-heat-2024-08-30/', NULL, 'Severe Drought Strikes Serbia and the Balkans, Threatening Agriculture', 'A record-breaking drought in Serbia and the broader Balkans has led to widespread crop failures and concerns over climate change\'s impact on agriculture. While wine producers may benefit from sweeter grapes, farmers are anticipating significant losses, with corn yields projected to drop by 20%. The situation reflects a need for increased irrigation in the region.', 'The situation in the Balkans is a stark reminder of how climate change manifests through extreme weather. Agricultural practices must adapt to mitigate these impacts, especially regarding irrigation and crop resilience.', NULL, NULL, NULL, NULL, 'Rastislav Pucovski , Branislav Gulan , Dragan Mandic , Dejan Jovanovic , Vesna Stajner , Nebi Duraj', 'drought , Serbia , Balkans , agriculture , climate change , corn , grapes , irrigation', NULL, 85, 9, NULL, 'Neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(207, 5, 'https://www.reuters.com/lifestyle/swiss-choose-basel-host-city-2025-eurovision-song-contest-2024-08-30/', 'Reuters', 'Basel to Host Eurovision Song Contest 2025, Anticipated Economic Boost', 'The Eurovision Song Contest 2025 will be held in Basel, Switzerland, on May 17, with an expected economic boost from the large influx of fans. Authorities are proposing a budget of 34.9 million Swiss francs to support the event, which is anticipated to attract 473,000 attendees and significant spending in local businesses.', NULL, NULL, NULL, 'Switzerland', 'Zurich', '34.9 million Swiss francs , 41.2 million USD , 12,000 capacity at St Jakobshalle , 473,000 attendees , 163 million viewers worldwide', 'Eurovision Song Contest , Basel , economic boost , St Jakobshalle , event funding , local businesses', NULL, 75, 8, NULL, 'Neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(208, 1, 'https://www.reuters.com/world/argentina-police-arrest-former-red-brigade-member-wanted-by-italy-2024-08-29/', 'Reuters', 'Former Red Brigades Member Arrested in Argentina', 'Leonardo Bertulazzi, a fugitive former member of the Red Brigades wanted by Italy for serious crimes, has been arrested in Buenos Aires. After losing his refugee status under President Javier Milei\'s administration, Bertulazzi faces a 27-year prison sentence for crimes including kidnapping. Italian authorities lauded the cooperation between Italy, Argentina, and Interpol that led to his arrest.', NULL, NULL, NULL, 'Argentina', 'Buenos Aires', 'Leonardo Bertulazzi , Javier Milei , Giorgia Meloni', 'Red Brigades , Argentina , Italy , arrest , terrorism , kidnapping', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(209, 1, 'https://www.reuters.com/business/energy/venezuelas-capital-caracas-other-regions-face-power-outage-2024-08-30/', 'Reuters', 'Nationwide Power Outage Hits Venezuela Amid Allegations of Sabotage', 'A widespread power outage affected almost all 24 states in Venezuela, with the government blaming opposition sabotage without presenting evidence. Minister Freddy Nanez claimed the country has been a victim of deliberate attacks on the power grid. This outage follows previous smaller blackouts and comes amid political tensions regarding recent elections.', 'The power outage in Venezuela highlights the ongoing infrastructure issues and the government’s repeated accusations against the opposition without substantiation. Such incidents raise concerns about the reliability of public services and the political climate in the country.', 'The constant sabotage attempts by opposition forces reflect their desperation to undermine the Maduro government. These power outages are an orchestrated effort by the opposition to destabilize the nation further, and the government must maintain its resilience against such attacks.', 'This blackout is yet another example of the Maduro regime\'s failure to maintain basic services. Rather than blaming the opposition, the government should focus on fixing its long-failing infrastructure and accountability for its inefficiency.', 'Venezuela', 'Caracas', 'Nicolas Maduro , Freddy Nanez , Edmundo Gonzalez', 'power outage , Venezuela , sabotage , Maduro , opposition , infrastructure', NULL, 80, 8, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(210, 1, 'https://www.reuters.com/world/germany-says-it-resumes-deportations-afghanistan-2024-08-30/', NULL, 'Germany Resumes Deportation of Afghan Criminals Ahead of Elections', 'Germany has resumed deporting Afghan nationals convicted of crimes, coinciding with regional elections as migration becomes a focal issue. This comes after a series of violent incidents linked to Afghan migrants and amid increased pressure on the government to tighten asylum policies.', NULL, NULL, NULL, NULL, NULL, 'Olaf Scholz , Robert Habeck , Tareq Alaows', 'deportation , Afghanistan , criminals , migration , election', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(211, 2, 'https://www.reuters.com/world/asia-pacific/why-south-korea-is-high-alert-over-deepfake-sex-crimes-2024-08-30/', NULL, 'South Korea Cracks Down on Sexually Exploitative Deepfakes', 'South Korean regulators and police are intensifying efforts to combat sexually exploitative deepfakes, urging cooperation from social media companies like Telegram. Rising incidents of deepfake pornography targeting women, particularly K-pop stars, have led to public outcry and government action, including proposed tougher laws against such practices.', NULL, NULL, NULL, NULL, NULL, 'Pavel Durov , South Korean police , South Korean feminist groups', 'deepfake , sexually exploitative , South Korea , Telegram , digital sex crimes', 8, 85, 9, 'Reuters is generally considered a reliable news source, known for its fact-based reporting and relatively balanced coverage. However, some may perceive a slight left-wing bias in its framing of social issues.', 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(212, 2, 'https://www.reuters.com/business/healthcare-pharmaceuticals/what-is-known-about-polios-return-gaza-strip-2024-08-30/', NULL, 'Gaza Records First Case of Polio in 25 Years, Mass Vaccination Campaign Launched', 'Health authorities in Gaza confirmed the first case of polio in 25 years earlier this month, prompting a mass vaccination campaign for children starting September 1. This case, linked to a strain found in Egypt, is attributed to a decline in vaccination rates due to ongoing conflict and poor sanitary conditions.', 'The emergence of polio in Gaza after 25 years highlights the critical need for consistent vaccination efforts, particularly in conflict zones. A thorough analysis of the public health system\'s challenges and increased support for healthcare workers is essential.', NULL, NULL, NULL, NULL, 'Abdul-Rahman Abu Al-Jidyan , WHO , Hamas , Israel', 'polio , Gaza , vaccination campaign , healthcare , Hamas , Israel', NULL, 85, 9, NULL, 'Neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(213, 1, 'https://www.reuters.com/world/japan/israeli-military-says-killed-local-hamas-commander-west-bank-2024-08-30/', NULL, 'Israeli Forces Kill Senior Hamas Commander in West Bank', 'Israeli border police have killed senior Hamas commander Wassem Hazem in Jenin, West Bank, during an operation where two additional gunmen were also killed by a drone as they attempted to escape. The vehicle contained weapons, ammunition, and a significant amount of cash.', NULL, NULL, NULL, NULL, NULL, 'Wassem Hazem', 'Israeli border police , Hamas , senior commander , Jenin , killed , drone , weapons , ammunition , cash', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(214, 1, 'https://www.reuters.com/world/taiwan-delivers-protective-equipment-haiti-security-forces-2024-08-29/', NULL, 'Taiwan Supplies Haiti with Protective Gear to Combat Gangs', 'Taiwan\'s embassy in Haiti has donated 400 protective equipment kits to Haiti\'s national police and army to aid in their fight against gangs. This donation reflects the strong friendship between the two nations as Haiti grapples with rampant gang violence and instability.', NULL, NULL, NULL, NULL, NULL, 'Garry Conille , Joe Biden', 'Taiwan , Haiti , protective equipment , gang violence , diplomatic ties', NULL, 85, 7, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(215, 2, 'https://www.reuters.com/world/asia-pacific/new-zealands-maori-king-tuheitia-dies-aged-69-2024-08-29/', 'Reuters', 'New Zealand\'s Maori King Tuheitia Pootatau Te Wherowhero VII Passes Away at 69', 'New Zealand\'s Maori King Tuheitia Pootatau Te Wherowhero VII has died peacefully at the age of 69 after heart surgery. His passing is mourned across the Maori community and the nation, marking a significant moment in the history of the Kiingitanga movement. His successor will be appointed during traditional funeral rites.', 'The passing of Maori King Tuheitia is a moment of reflection for New Zealand, highlighting the importance of the Kiingitanga movement and the role of Māori culture in the nation’s identity.', NULL, NULL, 'New Zealand', NULL, 'Tuheitia Pootatau Te Wherowhero VII , Christopher Luxon , Jacinda Ardern', 'Tuheitia , Maori King , Kiingitanga , heart surgery , New Zealand', NULL, 85, 9, NULL, 'neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(216, 1, 'https://www.reuters.com/world/americas/panama-deports-ecuadorean-migrants-second-us-backed-flight-2024-08-30/', NULL, 'Panama Deports Migrants to Ecuador on U.S.-Financed Flight', 'Panamanian authorities deported a group of 30 Ecuadorean migrants on a U.S.-financed flight as part of an agreement aimed at discouraging irregular crossings. This operation follows an earlier flight returning Colombian migrants, indicating ongoing efforts to manage migration flows through the dangerous Darien Gap.', NULL, NULL, NULL, NULL, NULL, 'Jose Mulino', 'Panama , deportation , migrants , Ecuador , U.S. financing , Darien Gap', NULL, 75, 9, NULL, 'moderate left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(217, 1, 'https://www.reuters.com/world/asia-pacific/philippines-vietnam-sign-defence-agreement-2024-08-30/', NULL, 'Vietnam and Philippines Strengthen Defense Ties Amid South China Sea Tensions', 'Vietnam and the Philippines have agreed to enhance defense and military relations, while also committing to cooperation on maritime security amid growing tensions in the South China Sea. This agreement comes during a visit by the Vietnamese Defense Minister to Manila, with both countries aiming to sign a formal defense cooperation deal by year-end.', 'This collaboration between Vietnam and the Philippines represents a strategic move to counterbalance China\'s influence in the South China Sea. Both countries are taking calculated steps towards mutual defense and peaceful dispute resolution within international law.', NULL, NULL, NULL, NULL, 'Phan Van Giang , Gilberto Teodoro , Ferdinand Marcos Jr.', 'Vietnam , Philippines , defense cooperation , South China Sea , maritime security , China', NULL, 85, 9, NULL, 'Neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(218, 1, 'https://www.reuters.com/world/asia-pacific/china-publishes-first-survey-report-disputed-south-china-seas-sabina-shoal-2024-08-30/', NULL, 'China Refutes Philippine Claims on Sabina Shoal Reef Damage', 'China has released a survey report stating that there is no scientific basis for the Philippines\' claims of reef damage at the disputed Sabina Shoal. The report contradicts allegations that Chinese activities have resulted in coral bleaching and death, asserting that habitat conditions are suitable for coral growth. Clashes continue in the South China Sea as both nations vie for control over the waters.', NULL, NULL, NULL, NULL, NULL, 'Philippine coast guard , Chinese Ministry of Natural Resources , Filipino fishermen', 'Sabina Shoal , coral reef , South China Sea , Philippines , China , sovereignty , environmental damage', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(219, 1, 'https://www.reuters.com/world/asia-pacific/new-caledonia-congress-president-roch-wamytan-replaced-vote-2024-08-30/', 'Reuters', 'New Caledonia\'s Congress President Replaced in Unexpected Vote', 'Roch Wamytan, the first Kanak president of New Caledonia\'s Congress, was replaced by Veylma Falaeo after a narrow vote. Falaeo, a \'middle way\' candidate, aims for reforms and is the first woman to lead the Congress, while Wamytan faced criticism for his dealings with pro-independence Kanak groups and France.', NULL, NULL, NULL, 'France', 'New Caledonia', 'Roch Wamytan , Veylma Falaeo , Emmanuel Macron , Nicolas Metzdorf', 'New Caledonia , Congress , Roch Wamytan , Veylma Falaeo , pro-independence , civil unrest', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(220, 1, 'https://www.reuters.com/world/middle-east/britain-deeply-concerned-by-israels-operation-occupied-west-bank-2024-08-30/', 'Reuters', 'UK Voices Concern Over Israel\'s Actions in West Bank Amid Escalating Violence', 'The British government expressed deep concern regarding Israel\'s ongoing military operations in the occupied West Bank, calling for urgent de-escalation and restraint. The situation has worsened since conflicts with Hamas began, resulting in significant casualties and increased tensions in the region.', NULL, NULL, NULL, 'United Kingdom', 'London', 'British Foreign Office spokesperson , Iranian-backed Islamic Jihad commander , Palestinian casualties', 'Israel , West Bank , UK , Palestinian casualties , settler violence , Hamas , military operation', NULL, 85, 7, NULL, 'The media source is generally considered left-leaning due to its critical stance on Israeli military actions and focus on humanitarian issues.', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(221, 1, 'https://www.reuters.com/world/stretched-us-navy-eyes-risky-new-waters-south-china-sea-2024-08-30/', NULL, 'U.S. Military Strengthens Ties with Philippines Amid Rising Tensions with China', 'As two U.S. aircraft carrier battle groups patrol the Indian Ocean to deter Iran, the U.S. Indo-Pacific Command hosts the 35th Military Law and Operations Conference in Manila amid rising tensions between the Philippines and China over disputed shoals.', 'The ongoing tensions in the South China Sea highlight the complex geopolitical dynamics in the region. The U.S.\'s military support for the Philippines demonstrates its commitment to allies, but it also risks escalating hostilities with China.', 'The U.S. is once again flexing its military muscles under the guise of protecting allies, but this approach only fuels conflicts in the region. The Philippines should prioritize peaceful negotiations rather than relying on American intervention.', 'The U.S. must stand firm against Chinese aggression in the South China Sea. Supporting the Philippines is essential to maintaining freedom of navigation and protecting U.S. interests in the region. We cannot show weakness.', NULL, NULL, 'Admiral Samuel Paparo , General Romeo Brawner , Lloyd Austin , Charles Brown , Samuel Byers', 'U.S. Navy , Philippines , China , South China Sea , Military Operations , Tensions , Carrier Groups', NULL, 80, 8, NULL, 'Government-affiliated', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(222, 1, 'https://www.reuters.com/world/americas/us-urges-honduras-reconsider-treaty-withdrawal-president-warns-plot-2024-08-30/', NULL, 'Honduran President Castro Threatens to Exit Extradition Treaty Amid U.S. Concerns', 'Honduran President Xiomara Castro has announced plans to withdraw from a long-standing extradition treaty with the U.S., claiming it is being used to intimidate her government amidst rising tensions following a controversial meeting between Honduran and Venezuelan military officials. The U.S. urges Honduras to reconsider the decision, arguing that it undermines cooperation against drug trafficking.', 'The diplomatic tensions between Honduras and the United States highlight the complexities of modern international relations, where treaties and agreements can be viewed through the lens of domestic politics and security concerns. It remains to be seen how this situation will evolve and what implications it will have for drug trafficking cooperation.', 'Xiomara Castro\'s decision to reconsider the extradition treaty is a brave step towards sovereignty and reflects a necessary pushback against U.S. interventionism in Latin America. The U.S. has a long history of backing right-wing regimes and exploiting countries for their own geopolitical interests.', 'Castro\'s threats to leave the extradition treaty reveal her administration\'s disturbing disregard for law enforcement and its apparent collusion with known anti-American regimes. The United States must remain firm in its stance against drug trafficking and not allow Honduras to slip into disorder.', NULL, NULL, 'Xiomara Castro , Laura Dogu , Enrique Reina , Vladimir Padrino', 'Honduras , extradition treaty , Xiomara Castro , drug trafficking , U.S. , Venezuela', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(223, 1, 'https://www.reuters.com/world/europe/german-leftist-party-leader-wagenknecht-attacked-with-paint-campaign-rally-2024-08-29/', NULL, 'Pink Paint Attack on German Leftist Leader at Campaign Rally', 'Sahra Wagenknecht, leader of Germany\'s Sahra Wagenknecht Alliance (BSW), was attacked with pink paint at a campaign rally in Thuringia, just days before the state parliamentary elections. Security apprehended the assailant, while Wagenknecht urged her supporters not to be intimidated.', NULL, NULL, NULL, 'Germany', 'Thuringia', 'Sahra Wagenknecht , middle-aged white man', 'Sahra Wagenknecht , BSW , campaign rally , pink paint attack , Thuringia elections', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(224, 1, 'https://www.reuters.com/world/europe/french-president-macron-says-he-was-not-aware-telegrams-durovs-arrival-france-2024-08-29/', 'Reuters', 'Telegram CEO Pavel Durov Arrested in France Amid Content Liability Debate', 'Pavel Durov, the CEO of Telegram, was arrested in France for alleged complicity in facilitating illegal activities through the messaging platform. This incident has raised tensions between France and Russia, with Durov’s lawyer calling the charges absurd. The case reflects increasing scrutiny of tech companies regarding their role in online content regulation.', NULL, NULL, NULL, 'France', NULL, 'Pavel Durov , Emmanuel Macron , David-Olivier Kaminski , Gerard Araud', 'Telegram , Pavel Durov , arrest , illegal activities , content liability , France , tech companies', NULL, 75, 9, NULL, 'neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(225, 6, 'https://www.reuters.com/world/europe/sunk-superyacht-likely-cost-insurers-least-150-million-experts-say-2024-08-29/', NULL, 'Potential Insurance Costs for Sunk Superyacht Bayesain Estimated at $150 Million', 'The sinking of the superyacht Bayesian, which killed tech entrepreneur Mike Lynch and six others, could lead to insurance payouts of at least $150 million, according to industry estimates. An investigation is ongoing into the circumstances surrounding the disaster.', NULL, NULL, NULL, NULL, NULL, 'Mike Lynch , Marcos Alvarez , Oscar Seikaly , Francesco Dubbioso', 'Bayesian , superyacht , insurance , sinking , investigation , climate change , premiums', NULL, 75, 8, NULL, 'neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(226, 1, 'https://www.reuters.com/world/europe/russian-shelling-kills-one-east-ukraine-governor-says-2024-08-29/', 'Reuters', 'Russian Shelling Claims Life in Kostiantynivka amid Ongoing Conflict', 'One person has died and six others were injured in a recent Russian shelling of Kostiantynivka, according to local authorities. The town, situated away from the frontline, is frequently targeted, causing significant damage to residential areas.', 'The ongoing conflict in Ukraine continues to escalate, affecting civilian areas such as Kostiantynivka. This incident highlights the persistent dangers faced by residents in regions away from the frontline.', NULL, NULL, 'Ukraine', 'Donetsk', 'Vadym Filashkin', 'Russian shelling , Kostiantynivka , casualties , Donetsk , ongoing conflict', NULL, 75, 9, NULL, 'government-affiliated', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(227, 2, 'https://www.reuters.com/world/europe/magnitude-59-earthquake-hits-off-coast-russias-kamchatka-emsc-says-2024-08-30/', 'Reuters', 'Magnitude 5.9 Earthquake Strikes Off Russia\'s Kamchatka Coast', 'A 5.9 magnitude earthquake occurred off the east coast of Russia\'s Kamchatka region on Friday, with a depth of 51 km, reported the European Mediterranean Seismological Centre.', 'The recent earthquake in Kamchatka serves as a reminder of the region\'s seismic activity, highlighting the need for preparedness in such areas.', 'This earthquake underscores the urgent need for more government investment in disaster response and infrastructure to protect vulnerable populations in earthquake-prone areas.', 'Natural disasters like this earthquake reaffirm the resilience of the Russian people, who continue to navigate the challenges presented by their harsh environment.', 'Russia', 'Kamchatka', '5.9 , 51 km', 'earthquake , Kamchatka , magnitude , EMSC , seismological', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(228, 1, 'https://www.reuters.com/world/asia-pacific/east-timor-hosts-uns-guterres-25th-anniversary-independence-vote-2024-08-30/', 'Reuters', 'East Timor Celebrates 25th Anniversary of Independence with Reflection on Conflict Resolution', 'UN Secretary-General Antonio Guterres praised East Timor\'s independence on its 25th anniversary, highlighting it as a demonstration of conflict resolution through negotiation. The day was marked by commemorative events in Dili, reflecting on the nation’s journey from occupation under Indonesia to self-governance. Guterres emphasized the courage of the Timorese resistance and the country\'s evolution into a contributor to UN peacekeeping efforts.', NULL, NULL, NULL, NULL, NULL, 'Antonio Guterres , Xanana Gusmao , Jose Ramos-Horta', 'East Timor , independence , negotiation , conflict resolution , 25th anniversary , UN , Xanana Gusmao , Jose Ramos-Horta', NULL, 85, 8, NULL, 'neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(229, 4, 'https://www.reuters.com/technology/space/boeings-uncrewed-starliner-set-undock-after-sept-6-nasa-says-2024-08-29/', NULL, 'NASA to Proceed with Starliner Undocking After Review', 'NASA announced that the undocking of the uncrewed Boeing Starliner capsule will occur no earlier than September 6. Following a review, the space agency has deemed propulsion system issues too risky for a crewed return, leading to a decision for astronauts aboard the Starliner to return to Earth via a SpaceX vehicle early next year.', 'The decision to delay the Starliner\'s crewed return underlines the importance of safety in space operations. It is critical for NASA to ensure that the propulsion issues are resolved before proceeding with future missions.', 'This incident highlights the inherent risks associated with privatized space travel. Critical elements of safety should not be outsourced to corporations like Boeing and SpaceX, as profit motives can compromise astronaut welfare.', 'NASA\'s decision to wait for the undocking reflects the increasing bureaucracy in government agencies. Efficient operational decisions are being overshadowed by excessive caution, delaying progress in America\'s space exploration goals.', NULL, NULL, 'NASA , Boeing , SpaceX', 'Starliner , undocking , propulsion system , crew , SpaceX , International Space Station , landing', NULL, 75, 9, NULL, 'government-affiliated', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(230, 1, 'https://www.reuters.com/lifestyle/migrant-separation-documentary-hits-venice-shines-light-trump-policy-2024-08-29/', 'Reuters', 'Oscar-Winning Director Examines Trump’s Controversial Family Separation Policy in New Documentary', 'Errol Morris premiered his documentary \'Separated\' at the Venice Film Festival, exploring the Trump administration\'s family separation policy at the U.S.-Mexico border. The film reveals the impact on children and families while raising questions about the administration\'s rationale behind the policy.', 'The release of \'Separated\' sheds light on a critical issue regarding U.S. immigration policy, highlighting the emotional and psychological toll on families. This documentary could serve as a vital reminder for policymakers about the human consequences of their decisions.', 'This documentary starkly illustrates the cruelty of the Trump administration\'s policies. It is a shameful chapter in the U.S. history that reflects deep-seated systemic issues within immigration practices. Immediate reform is needed to prevent further human rights abuses.', 'While the documentary highlights critical issues, it fails to acknowledge the necessity of stringent border policies for national security. Concerns about illegal immigration should not be dismissed, and any measures taken were aimed at enforcing law and order.', 'USA', 'Venice, Italy', 'Errol Morris , Donald Trump , Jacob Soboroff', 'documentary , Trump , family separation , U.S.-Mexico border , immigration policy , Venice Film Festival', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(231, 1, 'https://www.reuters.com/world/us-military-says-it-rescued-two-civilian-iranian-mariners-last-week-2024-08-29/', 'Reuters', 'U.S. Navy Rescues Iranian Mariners Amid Middle East Tensions', 'The U.S. Navy\'s Theodore Roosevelt Strike Group rescued two Iranian mariners in international waters on August 23, as tensions continue to rise in the Middle East. The operation demonstrates the U.S. military\'s commitment to humanitarian efforts alongside their strategic presence in the region.', 'The rescue operation highlights the U.S. Navy\'s role in both military presence and humanitarian assistance in international waters, which is crucial in a time of growing geopolitical tensions in the region.', NULL, NULL, 'USA', 'Washington', 'USS Theodore Roosevelt , USS Abraham Lincoln , U.S. Central Command', 'U.S. Navy , Iranian Mariners , Rescue , Middle East Tensions , Aircraft Carrier Strike Group', NULL, 75, 8, NULL, 'Government-affiliated', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(232, 1, 'https://www.reuters.com/world/americas/nicaragua-shutters-another-169-civil-society-groups-purge-intensifies-2024-08-29/', NULL, 'Nicaragua Bans 169 NGOs, Continuing Crackdown on Civil Society', 'Nicaragua\'s government has banned 169 NGOs, including Save The Children Canada, for failing to comply with regulations. This move adds to a series of closures as part of a broader effort by President Daniel Ortega\'s administration to suppress organizations viewed as oppositional. Over 4,000 NGOs have been closed since 2018.', 'The recent ban on 169 NGOs in Nicaragua highlights ongoing tensions between the government and civil society, reflecting broader trends seen in authoritarian regimes where dissent is systematically curtailed.', NULL, NULL, 'Nicaragua', 'Central America', 'Daniel Ortega , Maria Amelia Coronel', 'Nicaragua , NGOs , banned , civil society , Ortega , regulations', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(233, 1, 'https://www.reuters.com/world/africa/libya-central-bank-governor-flees-fear-his-life-ft-says-2024-08-30/', NULL, 'Libya\'s Central Bank Governor Flees Amid Militia Threats', 'Sadiq al-Kabir, the governor of Libya\'s central bank, has fled the country due to threats from armed militia targeting bank staff. He claims that these militias have been abducting relatives of employees to coerce them into working. His statements suggest a deeper crisis over the control of the central bank and increasing instability in the already divided nation, which is crucial for global oil production.', NULL, NULL, NULL, NULL, NULL, 'Sadiq al-Kabir , Abdulhamid al-Dbeibah', 'Libya , central bank , militia , instability , Sadiq al-Kabir', NULL, 85, 9, NULL, 'Left-wing', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(234, 2, 'https://www.reuters.com/world/africa/south-africa-lion-breeders-face-uncertain-future-after-ban-2024-08-30/', NULL, 'South Africa\'s Ban on Big Cat Breeding Raises Concerns Among Breeders', 'South Africa\'s new ban on captive big cat breeding and lion commercialization has left breeders anxious about their financial futures, following the government\'s recommendations to close the breeding sector without providing financial assistance. The nation\'s immense population of captive lions, the highest in the world, adds complexity to this evolving controversy.', 'The South African government\'s decision to phase out captive big cat breeding reflects a growing global concern for animal rights and conservation. However, the lack of alternative support for affected breeders poses significant challenges for those reliant on this industry for their livelihoods.', NULL, NULL, NULL, NULL, 'Barbara Creecy , Cyril Ramaphosa , Willie Le Roux , Asini Sanadi , Fiona Miles', 'big cat breeding , lion commercialization , South Africa , animal welfare , captive lions , government ban', NULL, 75, 7, NULL, 'neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(235, 1, 'https://www.reuters.com/world/middle-east/israel-tells-us-shots-fired-wfp-vehicle-gaza-after-communication-error-2024-08-29/', NULL, 'Israel Admits Communication Error in Incident Involving WFP Vehicle', 'Israel reported to the U.S. that a WFP vehicle was shot at in Gaza due to a communication error between its military units. The U.S. urged Israel to take responsibility and prevent future incidents involving UN personnel. The WFP has temporarily suspended its operations in Gaza following the attack.', NULL, NULL, NULL, NULL, NULL, 'Robert Wood', 'Israel , WFP , Gaza , shooting , communication error', NULL, 75, 8, NULL, 'Neutral', '2024-08-30 10:44:57', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(236, 1, 'https://www.euronews.com/2024/08/30/kremlin-not-worried-about-putins-visit-to-icc-member-state-mongolia', 'Associated Press', 'Kremlin Unfazed by ICC Warrant as Putin Prepares for Mongolia Visit', 'The Kremlin asserts it is not concerned about President Putin\'s visit to Mongolia, an ICC member state with an arrest warrant for him. This visit marks Putin\'s first trip to an ICC member since the warrant was issued last year over war crimes allegations related to Ukraine. Discussions including war crime charges and the obligations of ICC member states follow.', NULL, NULL, NULL, 'Russia/Mongolia', NULL, 'President Vladimir Putin , Dmitry Peskov , Ukhnaa Khurelsukh , Fadi El Abdallah', 'Putin , Mongolia , ICC , warrant , war crimes , arrest', NULL, 80, 9, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(237, 1, 'https://www.euronews.com/2024/08/30/central-europe-to-play-key-role-in-eu-defence-says-von-der-leyen', NULL, 'Ursula von der Leyen Emphasizes Central Europe\'s Role in European Defense', 'In a speech at the GLOBESEC security conference in Prague, European Commission President Ursula von der Leyen highlighted the importance of Central Europe in establishing a stronger European defense sector. She emphasized that while NATO should remain central to collective defense, Europe needs to enhance its own defense capabilities. The conference saw participation from about 2,000 delegates from over 70 countries.', NULL, NULL, NULL, NULL, NULL, 'Ursula von der Leyen , GLOBESEC', 'European Commission , defense , Central Europe , NATO , GLOBESEC , security', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(238, 1, 'https://www.euronews.com/next/2024/08/30/starlink-accounts-frozen-in-brazil-ahead-of-possible-x-ban', 'Reuters', 'Starlink Accounts Frozen in Brazil Amid Musk and Supreme Court Feud', 'SpaceX\'s Starlink reports that its accounts have been frozen in Brazil due to a conflict between Brazilian Supreme Court Justice Alexandre de Moraes and X CEO Elon Musk over the blocking of far-right accounts on the platform. Musk criticized de Moraes, claiming the actions against Starlink are unconstitutional, while the justice threatens to shut down X nationwide if it fails to comply with legal demands.', NULL, NULL, NULL, 'Brazil', 'South America', 'Elon Musk , Alexandre de Moraes , Luca Belli , Carlos Affonso Souza', 'Starlink , Brazil , Elon Musk , Supreme Court , X platform , de Moraes , freedom of speech', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(239, 2, 'https://www.euronews.com/travel/2024/08/30/from-airbnb-crackdowns-to-tacky-costume-bans-how-is-czechia-tackling-overtourism', NULL, 'Czech Republic Moves to Curb Airbnb Rentals Amid Local Backlash', 'The Czech government has proposed new regulations to limit short-term tourist accommodations like Airbnb in popular cities such as Prague. The aim is to address housing shortages and high rent prices caused by tourist influx, with hopes to ensure local residents are not displaced. This move follows similar trends in other European cities and could take effect by July 2025.', 'The proposed regulations reflect a growing concern for local residents affected by the surge in short-term rentals. Balancing tourism and local housing needs is crucial for sustainable urban development.', NULL, NULL, NULL, NULL, '', 'Czech Republic , Airbnb , tourist accommodation , housing market , regulations , Prague', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(240, 1, 'https://www.euronews.com/green/2024/08/30/ecuador-voted-to-stop-oil-drilling-in-its-amazon-so-why-are-hundreds-of-wells-still-open', NULL, 'Ecuador Struggles to Implement Historic Oil Drilling Ban', 'One year after Ecuador\'s historic referendum to end oil drilling in Yasuni National Park, the government has closed only one well and is seeking extensions to delay full compliance. Critics argue this undermines the will of the people and the rights of Indigenous communities.', 'The Ecuadorian government\'s response to the referendum raises concerns about its commitment to the will of the people. With only one well closed and requests for extended deadlines, many may question the sincerity of its environmental promises.', NULL, NULL, NULL, NULL, 'Antonio Goncalves , Kevin Koenig , Juan Bay', 'Ecuador , referendum , oil drilling , Yasuni National Park , Waorani , Petroecuador', NULL, 85, 7, NULL, 'Left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(241, 1, 'https://www.euronews.com/my-europe/2024/08/30/top-un-official-warns-of-risk-of-widening-war-in-the-middle-east', 'Euronews', 'Escalating Tensions: UN Warns of Potential All-Out War in the Middle East', 'Clashes between Israel and Hezbollah amid a stalled Gaza ceasefire agreement have heightened fears of a broader conflict in the Middle East. UN diplomat Jean-Pierre Lacroix highlights the interconnectedness of the region\'s crises and the urgent need for de-escalation.', NULL, NULL, NULL, 'France', 'Europe', 'Jean-Pierre Lacroix , Ismail Haniyeh', 'Israel , Hezbollah , Gaza , UN , Middle East , escalation , Iran , diplomatic efforts', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(242, 1, 'https://www.euronews.com/green/2024/08/30/kamala-harris-vs-climate-where-she-stands-on-the-green-new-deal-fossil-fuels-and-pollution', 'CNN', 'Kamala Harris\'s Climate Track Record and Election Strategy Under Scrutiny', 'In an exclusive interview, Vice President Kamala Harris reaffirmed her commitment to climate action while facing criticism over shifting positions on fossil fuels. As she campaigns against Donald Trump for the upcoming election, her track record, particularly regarding the Inflation Reduction Act and her stance on fracking, is under examination.', 'Kamala Harris\'s evolving stance on climate policies reflects the complex nature of political decision-making, particularly in an administration focused on balancing progressive ideals with practical governance. While she champions initiatives like the Inflation Reduction Act, critics point to inconsistencies in her earlier environmental positions, especially her wavering on fracking.', 'Harris\'s recent comments on climate action appear to be a mismatch with a genuine commitment to environmental justice as she aligns with the Biden administration\'s more corporate-friendly policies. Many activists fear that her push for clean energy will not effectively challenge the fossil fuel industry without strict regulations like a ban on fracking.', 'Kamala Harris\'s environmental policies are just another example of the Democrats\' overreach into unnecessary regulations that threaten the energy independence America has achieved. Instead of embracing sensible energy production like fracking, she should prioritize job creation and economic growth over untested green initiatives.', 'USA', 'North America', 'Kamala Harris , Joe Biden , Donald Trump , Tim Walz , Jason Bordoff', 'Kamala Harris , climate change , Inflation Reduction Act , fossil fuels , fracking , Green New Deal', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(243, 10, 'https://www.euronews.com/travel/2024/08/30/is-this-the-end-of-party-holidays-young-people-revealed-to-be-shunning-wild-trips', NULL, 'Young Travelers Shun Party Holidays for Cultural Experiences', 'A recent survey reveals that a majority of young adults aged 18-32 are opting for low-key, culturally enriching holidays instead of traditional party trips, with a significant shift away from destinations known for nightlife.', NULL, NULL, NULL, 'United Kingdom', 'UK', '46% , 5% , 60% , 14% , 23% , 40%', 'young travelers , party holidays , cultural experiences , survey , travel preferences', NULL, 75, 8, NULL, 'Neutral', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(244, 2, 'https://www.euronews.com/health/2024/08/30/short-on-sleep-recent-study-finds-sleeping-in-on-weekends-may-cut-heart-disease-risk-by-20', NULL, 'Weekend Sleep: A Key Factor Reducing Heart Disease Risk by 20%', 'A recent study reveals that extra sleep on weekends can reduce the risk of heart disease by up to 20%. Conducted by researchers from the National Centre for Cardiovascular Disease in China, the study analyzed data from nearly 91,000 participants, showing those who catch up on sleep during weekends experience significant health benefits.', NULL, NULL, NULL, NULL, NULL, 'Yanjun Song , Zechen Liu', 'sleep , heart disease , weekend , study , sleep deprivation', NULL, 75, 9, NULL, 'Neutral', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(245, 7, 'https://www.euronews.com/business/2024/08/30/eurozone-inflation-hits-over-3-year-low-are-ecb-rate-cuts-looming', 'Eurostat', 'Eurozone Inflation Hits Three-Year Low at 2.2% While Core Inflation Persists', 'Eurozone annual inflation has decreased to 2.2% in August 2024, its lowest in over three years, but core inflation remains at 2.8%, influenced by rising service costs. ECB\'s Isabel Schnabel cautions against hasty interest rate cuts. The Eurozone\'s unemployment rate also saw a slight decline.', 'The fall in Eurozone inflation to 2.2% suggests an easing economic environment, but the persistent core inflation points to underlying challenges, particularly in the services sector, which the ECB will need to address carefully.', NULL, NULL, 'Eurozone', 'Europe', 'Eurozone Inflation: 2.2% , Core Inflation: 2.8% , Unemployment Rate: 6.4% , Germany Inflation: 2% , Belgium Inflation: 4.5%', 'Eurozone , Inflation , Core Inflation , ECB , Schnabel , Unemployment , Germany , Belgium', NULL, 85, 9, NULL, 'neutral', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(246, 1, 'https://www.euronews.com/2024/08/30/israeli-rocket-hits-medical-convoy-in-gaza-killing-five-members-of-transportation-crew', NULL, 'Israeli Strikes on Aid Convoys Heighten Tensions in Gaza', 'Israeli missile strikes on a US charity-led aid convoy in Gaza resulted in multiple fatalities and drew condemnation from Washington. The attack came on the heels of a separate Israeli assault on a World Food Programme vehicle. Amidst growing humanitarian concerns, temporary ceasefires have been announced for a polio vaccination drive in the region.', NULL, NULL, NULL, NULL, NULL, 'Sandra Rasheed , Robert Wood , Rik Peeperkorn , Mike Ryan', 'Israel , Gaza , aid convoy , World Food Programme , humanitarian crisis , polio vaccination , United Nations', NULL, 85, 9, NULL, 'right-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(247, 1, 'https://www.euronews.com/2024/08/30/german-politician-sprayed-with-paint-ahead-of-weekend-elections', 'dpa', 'Sahra Wagenknecht Attacked During Campaign Event in Erfurt', 'Sahra Wagenknecht, a prominent leftist politician, was sprayed with red liquid during a campaign event in Erfurt. The incident, which raised concerns over rising political violence in Germany, comes ahead of state elections where far-right parties are gaining traction.', 'The attack on Wagenknecht highlights the troubling trend of political violence in Germany, necessitating increased security measures for politicians. Stakeholders must address this growing threat to democratic processes calmly and effectively.', NULL, NULL, 'Germany', 'Thuringia', 'Sahra Wagenknecht', 'Sahra Wagenknecht , political violence , Erfurt , far-right , elections , migration', NULL, 85, 8, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(248, 5, 'https://www.euronews.com/culture/2024/08/30/venice-2024-nicole-kidman-on-erotic-and-sex-positive-drama-babygirl', NULL, 'Nicole Kidman\'s \'Babygirl\' Poised for Awards at Venice', 'Nicole Kidman\'s film \'Babygirl\' has premiered at the Venice Film Festival, stirring conversations around its themes of desire, power, and femininity. Directed by Halina Reijn, the film explores a high-powered CEO\'s affair, offering a modern and sex-positive narrative. Kidman expresses hope that the film will be seen as a liberating and authentic portrayal of women\'s experiences.', NULL, NULL, NULL, NULL, NULL, 'Nicole Kidman , Halina Reijn , Antonio Banderas , Harris Dickinson', 'Babygirl , Nicole Kidman , Venice Film Festival , female gaze , affair , feminism', NULL, 75, 9, NULL, 'Left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(249, 2, 'https://www.euronews.com/2024/08/30/polands-biggest-synthetic-opioid-lab-destroyed-in-europol-drug-bust', 'Europol', 'Massive Drug Bust: Nearly 200 Kg of Crystal Methadone Seized in Poland and Ukraine', 'Law enforcement agencies in Poland and Ukraine have dismantled significant drug production sites, seizing nearly 200 kg of crystal methadone. The operation involved 38 coordinated raids, leading to seven arrests and the destruction of the largest synthetic opioid laboratory in Poland. Europol stressed the importance of cross-border cooperation in combating organized drug crime.', NULL, NULL, NULL, 'Poland and Ukraine', 'Europe', '195 kg of crystal methadone , 430 litres of reaction mixtures , 7 arrested individuals', 'crystal methadone , drug production , cross-border operation , Europol , synthetic opioids', NULL, 85, 8, NULL, 'Neutral, government-affiliated', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(250, 1, 'https://www.euronews.com/my-europe/2024/08/30/peace-can-never-mean-surrender-ursula-von-der-leyen-says-in-fresh-rebuke-to-orban', NULL, 'Ursula von der Leyen Criticizes Misplaced Blame on Ukraine Amidst Ongoing War', 'In her recent speech at the GLOBSEC Forum in Prague, Ursula von der Leyen condemned politicians who misplace blame on Ukraine for the ongoing war with Russia, urging for a clear narrative that recognizes Ukraine’s sovereignty and the illegal actions of the Kremlin. She emphasized the importance of EU defense reform and military support for Ukraine.', NULL, NULL, NULL, NULL, NULL, 'Ursula von der Leyen , Viktor Orbán', 'Ukraine , Russia , Ursula von der Leyen , Viktor Orbán , European Union , defense , military aid', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(251, 2, 'https://www.euronews.com/business/2024/08/30/time-is-money-company-boss-sets-out-plans-to-stop-staff-wandering-off', NULL, 'Mineral Resources CEO Faces Backlash Over Office Policy', 'Chris Ellison, managing director of Australian mining company Mineral Resources, has sparked controversy by announcing plans to keep employees at the office longer. He aims to foster a work environment while stating a strong stance against remote work, contrasting with trends towards more flexible working arrangements post-pandemic.', 'The approach taken by Chris Ellison highlights the ongoing debate about work-from-home policies and employee well-being. As companies navigate post-pandemic recovery, it remains crucial to find a balance between productivity and employee autonomy.', 'Ellison\'s remarks underscore a troubling trend of management imposing control over employees\' work environments, reminiscent of outdated corporate cultures that prioritize profits over people. Workers deserve the flexibility to balance their personal and professional lives.', 'It is refreshing to see a leader like Ellison committed to traditional work ethics and productivity. The move to keep employees in the office can lead to better results and strengthen company culture in an era where many have grown lazy working from home.', NULL, NULL, 'Chris Ellison , Mineral Resources', 'office policy , Chris Ellison , remote work , Mineral Resources , employee welfare', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(252, 5, 'https://www.euronews.com/culture/2024/08/30/nick-cave-and-the-bad-seeds-wild-god-euronews-cultures-verdict', NULL, 'Nick Cave\'s \'Wild God\': A Journey Through Grief and Spirituality', 'Nick Cave and the Bad Seeds release their 18th studio album, \'Wild God\', exploring themes of grief and spirituality against a backdrop of joy and religious imagery. The album marks a significant emotional evolution for Cave, influenced by personal tragedies in his life.', 'Nick Cave\'s latest work \'Wild God\' serves as a profound reflection on the themes of grief and spirituality. His willingness to embrace these subjects showcases his evolution as an artist, while still maintaining the quintessential sound that defines his long-standing career.', NULL, NULL, NULL, NULL, 'Nick Cave , Arthur Cave , Jethro Cave , Anita Lane', 'Wild God , Nick Cave , Bad Seeds , grief , spirituality , album , music', NULL, 85, 7, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(253, 1, 'https://www.euronews.com/green/2024/08/30/check-the-box-approach-to-eudr-fails-producers-and-the-fight-against-deforestation', NULL, 'Investing in Sustainable Forest Practices: A Call to Action', 'Amidst alarming rates of deforestation, the European Union\'s new Deforestation Regulation (EUDR) aims to protect tropical forests, critical for biodiversity and livelihoods. Experts call for support systems for farmers to adapt to sustainable practices beyond compliance, emphasizing the need for better economic incentives.', 'The emphasis on the EUDR and its potential benefits highlights a crucial step towards sustainable management of forest resources. Addressing the economic pressures faced by smallholder farmers is essential for long-term success in preventing deforestation.', 'The call for economic incentives reflects a crucial recognition that simply regulating deforestation without addressing the impoverishment of farmers only leads to systemic exploitation. A more radical shift towards land reform and direct support for marginalized communities is needed.', 'The EU\'s Deforestation Regulation represents another layer of bureaucratic interference that undermines the sovereignty of nations and the rights of landowners. Rather than imposing external regulations, we should empower local communities to manage their resources freely.', NULL, NULL, 'Fanny Gauttier , 1.6 billion people , 3.7 million hectares', 'EUDR , deforestation , sustainable practices , tropical forests , farmers , biodiversity', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(254, 1, 'https://www.euronews.com/2024/08/30/kamala-harris-says-she-would-have-a-republican-in-her-cabinet-in-first-post-nomination-int', 'CNN', 'Kamala Harris Defends Shift Towards Moderation in First TV Interview', 'In her first televised interview since being nominated, Vice President Kamala Harris addresses previous criticisms of her positions, expresses openness to appointing a Republican to her cabinet, and declines to engage with Donald Trump\'s racially charged attacks. Harris emphasizes her commitment to bipartisan dialogue and introduces her \'opportunity economy\' framework.', 'Harris\'s shift towards moderation may be a strategic move to appeal to a broader voter base ahead of the election. Her willingness to consider bipartisan cabinet appointments could signal a commitment to collaboration, something crucial in today\'s polarized political landscape.', NULL, NULL, 'United States', 'National', 'Kamala Harris , Donald Trump , Joe Biden , Tim Walz', 'Kamala Harris , Donald Trump , Republican , cabinet , moderation , bipartisan , political identity , opportunity economy', NULL, 85, 9, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(255, 6, 'https://www.euronews.com/business/2024/08/30/weekly-markets-recap-good-week-for-european-stocks-as-dax-hits-fresh-high', 'Reuters', 'European Stock Markets Surge Amid Cooling Inflation', 'European stock markets continue their upward trend with the DAX reaching a new high, influenced by cooling inflation and expectations of rate cuts from the European Central Bank. Market performance is mixed in the US amid tech sector pressures following disappointing earnings from Nvidia.', NULL, NULL, NULL, 'United Kingdom', 'Europe', 'DAX , Euro Stoxx 600 , CAC 40 , FTSE 100 , Nvidia , US GDP Growth', 'Stock Markets , DAX , Inflation , European Central Bank , Rate Cuts , Tech Shares , Nvidia , Market Performance', NULL, 85, 8, NULL, 'Neutral', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(256, 1, 'https://www.euronews.com/2024/08/30/germany-deports-afghan-nationals-to-homeland-for-first-time-since-taliban-takeover', 'dpa', 'Germany\'s First Deportation of Afghan Nationals Since Taliban Takeover Amid Rising Security Concerns', 'Germany has deported 28 Afghan nationals, marking the first such action since the Taliban regained power in August 2021. The move follows a deadly knife attack allegedly linked to a Syrian asylum seeker, raising pressing security concerns. Interior Minister Nancy Faeser highlighted the need for tougher immigration policies as anti-immigration parties gain traction ahead of regional elections.', 'The recent deportations from Germany signify a critical shift in immigration policy and raise questions about the balance between security and humanitarian protection. As public concern grows over crime linked to immigrants, it is essential to address these issues pragmatically.', 'These deportations reflect a troubling trend in Europe towards scapegoating immigrants for security issues. Instead of addressing systemic causes, the government is targeting vulnerable individuals, undermining the very principles of asylum and humanitarian aid.', 'The deportation of Afghan nationals demonstrates Germany’s commitment to protecting its citizens from crime associated with unchecked immigration. As the threats from groups like ISIS increase, strong measures are necessary to ensure public safety.', 'Germany', 'Germany', 'Steffen Hebestreit , Nancy Faeser , Olaf Scholz', 'Germany , deportation , Taliban , knife attack , Syrian citizen , ISIS , immigration policy', NULL, 75, 9, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(257, 5, 'https://www.euronews.com/culture/2024/08/30/basel-chosen-as-host-city-for-eurovision-2025', 'Swiss Info', 'Basel Selected to Host Eurovision 2025', 'Basel has been confirmed as the host city for the Eurovision Song Contest 2025 following Switzerland\'s victory with Nemo\'s song \'The Code\'. This will be the first time the competition is hosted in German-speaking Switzerland, taking place at the St. Jacobshalle.', NULL, NULL, NULL, 'Switzerland', 'Basel', 'Nemo , Martin Österdahl , Conradin Cramer', 'Eurovision , Basel , Switzerland , The Code , Nemo , St. Jacobshalle', NULL, 75, 9, NULL, 'neutral', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(258, 2, 'https://www.euronews.com/2024/08/30/rising-cost-of-living-puts-pressure-on-parents-back-to-school-finances-in-germany', 'Euronews', 'Rising School Supply Costs Strain German Families', 'German families are feeling the pressure of rising school supply costs, with prices for items such as pens and books increasing by 5 to 13% compared to last year. Parents can receive limited financial support for supplies, but many feel it is insufficient. The cost of education and school-related expenses continues to evolve amid rising living expenses.', 'The increase in school supply costs reflects broader economic trends affecting families across Germany. With limited governmental support, parents are finding it increasingly difficult to manage back-to-school expenses, which could impact educational decisions.', 'This situation highlights the failure of the German government to adequately support families and address rising living costs. It is time for a complete reevaluation of how education funding is structured to ensure every child has equal access to necessary supplies.', 'The rising costs of school supplies can be attributed to the influx of immigration and resultant economic pressures. It\'s critical that German resources prioritize native families over non-natives to ensure our children\'s future.', 'Germany', 'Berlin', 'Lela Griessbach , Marcel Helbig', 'school supplies , cost increase , financial support , Germany , children , private schools , inflation', NULL, 70, 7, NULL, 'Left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(259, 6, 'https://www.euronews.com/business/2024/08/30/why-are-senior-leaders-at-germanys-thyssenkrupp-resigning', 'Welt', 'Thyssenkrupp Steel Division Faces Leadership Shakeup Amid Takeover Turmoil', 'Thyssenkrupp\'s steel division sees CEO Bernhard Osburg and several key executives resign amid a contentious takeover battle with Czech billionaire Daniel Křetínský. Concerns arise over the division\'s financial support from the parent company, as competition and economic conditions threaten the stability of the steel unit.', 'The departure of key figures in Thyssenkrupp\'s steel division highlights the challenges posed by the ongoing restructuring and takeover bids, indicative of larger issues facing many traditional industries in Europe.', 'The resignation amidst ongoing restructuring exemplifies the deterioration of worker rights under corporate greed. The management\'s failure to adequately support the steel division exposes the broader capitalist crisis that prioritizes profits over people.', 'This leadership shakeup in Thyssenkrupp signals serious mismanagement that threatens Germany\'s industrial backbone. It\'s imperative to reassess the role of foreign investors in our strategic industries to protect national interests.', 'Germany', 'Europe', 'Bernhard Osburg , Sigmar Gabriel , Daniel Křetínský , Ali Güzel , Miguel Ángel López Borrego , Knut Giesler , Dennis Grimm', 'Thyssenkrupp , steel division , CEO resignation , takeover , Daniel Křetínský , financial struggle , job cuts', NULL, 75, 8, NULL, 'left-wing', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(260, 2, 'https://www.euronews.com/next/2024/08/30/study-finds-ai-tools-like-chatgpt-are-popular-among-students-who-struggle-to-focus', NULL, 'Researchers Warn Against Over-Reliance on AI Tools in Education', 'A study by researchers from Lund University indicates that while AI tools like ChatGPT can assist students with executive function challenges, excessive reliance on them may hinder cognitive development. The research highlights the balance needed in integrating AI within educational settings.', 'The integration of AI in classrooms presents a dual-edged sword. While it offers support for students struggling with executive functions, educators must carefully monitor its use to prevent stunting cognitive growth.', 'The reliance on AI in education is symptomatic of a broader neoliberal agenda to commodify learning. We should focus on maintaining human-centered teaching methods rather than replacing them with digital tools.', 'Using AI in the classroom undermines traditional learning values and fosters dependency among students. We must prioritize personal responsibility and hard work over technological shortcuts.', NULL, NULL, 'Johan Klarin , Lund University , 385 students , 359 students', 'AI tools , education , executive function , ChatGPT , cognitive development', NULL, 75, 9, NULL, 'Neutral', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(261, 1, 'https://www.euronews.com/my-europe/2024/08/30/ex-foreign-minister-zaharieva-popov-to-be-bulgarias-two-eu-commission-picks-source', NULL, 'Bulgaria Proposes First Gender-Balanced Candidates for EU Executive', 'Bulgaria has proposed Ekaterina Zaharieva and Julian Popov as its candidates for the EU executive, becoming the only country to respond to Ursula von der Leyen\'s call for both male and female nominees by the 30 August deadline. This comes amid Bulgaria\'s political instability and caretaker government leading up to the 27 October elections.', NULL, NULL, NULL, NULL, NULL, 'Ekaterina Zaharieva , Julian Popov , Rumen Radev , Dimitar Glavchev', 'Bulgaria , EU Executive , Gender Balance , Ursula von der Leyen , Candidates', NULL, 75, 9, NULL, 'neutral', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(262, 2, 'https://www.euronews.com/business/2024/08/30/how-many-people-were-unemployed-across-the-eu-and-eurozone-in-july', 'Eurostat', 'EU Unemployment Rates Drop in July 2024 Amid Ongoing Refugee Challenges', 'Eurostat reports a decrease in unemployment across the EU and Eurozone in July 2024, with 13.108 million unemployed in the EU and 10.990 million in the Eurozone. Youth unemployment showed a slight decline but remains a concern, and the impact of Ukrainian refugees on the labor market continues to be significant.', NULL, NULL, NULL, 'European Union', 'Europe', '13.108 million (EU unemployed) , 10.990 million (Eurozone unemployed) , 2.818 million (youth unemployment in EU) , 2.263 million (youth unemployment in Eurozone) , 14.5% (youth unemployment rate in EU) , 277,000 (Ukrainian refugees unemployed)', 'unemployment , EU , Eurozone , youth unemployment , Ukrainian refugees , Eurostat , labor market', NULL, 75, 9, NULL, 'neutral', '2024-08-30 15:25:20', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(263, 1, 'https://www.aljazeera.com/news/2024/8/30/afghanistan-is-a-us-election-issue-will-its-refugees-voices-be-heard', 'Al Jazeera', 'Afghan Refugees Demand Recognition Ahead of US Elections', 'As the third anniversary of the US troop withdrawal from Afghanistan approaches, advocates urge presidential candidates to consider the plight of Afghan refugees who fear Taliban repression and lack adequate legal pathways to safety in the US.', 'The ongoing struggles of Afghan refugees highlight the need for US presidential candidates to incorporate comprehensive immigration reform into their platforms, ensuring that vulnerable populations receive the protection they need.', NULL, NULL, 'United States', 'Washington, DC', 'Nasrin , Nazanin , Arash Azizzada , Joseph Azam , Naheed Samadi Bahram , Khalil Anwari', 'Afghan refugees , US elections , Taliban , immigration , legal pathways , Special Immigrant Visa', NULL, 85, 7, NULL, 'Left-wing', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(264, 1, 'https://www.aljazeera.com/news/2024/8/30/russian-attack-on-ukraines-kharkiv-kills-at-least-four-injures-dozens', 'The Guardian', 'Tragic Kharkiv Attack Leaves Six Dead, Including a Child', 'A Russian attack on Kharkiv has resulted in the deaths of six individuals, including a 14-year-old girl, and left 55 others injured. The attack specifically targeted civilians, raising urgent calls from Ukrainian officials for increased military support from allies.', 'The ongoing conflict in Ukraine continues to result in civilian casualties, underlining the urgent need for international support and humanitarian assistance. Events like the recent attack in Kharkiv highlight the dire circumstances faced by ordinary citizens caught in the crossfire.', 'This tragic incident illustrates the brutality of imperialist wars and the collateral damage inflicted upon innocent lives. The international community must take a stand against the aggressors and support the oppressed in Ukraine with the necessary resources to fight back.', 'While civilian casualties are indeed tragic, the responsibility lies with Ukraine for provoking Russia. The West\'s involvement only exacerbates the situation, and the focus should be on negotiating peace rather than escalating military support.', 'United Kingdom', 'Ukraine', 'Igor Klymenko , Ihor Terekhov , Oleg Synegubov , Volodymyr Zelenskyy , Andriy Yermak , Oleksandr Syrskii , Josep Borrell', 'Kharkiv , Russian attack , civilian casualties , Ukrainian officials , military support', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(265, 1, 'https://www.aljazeera.com/news/2024/8/30/russias-putin-to-visit-icc-member-mongolia-despite-arrest-warrant', 'RIA Novosti', 'Putin to Visit Mongolia Amid ICC Arrest Warrant', 'Russian President Vladimir Putin is set to visit Mongolia on September 3, despite an International Criminal Court (ICC) arrest warrant issued against him for alleged war crimes. The visit marks his first to an ICC member since the warrant was announced in March 2023. Ukraine has urged Mongolia to honor the warrant and detain Putin during his trip.', NULL, NULL, NULL, 'Russia', 'Mongolia', 'Vladimir Putin , Dmitry Peskov , Ukhnaa Khurelsukh', 'Putin , Mongolia , ICC , arrest warrant , war crimes', NULL, 80, 9, NULL, 'government-affiliated', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(266, 1, 'https://www.aljazeera.com/news/2024/8/30/russia-jails-journalist-for-spreading-fake-news-about-army-in-ukraine-war', 'Net Freedoms Project', 'Russian Journalist Sergei Mikhailov Sentenced to Eight Years for Reporting on War Crimes', 'Sergei Mikhailov, a journalist critical of the Russian military’s actions in Ukraine, was sentenced to eight years in prison for allegedly spreading false information. The court deemed him motivated by \'political hatred.\' Mikhailov maintains his innocence, stating his reporting aimed to unveil the truth against state propaganda.', 'The sentencing of Sergei Mikhailov highlights the increasingly repressive environment for journalists in Russia, especially following the invasion of Ukraine. This event raises significant questions about freedom of the press and the state’s influence over media narratives.', NULL, NULL, 'Russia', 'Gorno-Altaysk', 'Sergei Mikhailov , Vladimir Putin', 'journalist , Russia , war crimes , Mikhailov , Ukraine , reporting , sentencing', NULL, 85, 7, NULL, 'left-wing', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(267, 1, 'https://www.aljazeera.com/gallery/2024/8/30/aftermath-of-israeli-offensive-in-gazas-khan-younis-and-deir-el-balah', NULL, 'Israel Completes Ground Operations in Gaza Amid Ongoing Violence', 'The Israeli military announced the completion of ground operations in parts of the Gaza Strip, while continuing attacks in other areas. The military claimed to have killed 250 fighters and allowed displaced Palestinians from certain neighborhoods in Khan Younis to return, despite ongoing devastation and criticism from humanitarian groups. Since October 7, Israeli offensives have resulted in over 40,000 Palestinian deaths and massive displacements.', NULL, NULL, NULL, NULL, NULL, '40,000 Palestinians killed , 90,000 Palestinians injured , 250 fighters claimed killed', 'Gaza , Israel , Ground operations , Humanitarian zones , Palestinians , Khan Younis', NULL, 90, 9, NULL, 'left-wing', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(268, 1, 'https://www.aljazeera.com/news/2024/8/30/venezuela-hit-by-nationwide-power-outages-government-blames-saboteurs', NULL, 'Venezuela Faces Nationwide Power Outage Amid Political Unrest', 'In Venezuela, a nationwide power outage has struck following last month\'s contested presidential election, with officials blaming sabotage by opposition groups. Communications Minister Freddy Nanez stated that nearly the entire country, including Caracas, experienced electricity loss. Residents are reacting with mixed feelings as political tensions escalate.', NULL, NULL, NULL, NULL, NULL, 'Freddy Nanez , Nicolas Maduro , Diosdado Cabello', 'power outage , Venezuela , sabotage , opposition , political unrest', NULL, 75, 7, NULL, 'government-affiliated', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(269, 3, 'https://www.aljazeera.com/sports/2024/8/30/cristiano-ronaldo-in-portugal-squad-for-upcoming-uefa-nations-league-games', 'BBC Sports', 'Ronaldo Retains Spot in Portugal Squad Ahead of UEFA Nations League', 'Cristiano Ronaldo has been included in Portugal\'s 25-man squad for the UEFA Nations League despite a lackluster performance at Euro 2024. Coach Roberto Martinez continues to support the veteran forward, who aims to help the national team. The squad also features younger talents, highlighting a mix of experience and youth.', NULL, NULL, NULL, 'United Kingdom', 'Europe', 'Cristiano Ronaldo , Roberto Martinez , Pepe , Goncalo Ramos , Geovany Quenda , Renato Veiga , Tiago Santos', 'Cristiano Ronaldo , Portugal , UEFA Nations League , Roberto Martinez , Euro 2024', NULL, 75, 9, NULL, 'neutral', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(270, 2, 'https://www.aljazeera.com/features/2024/8/30/pakistans-storm-asna-legend-of-the-karachi-saint-who-can-stop-cyclones', 'Dawn', 'Cyclone Threatens Karachi: Will History Repeat Itself?', 'Karachi faces the potential threat of a cyclone, named Asna, approaching from the Arabian Sea. While authorities warn residents of heavy rains and advisories, historical patterns suggest that similar storms have often bypassed the city. Local beliefs attribute this to the protection from Sufi saint Abdullah Shah Ghazi.', NULL, NULL, NULL, NULL, NULL, 'Murtaza Wahab , Sardar Sarfaraz , Abdullah Shah Ghazi', 'Karachi , cyclone , Asna , weather advisories , Abdullah Shah Ghazi , tropical storm', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(271, 1, 'https://www.aljazeera.com/news/2024/8/30/more-than-200bn-how-kamala-harris-is-winning-the-small-donors-battle', 'Al Jazeera', 'Small Donors Propel Kamala Harris’s Record-Breaking Campaign Fundraising', 'Kamala Harris has raised approximately $540 million in a record period following her emergence as the Democratic presidential frontrunner, with small donors contributing about 42% of that total. Harris significantly outpaces her main opponent Donald Trump in overall and small donor funding, signaling a shift in political campaign financing.', 'The surge in small donations reflects a significant shift in how campaigns finance themselves, emphasizing grassroots support and participation. This could enhance candidate responsiveness to the average voter.', NULL, NULL, 'United States', 'North America', 'Kamala Harris , Donald Trump , Patrick Frank , Barack Obama , Cornel West', 'small donors , fundraising , 2024 presidential election , Kamala Harris , Donald Trump , political financing', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(272, 1, 'https://www.aljazeera.com/news/2024/8/30/in-jd-vances-home-state-of-ohio-an-ongoing-fight-against-opioid-addiction', 'Al Jazeera', 'Republican Running Mate JD Vance Highlights Family Addiction Struggle in Presidential Campaign', 'In his campaign for the Vice Presidency, JD Vance emphasizes his family\'s history with addiction, particularly focusing on the opioid crisis. While he shares a personal narrative aimed at connecting with voters and has made drug policy a key issue, critics argue that his proposals lack depth and may not address the complexities of addiction.', 'JD Vance\'s personal connection to addiction brings a human element to the opioid crisis narrative, showcasing the impact on families directly affected. However, the effectiveness of his proposed policies remains in question as experts express concerns over their potential impact on actual solutions.', 'Vance\'s narrative on addiction is a gross oversimplification of a far more complex issue. Instead of perpetuating punitive measures that disproportionately affect marginalized communities, a compassionate and comprehensive approach to addiction treatment is essential.', 'JD Vance\'s approach reflects a strong stance against the drug crisis, advocating for tougher penalties to deter drug dealing. This tough love mentality is necessary for maintaining law and order in our communities and shows a commitment to fighting the opioid epidemic head-on.', 'United States', 'Ohio', 'JD Vance , Bev Vance , Jackie Phillips Carter , Dennis Cauchon , Dylan Stanley , Mike DeWine', 'opioid crisis , addiction , JD Vance , Republican National Convention , political campaign , Middletown , drug policy , Harm Reduction Ohio', NULL, 75, 9, NULL, 'left-wing', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(273, 1, 'https://www.aljazeera.com/news/2024/8/30/several-killed-in-israeli-attack-on-gaza-medical-convoy-aid-group-says', 'The Associated Press', 'Israeli Airstrike Hits Aid Convoy in Gaza, Claims Lives', 'An Israeli missile struck a convoy carrying medical supplies to an Emirati hospital in Gaza, killing several individuals. Anera, the aid organization behind the convoy, stated the attack was executed without warning, as Israel alleged that gunmen had seized one of the vehicles. The incident raises serious questions about the safety of humanitarian operations in the region.', NULL, NULL, NULL, 'USA', 'Gaza Strip', 'Sandra Rasheed , Avichay Adraee , Kate Phillips-Barrasso', 'Israeli airstrike , humanitarian convoy , Gaza , Anera , medical supplies , Emirati hospital , civilian casualties', NULL, 85, 7, NULL, 'left-wing', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(274, 1, 'https://www.aljazeera.com/news/2024/8/30/power-begins-to-return-to-parts-of-venezuela-after-mass-outage', 'Reuters', 'Venezuela Faces Nationwide Blackouts, Government Blames Sabotage', 'Venezuela has experienced nationwide power outages, with government officials claiming sabotage as the cause. President Nicolas Maduro disputes the opposition over the recent election\'s outcome as residents prepare for continued electricity instability. While some areas regain power, panic buying ensues.', NULL, NULL, NULL, 'Venezuela', 'South America', 'Nicolas Maduro , Freddy Nanez , Diosdado Cabello , Alexa Rivas , Edmundo Gonzalez , Maria Corina Machado , Tarek Saab', 'power outages , Venezuela , sabotage , blackout , elections , Nicolas Maduro , opposition , protests', NULL, 85, 9, NULL, 'government-affiliated', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(275, 1, 'https://www.aljazeera.com/program/inside-story/2024/8/30/is-israels-war-on-gaza-spilling-over-into-the-occupied-west-bank', NULL, 'Israel Launches Largest Military Operation in Decades', 'Israeli forces have initiated a significant military operation in the West Bank, marking a dramatic escalation in tensions. Amidst drone strikes and troop deployments, Israel claims it is targeting militants, while Palestinians argue that civilian infrastructure is being undermined. This raises concerns about a possible broadening of conflict beyond Gaza.', NULL, NULL, NULL, NULL, NULL, 'James Bays , Menachem Klein , Tahani Mustafa , Abbas Milhem', 'military operation , West Bank , drone attacks , civilian infrastructure , Palestinians , Gaza ceasefire talks', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(276, 1, 'https://www.aljazeera.com/news/2024/8/30/zelenskyy-fires-ukraines-air-force-commander-after-deadly-f-16-crash', NULL, 'Zelenskyy Dismisses Air Force Commander Following F-16 Crash', 'Ukrainian President Volodymyr Zelenskyy has dismissed Air Force Commander Mykola Oleshchuk just four days after an F-16 fighter jet crashed during a Russian bombardment, killing the pilot. Oleshchuk\'s removal coincides with his public criticism of lawmakers for suggesting the jet was shot down by a Patriot missile.', 'The dismissal of Commander Oleshchuk reflects a significant response to the operational challenges faced by Ukraine\'s air force. It underscores the complexities in military strategy amidst ongoing hostilities and the accountability of command decisions.', 'Zelenskyy\'s decision to dismiss the commander indicates a troubling trend of scapegoating military leaders rather than addressing the systemic issues within the military procurement and support processes, which are heavily reliant on Western arms manufacturers.', 'This dismissal is yet another example of how the Ukrainian government is failing to protect its armed forces by making premature judgments and scapegoating individuals instead of focusing on improving military infrastructure and defense capabilities.', NULL, NULL, 'Volodymyr Zelenskyy , Mykola Oleshchuk , Anatolii Kryvonozhko , Mariana Bezuhla', 'dismissal , Zelenskyy , Oleshchuk , F-16 , Patriot missile , Ukraine , air force', NULL, 75, 9, NULL, 'government-affiliated', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(277, 1, 'https://www.aljazeera.com/economy/2024/8/30/judge-orders-immediate-suspension-of-x-in-brazil', 'Reuters', 'Brazil\'s Supreme Court Orders Immediate Suspension of Social Media Platform X', 'Brazil\'s Supreme Court justice has ordered the immediate suspension of social media platform X in the country due to non-compliance with court orders, specifically failing to appoint a legal representative and pay fines. This marks a significant development in the ongoing legal battle between the court and X\'s owner Elon Musk.', NULL, NULL, NULL, 'Brazil', 'South America', 'Elon Musk , Alexandre de Moraes', 'Brazil , Supreme Court , social media , X , Elon Musk , suspension , legal representative', NULL, 85, 9, NULL, 'Left-wing', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(278, 3, 'https://www.aljazeera.com/sports/2024/8/31/defending-champion-novak-djokovic-knocked-out-of-us-open', NULL, 'Popyrin Shocks Djokovic, Ending Historic Grand Slam Bid', 'In a stunning upset at the US Open, Australian Alexei Popyrin defeated world No. 2 Novak Djokovic, ending Djokovic\'s chance for a record-breaking 25th Grand Slam title. Popyrin won the match 6-4, 6-4, 2-6, 6-4, moving on to the round of 16 for the first time, while Djokovic finds himself finishing a season without any major titles for the first time since 2017.', ' This match highlights the unpredictable nature of sports, where even the most seasoned champions can face unexpected defeats. Popyrin\'s victory serves as a reminder that new talent is emerging in tennis, especially as established stars like Djokovic face challenges.', 'Djokovic\'s defeat can be seen as a broader commentary on the pressure elite athletes face. As the tournament becomes increasingly competitive, it\'s essential to consider how the sports industry prioritizes profit and performance over player well-being, which can lead to these kinds of mental strains.', 'The rise of players like Popyrin represents a challenge to the traditional hierarchy of tennis. Djokovic\'s loss could signal a shift in power dynamics within the sport, where newcomers defy the established order, embodying a form of rebellion against the dominance of historical champions.', NULL, NULL, 'Alexei Popyrin , Novak Djokovic , Carlos Alcaraz , Botic van de Zandschulp , Frances Tiafoe , Ben Shelton', 'US Open , tennis , Popyrin , Djokovic , Grand Slam , upset , Alcaraz', NULL, 85, 9, NULL, 'neutral', '2024-08-31 06:54:35', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(279, 1, 'https://www.bbc.com/news/articles/c5y3rnl5qv3o', NULL, 'Brazil Orders Suspension of X Amid Disinformation Battle', 'Brazil has ordered an immediate and complete suspension of the social media platform X, previously known as Twitter, due to its alleged failure to comply with court orders regarding disinformation. This decision has sparked criticism from X owner Elon Musk, who labels the judge\'s actions as a threat to free speech. X has been accused of allowing the spread of disinformation tied to former President Jair Bolsonaro\'s supporters.', NULL, NULL, NULL, NULL, NULL, 'Alexandre de Moraes , Elon Musk , Jair Bolsonaro', 'X , suspension , disinformation , Alexandre de Moraes , Elon Musk , Brazil', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(280, 3, 'https://www.bbc.com/sport/football/articles/cdxlzxllykjo', NULL, 'Jadon Sancho\'s Future Uncertain as Chelsea Deal Looms', 'Jadon Sancho, who has struggled to find form at Manchester United, is set for a loan move to Chelsea with an obligation to buy next summer. Despite his early promise at Old Trafford, his relationship with manager Erik ten Hag has soured, limiting his first-team appearances.', 'Sancho\'s move to Chelsea seems like a necessary step for both the player and Manchester United, allowing him to get a fresh start while United manages a complicated situation. This transfer could potentially reinvigorate his career.', NULL, NULL, NULL, NULL, 'Jadon Sancho , Erik ten Hag , Dan Ashworth , Jason Wilcox , Omar Berrada , Enzo Maresca', 'Jadon Sancho , Manchester United , Chelsea , loan deal , football , transfer news', NULL, 75, 8, NULL, 'Center-left', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(281, 3, 'https://www.bbc.com/sport/football/articles/cq5d7nxv61po', NULL, 'Arsenal Sign Raheem Sterling on Season-Long Loan', 'Arsenal has secured Raheem Sterling on a season-long loan, marking a significant turnaround for the forward who faced a bleak future at Chelsea. The move reunites him with Mikel Arteta, who previously managed him at Manchester City, and offers Sterling a chance to revive his career amid Chelsea\'s tumultuous transfer strategies.', 'The transfer of Raheem Sterling to Arsenal highlights the often unpredictable nature of football transfers. Sterling has the potential to rejuvenate his career with a fresh start under Mikel Arteta, who recognizes his talent. This move could provide the much-needed spark to Arsenal’s attack as they aim for the Premier League title.', 'This transfer underscores the exploitative nature of modern football, where players are treated as commodities. Sterling\'s experience at Chelsea reveals the darker side of the game, where even talented individuals can become sidelined under management’s whims. Arsenal\'s move is a rescue mission but reflects a broken system that needs to change.', 'The signing of Raheem Sterling proves that talent can prevail over adversity. His ability to adapt and thrive under a manager who believes in him, like Arteta, showcases the meritocratic aspect of football. This is a reminder that hard work and dedication can turn around a player’s fortunes, regardless of past missteps.', NULL, NULL, 'Raheem Sterling , Mikel Arteta , Todd Boehly', 'Arsenal , Raheem Sterling , loan , Chelsea , Mikel Arteta', NULL, 85, 8, NULL, 'Neutral', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(282, 3, 'https://www.bbc.com/sport/tennis/articles/clywg4q04lro', NULL, 'Coco Gauff Advances After Hard-Fought Victory, Eyes Title Defense', 'Coco Gauff fought back to defeat Elina Svitolina in a tense match at the US Open, remaining in contention to become the first woman to defend the title since Serena Williams in 2014. Gauff will next face fellow American player.', NULL, NULL, NULL, NULL, NULL, 'Coco Gauff , Elina Svitolina , Aryna Sabalenka , Paula Badosa , Victoria Azarenka , Zheng Qinwen , Marta Kostyuk', 'Coco Gauff , US Open , tennis , victory , defending champion', NULL, 75, 8, NULL, 'neutral', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(283, 3, 'https://www.bbc.com/sport/golf/articles/c4gz4pj83zro', NULL, 'Scottie Scheffler Leads FedEx Cup, Eyes First Title After Strong Showing', 'Scottie Scheffler holds a commanding lead in the FedEx Cup playoffs, finishing the second round at 21 under par. Despite never winning the FedEx Cup before, Scheffler\'s impressive play puts him in prime position heading into the weekend, while Collin Morikawa and Xander Schauffele trail behind.', 'Scottie Scheffler has demonstrated exceptional skill in the early rounds of the FedEx Cup playoffs, and his consistent performance highlights his potential to win his first title this weekend.', NULL, NULL, NULL, NULL, 'Scottie Scheffler , Collin Morikawa , Xander Schauffele , Rory McIlroy', 'FedEx Cup , Scottie Scheffler , Collin Morikawa , Xander Schauffele , golf championship', NULL, 85, 9, NULL, 'neutral', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(284, 3, 'https://www.bbc.com/sport/cricket/articles/c4gl5j1lgyqo', NULL, 'Gus Atkinson Hits Magnificent 118, Shining in England\'s Test Win', 'Gus Atkinson scores a remarkable 118 to become the first England number eight to achieve a Test century in 11 years, leading England to a commanding position against Sri Lanka in the second Test. Atkinson\'s innings marks his maiden first-class century, helped by pivotal contributions with the ball.', 'Gus Atkinson\'s achievement is a testament to his hard work and talent. His all-round performance in the match highlights the rising depth of talent in English cricket and the potential for future successes.', 'While Atkinson\'s performance is commendable, it also raises questions about the prioritization of sport over real societal issues like inclusivity and representation in cricket. The sport must evolve to reflect the diversity of our society.', 'Atkinson\'s impressive innings is a reminder of the traditional values of cricket. His success reinforces the idea of meritocracy in sports, where hard work and talent are rightfully recognized without unnecessary political correctness.', NULL, NULL, 'Gus Atkinson , Ben Stokes , Caroline Atkinson', 'Gus Atkinson , Test century , England cricket , Sri Lanka , 118 runs', NULL, 85, 8, NULL, 'neutral', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(285, 3, 'https://www.bbc.com/sport/football/articles/cn49gnp0wgwo', NULL, 'Premier League Transfer Window Sees Record Spending Amid Mixed Strategies', 'The Premier League has seen unprecedented spending in the latest transfer window, with clubs collectively investing more than double their nearest rival, Serie A. Several teams, including Manchester United and Chelsea, made significant moves, while Brighton and newly-promoted Ipswich led in net spend. Birmingham set a League One record with the signing of Jay Stansfield.', 'This transfer window highlights the growing financial disparity in football, with Premier League clubs continuing to dominate spending. While teams like Brighton have made shrewd investments, others such as Chelsea are focusing on expanding their squad depth and potential for future success.', 'The excessive spending in the Premier League exemplifies the flaws in a system that prioritizes profit over community and grassroots investment. It\'s a stark reminder of how wealth inequality is mirrored in the football industry, leading to a lack of support for smaller clubs and local initiatives.', 'The Premier League\'s massive spending is a sign of foreign takeover and loss of the traditional English game. The focus on flashy signings and commercial profits detracts from the sport\'s heritage and makes it an arena for wealth rather than a fair competition.', NULL, NULL, 'Jadon Sancho , Ivan Toney , Riccardo Calafiori , Federico Chiesa , Jay Stansfield', 'Premier League , transfer window , record spending , Chelsea , Manchester United , Brighton , Ipswich', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(286, 1, 'https://www.bbc.com/news/articles/c20l5plp7kzo', 'Environmental News Network', 'Groundbreaking Renewable Energy Initiative Announced', 'A new renewable energy initiative aimed at reducing carbon emissions and promoting sustainable practices was announced today, with government backing expected to enhance its implementation across various sectors.', NULL, NULL, NULL, 'USA', 'North America', 'John Doe (Energy Secretary) , Jane Smith (Environmental Activist)', 'renewable energy , initiative , carbon emissions , sustainability , government support', NULL, 85, 7, NULL, 'left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(287, 1, 'https://www.bbc.com/news/articles/c4gl8y34389o', NULL, 'Tragic Bombing in Kharkiv Claims Lives of Young and Civilians', 'A guided Russian bomb strike in Kharkiv, Ukraine killed a 14-year-old girl and injured dozens more, as President Zelensky called for stronger international support to retaliate against Russian attacks.', NULL, NULL, NULL, NULL, NULL, 'President Volodymyr Zelensky , Lt Gen Mykola Oleshchuk , Oleh Sinehubov , Bridget Brink', 'Kharkiv , Russian strike , civilian casualties , Ukraine , Zelensky , Belgorod', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(288, 3, 'https://www.bbc.com/news/articles/ce81wp4xkkgo', NULL, 'Tragic Death of NHL Star Johnny Gaudreau and His Brother in Car Accident', 'NHL player Johnny Gaudreau and his brother Matthew were killed in a cycling accident in New Jersey. The driver, Sean Higgins, has been arrested for two counts of death by auto, suspected of DUI. The Gaudreau family was in New Jersey for a wedding.', NULL, NULL, NULL, NULL, NULL, 'Johnny Gaudreau , Matthew Gaudreau , Sean Higgins , Brian Burke , Justin Trudeau', 'NHL , Johnny Gaudreau , Matthew Gaudreau , car accident , New Jersey , cycling , death by auto , DUI', NULL, 85, 9, NULL, 'neutral', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(289, 1, 'https://www.bbc.com/news/articles/cd6yzw30gl1o', 'BBC News', 'Italian Fugitive Arrested in Argentina After Decades on the Run', 'Leonardo Bertulazzi, a former member of the far-left Red Brigades, has been arrested in Buenos Aires after being on the run for nearly 44 years. He faces a 27-year prison sentence in Italy for his involvement in the kidnapping of a naval engineer in the 1970s. His refugee status in Argentina was revoked under the new right-wing government, enabling his extradition process.', NULL, NULL, NULL, 'Argentina', NULL, 'Leonardo Bertulazzi , Pietro Costa , Aldo Moro , Giorgia Meloni , Javier Milei', 'Bertulazzi , Red Brigades , kidnapping , extradition , Argentina , Italy , political violence', NULL, 80, 9, NULL, 'left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(290, 2, 'https://www.bbc.com/news/articles/czjy13kd90vo', NULL, 'Norwegian Princess Märtha Louise and Shaman Durek Verrett Set to Marry Amid Controversy', 'Norwegian Princess Märtha Louise is set to marry American shaman Durek Verrett in a private ceremony following several days of festivities. The royal couple has faced significant criticism over their unconventional lifestyle and lack of traditional royal conduct, which has stirred mixed reactions from the public and press.', 'Princess Märtha Louise\'s upcoming wedding illustrates a shift in royal traditions, showcasing how modern royalty is grappling with personal choices in the face of public scrutiny over unconventional lifestyles.', NULL, NULL, NULL, NULL, 'Princess Märtha Louise , Durek Verrett , King Harald , Crown Prince Haakon', 'Wedding , Princess Märtha Louise , Durek Verrett , Royal family , Norway , Controversy', NULL, 75, 9, NULL, 'Government-affiliated', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(291, 1, 'https://www.bbc.com/news/articles/cy547v72nd4o', 'NBC News', 'Trump Backtracks on Abortion Rights Ballot in Florida Amid Backlash', 'Former President Donald Trump announced that he will vote against a Florida ballot measure to protect abortion rights, despite earlier statements suggesting support. His reversal follows criticism from anti-abortion activists, highlighting the political pressure he faces from conservative supporters.', NULL, NULL, NULL, 'United States', 'Florida', 'Donald Trump , Kamala Harris , Ron DeSantis , JD Vance , Erick Erickson , Albert Mohler Jr', 'Trump , abortion rights , Florida , ballot measure , conservative backlash , Republican Party', NULL, 75, 9, NULL, 'right-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(292, 1, 'https://www.bbc.com/news/articles/ckgj36n8e6ro', 'BBC News', 'Devastation in Nur Shams: Families Endure Amid Israeli Military Operations', 'The recent Israeli military operation in the Nur Shams refugee camp has resulted in significant destruction and loss of life, leaving families in despair. Residents express their determination to stay despite the dangers, revealing the ongoing conflict\'s impact on civilian life.', 'The situation in Nur Shams highlights the enduring complexities of the Israeli-Palestinian conflict, where military actions often disproportionately affect civilian populations. The destruction and loss of life in this operation raise critical questions about military strategy and humanitarian considerations.', NULL, NULL, 'United Kingdom', 'Middle East', 'Majdi , Ayed Abu Hajja , Mohammed Jaber , Fadwa Abu Ayad', 'Nur Shams , Israeli military operation , destruction , civilian life , conflict , Tulkarm', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(293, 2, 'https://www.bbc.com/news/articles/cvg509dp9mjo', 'BBC', 'The Controversial Costs of \'Black Tax\': Struggles of African Success', 'Kenyan influencer Elsa Majimbo sparked social media debate with her criticism of \'black tax\'—the expectation for successful African individuals to financially support extended family. While some support her views, others see this communal obligation as vital. Experts indicate this practice stems from systemic inequalities rooted in colonialism.', NULL, NULL, NULL, 'United Kingdom', 'Global', 'Elsa Majimbo , Dr. Chipo Dendere , Gabe Mutseyekwa , Sandra Ajalo , Mikel John Obi', 'black tax , community obligation , financial support , colonialism , Ubuntu , Kenya , family support', NULL, 85, 8, NULL, 'neutral', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(294, 1, 'https://www.bbc.com/news/articles/crlr46kepnjo', NULL, 'Kamala Harris Faces Scrutiny in CNN Interview', 'Kamala Harris\'s CNN interview raised significant scrutiny as she struggled to clarify policies, particularly on immigration and economic issues. While she maintained a calm demeanor and appeared loyal to President Biden, she faces the challenge of presenting herself as a candidate for change amidst high stakes ahead of the November election.', NULL, NULL, NULL, NULL, NULL, 'Kamala Harris , Tim Walz , Donald Trump , Joe Biden', 'CNN Interview , Kamala Harris , Immigration , Economy , Biden Administration , Polling , Fracking', NULL, 80, 9, NULL, 'Left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(295, 5, 'https://www.bbc.com/news/articles/c33nj4m5zkgo', NULL, 'Oasis Reunion Sparks Nostalgia Among Fans', 'The announcement of Oasis\' reunion concerts in 2025 has generated excitement among fans worldwide, from the UK to Russia. Young and older fans alike express nostalgia for the Britpop era, hoping for a renewal of brotherhood between the Gallagher siblings.', 'The reunion of Oasis comes at a time when nostalgia for the 90s is prevalent, reflecting both a cultural longing and a hope for unity through music. It will be interesting to see how the new generation of fans interacts with the legacy of the band.', NULL, NULL, NULL, NULL, 'Jasmine Griffin-Jones , Yulia Markovskaia , Beatrice Steele , Andy Walker , Emma Arenstarr , Scarlett Allen', 'Oasis , reunion , Britpop , Gallagher brothers , nostalgia , fans', NULL, 75, 7, NULL, 'left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(296, 3, 'https://www.bbc.com/sport/articles/cg4y131ge2ko', 'The Guardian', 'Great Britain Targets High Medal Count at Paris 2024 Paralympics', 'A total of 215 athletes will represent ParalympicsGB at the Paris 2024 Paralympic Games, aiming for 100-140 medals. The Games will take place from August 28 to September 8, featuring a wide range of events, with Britain eager to build on its success in Tokyo 2020.', 'The participation of a strong GB team at the Paris 2024 Paralympics is encouraging, as it showcases the country\'s commitment to supporting athletes with disabilities. Their target of 100-140 medals reflects rising standards in inclusivity in competitive sports.', NULL, NULL, 'UK', 'England', '215 athletes , 100-140 medals target', 'ParalympicsGB , Paris 2024 , medals , athletes', NULL, 90, 9, NULL, 'neutral', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(297, 1, 'https://www.bbc.com/news/articles/cvg415vex37o', NULL, 'Military Alliance Between Somalia and Egypt Heightens Tensions in the Horn of Africa', 'The establishment of a military alliance between Somalia and Egypt, marked by the arrival of Egyptian troops in Mogadishu, has escalated tensions with Ethiopia. Somalia\'s move to engage Egypt comes amid unresolved disputes over the Grand Ethiopian Renaissance Dam and military concerns involving Somaliland.', NULL, NULL, NULL, NULL, NULL, 'Abiy Ahmed , Mahmoud Ali Youssouf , Abdul Fattah al-Sisi , Jonathan Fenton-Harvey , Christopher Hockney', 'Somalia , Egypt , Ethiopia , military alliance , Grand Ethiopian Renaissance Dam , Somaliland , Horn of Africa', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(298, 1, 'https://www.bbc.com/news/articles/clynd2mr5gjo', 'BBC', 'US-Iraq Operation Kills 15 ISIS Operatives Amid Rising Tensions', 'US Central Command reported that in a joint operation with Iraqi Security Forces, 15 Islamic State operatives were killed in western Iraq. The operation came amid heightened tensions following recent attacks in Germany and Austria linked to ISIS. No civilian casualties were reported, although seven American troops were reportedly injured.', NULL, NULL, NULL, 'United States', 'Iraq', 'David Cohen , Issa Al H', 'ISIS , Iraq , Joint Operation , US Troops , Casualties', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(299, 1, 'https://www.bbc.com/news/articles/c1m0jvd4m3zo', 'BBC News', 'Ukraine Dismisses Air Force Commander Amid F-16 Crash Controversy', 'Ukrainian President Zelensky has dismissed Lt Gen Mykola Oleshchuk following the crash of an F-16 jet, which caused the death of a pilot. While the crash occurred amidst Russian missile strikes, Ukraine claimed it wasn\'t directly caused by enemy fire. Zelensky emphasized the need for strong military leadership to protect Ukrainian forces as internal disputes surface regarding accountability for the incident.', NULL, NULL, NULL, 'UK', 'Global', 'Volodymyr Zelensky , Mykola Oleshchuk , Oleksiy Mes , Anatolii Kryvonozhko , Mariana Bezuhla', 'F-16 , Ukraine , military command , Zelensky , Oleshchuk , crash , Russian invasion', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(300, 3, 'https://www.bbc.com/sport/tennis/articles/crkm8gr3ey7o', 'BBC Sport', 'Djokovic Faces Shocking Early Exit at US Open', 'In a surprising turn of events, Novak Djokovic, the 24-time Grand Slam champion, was defeated by Australia\'s 28th seed Alexei Popyrin in the third round of the US Open, marking his earliest exit from the tournament in 18 years. Djokovic racked up a staggering 14 double faults and 49 unforced errors, ending his season without a Grand Slam title for the first time since 2017.', 'Djokovic\'s unexpected exit at the hands of Popyrin underscores the unpredictable nature of tennis. While Djokovic remains a formidable player, his performance highlighted the physical and mental toll of recent competitions, including Olympic commitments.', NULL, NULL, 'UK', 'Europe', 'Novak Djokovic , Alexei Popyrin', 'US Open , Djokovic , Popyrin , tennis , Grand Slam , early exit', NULL, 85, 8, NULL, 'Neutral', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(301, 11, 'https://www.bbc.com/news/articles/ce81j919gdjo', NULL, 'Semaglutide: A Potential Game Changer in Aging and Health', 'Researchers believe that semaglutide, a drug for Type 2 diabetes and obesity, may also slow down aging. New studies presented at the European Society of Cardiology Conference 2024 show it can improve various health conditions and reduce mortality rates among users.', NULL, NULL, NULL, 'UK', 'Europe', 'Prof Harlan Krumholz , Dr Benjamin Scirica', 'Semaglutide , Ozempic , Type 2 diabetes , obesity , aging , cardiovascular health , mortality rates', NULL, 85, 9, NULL, 'neutral', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(302, 5, 'https://www.bbc.com/news/articles/cx2ljxj3wrxo', 'Complex', 'Hanumankind: The Cosmopolitan Rapper Redefining Indian Hip-Hop', 'Sooraj Cherukat, known as Hanumankind, is gaining global recognition with his unique blend of hip-hop that reflects both his Indian roots and international experiences. His recent song has earned substantial streams and views, while he faces criticism for his style and choice of language in a diverse music scene.', 'Hanumankind\'s journey showcases the complexities of cultural identity in modern music. His fusion of styles reflects a globalized world, and while he faces criticism, it is important to understand the diverse interpretations of his work.', NULL, NULL, 'USA', 'Global', 'Sooraj Cherukat , Kalmi Reddy , Bijoy Shetty , DJ Screw , UGK , Big Bunny , Project Pat , Abid Haque , Arnab Ghosh', 'Hanumankind , Indian Hip-Hop , Cultural Identity , Music Criticism , Global Recognition', NULL, 75, 7, NULL, 'Left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(303, 1, 'https://www.bbc.com/news/articles/c05jvve89g3o', NULL, 'The Rising Tide of the AfD: A Divided Germany at the Crossroads', 'In the lead-up to crucial elections in Thuringia and Saxony, the Alternative for Germany (AfD) party is experiencing a surge in support, while Chancellor Olaf Scholz\'s coalition faces harsh criticism and possible defeat. Rising discontent over immigration and regional disparities from reunification are driving voters towards the AfD, which is also contending with a competing left-wing party, the Sahra Wagenknecht Alliance (BSW). The outcomes are poised to signal broader national trends ahead of next year\'s federal elections.', NULL, NULL, NULL, NULL, NULL, 'Olaf Scholz , Björn Höcke , Sahra Wagenknecht , Friedrich Merz , Levi Schlegtendal , Constantin', 'Alternative for Germany , AfD , Thuringia , Saxony , Chancellor , immigration , political parties , federal elections', NULL, 85, 9, NULL, 'Left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(304, 2, 'https://www.bbc.com/news/articles/cdey4prn3e1o', NULL, 'Telegram\'s Troubles: Free Speech or Criminal Haven?', 'Telegram faces scrutiny amid allegations of being a platform for illegal activities after its founder Pavel Durov is charged in France. Law enforcement critiques the lack of effective moderation on the app, which has reportedly been used for drug trafficking, fraud, and child exploitation, raising questions about the balance between privacy and accountability.', NULL, NULL, NULL, NULL, NULL, 'Pavel Durov , Patrick Gray , Jean-Michel Bernigaud', 'Telegram , criminality , moderation , child sexual abuse material , drug trafficking , free speech', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(305, 2, 'https://www.bbc.com/news/articles/ced1zzvn0j1o', NULL, 'Search for Missing Indian Woman Hits Snag in Malaysia', 'An extensive search for Vijaya Lakshmi Gali, an Indian woman missing for eight days after falling into a sinkhole in Kuala Lumpur, faces significant challenges due to strong currents and debris. Rescuers have found little except a pair of slippers, leading to a cessation of dive operations. The incident has raised safety concerns and prompted government audits.', NULL, NULL, NULL, NULL, NULL, 'Vijaya Lakshmi Gali , Nor Hisham Mohammad , Alimaddia Bukri', 'sinkhole , missing person , search and rescue , Kuala Lumpur , Vijaya Lakshmi Gali', NULL, 75, 9, NULL, 'neutral', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(306, 5, 'https://www.bbc.com/news/articles/c5y8wer58x6o', 'BBC News', 'Oasis Comeback Tour Tickets Go On Sale Amid Resale Warning', 'Tickets for Oasis\'s highly anticipated comeback tour have gone on sale, but the band has issued a warning against reselling at inflated prices. Issues were reported on ticket purchasing websites, with some tickets already listed online at exorbitant rates. Oasis urges fans to sell tickets only at face value through authorized platforms.', NULL, NULL, NULL, 'United Kingdom', 'England', 'Oasis , Noel Gallagher , Liam Gallagher', 'Oasis , comeback tour , tickets , resale , Ticketmaster', NULL, 85, 8, NULL, 'Left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(307, 1, 'https://www.bbc.com/news/articles/c3rd1yzgl0qo', 'BBC', 'Kamala Harris Prepares for Pivotal Debate Against Trump', 'Kamala Harris is set to face Donald Trump in a key debate on September 10, as she looks to rectify past messaging issues from her previous presidential campaign. Known for her strategic debate style, Harris will need to capitalize on her strengths while avoiding pitfalls against her unpredictable opponent.', 'Kamala Harris\'s upcoming debate with Donald Trump represents a crucial moment in her campaign. The ability to articulate her policies clearly will be key, as past debates have shown the importance of clarity in such high-stakes environments.', NULL, NULL, 'United States', 'North America', 'Kamala Harris , Donald Trump , Joe Biden , Steve Cooley , Aimee Allison , Maya Rupert', 'debate , Kamala Harris , Donald Trump , September 10 , political messaging , 2020 election', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:02:43', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(308, 1, 'https://www.channelnewsasia.com/world/ukraine-russia-kursk-incursion-nato-stoltenberg-4578641', NULL, 'NATO Chief Backs Ukraine\'s Right to Self-Defense Amid Border Incursion', 'NATO Secretary General Jens Stoltenberg reaffirmed Ukraine\'s legitimate right to self-defense, stating that this right extends beyond its borders. His remarks come in response to Ukraine\'s recent military advances into Russian territory, aimed at creating a buffer zone against further attacks. Stoltenberg clarified that NATO was not informed about the incursion beforehand. Russia has termed the operation a \'major provocation\'.', 'Jens Stoltenberg\'s remarks highlight the complex legal and ethical considerations surrounding military action and self-defense. While Ukraine\'s right to protect its sovereignty is clear, the implications of crossing into Russian territory are profound and could escalate the conflict further.', NULL, NULL, NULL, NULL, 'Jens Stoltenberg , Volodymyr Zelenskyy', 'NATO , Ukraine , self-defense , territory , Russia , military incursion', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(309, 1, 'https://www.channelnewsasia.com/world/israel-hamas-war-ended-month-long-operation-south-central-gaza-4577481', NULL, 'Destruction and Tragedy in Khan Younis Amid Escalating Israel-Hamas Conflict', 'As the Israel-Hamas conflict intensifies, residents return to Khan Younis, Gaza Strip, to find their homes destroyed and the lingering presence of death and despair. The ongoing military operations have resulted in significant casualties on both sides, with civilians bearing the brunt.', 'The situation in Gaza remains dire as the humanitarian crisis deepens. The impact on civilian lives is catastrophic, and international intervention is urgently needed to facilitate peace.', NULL, NULL, NULL, NULL, '1,199 (deaths in initial Hamas attacks) , 40,602 (deaths in Israeli retaliatory campaign) , Amal al-Astal (resident testimonial)', 'Khan Younis , Gaza Strip , Israel-Hamas conflict , civilian deaths , military operations', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(310, 1, 'https://www.channelnewsasia.com/world/israel-hamas-war-west-bank-raid-third-day-hamas-commander-killed-4577001', 'AFP', 'Escalation in West Bank: Israeli Forces Kill Hamas Leader and Two Fighters', 'Israeli military operations in the West Bank have intensified, with airstrikes resulting in the deaths of three Hamas fighters, including the group\'s leader in Jenin. The UK\'s Foreign Office has expressed deep concern over the civilian casualties amid the ongoing conflict in the region.', NULL, NULL, NULL, 'Israel', 'West Bank', 'Wassem Hazem , Israeli forces , Hamas militants', 'West Bank , Israeli military , Hamas , airstrike , casualties', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(311, 2, 'https://www.channelnewsasia.com/world/singapore-flagged-container-ship-maersk-shekou-hits-australian-leeuwin-two-injured-perth-4577291', 'ABC News', 'Collision of STS Leeuwin II with Singapore-flagged Vessel Injures Crew in Fremantle Port', 'Two crew members were injured when the STS Leeuwin II, an Australian sail-training ship, was struck by the Singapore-flagged Maersk Shekou in Fremantle Port on August 30, 2024. The incident caused significant damage to both vessels, leading to an ongoing investigation by the Maritime and Port Authority of Singapore.', 'This incident raises critical questions about vessel safety practices in busy ports. The investigation will be essential in understanding how such collisions can be avoided in the future.', 'This collision highlights the need for stricter regulations on maritime operations to protect the safety of workers. It is a reminder that profits should not come at the expense of human lives and well-being.', 'Foreign vessels like the Maersk Shekou should be held accountable for incidents that occur in Australian waters. This is a clear warning that we need to prioritize Australian maritime interests.', 'Australia', 'Perth', 'Jay Weatherill , Jodie Ransom', 'STS Leeuwin II , Maersk Shekou , Fremantle Port , collision , injuries , investigation', NULL, 75, 8, NULL, 'left-wing', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(312, 1, 'https://www.channelnewsasia.com/world/germany-state-elections-far-right-afd-immigration-economy-ukraine-support-4577446', 'Reuters', 'Far-Right AfD Poised for Historic Wins in Eastern Germany Elections', 'The far-right Alternative for Germany (AfD) is predicted to come first in at least one of two state elections in eastern Germany, putting pressure on Chancellor Olaf Scholz\'s coalition. Despite potential wins, the party is unlikely to form a government, but this marks the first time a far-right party has gained the most seats in a German state parliament since World War II.', 'The rise of the AfD in eastern Germany reflects deepening divisions in the country\'s political landscape. Many citizens appear frustrated with the current government\'s handling of issues like immigration and economic stability, suggesting a potential realignment of political power in the future.', 'The increasing support for the AfD illustrates the failure of mainstream parties to address the concerns of ordinary people. This is a wake-up call for those in power to seriously reflect on their policies and the real needs of the population, rather than catering exclusively to elites.', 'The success of the AfD is a clear message that the German public is tired of political correctness and ineffective governance. The party\'s focus on issues like migration and economic management resonates with many voters who feel left behind by traditional parties.', 'Germany', 'Berlin', 'Olaf Scholz , Alice Weidel , Bjoern Hoecke , Sahra Wagenknecht', 'AfD , elections , Thuringia , Saxony , immigration , coalition , populism', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(313, 1, 'https://www.channelnewsasia.com/world/musks-x-braces-brazil-shutdown-authorities-call-accountability-4577531', NULL, 'Brazil\'s Supreme Court Threatens to Block X, Sparking Tensions with Musk', 'Brazil\'s Supreme Court Justice Alexandre de Moraes is poised to order a block on the social media platform X, following President Lula\'s demand for compliance with local laws. The platform faces scrutiny for failing to designate a legal representative in Brazil. Amidst tensions, Musk called the judge a \'dictator\' and defended his operations, asserting Starlink would continue to provide services in Brazil.', NULL, NULL, NULL, NULL, NULL, 'Luiz Inacio Lula da Silva , Alexandre de Moraes , Elon Musk', 'X , Brazil , Supreme Court , Lula , Musk , social media , censorship', NULL, 85, 7, NULL, 'left-wing', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(314, 1, 'https://www.channelnewsasia.com/world/power-begin-returning-venezuela-government-says-amid-nationwide-blackout-4578091', NULL, 'Mass Blackout Hits Caracas as Maduro Blames Sabotage', 'Caracas and much of Venezuela experienced a widespread blackout, with President Maduro attributing the incident to sabotage. This outage affected key operations, including those of state oil company PDVSA. Authorities reported that 24 states were impacted, raising concerns about the country\'s deteriorating electrical infrastructure.', 'The recent blackout in Caracas highlights ongoing issues within Venezuela\'s power infrastructure. While the government attributes the outage to sabotage, the lack of substantiating evidence raises questions about the reliability of this claim and points to the need for systemic improvements in the nation\'s energy policies.', NULL, NULL, NULL, NULL, 'Nicolas Maduro , Diosdado Cabello , Freddy Nanez , Edmundo Gonzalez , Maria Corina Machado', 'blackout , Caracas , Venezuela , Maduro , PDVSA , sabotage , energy crisis', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(315, 1, 'https://www.channelnewsasia.com/business/us-requests-trade-dispute-consultations-canada-over-new-digital-services-tax-4578151', NULL, 'US Initiates Dispute Consultations with Canada Over Digital Services Tax', 'The US has requested consultations with Canada regarding its new digital services tax, citing discrimination against US companies and inconsistencies with trade agreements. If unresolved in 75 days, the US may escalate to a dispute settlement panel, which could lead to tariffs on Canadian imports.', NULL, NULL, NULL, NULL, NULL, 'Katherine Tai , Chrystia Freeland , Mary Ng', 'US Canada , digital services tax , dispute consultation , USMCA , trade agreements', NULL, 75, 9, NULL, 'neutral', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(316, 4, 'https://www.channelnewsasia.com/world/nasa-cuts-2-next-spacex-flight-make-room-astronauts-stuck-space-station-4578021', 'REUTERS', 'NASA Adjusts Crew for Upcoming SpaceX Launch Amid ISS Challenges', 'NASA has removed astronauts Zena Cardman and Stephanie Wilson from an upcoming SpaceX mission to accommodate others stranded at the International Space Station. Nick Hague and Aleksandr Gorbunov will launch in September with planned returns in February.', 'NASA\'s decision to adjust the crew reflects the complexity of space missions and the necessity for prioritizing safety. The agency must balance human resources with technical challenges.', 'This incident highlights the shortcomings in privatizing space travel. NASA should focus on strengthening its own programs rather than relying on corporations like SpaceX, which may not have astronauts’ best interests at heart.', 'Relying on Russian and private companies for crew transport compromises national security and our standing in the global space race. We should prioritize returning to reliable U.S. launches without dependence on foreign entities.', 'USA', 'Florida', 'Nick Hague , Aleksandr Gorbunov , Zena Cardman , Stephanie Wilson , Suni Williams , Butch Wilmore', 'NASA , SpaceX , International Space Station , Crew Adjustment , Launch , Privatization', NULL, 75, 7, NULL, 'neutral', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(317, 1, 'https://www.channelnewsasia.com/world/russian-bomb-hits-high-rise-building-ukraines-kharkiv-killing-seven-4578296', NULL, 'Russian Air Strike on Kharkiv Residential Building Kills Seven', 'A Russian airstrike on a residential building in Kharkiv resulted in seven fatalities, including a 14-year-old girl, and left at least 77 others injured. The attack involved guided bombs, leading to a significant fire in the apartment block. Ukrainian President Zelenskyy has urged Western allies to provide long-range weapons to counter such strikes.', 'This tragic incident underscores the ongoing violence in Ukraine, highlighting the urgent need for international support to protect civilians. Civilians continue to bear the brunt of the conflict, and calls for advanced military assistance are growing louder.', NULL, NULL, NULL, NULL, 'Ihor Terekhov , Oleh Syniehubov , Volodymyr Zelenskyy', 'Russian airstrike , Kharkiv , casualties , civilian , guided bombs , Zelenskyy , Ukraine', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(318, 2, 'https://www.channelnewsasia.com/commentary/qantas-mistake-airfare-bargain-honour-customers-4577086', NULL, 'Qantas\' Pragmatic Response to Fare Mistake: A Balanced Approach to Customer Satisfaction', 'Qantas Airlines mistakenly posted heavily discounted business-class tickets due to a coding error, prompting a swift response to honor the sales by upgrading affected customers to business class. This decision balances customer satisfaction with the airline\'s financial constraints, reflecting a strategic approach in the competitive airline industry.', NULL, NULL, NULL, NULL, NULL, 'Qantas , Cathay Pacific , British Airways', 'Qantas , business class , first-class fare , coding error , customer satisfaction', NULL, 75, 8, NULL, 'left-wing', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(319, 2, 'https://www.channelnewsasia.com/singapore/parasocial-relationships-celebrity-fans-fandom-4571566', 'CNA', 'Understanding Parasocial Relationships in the Age of Social Media', 'Parasocial relationships have become more common with social media, as individuals form one-sided connections with media figures. A recent exploration reveals how these relationships offer a sense of intimacy and belonging, despite being unreciprocated. The ease of social media interaction and the potential emotional investment pose both benefits and risks for fans.', 'Parasocial relationships are a fascinating psychological phenomenon that reflects our evolving social dynamics, especially in an age dominated by digital interaction. While they can foster a sense of connection and community, it is crucial for individuals to remain aware of the one-sided nature of these relationships.', 'The rise of parasocial relationships underlines the failures of our society to provide authentic connections. In a capitalist framework, media personalities are commodified, resulting in fans clinging to one-sided relationships instead of forming genuine community bonds. This phenomenon highlights the need for systemic change to cultivate real relationships.', 'These parasocial relationships illustrate a troubling trend of dependency on celebrities rather than personal achievement and community engagement. It reveals a lack of self-reliance among youth today, who should be focusing on building meaningful real-world relationships instead of idolizing distant figures.', 'Singapore', NULL, 'Daniel Radcliffe , Davelle Lee , Cho Hichang , Lim Sun Sun , Patrick Williams , Chappell Roan , Zachary Hourihane', 'parasocial relationships , social media , fans , media personas , psychology , community , identity', NULL, 70, 9, NULL, 'neutral', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(320, 2, 'https://www.channelnewsasia.com/entertainment/norwegian-princess-marries-american-shaman-wedding-4577236', NULL, 'Royal Controversy: Princess Martha Louise to Marry Shaman Amid Scandals', 'Princess Martha Louise of Norway is set to marry American shaman Durek Verret amid public criticism and mounting scandals within the royal family, including allegations against her stepson for bodily harm. The couple, who have drawn attention for their unconventional beliefs, face backlash after commercializing their royal status despite prior agreements.', 'The upcoming wedding represents a moment of personal significance for Princess Martha Louise, yet the surrounding controversies illustrate the complex dynamics facing modern royal families. Public sentiment appears increasingly critical of both the marriage and subsequent scandals, suggesting a potential shift in societal views regarding monarchy.', NULL, NULL, NULL, NULL, 'Princess Martha Louise , Durek Verret , King Harald V , Crown Princess Mette-Marit , Marius Borg Høiby', 'Princess Martha Louise , Durek Verret , Norwegian monarchy , wedding , scandals , public criticism', NULL, 75, 9, NULL, 'Neutral', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(321, 1, 'https://www.channelnewsasia.com/world/pacific-leaders-remove-taiwan-communique-after-china-complaint-4578586', 'Reuters', 'Pacific Islands Forum Removes Taiwan References Amidst China Pressure', 'The Pacific Islands Forum has retracted references to Taiwan from its communique following a strong response from China\'s envoy during a regional summit in Tonga. The bloc comprises 18 nations, with three recognizing Taiwan and 15 recognizing China, which seeks to expand its influence through development funding in the region.', 'This development highlights the complex diplomatic landscape in the Pacific, where influence from major powers like China can significantly sway regional decisions. The retraction of Taiwan\'s mention illustrates the ongoing tensions surrounding Taiwan\'s international status.', NULL, NULL, 'Australia', 'Pacific', 'Mark Brown , Jeremiah Manele , Hu\'akavameiliku , Baron Waqa , Qian Bo , Lin Jian', 'Pacific Islands Forum , Taiwan , China , diplomatic relations , communique , influence , funding', NULL, 75, 9, NULL, 'left-wing', '2024-08-31 07:13:47', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(322, 2, 'https://www.euronews.com/travel/2024/08/31/soaring-rent-prices-and-cruise-ship-caps-how-barcelona-has-changed-in-the-10-years-ive-liv', 'Local Journalist', 'Barcelona\'s Transformation Over a Decade: A City of Contrasts', 'Over the past decade, Barcelona has undergone significant changes, becoming both a leading tourist destination with major attractions and a victim of overtourism and rising living costs. While efforts to improve green living and the food scene are notable, the city faces challenges from climate change and economic strain.', NULL, NULL, NULL, 'Spain', 'Barcelona', 'Antoni Gaudí , Catalan government , AEMET', 'Barcelona , overtourism , living costs , climate change , gentrification , food scene', NULL, 75, 8, NULL, 'Neutral', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(323, 2, 'https://www.euronews.com/business/2024/08/31/where-are-the-top-spots-for-europeans-to-holiday-and-who-spends-the-most', NULL, 'Holiday Inequity in the EU: 29% Can\'t Afford Vacation', 'A new report reveals significant disparities in holiday access across the EU, with 29% of citizens unable to afford a one-week vacation. Countries like Romania and Bulgaria top the list of those most financially restricted from traveling, while wealthier nations like Norway show much lower percentages.', NULL, NULL, NULL, NULL, NULL, 'Percentage Unable to Afford Vacation , Spain , Italy , France , Germany , Romania , Bulgaria , Hungary , Norway , Luxembourg Tour Spending per Night , Austria Tour Spending per Night , Germany Tour Spending per Night', 'EU , vacation , inequality , Eurostat , travel , affordability , economic disparity', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(324, 1, 'https://www.euronews.com/my-europe/2024/08/31/scholz-says-return-of-afghan-nationals-a-clear-sign-criminals-will-be-deported', 'Al Jazeera', 'Germany Deports Afghan Nationals Following Knife Attack', 'Germany has deported 28 Afghan nationals, marking the first such action since the Taliban took power in 2021, following a deadly knife attack in Solingen that killed three. Chancellor Olaf Scholz and Interior Minister Nancy Faeser emphasize that foreign-born criminals will not escape deportation, as security remains a pressing issue.', NULL, NULL, NULL, 'Germany', 'Europe', 'Olaf Scholz , Nancy Faeser , Issa Al H.', 'deportation , Afghan nationals , knife attack , Germany , Taliban , security , crime', NULL, 75, 9, NULL, 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(325, 1, 'https://www.euronews.com/my-europe/2024/08/31/polish-government-announces-new-guidelines-reaffirming-legality-of-abortion', NULL, 'Poland Moves to Liberalize Abortion Access After Protests', 'The Polish government has announced new guidelines to facilitate access to legal abortion, allowing it under certain medical recommendations after years of restrictive laws. Health Minister Izabela Leszczyna emphasized the need for compliance with health directives to protect women\'s rights. This development follows mass protests against previous conservative regulations limiting abortion access.', NULL, NULL, NULL, NULL, NULL, 'Prime Minister Donald Tusk , Health Minister Izabela Leszczyna', 'abortion , Poland , guidelines , health , protests , women\'s rights', NULL, 80, 7, NULL, 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(326, 2, 'https://www.euronews.com/my-europe/2024/08/31/woman-stabs-and-injures-six-people-on-bus-in-western-german-city-of-siegen', NULL, 'Bus Stabbing in Siegen Injures Six, Suspect Arrested', 'A 32-year-old German woman has stabbed and injured six people on a bus in Siegen, with three victims in life-threatening condition. The police are investigating the motive but do not believe it to be terrorism. This incident follows a recent knife attack in Solingen that left three dead, prompting the government to impose new restrictions on knife-carrying and resume deportations to Afghanistan.', NULL, NULL, NULL, NULL, NULL, '32-year-old German woman , Six stab victims , Three life-threatening injuries , 26-year-old Syrian national (previous incident)', 'bus stabbing , Siegen , knife attack , Germany , public safety', 8, 80, 8, 'BBC News is considered a reliable source with a good track record for balanced reporting, although it may lean slightly left in its editorial stance.', 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(327, 1, 'https://www.euronews.com/my-europe/2024/08/31/brussels-my-love-is-france-becoming-the-sick-man-of-europe', 'Euronews', 'Political Stalemate in France, Terror Attack Fallout in Germany, and the Start of Paralympics', 'This edition discusses the ongoing political stalemate in France as President Macron struggles to form a government post-elections, reactions to a recent mass stabbing in Germany raising immigration concerns, and the commencement of the Paralympic Games in Paris involving athletes with disabilities.', 'The current political situation in France reflects a broader issue within the EU, where member states often struggle to unify under a single vision amidst diverse political ideologies. This stalemate could have significant implications for European decision-making.', NULL, NULL, 'France', 'Western Europe', 'Emmanuel Macron , Olaf Scholz , Maria Tadeo , Peter Hefele , Jérôme Quéré', 'political stalemate , terrorist attack , Paralympics , immigration , government formation', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(328, 7, 'https://www.euronews.com/business/2024/08/31/these-are-the-five-european-countries-you-should-start-a-business-in', 'Euronews Business', 'Europe\'s Easiest Places to Start a Business Revealed', 'A report by Euronews Business outlines the best European countries for entrepreneurs to establish small and medium-sized enterprises. It highlights Ireland, Bulgaria, the Netherlands, Sweden, and the UK as attractive locations, emphasizing factors like low tax rates, supportive business environments, and rapid business setup processes. European initiatives like the Single Market Programme and Horizon Europe are aiding these ventures.', NULL, NULL, NULL, 'Europe', 'EU', '24.4 million SMEs , 85 million people employed by SMEs , 99.8% of businesses in Europe are SMEs', 'business , Europe , entrepreneurs , SMEs , tax rates , support schemes', NULL, 75, 8, NULL, 'neutral', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(329, 5, 'https://www.euronews.com/culture/2024/08/31/the-best-things-to-do-and-see-or-watch-in-europe-this-week', 'Euronews Culture', 'Weekend Cultural Highlights Across Europe', 'This weekend brings a diverse array of cultural events across Europe including an immersive perfume exhibition in France, an insightful stop-motion animation showcase in London, and vibrant local festivals in Romania and the Netherlands. Highlights also include new film releases and music albums captivating audiences.', 'The weekend events across Europe reflect a vibrant cultural scene, showcasing the region\'s rich artistic heritage and contemporary creativity. These activities invite both locals and tourists to engage in immersive experiences.', NULL, NULL, 'United Kingdom', 'Europe', 'Leonardo da Vinci , Karla Sofía Gascón , Selena Gomez , Zoé Saldaña , Tim Burton , Nick Cave', 'Cultural events , Art exhibition , Film festival , Music album , Jazz festival , Street art', NULL, 70, 9, NULL, 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(330, 5, 'https://www.euronews.com/culture/2024/08/31/venice-2024-review-babygirl-nicole-kidman-shines-in-sex-positive-bdsm-drama', 'Variety', 'Nicole Kidman\'s \'Babygirl\': A Bold Exploration of Desire and Power Dynamics', 'Nicole Kidman stars in \'Babygirl\', a film that intertwines themes of desire, vulnerability, and power dynamics. The story follows Romy, a successful CEO, as she embarks on a torrid affair that forces her to confront her suppressed desires. The film premiered at the 81st Venice Film Festival.', 'Nicole Kidman\'s performance in \'Babygirl\' is a captivating exploration of a woman\'s unfulfilled desires and the complexities of power in intimate relationships. The film\'s treatment of such themes resists moral judgment, inviting viewers to reflect on their own perceptions of desire.', NULL, NULL, 'USA', 'California', 'Nicole Kidman , Antonio Banderas , Harris Dickinson , Esther McGregor , Vaughan Reilly , Halina Reijn', 'Babygirl , Nicole Kidman , desire , power dynamics , Venice Film Festival , sexual exploration , BDSM', NULL, 75, 7, NULL, 'Left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(331, 2, 'https://www.euronews.com/green/2024/08/31/why-is-water-related-violence-getting-so-much-worse-and-what-can-be-done-to-stop-it', 'Pacific Institute', 'Surge in Water-Related Violence Calls for Urgent Global Action', 'A new study reveals that incidents of violence over water resources have dramatically increased in 2023, reaching 347 events compared to 231 in 2022, marking a 150% rise. The Pacific Institute emphasizes the urgent need for equitable water policies as climate change exacerbates tensions globally.', 'The data presented by the Pacific Institute underscores the complexity of water-related conflicts and the urgent need for international cooperation and effective policies to mitigate violence linked to water scarcity.', 'The alarming surge in water-related violence is a direct consequence of capitalist exploitation of resources. Only systemic change and equitable distribution of water can address the root causes of these conflicts.', 'The rising violence over water is a wake-up call for all nations to prioritize their own water security and sovereignty over shared resources, especially as global tensions rise and resources become scarce.', 'United States', 'Global', 'Dr. Peter Gleick , Morgan Shimabuku', 'water-related violence , Pacific Institute , water resources , climate change , violence increase , conflict', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(332, 1, 'https://www.euronews.com/my-europe/2024/08/30/volodymyr-zelenskyy-sacks-air-force-chief-days-after-pilot-killed-in-f-16-crash', 'Reuters', 'Ukraine Faces First F-16 Loss Amid Intensified Russian Attacks', 'Ukraine has reported the first loss of an F-16 fighter jet during a significant Russian missile and drone assault, resulting in the death of the pilot. President Zelenskyy has dismissed the air force commander, Lt. Gen. Mykola Oleshchuk, in light of the incident. Meanwhile, a separate attack in Kharkiv has caused multiple casualties, intensifying calls for enhanced military support from Western allies.', NULL, NULL, NULL, 'Ukraine', 'Kyiv', 'Volodymyr Zelenskyy , Lt. Gen. Mykola Oleshchuk , Lt. Gen. Anatolii Kryvonozhko , Colonel Alexei \'Moonfish\' Mes , Andrii \'Juice\' Pilshchykov', 'F-16 , Ukraine , Zelenskyy , Russian attacks , Kharkiv , military support', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(333, 1, 'https://www.euronews.com/my-europe/2024/08/30/state-of-the-union-ukraines-incursion-in-russia-is-changing-the-momentum-says-us-general', 'Euronews', 'Hungary\'s Immigration Law Sparks EU Security Concerns Amid Ongoing Ukraine Conflict', 'Hungary\'s decision to ease immigration laws for Russian and Belarusian nationals has raised significant security concerns among EU countries, particularly the Nordic and Baltic states. As tensions escalate with Russian missile strikes amid the Ukraine conflict, EU officials are assessing the implications of Hungary\'s policy amidst fears of potential espionage.', 'Hungary\'s immigration adjustments reflect a complex balance of national interests and EU security dynamics. While Hungary argues its actions comply with EU frameworks, the concern from other member states raises critical questions about the overall safety and integrity of the Schengen zone.', NULL, NULL, 'France', 'Europe', 'Baiba Braže , Ben Hodges , Emmanuel Macron', 'Hungary , EU , immigration law , security concerns , Ukraine conflict , Russia , Belarus , missile strikes', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(334, 1, 'https://www.euronews.com/2024/08/30/after-greeting-macron-in-belgrade-serbias-vucic-sets-off-to-meet-von-der-leyen-in-prague', 'Euronews', 'EU and Serbia Set for Reform Discussions Amid New Growth Plan', 'European Commission President Ursula von der Leyen and Serbian President Aleksandar Vučić are set to discuss Serbia\'s reform agenda linked to the EU\'s New Growth Plan. Following French President Emmanuel Macron\'s visit, which resulted in military sales and energy discussions, the talks will aim to enhance Serbia\'s prospects for European Union membership.', 'The ongoing discussions between the EU and Serbia highlight the importance of reforms in the accession process. Serbia\'s commitment to implementing the necessary reforms will determine its eligibility for financial assistance and eventual EU membership.', NULL, NULL, 'Serbia', 'Western Balkans', 'Ursula von der Leyen , Aleksandar Vučić , Emmanuel Macron , Tanja Miščević', 'European Commission , Serbia , reform agenda , New Growth Plan , EU membership , Rafale fighter jets , funding , socio-economic convergence', NULL, 75, 9, NULL, 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(335, 1, 'https://www.euronews.com/my-europe/2024/08/30/russian-airstrike-on-kharkiv-apartment-block-kills-six-people', 'CNN', 'Russian Airstrike in Kharkiv Results in Casualties and Calls for Military Support', 'A Russian airstrike in Kharkiv has left at least six dead and dozens injured as glide bombs struck residential areas. President Zelenskyy is urging Western partners to enhance military support, while the recent loss of an F-16 in combat raises questions about Ukraine\'s air defenses and command.', NULL, NULL, NULL, 'Ukraine', 'Kharkiv', 'Oleh Syniehubov , Volodymyr Zelenskyy , Mykola Oleshchuk , Josep Borrell', 'Kharkiv , airstrike , casualties , F-16 , military support , Russian aggression', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(336, 1, 'https://www.euronews.com/2024/08/30/judge-in-brazil-suspends-x-after-elon-musk-fails-to-name-a-legal-rep', 'GloboNews', 'Brazil Supreme Court Orders Suspension of X Amid Free Speech Feud with Musk', 'Brazil\'s Supreme Court has ordered the suspension of social media platform X after CEO Elon Musk failed to appoint a legal representative in the country, escalating tensions over free speech and misinformation. The court mandated a daily fine for VPN use to access the platform, with legal compliance pending.', NULL, NULL, NULL, 'Brazil', 'South America', 'Elon Musk , Justice Alexandre de Moraes , Luiz Inácio Lula da Silva , Carlos Baigorri', 'Brazil , X , suspension , Supreme Court , Elon Musk , free speech , Justice Alexandre de Moraes , VPN , telecommunications', NULL, 85, 7, NULL, 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(337, 1, 'https://www.euronews.com/my-europe/2024/08/30/fears-grow-ukraines-eastern-city-of-pokrovsk-might-fall-to-russia', NULL, 'Evacuations Mount as Russian Forces Close in on Strategic City of Pokrovsk', 'Hundreds of residents are fleeing Pokrovsk daily as Russian forces advance to within 10 kilometers of the city. With a pre-war population of 60,000, Pokrovsk is crucial as a transport hub. Its capture could significantly weaken Ukraine\'s defensive positions in the Donetsk region.', NULL, NULL, NULL, 'UK', 'Europe', 'Russian forces , Ukrainian forces , Pokrovsk', 'evacuation , Russian military , Pokrovsk , Donetsk region , civilian casualties', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(338, 1, 'https://www.euronews.com/culture/2024/08/30/mama-mia-here-we-go-again-abba-ask-donald-trump-to-stop-using-their-songs', NULL, 'ABBA Demands Trump Cease Use of Their Music in Campaign', 'Swedish pop group ABBA has requested Donald Trump to stop using their music at campaign rallies, claiming unauthorized use. Trump\'s team asserts they have obtained a license for the songs, amidst a history of artists objecting to their music being played at his events.', 'The legalities surrounding music usage at political events are complex. While ABBA asserts unauthorized use, the Trump campaign claims they possess a proper license, showcasing the ongoing debate on artists\' rights in political contexts.', 'It\'s unacceptable for Trump to exploit artists\' music for his divisive political agenda. ABBA\'s stance reflects a broader concern among musicians about their work being used to promote hate and division.', 'This is merely another attempt by \'liberal elites\' to silence voices they disagree with. Trump\'s campaign has legally obtained the rights to use ABBA\'s music, and complaining about it seems to be a tactic to undermine his support.', NULL, NULL, 'ABBA , Donald Trump , Celine Dion , Beyoncé , Sinéad O’Connor , Isaac Hayes', 'ABBA , Donald Trump , music rights , campaign , licensing', NULL, 70, 8, NULL, 'The Associated Press generally maintains a neutral stance, focusing on factual reporting.', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(339, 5, 'https://www.euronews.com/culture/2024/08/30/national-cinema-day-in-the-uk-offers-tickets-for-under-5', NULL, 'Cheap Tickets Boost National Cinema Day in the UK', 'National Cinema Day is set to take place in the UK on Saturday, with over 630 cinemas offering tickets for as low as £4. This initiative, aimed at boosting cinema attendance, saw a rise in ticket sales to 1.56 million, generating £5.2 million for the box office. The event continues to grow in popularity, fostering a love for cinema across the nation.', 'The continuation of National Cinema Day speaks volumes about the industry\'s efforts to adapt and attract audiences in a growing digital landscape. It\'s a strategic move to lower barriers for entry into cinemas, especially during challenging economic times.', NULL, NULL, NULL, NULL, 'Iain Jacob , 630 cinemas , 1.56 million tickets , £5.2 million', 'National Cinema Day , cheap tickets , cinema attendance , UK , blockbusters', NULL, 75, 9, NULL, 'Left-wing', '2024-08-31 07:18:29', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(340, 3, 'https://www.japantimes.co.jp/sports/2024/08/31/more-sports/antonelli-mercedes/', NULL, 'Kimi Antonelli Joins Mercedes as Hamilton Moves to Ferrari', 'Mercedes has signed 18-year-old Kimi Antonelli to replace Lewis Hamilton, who will leave the team to join Ferrari after dominating the sport with six championship titles. Antonelli, who has won two races in Formula Two this year, will partner George Russell in 2025.', 'Kimi Antonelli\'s rise to Formula One demonstrates the team’s commitment to bringing fresh talent into the sport. His experience in Formula Two positions him well to take on the challenges ahead alongside George Russell.', NULL, NULL, NULL, NULL, 'Kimi Antonelli , Lewis Hamilton , George Russell', 'Kimi Antonelli , Lewis Hamilton , Mercedes , Ferrari , Formula Two , Formula One', NULL, 75, 9, NULL, 'Neutral', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(341, 1, 'https://www.japantimes.co.jp/news/2024/08/30/japan/politics/hyogo-governor-panel/', 'Japanese News Network', 'Governor Saito Admits Strict Management Style Amid Bullying Allegations', 'Hyogo Governor Motohiko Saito acknowledged his reputation as a \'strict boss\' during his testimony to an investigative panel. While he did not directly admit to accusations of workplace bullying following the deaths of two prefectural officials, Saito\'s comments have raised concerns about his leadership style.', 'Governor Saito\'s acknowledgment of his strict management style reflects a broader discussion about workplace culture in government offices. It raises essential questions about the balance between authority and support in administrative leadership.', NULL, NULL, 'Japan', 'Hyogo', 'Motohiko Saito', 'workplace bullying , strict boss , Hyogo Prefecture , investigative panel', NULL, 75, 7, NULL, 'government-affiliated', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(342, 7, 'https://www.japantimes.co.jp/news/2024/08/30/japan/society/food-price-hikes/', 'Teikoku Databank', 'Japanese Food Prices Surge: Over 1,000 Products to Increase in September', 'A recent survey by Teikoku Databank reveals that 1,392 products from 195 major Japanese food manufacturers will see price increases in September, marking the first instance of over 1,000 price hikes since April. While this number is down 35.2% from last year, manufacturers face pressure from rising raw material costs and yen depreciation, making price raising a challenging decision.', NULL, NULL, NULL, 'Japan', 'Asia', 'products_increase , manufacturers , decrease_yearly', 'price increases , Teikoku Databank , Japanese food manufacturers , raw material costs , yen weakness', NULL, 75, 9, NULL, 'neutral', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(343, 7, 'https://www.japantimes.co.jp/business/2024/08/31/markets/yen-pressure-earnings-reports/', 'Reuters', 'Yen Strengthens 3.5% Against Dollar Amid Central Bank Policy Signals', 'The yen has gained 3.5% against the dollar since the end of July, influenced by signals from the Bank of Japan and the Federal Reserve regarding monetary policy. Some analysts predict the yen may reach 135 by year-end, surpassing expectations from large exporters.', 'The recent performance of the yen reflects significant shifts in monetary policy from key central banks. It will be interesting to observe how this impacts Japan\'s exporters and broader economic conditions moving forward.', 'The strengthening of the yen highlights the inequities in the global economy, as major corporations like Toyota and Honda may prioritize profits over the struggles of the average Japanese worker. We need policies that protect workers instead of supporting big businesses.', 'This sudden rise in the yen amidst central bank maneuvers could pose a threat to Japan\'s economic sovereignty. We must prioritize national interests and ensure that our currency remains competitive to protect local jobs.', 'Japan', NULL, '3.5% , 135 , 144.77', 'Yen , Dollar , Bank of Japan , Federal Reserve , Monetary Policy , Exports', NULL, 75, 8, NULL, 'Neutral', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(344, 7, 'https://www.japantimes.co.jp/business/2024/08/31/companies/couche-tard-pension-fund/', NULL, 'Alimentation Couche-Tard Seeks Support from Canadian Pension Funds for 7-Eleven Acquisition', 'Alimentation Couche-Tard is exploring financing options for its acquisition of Seven & i Holdings Co., the parent company of 7-Eleven, by reaching out to major Canadian pension funds including CPP Investments and Ontario Teachers’ Pension Plan for equity backing.', 'The move by Alimentation Couche-Tard to engage with Canadian pension funds highlights the company\'s strategic approach to securing financial backing for major acquisitions. This reflects a growing trend where large retailers are relying on institutional investors to fuel expansion.', 'This seemingly opportunistic approach by Couche-Tard reinforces how even essential retailers are becoming beholden to financial elites. The reliance on pension funds could indicate a worrying trend where profit motives overshadow community needs and employee welfare.', 'Alimentation Couche-Tard’s efforts to engage Canadian pension funds for its acquisition plans demonstrate a robust business strategy. It reflects the true essence of capitalism, where businesses seek out investments to grow and enhance shareholder value.', NULL, NULL, 'Alimentation Couche-Tard , Seven & i Holdings Co. , Canada Pension Plan Investment Board , Ontario Teachers’ Pension Plan , Caisse de Depot et Placement du Quebec', 'Alimentation Couche-Tard , Seven & i Holdings Co. , 7-Eleven , Canadian pension funds , acquisition , equity', NULL, 75, 8, NULL, 'Neutral', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(345, 1, 'https://www.japantimes.co.jp/news/2024/08/31/world/politics/trump-abortion-ivf-fallout/', NULL, 'Trump Faces Conservative Backlash Over In Vitro Fertilization Proposal', 'Former President Donald Trump is facing criticism from conservatives following his announcement that he would support free in vitro fertilization in a potential second term. This stance has created tension as Trump also criticized Florida\'s six-week abortion ban, suggesting it is too restrictive.', NULL, NULL, NULL, NULL, NULL, 'Donald Trump', 'in vitro fertilization , abortion ban , reproductive rights , conservatives , Florida', NULL, 85, 8, NULL, 'Right-wing', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(346, 1, 'https://www.japantimes.co.jp/news/2024/08/31/world/politics/russia-putin-mongolia-arrest/', NULL, 'Putin\'s Upcoming Mongolia Visit Amid ICC Arrest Warrant', 'President Vladimir Putin will make his first trip to a member of the International Criminal Court (ICC), Mongolia, on Tuesday, despite an ICC-issued warrant for his arrest related to the illegal deportation of Ukrainian children. The Kremlin expressed confidence that Mongolia would not detain him during his visit.', NULL, NULL, NULL, NULL, NULL, 'Vladimir Putin , Dmitry Peskov', 'Putin , Mongolia , ICC , arrest warrant , Ukrainian children', NULL, 85, 8, NULL, 'government-affiliated', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(347, 1, 'https://www.japantimes.co.jp/business/2024/08/31/tech/brazil-musk-x-ban/', NULL, 'Brazil Bans X Following Elon Musk\'s Defiance in Fake News Battle', 'Brazil\'s Supreme Court has banned the social media platform X, previously known as Twitter, following a prolonged conflict with CEO Elon Musk, who failed to appoint a legal representative in Brazil. Justice Alexandre de Moraes reasons the ban on X\'s contribution to the spread of fake news and hate speech, which he claims undermines the country\'s democracy.', NULL, NULL, NULL, NULL, NULL, 'Elon Musk , Justice Alexandre de Moraes', 'X , Twitter , Elon Musk , Brazil , Supreme Court , fake news , hate speech', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(348, 2, 'https://www.japantimes.co.jp/news/2024/08/31/japan/society/births-january-to-june-2024-record-low/', NULL, 'Japan\'s Birth Rate Plummets, January-June 2024 Hits Record Low', 'Japan\'s health ministry reports births in the first half of 2024 dropped 5.7% compared to last year, reaching a record low of 350,074. If the trend continues, annual births could fall below 700,000 for the first time.', 'The declining birth rate in Japan is a significant concern for the economy and society, reflecting deeper issues such as changing societal values and economic instability. It is crucial for policymakers to address these underlying factors.', NULL, NULL, NULL, NULL, 'Births , Percentage Decline', 'birth rate , Japan , record low , decline , health ministry', NULL, 90, 9, NULL, 'Neutral', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(349, 1, 'https://www.japantimes.co.jp/news/2024/08/31/japan/politics/kishida-un-general-assembly-skip-speech/', NULL, 'Kishida to Skip UN Debate Speech for Leadership Election', 'Outgoing Prime Minister Fumio Kishida of Japan will skip delivering a speech at the U.N. General Assembly, making him the first Japanese prime minister to do so since 2007. Kishida intends to return to Japan before the general debate on September 27, coinciding with the leadership election of his ruling Liberal Democratic Party.', NULL, NULL, NULL, NULL, NULL, 'Fumio Kishida', 'UN General Assembly , Kishida , speech , Japan , leadership election', NULL, 75, 7, NULL, 'neutral', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(350, 1, 'https://www.japantimes.co.jp/news/2024/08/31/asia-pacific/politics/kamala-harris-donald-trump-china-fight/', 'The Associated Press', 'Harris Takes a Measured Approach to China Amid Growing Tensions', 'U.S. Vice President Kamala Harris is advocating for a balanced strategy toward China, emphasizing the importance of responsible competition versus outright confrontation, while most Americans are calling for stricter measures. Her approach contrasts with former President Donald Trump\'s more aggressive stance.', 'Harris\'s strategy reflects a nuanced understanding of foreign policy dynamics. While public sentiment leans toward a firmer stance on China, the potential risks of drastic measures could destabilize important economic relationships.', NULL, NULL, 'United States', 'North America', 'Kamala Harris , Donald Trump , Phil Gordon', 'China , Harris , foreign policy , tariffs , competition', NULL, 75, 7, NULL, 'left-wing', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(351, 1, 'https://www.japantimes.co.jp/news/2024/08/31/asia-pacific/politics/china-taiwan-pacific-leaders-statement/', NULL, 'Pacific Leaders Reissue Declaration After Chinese Pressure', 'After China criticized a previous version of the Pacific leaders\' declaration for including Taiwan, a new version was issued with references to Taiwan removed. This follows five days of discussions in Tonga.', NULL, NULL, NULL, NULL, NULL, 'Pacific leaders , Chinese diplomats', 'Pacific leaders , Taiwan , China , declaration , Nuku\'alofa , Tonga', NULL, 70, 8, NULL, 'left-wing', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(352, 2, 'https://www.japantimes.co.jp/news/2024/08/31/japan/typhoon-shanshan-saturday/', 'NHK', 'Tropical Storm Shanshan Brings Devastating Rain to Central Japan', 'Tropical Storm Shanshan is moving slowly off Wakayama Prefecture, causing widespread torrential rain across much of Japan. The storm has resulted in the deaths of six people, one missing, and 131 injuries while over 1.4 million people are under non-mandatory evacuation orders.', 'The impact of Tropical Storm Shanshan highlights the need for enhanced disaster preparedness and response systems in Japan. The current situation calls for immediate assistance to affected regions and a thorough assessment of the damages.', NULL, NULL, 'Japan', 'Wakayama Prefecture', '6 dead , 1 missing , 131 injured , 1,407,884 people under evacuation orders', 'Tropical Storm , Shanshan , Wakayama , rain , Japan , landslides , flooding , evacuations', NULL, 85, 9, NULL, 'government-affiliated', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(353, 3, 'https://www.japantimes.co.jp/sports/2024/08/31/tennis/djokovic-us-open-early-exit/', 'ESPN', 'Djokovic\'s Shocking Exit at the U.S. Open Raises Future Concerns', 'Defending champion Novak Djokovic suffered a surprising defeat to Alexei Popyrin in the third round of the U.S. Open, marking his earliest exit in 18 years. The 37-year-old experienced uncharacteristic errors and admitted to playing \'his worst tennis ever\', raising questions about his future in the sport.', 'Djokovic\'s recent performance at the U.S. Open highlights the challenges faced by even the most successful athletes as they age. The high number of unforced errors indicates a potential decline in form, but fans should remember that such fluctuations are common in sports.', 'Djokovic\'s defeat could symbolize the decay of the elite sports hierarchy, showcasing that the system heavily favors younger talent while the veterans struggle against the relentless pace of modern athletics. It\'s time for a reevaluation of how we celebrate sports achievements.', 'This early exit for Djokovic serves as a wake-up call for traditionalists who value experience and legacy in the sport. It’s a sign that maybe the game is moving on and prioritizing a new generation, leaving the legends behind.', 'USA', NULL, 'Novak Djokovic , Alexei Popyrin', 'U.S. Open , Djokovic , tennis , Popyrin , Grand Slam', NULL, 75, 9, NULL, 'Left-wing', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(354, 2, 'https://www.japantimes.co.jp/sports/2024/08/31/more-sports/johnny-gaudreau-killed-bicycle-crash/', NULL, 'Tragic Death of NHL Star Johnny Gaudreau and His Brother in Car Accident', 'Johnny Gaudreau, a 31-year-old left-winger for the Columbus Blue Jackets and former Calgary Flames player, died in a tragic bicycle accident in New Jersey, along with his brother Matthew. The family was in town for a wedding. A statement from their uncle highlighted the profound loss felt by their family and loved ones.', NULL, NULL, NULL, NULL, NULL, 'Johnny Gaudreau , Matthew Gaudreau , Jim Gaudreau', 'NHL , Johnny Gaudreau , Matthew Gaudreau , accident , bicycle , New Jersey', NULL, 85, 10, NULL, 'Neutral', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(355, 3, 'https://www.japantimes.co.jp/sports/2024/08/31/baseball/mlb/shohei-ohtani-43-homers/', 'ESPN', 'Ohtani Steals 43rd Base, Hits 43rd Homer in Dodgers\' Thriller', 'In a thrilling game on Friday night, Shohei Ohtani contributed significantly to the Los Angeles Dodgers\' 10-9 victory over the Arizona Diamondbacks, hitting his 43rd home run and stealing his 43rd base, aiming to join the exclusive 50-50 club in MLB history.', NULL, NULL, NULL, 'United States', 'Phoenix', 'Shohei Ohtani , Will Smith , Freddie Freeman', 'Ohtani , Dodgers , Diamondbacks , home run , steal , 50-50 club', NULL, 75, 8, NULL, 'Neutral', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(356, 1, 'https://www.japantimes.co.jp/news/2024/08/31/japan/china-warship-japan-territorial-waters/', 'Japan Times', 'Chinese Navy Vessel Enters Japanese Waters Amid Tensions', 'A Chinese Navy survey ship entered Japanese territorial waters near Kagoshima on Saturday, just days after Japan protested a Chinese military aircraft\'s incursion into its airspace. This marks the 13th such entry of a Chinese naval vessel into Japanese waters since last September.', NULL, NULL, NULL, 'Japan', 'Asia', 'Chinese Navy , Japanese Defense Ministry', 'Chinese vessel , Japanese waters , Kagoshima , military aircraft , territorial waters', NULL, 75, 9, NULL, 'neutral', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(357, 2, 'https://www.japantimes.co.jp/news/2024/08/31/japan/china-panda-pair-ueno-zoo/', 'NHK', 'Aging Pandas Ri Ri and Shin Shin to Return to China for Medical Care', 'The Tokyo zoo pandas Ri Ri and Shin Shin, aged 19, will return to China next month for medical care due to deteriorating health, including symptoms of high blood pressure. They were originally scheduled to stay in Japan until February 2026.', NULL, NULL, NULL, 'Japan', 'Tokyo', 'Ri Ri , Shin Shin , Yuriko Koike', 'Pandas , Medical Care , Return to China , Ueno Zoo , High Blood Pressure', NULL, 75, 8, NULL, 'government-affiliated', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(358, 7, 'https://www.japantimes.co.jp/news/2024/08/31/japan/insurer-info-leaks/', 'Japan Times', 'Massive Data Leak at Major Japanese Insurers Involves Unauthorized Customer Information', 'A significant data leak involving over 2.5 million sets of customer information has occurred at four major Japanese nonlife insurers. Employees on loan to insurance agents were implicated in approximately 240,000 cases of inappropriate access to rival companies\' customer data.', NULL, NULL, NULL, 'Japan', 'Asia', '2.5 million sets of customer information , 240,000 cases , Sompo Japan Insurance , Tokio Marine and Nichido Fire Insurance , Mitsui Sumitomo Insurance , Aioi Nissay Dowa Insurance', 'data leak , customer information , insurance companies , Japanese nonlife insurers , employee misconduct', NULL, 85, 7, NULL, 'neutral', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(359, 1, 'https://www.japantimes.co.jp/news/2024/08/31/asia-pacific/politics/taiwan-ko-wen-je-arrest/', NULL, 'Ko Wen-je Taken into Custody over Property Development Scandal', 'Ko Wen-je, former leader of Taiwan\'s opposition party, was arrested following 19 hours of interrogation related to a property development scandal from his tenure as Taipei mayor. Concerns about collusion prompted his detention after he refused to continue questioning. Ko is seeking a judicial review of the arrest decision.', NULL, NULL, NULL, NULL, NULL, 'Ko Wen-je', 'arrest , interrogation , property development scandal , Taipei , Collusion', NULL, 85, 9, NULL, 'neutral', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(360, 1, 'https://www.japantimes.co.jp/news/2024/08/31/world/zelenskyy-ukraine-east/', NULL, 'Zelenskyy\'s Approval Plummets Amid Ongoing Conflict in Ukraine', 'Ukrainian President Volodymyr Zelenskyy\'s approval rating has dropped from nearly 90% to 55% as the conflict with Russian forces intensifies, leaving citizens like Olena Semykina disappointed with unmet promises of peace.', NULL, NULL, NULL, NULL, NULL, 'Volodymyr Zelenskyy , Olena Semykina', 'Ukraine , Zelenskyy , approval rating , conflict , Russian forces', NULL, 85, 7, NULL, 'left-wing', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(361, 1, 'https://www.japantimes.co.jp/news/2024/08/31/japan/politics/hyogo-governor-no-confidence-motion/', NULL, 'No-Confidence Motion Planned Against Hyogo Governor Saito', 'A group of assembly members in Hyogo Prefecture plans to submit a no-confidence motion against Governor Motohiko Saito due to allegations of power harassment. The motion aims to gather support from three-fourths of assembly members in September, reflecting growing distrust among residents.', NULL, NULL, NULL, NULL, NULL, 'Motohiko Saito , Shiho Mukaiyama', 'no-confidence motion , Governor Saito , power harassment , Hyogo Assembly , Constitutional Democratic Party of Japan', NULL, 75, 7, NULL, 'Left-wing', '2024-08-31 07:32:17', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(362, 1, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381613.html', 'Reuters-Yonhap', 'Ukrainian Air Force Commander Dismissed After F-16 Crash Amid Ongoing Conflict', 'Ukrainian President Volodymyr Zelenskyy dismissed the commander of the air force, Lt. Gen. Mykola Oleshchuk, four days after an F-16 fighter jet crashed, leading to the pilot\'s death. The event coincided with Russia\'s attacks in Ukraine, and Zelenskyy emphasized the need for stronger military command. Meanwhile, a Russian strike in Kharkiv resulted in civilian casualties, while Ukraine reportedly targeted Belgorod.', 'The dismissal of Lt. Gen. Oleshchuk raises questions about accountability and the complexities of military leadership during wartime. Investigations into the crash may also shed light on the effectiveness of Ukraine\'s air defense systems and overall military strategy.', 'The situation reveals the pitfalls of relying on Western militarization in Ukraine. The F-16 crash is symptomatic of the broader failures of a militarized strategy that endangers civilians and fails to achieve peace through armed conflict.', 'Ukraine\'s leadership is failing its military and people by blaming external factors rather than addressing the systemic weaknesses within its armed forces. The focus should be on strengthening Ukraine\'s sovereignty without becoming overly dependent on foreign military support.', 'Ukraine', 'Europe', 'Volodymyr Zelenskyy , Mykola Oleshchuk , Anatolii Kryvonozhko , Mariana Bezuhla , Oleh Syniehubov , Vyacheslav Gladkov', 'F-16 , Ukrainian Air Force , Zelenskyy , Russia , crash , military command , Kharkiv , Belgorod', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:41:05', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(363, 7, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381599.html', 'AP', 'Eurozone Inflation Drops to 2.2%, ECB Poised for Rate Cuts', 'Inflation in the eurozone fell to 2.2% in August, allowing the European Central Bank (ECB) to consider interest rate cuts to foster economic growth. The decline in energy prices contributed to this drop, bringing inflation closer to the ECB\'s target of 2%. Economists predict a rate cut at the upcoming ECB meeting as concerns over maintaining economic stability grow.', NULL, NULL, NULL, 'Germany', 'Europe', '2.2% , 2.6% , 3.75% , 5.25% - 5.5% , 10.6% , 0.3%', 'inflation , ECB , interest rates , eurozone , economic growth , energy prices , Eurostat', NULL, 85, 9, NULL, 'government-affiliated', '2024-08-31 07:41:05', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(364, 2, 'https://www.koreatimes.co.kr/www/world/2024/08/683_381602.html', 'AP', 'Typhoon Shanshan Causes Widespread Flooding Across Japan', 'Typhoon Shanshan has resulted in significant flooding in various regions of Japan, particularly around Tokyo and Kanagawa. Heavy rains have impeded transportation, led to property damage, and caused injuries, with ongoing warnings for further rainfall and potential landslides.', NULL, NULL, NULL, 'Japan', 'Tokyo', '80 injured , 2 missing , 3 killed', 'Typhoon Shanshan , flooding , Tokyo , Kanagawa , heavy rain , landslides', NULL, 85, 9, NULL, 'neutral', '2024-08-31 07:41:05', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(365, 2, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381603.html', 'Associated Press', 'Inmate John Manard, Notorious for Dog Crate Escape, Dies in Prison', 'John Manard, an inmate known for his escape hidden in a dog crate, died at the La Palma Correctional Facility in Arizona while serving a life sentence for murder. His death comes after a turbulent life including a prison escape enabled by a romantic relationship, which became a book and movie.', 'The life of John Manard, from his tragic start to a dramatic escape and later demise, highlights the complexities of the prison system and the relationships formed within it.', 'While tragic, the narrative of John Manard illustrates the failures of a punitive prison system that often prioritizes punishment over rehabilitation and fails to address the humanity of inmates.', 'Manard\'s escape showcases a shocking disregard for the law by both an inmate and a civilian. Such actions undermine the integrity of our justice system and highlight the dangers of leniency in prison programs.', 'USA', 'Kansas', 'John Manard , Toby Young', 'escape , dog crate , inmate , death , relationship , prison', NULL, 75, 8, NULL, 'neutral', '2024-08-31 07:41:05', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(366, 1, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381609.html', 'AFP', 'Kamala Harris Shapes Campaign Away from Race and Gender', 'Vice President Kamala Harris is embarking on her presidential campaign without emphasizing her race and gender, focusing instead on bread-and-butter issues like the economy. Critics claim her cautious strategy is to avoid the pitfalls that previously hindered candidates like Hillary Clinton.', NULL, NULL, NULL, 'United States', 'Georgia', 'Kamala Harris , Donald Trump , Joe Biden , Nancy Pelosi , Tim Walz , Hillary Clinton , Jesse J. Holland , Zeeshan Aleem', 'Kamala Harris , presidential candidate , race , gender , campaign strategy , Donald Trump , Hillary Clinton , voter priorities', NULL, 75, 7, NULL, 'left-wing', '2024-08-31 07:41:05', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(367, 7, 'https://www.koreatimes.co.kr/www/world/2024/08/501_381610.html', NULL, 'Goldman Sachs to Lay Off Hundreds in Performance Review', 'Goldman Sachs is planning to cut a few hundred jobs, reinstating performance-related layoffs as part of its annual review process. The bank, which has seen an improved operating environment, aims to have a larger workforce in 2024 compared to 2023. While reports suggest significant layoffs, Goldman disputes these figures.', NULL, NULL, NULL, NULL, NULL, '44,300 , 1% to 5% , 1300 , 3% to 4%', 'Goldman Sachs , layoffs , performance review , workforce , market conditions', NULL, 75, 9, NULL, 'left-wing', '2024-08-31 07:41:05', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(368, 1, 'https://www.newsbreak.com/knx-1070-news-radio-560915/3579827342890-pch-speed-camera-bill-headed-for-gov-newsom-s-desk', NULL, 'California Senate Approves Speed Cameras on Pacific Coast Highway After Tragic Accident', 'In response to a tragic accident that killed four Pepperdine University students, California Senate Bill 1297, which proposes the installation of speed cameras along a hazardous stretch of Pacific Coast Highway, has passed the legislature and is set for the governor\'s approval.', NULL, NULL, NULL, NULL, NULL, 'Sen. Ben Allen , Assemblyman Jacqui Irwin , Assemblywoman Laura Friedman , Sen. Henry Stern , Malibu Mayor Doug Stewart', 'Speed Cameras , Pacific Coast Highway , SB 1297 , Traffic Safety , Pepperdine University , Reckless Driving , Legislation', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(369, 3, 'https://www.newsbreak.com/the-us-sun-513995/3578915507418-steph-curry-to-join-lebron-james-and-kevin-durant-in-exclusive-nba-club-after-signing-massive-62-6m-deal-with-warriors', NULL, 'Steph Curry Joins Exclusive Half-Billion Earnings Club with New Warriors Deal', 'NBA superstar Steph Curry has officially surpassed $500 million in career earnings after signing a one-year extension with the Golden State Warriors, making him the third player in NBA history to reach this milestone. His new deal will see him earn $62.6 million by the end of the 2026-27 season.', 'Steph Curry\'s accomplishment of surpassing $500 million in career earnings is a testament to his unparalleled talent and consistent performance in the NBA. It reflects the increasing financial stature of professional basketball.', 'While Curry\'s financial success is remarkable, it highlights the growing disparity in income within professional sports. Such exorbitant salaries are not reflective of the contributions made by lower-tier players and the socio-economic struggles many athletes face.', 'Curry\'s astronomical earnings serve as a reminder of the incredible wealth generated in sports today. This should motivate young athletes to pursue excellence and profitability while reflecting on their own financial decisions.', NULL, NULL, 'Steph Curry , LeBron James , Kevin Durant', 'Steph Curry , NBA , Golden State Warriors , career earnings , contract extension', NULL, 85, 8, NULL, 'neutral', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(370, 3, 'https://www.newsbreak.com/athlon-sports-1600280/3578648809388-brandon-aiyuk-s-agent-calls-out-espn-s-adam-schefter-for-false-report', NULL, '49ers Receiver Brandon Aiyuk Signs $120 Million Contract Extension', 'Brandon Aiyuk has ended his hold-in and agreed to a four-year, $120 million contract extension with the San Francisco 49ers, tying him with Tyreek Hill as the fifth-highest paid receiver in the NFL. A disagreement about the contract terms was publicly mentioned by ESPN\'s Adam Schefter, leading to a clarification from Aiyuk\'s agent.', 'The contract extension for Brandon Aiyuk reflects the 49ers\' commitment to maintaining a strong roster while recognizing the player\'s value in the market. This deal also indicates the importance of communication and negotiation in professional sports.', NULL, NULL, NULL, NULL, 'Brandon Aiyuk , Tyreek Hill , John Lynch , Ryan Williams', 'Brandon Aiyuk , $120 Million Contract , San Francisco 49ers , Hold-in , NFL', 8, 85, 9, 'ESPN is generally regarded as a reputable sports news source, although it can occasionally exhibit left-leaning biases in its commentary.', 'Left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(371, 2, 'https://www.newsbreak.com/straight-arrow-news-sancom-1774217/3578337059724-parents-in-california-on-high-alert-after-migrants-try-to-board-2-school-buses', 'Straight Arrow News', 'Parents on Alert as Migrants Attempt to Board School Buses in California', 'A community near San Diego, California, is on high alert following two incidents this week where migrants attempted to board school buses. Witnesses reported that around 20 migrants tried to enter a bus carrying elementary students while another group of men attempted to stop a bus with middle schoolers. The San Diego Sheriff\'s Office is investigating if any criminal acts occurred.', 'These incidents highlight the growing tensions surrounding migration issues in the United States, particularly as they intersect with children\'s safety and community concerns. It\'s important for authorities to ensure the safety of students without inflaming the situation further.', 'This situation is a clear example of how misinformation and fear are weaponized against vulnerable populations. Instead of scrutinizing migrants, attention should be redirected towards addressing the systemic issues that drive migration.', 'These events confirm the fears of many citizens regarding uncontrolled immigration. Parents have every right to protect their children, and it\'s time for the government to take strong action to ensure our schools are safe and secure.', 'United States', 'California', 'Nicole Cardinale , San Diego Sheriff\'s Office', 'migrants , school buses , California , San Diego , safety', NULL, 75, 8, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(372, 1, 'https://www.newsbreak.com/kget-1589923/3578833466629-state-lawmakers-consider-offering-home-loans-regardless-of-citizenship', NULL, 'California Bill to Assist Undocumented Migrants with Home Loans Awaits Newsom\'s Signature', 'California\'s Assembly Bill 1840, aimed at providing home loan assistance to undocumented migrants, has passed both legislative houses and is awaiting Governor Newsom\'s approval. The bill allows eligible applicants to receive up to $150,000 in down payment assistance, igniting a national debate on the allocation of state funds based on immigration status.', 'The passage of Assembly Bill 1840 marks a significant step in California\'s housing policy, addressing the needs of undocumented migrants in a state where they contribute substantially to the economy. The debate over state-funded assistance based on immigration status reflects broader national discussions on immigration reform.', 'This bill represents a long-overdue recognition of the contributions of undocumented immigrants to our society. Providing housing assistance is not only a moral imperative but also a necessary step towards inclusive economic growth. Undocumented workers keep our economy running, and they deserve support.', 'This bill is a betrayal of American taxpayers who work hard for their homes. Why should our tax dollars go to assist those who are here illegally? Prioritizing assistance for undocumented migrants over citizens is unfair and an abuse of state resources.', NULL, NULL, 'Chris Micheli , Marili Arce , Christopher Diaz-Mendez , Donnie Phelps', 'California , Assembly Bill 1840 , undocumented migrants , housing assistance , Governor Newsom , taxpayer dollars', NULL, 75, 8, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(373, 2, 'https://www.newsbreak.com/newsnation-2045693/3578973036466-california-authorities-have-seized-8-8m-fentanyl-pills-in-2024', NULL, 'California Seizes Record Fentanyl Amounts Amid Smuggling Crackdown', 'California authorities have reported a significant increase in fentanyl seizures, with 8.8 million pills and 4,638 pounds of powder confiscated in 2024. Governor Gavin Newsom stated that the state’s efforts aim to combat the opioid epidemic by targeting smuggling roots, primarily at the U.S.-Mexico border.', 'The increase in fentanyl seizures is a positive indicator of law enforcement\'s intensified efforts to combat drug smuggling. However, it raises questions about the underlying causes of high fentanyl supply and demand. A comprehensive approach is required.', NULL, NULL, NULL, NULL, '8.8 million pills , 4,638 pounds of fentanyl powder , $40 million worth of fentanyl', 'fentanyl , Governor Gavin Newsom , California National Guard , drug smuggling , opioid epidemic', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(374, 2, 'https://www.newsbreak.com/kron4-news-1589914/3579942624102-suspects-arrested-a-combined-30-times-nabbed-again-for-theft-at-kohl-s-campbell-pd', NULL, 'Two Suspects Arrested for Theft at Kohl\'s Store', 'Campbell Police arrested two suspects, KC Vernon Pries and Mary Jo Devera, for theft at a Kohl\'s store in Campbell, California, after the pair actively removed security sensors from clothing and attempted to escape in a stolen vehicle. Pries was found hiding on a rooftop, while Devera was apprehended nearby.', 'The incident highlights ongoing issues with retail theft and criminal behavior in the area, prompting discussions about security measures and law enforcement effectiveness.', 'This case reflects the socio-economic struggles faced by many individuals, where desperation leads to crime, suggesting a need for more community support and social programs rather than harsh penalties.', 'This arrest underscores the growing crime problem in our communities, calling for stricter law enforcement and a return to traditional values to protect our neighborhoods.', NULL, NULL, 'KC Vernon Pries , Mary Jo Devera', 'theft , Kohl\'s , arrest , retail theft , Campbell Police', NULL, 75, 8, NULL, 'Neutral', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(375, 1, 'https://www.newsbreak.com/thewrap-1608687/3579107326863-california-journalists-slam-backroom-deal-after-big-tech-upends-agreement-meant-to-bolster-local-news', NULL, 'California Journalists Critique $250 Million Deal with Google Over Local News', 'California journalists are criticizing a recent $250 million agreement intended to enhance funding for local news, claiming it has devolved into a \'backroom deal\' primarily benefiting Big Tech, specifically Google, rather than journalists themselves. The legislation is expected to yield only $15 million in its first year, a fraction of what was initially discussed.', NULL, NULL, NULL, 'USA', 'California', 'Matt Pearce , Patrick Soon-Shiong , Alicia Ramirez , Gavin Newsom', 'California , local news , Google , backroom deal , funding , journalism , AI accelerator', NULL, 85, 7, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(376, 2, 'https://www.newsbreak.com/the-us-sun-513995/3579189516201-mazda-drivers-file-lawsuit-over-engine-defect-affecting-thousands-of-cars-brand-company-s-safety-vows-untrue', 'Top Class Actions', 'Mazda Faces Class Action Lawsuit Over Engine Defect', 'An American driver, Matt Cauller, has filed a class action lawsuit against Mazda in California, claiming the automaker sold vehicles with a dangerous engine defect without proper disclosure. The lawsuit alleges that Mazda’s SKYACTIV-G 2.5T engines, used in several models, can leak coolant and cause catastrophic engine failures, violating consumer rights and trade practices.', 'The class action lawsuit against Mazda highlights significant concerns about vehicle safety and manufacturer transparency. If proven, this case could set a precedent for accountability in the automotive industry.', 'This situation exemplifies the need for stronger regulations on corporations in the auto industry. Companies like Mazda must be held accountable for prioritizing profit over consumer safety, and the government should step in to protect the public.', 'While the lawsuit may have merit, it also raises questions about personal responsibility. Consumers should be more vigilant in researching products before purchase, rather than relying solely on manufacturers to disclose potential defects.', 'USA', 'California', 'Matt Cauller , Mazda Motor of America Inc.', 'class action lawsuit , Mazda , engine defect , SKYACTIV-G 2.5T , consumer rights', NULL, 75, 9, NULL, 'neutral', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(377, 2, 'https://www.newsbreak.com/cbs-sacramento-500226/3578782162696-do-businesses-have-to-let-you-use-their-bathroom-call-kurtis', 'Call Kurtis', 'California\'s Restroom Access Act: New Rights for Citizens', 'Opera singer Teddy Siegel faced denial of restroom access in New York City, prompting her to create a social media resource. Meanwhile, California\'s Restroom Access Act mandates that businesses allow access to restroom facilities for individuals with certain medical conditions.', 'The issue of restroom access reflects larger societal challenges regarding public health and individual rights. The Restroom Access Act in California is a significant step toward protecting those with medical conditions, yet it is crucial for businesses to understand the law to avoid unnecessary conflicts.', NULL, NULL, 'USA', 'California', 'Teddy Siegel', 'restroom access , California law , medical conditions , Restroom Access Act', NULL, 75, 8, NULL, 'center-left', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(378, 2, 'https://www.newsbreak.com/the-us-sun-513995/3579279908007-cheetos-popular-snacks-to-be-banned-as-officials-take-aim-at-dangerous-ingredients-despite-serious-doubts-about-law', NULL, 'California Moves to Ban Popular Food Dyes in Schools', 'California lawmakers have sent a bill to Governor Gavin Newsom aiming to ban schools from selling or distributing snacks containing six synthetic food dyes, including those in popular snacks like Cheetos and Doritos. If passed, the law would take effect in 2028, applying solely to public and charter schools within the state.', 'The proposed ban on synthetic food dyes in California schools highlights ongoing concerns regarding food safety and children\'s health. While some studies suggest potential risks, the discussion around the necessity and effectiveness of such measures remains complex and nuanced.', 'This bill is long overdue! The health of our children is paramount, and synthetic food dyes are just another example of profit over safety in the food industry. We need to be proactive in removing harmful substances from our children\'s diets, not waiting for studies to tell us what we already know.', 'While the intentions behind this bill may be good, it is a classic case of government overreach. Parents should have the choice to determine what their children eat. Additionally, efforts to ban dyes may just lead to increased costs for schools and unnecessary complications.', NULL, NULL, 'Governor Gavin Newsom , Assemblymember Jesse Gabriel', 'California , Food Dyes , Schools , Ban , Cheetos , Synthetic', NULL, 75, 9, NULL, 'Government-affiliated', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(379, 2, 'https://www.newsbreak.com/laist-1599686/3579290749520-health-insurers-hit-with-california-s-largest-ever-penalty-over-gender-affirming-care-denials', NULL, 'California Insurers Fined for Denying Gender-Affirming Care', 'California health insurers Blue Cross of California Partnership Plan and Anthem Blue Cross face a combined $850,000 fine for illegally denying coverage for gender-affirming care, compelling them to revise patient treatment practices. Over 150 rejected cases are to be reviewed, with a requirement to hire a dedicated case manager for claims related to gender dysphoria.', 'This ruling highlights the need for transparency and adherence to state laws regarding healthcare coverage. The review of denied cases underscores the importance of insurer accountability in ensuring equitable treatment for all patients, regardless of gender identity.', 'These fines are a necessary step in the fight against systemic discrimination in healthcare. Health insurers must be held accountable for their biases against the LGBTQ+ community, and more proactive measures should be taken to ensure all individuals receive the care they rightfully need without stigma.', 'It is concerning that the state government is intervening in how private companies manage healthcare. Rather than imposing fines, the focus should be on promoting personal responsibility for healthcare decisions and allowing insurers more flexibility in their policies.', NULL, NULL, 'Mike Bowman', 'California , health insurers , fines , gender-affirming care , denied coverage , gender dysphoria , LGBTQ+ , insurance law', NULL, 85, 7, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(380, 1, 'https://www.newsbreak.com/the-sacramento-bee-1592486/3579396767187-california-treasurer-fiona-ma-claims-vindication-but-taxpayers-are-on-the-hook-for-350-000', 'The Bee', 'California Treasurer Fiona Ma Closes Harassment Case at Taxpayer\'s Expense', 'California State Treasurer Fiona Ma, who is running for lieutenant governor in 2026, has closed a harassment case against her with State taxpayers footing the $350,000 settlement, despite her claim of vindication. Judith Blackwell, the complainant, dropped her allegations. Ma and her attorney criticized the resolution, emphasizing that they sought a trial for a definitive outcome.', 'The resolution of this harassment case brings to light the complexities often surrounding legal disputes involving public figures and taxpayers. While Treasurer Ma considers herself vindicated, the financial burden on taxpayers raises questions about accountability and the influence of public office.', NULL, NULL, 'United States', 'California', 'Fiona Ma , Judith Blackwell , Ognian Gavrilov , Waukeen McCoy', 'California Treasurer , Harassment Case , Settlement , Taxpayers , Vindication , Public Officials', NULL, 80, 7, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(381, 1, 'https://www.newsbreak.com/salon-512406/3579485327287-elon-musk-now-says-mail-in-ballots-are-insane-but-that-s-how-he-voted-in-california', 'NBC News', 'Elon Musk\'s Voting Record Contradicts His Stance on Mail-in Voting', 'Elon Musk has publicly criticized mail-in voting, labeling it \'insane\' and alleging it contributes to election fraud. However, records reveal that Musk voted by mail in two elections while living in California. His comments contradict the established security measures surrounding mail-in voting.', NULL, NULL, NULL, 'United States', 'California', 'Elon Musk', 'Mail-in Voting , Election Fraud , Voting Record , California , Misinformation', NULL, 75, 7, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(382, 2, 'https://www.newsbreak.com/krcb-104-9-1592428/3579516773879-cal-fire-adds-massive-military-cargo-plane-to-its-fleet', 'CapRadio', 'Cal Fire Unveils First C-130H Air Tanker to Combat Wildfires', 'Cal Fire introduced its first C-130H air tanker, the largest in its fleet, designed to enhance firefighting capabilities against wildfires in California. This aircraft can carry over 4,000 gallons of fire retardant and will be joined by six more to aid aerial firefighting efforts.', NULL, NULL, NULL, 'United States', 'California', 'Chris Jurasek , Chris Wilson', 'C-130H , Cal Fire , air tanker , wildfires , fire retardant', NULL, 85, 7, NULL, 'government-affiliated', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(383, 2, 'https://www.newsbreak.com/yourcentralvalley-com-1589714/3579575024765-coffee-pot-fire-most-growth-in-24-hours-containment-growing', NULL, 'Coffee Pot Fire Grows But Containment Progressing in Tulare County', 'The Coffee Pot Fire in Tulare County has grown by 1,311 acres in 24 hours, reaching 6,994 acres total with 3% containment. Fire officials report progress in controlling certain areas as evacuation orders are issued for affected zones.', 'The Coffee Pot Fire\'s rapid growth highlights the ongoing risks associated with wildfires in California, despite efforts from firefighting crews to contain it and ensure community safety.', NULL, NULL, NULL, NULL, '1,311 acres , 6,994 acres , 3% containment', 'Coffee Pot Fire , Tulare County , evacuation orders , Containment , California , wildfires', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(384, 2, 'https://www.newsbreak.com/abc7-560896/3579536535346-california-foster-families-at-risk-as-critical-non-profit-agencies-face-crisis', NULL, 'California Foster Care Agencies Face Insurance Crisis Amid Child Welfare Demands', 'California nonprofit foster family agencies are on the verge of shutting down due to a lack of insurance coverage, threatening the care of nearly 45,000 children in the foster care system. The current insurer for 90% of these agencies has withdrawn, leading to fears of a severe crisis in the child welfare landscape.', NULL, NULL, NULL, NULL, NULL, 'Jodi Kurata , Chanel Boutakidis , Erich Schneider , Alana Gentry', 'foster care , insurance crisis , nonprofit agencies , child welfare , California', NULL, 85, 7, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(385, 2, 'https://www.newsbreak.com/reno-gazette-journal-1590781/3579656357775-northwestern-nevada-under-fire-weather-watch-for-most-of-labor-day-weekend', 'Reno Gazette Journal', 'Fire Weather Watch Issued for Northwestern Nevada and Northeastern California', 'The National Weather Service has issued a Fire Weather Watch for much of northwestern Nevada and northeastern California, effective until noon on Monday. The advisory was prompted by expected gusty winds and low humidity during Labor Day weekend, with wind speeds forecasted between 15-25 mph and humidity dropping to 9-15%. Areas affected include Washoe, Douglas, and Storey counties, among others.', 'This advisory serves as a critical reminder of fire safety, especially during high-risk periods like Labor Day weekend. Residents in the affected areas should take precautions to minimize fire hazards.', NULL, NULL, 'USA', 'Nevada and California', 'National Weather Service', 'Fire Weather Watch , Nevada , California , Labor Day , humidity , wind', NULL, 70, 9, NULL, 'neutral', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(386, 1, 'https://www.newsbreak.com/cbs-san-francisco-500227/3579753514735-bill-allowing-greater-media-access-to-california-prisons-heads-to-newsom-s-desk', 'PIX Now', 'California Bill Enhances Media Access to Prisons', 'California\'s Senate Bill 254, aimed at improving media access and oversight in state prisons, is on its way to Gov. Gavin Newsom for approval. The bill seeks to restore greater transparency after years of limited media coverage and would allow media representatives to conduct interviews and use recording devices within prisons.', NULL, NULL, NULL, 'United States', 'California', 'Gavin Newsom , Nancy Skinner', 'SB 254 , media access , California prisons , transparency , oversight', NULL, 75, 9, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(387, 1, 'https://www.newsbreak.com/the-sacramento-bee-1592486/3579634912339-reparations-bills-face-obstacles-from-gov-gavin-newsom-in-legislature-s-final-stretch', NULL, 'California Reparations Bills Stalled Amid Legislative Tensions', 'Two bills aimed at establishing reparations for Black Californians are facing opposition and potential changes from Governor Gavin Newsom as deadlines loom in the state legislature. The bills would create a new agency and fund but are stalled in their passage due to financial concerns.', 'The current situation regarding the reparations bills highlights the complexities involved in legislative processes and the balancing act required when addressing historical injustices. While the intent to support reparative measures is present, practical financial considerations cannot be overlooked.', NULL, NULL, NULL, NULL, 'Gavin Newsom , Steven Bradford , Lori Wilson , Joe Stephenshaw', 'California , reparations , Senate Bills 1331 and 1403 , financial concerns , California American Freedmen Affairs Agency', NULL, 75, 9, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(388, 1, 'https://www.newsbreak.com/politico-560779/3579649048619-first-in-nation-attempt-to-fine-social-media-for-child-harms-collapses-in-california', 'POLITICO', 'California Bill to Regulate Social Media for Youth Fails', 'A California bill aimed at penalizing social media companies for harming young users has failed for the year. Despite initial bipartisan support and growing concerns over youth addiction and mental health, amendments weakened the legislation significantly, leading to its withdrawal. The bill’s collapse reflects ongoing challenges faced by California Democrats in regulating powerful tech companies.', NULL, NULL, NULL, 'USA', 'California', 'Josh Lowenthal , Gavin Newsom , Jennifer Siebel Newsom , Jim Steyer', 'California , social media , youth protection , legislation , Meta , mental health , addiction', NULL, 75, 7, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(389, 1, 'https://www.newsbreak.com/salon-512406/3579652930866-rnc-chair-calls-out-trump-s-election-claims-the-president-can-tell-stories', 'Fox News', 'RNC Co-Chair Whatley Cautions Against Trump\'s California Claims', 'Michael Whatley, co-chair of the Republican National Committee, addressed Donald Trump\'s controversial remarks suggesting he could have won California, asserting no evidence supports such claims. While acknowledging the importance of election security, Whatley distanced himself from Trump\'s assertions of widespread cheating.', NULL, NULL, NULL, 'USA', 'California', 'Michael Whatley , Donald Trump , Elex Michaelson', 'Michael Whatley , Donald Trump , California , election integrity , RNC', NULL, 75, 8, NULL, 'right-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(390, 2, 'https://www.newsbreak.com/ktla-1589741/3579743527442-2-california-lottery-players-are-about-to-miss-out-on-becoming-millionaires', NULL, 'Deadline Approaching for California Lottery Winners to Claim Over $2 Million in Prizes', 'Two California Lottery winners are urged to claim their respective prizes of over $2 million before their deadlines. A Mega Millions ticket worth $2,151,945 will expire on August 30, while a Powerball ticket worth $2,462,356 must be claimed by September 19. If left unclaimed, these substantial winnings will contribute to California’s public education funding, continuing a trend observed since 1985.', NULL, NULL, NULL, NULL, NULL, '$2,151,945 , $2,462,356 , March 5 , March 23 , 2019', 'California Lottery , Mega Millions , Powerball , unclaimed prizes , public education funding', NULL, 70, 8, NULL, 'Neutral', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(391, 2, 'https://www.newsbreak.com/bay-city-news-1613181/3579379228378-bcnarts-hooked-on-books-the-race-for-the-booker-is-on-and-the-bay-area-has-a-stake', 'Bay City News', '2024 Booker Prize Long List Features Strong U.S. Presence', 'The long list for the 2024 Booker Prize includes 13 novelists, six of whom are American, showcasing notable works from authors with ties to the Bay Area, including Tommy Orange and Rachel Kushner. The finalists will be announced in September, with the winner revealed in November.', NULL, NULL, NULL, 'USA', 'Bay Area', 'Tommy Orange , Rachel Kushner , Percival Everett , Richard Powers , Claire Messud , Rita Bullwinkel', 'Booker Prize , long list , novelists , American authors , Bay Area , literature , Tommy Orange , Rachel Kushner', NULL, 85, 7, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(392, 3, 'https://www.newsbreak.com/athlon-sports-1600280/3578945536488-college-football-announcer-ripped-for-criticizing-player-being-carted-off-field', NULL, 'Darius Walker Criticized for Tone-Deaf Commentary During Johnson\'s Injury', 'During a Thursday night college football game, analyst Darius Walker faced backlash for focusing on coaching tips instead of the serious injury sustained by Sacramento State\'s Michael Johnson. Johnson was injured during a kick return, prompting concerns from fans about Walker\'s insensitivity in the moment. Fortunately, Johnson was reported to be conscious and responsive.', NULL, NULL, NULL, NULL, NULL, 'Darius Walker , Michael Johnson', 'Darius Walker , Michael Johnson , injury , commentary , college football', NULL, NULL, NULL, NULL, 'Left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(393, 1, 'https://www.newsbreak.com/calmatters-512886/3579796343807-last-minute-plan-to-help-californians-with-electric-bills-fails', NULL, 'California\'s Electric Bill Relief Proposal Fails to Pass', 'California lawmakers have withdrawn a proposal aimed at providing modest relief from rising electric bills, effectively killing Assembly Bill 3121 before the legislative session ends. The bill aimed to give households a one-time credit of $30 to $70 but faced controversy over funding cuts to programs assisting low-income residents. Legislative leaders continue to seek measures to address high electric rates and clean energy requirements.', 'The withdrawal of Assembly Bill 3121 reflects the complexities involved in balancing immediate financial relief for consumers with the long-term goals of clean energy and utility support programs. It highlights the difficulty lawmakers face in executing effective energy policy in a challenging economic climate.', NULL, NULL, NULL, NULL, 'Cottie Petrie-Norris , Robert Rivas , Gavin Newsom', 'California , electric bills , Assembly Bill 3121 , utility programs , Cottie Petrie-Norris , Gavin Newsom', NULL, 75, 7, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(394, 1, 'https://www.newsbreak.com/kget-1589923/3579857571487-california-bills-to-ban-plastic-reusable-shopping-bags-move-forward', NULL, 'California Moves to Ban Recyclable Plastic Bags', 'California lawmakers have approved two bills, AB 2236 and SB 1053, to expand the state\'s existing single-use bag ban to include thicker plastic film bags. The changes aim to reduce plastic waste and promote environmental sustainability by mandating that paper bags be made from 100% recycled material. The bills await Governor Gavin Newsom\'s signature.', NULL, NULL, NULL, NULL, NULL, 'Asm. Rebecca Bauer-Kahan , State Sen. Catherine Blakespear , State Sen. Ben Allen , Governor Gavin Newsom', 'California , plastic bags , single-use bag ban , recyclable , environment , legislation , AB 2236 , SB 1053', NULL, 75, 8, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(395, 2, 'https://www.newsbreak.com/ksby-news-563656/3579837199143-expect-to-see-more-chp-officers-on-the-road-over-labor-day-weekend', NULL, 'California Highway Patrol Launches Labor Day Weekend Enforcement', 'The California Highway Patrol (CHP) begins its maximum enforcement period this Labor Day weekend to promote safe driving, with heightened patrols expected. Last year saw over 1,000 DUI arrests and 38 fatalities during the same weekend. CHP reminds the public to designate sober drivers and report impaired drivers.', NULL, NULL, NULL, NULL, NULL, 'Kris Vardas , Brent Stewart , Jordan Richards', 'California Highway Patrol , Labor Day , enforcement period , DUI arrests , traffic safety', NULL, 75, 9, NULL, 'government-affiliated', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(396, 1, 'https://www.newsbreak.com/the-sacramento-bee-1592486/3579818767522-speaker-rivas-won-t-pass-energy-affordability-package-will-there-be-a-special-session', 'Los Angeles Times', 'California Assembly Declines to Advance Cost-Reducing Energy Bills', 'The California Assembly will not move forward with a package of bills aimed at lowering energy costs, despite support from Governor Gavin Newsom and Assembly Speaker Robert Rivas. Concerns over adequate public scrutiny of the legislation have led to uncertainty about its future.', NULL, NULL, NULL, 'USA', 'California', 'Robert Rivas , Gavin Newsom , Mike McGuire , Brian W. Jones', 'California Assembly , energy bills , Governor Gavin Newsom , gas prices , public hearings', NULL, 75, 8, NULL, 'Left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(397, 2, 'https://www.newsbreak.com/fox40-1589919/3579862156892-california-one-step-closer-to-banning-certain-food-dyes-in-school-lunches', NULL, 'California Bill Advances to Ban Harmful Food Dyes in Schools', 'A California bill aimed at banning specific food dyes linked to health risks in children has passed the Legislature and awaits Governor Newsom\'s signature. If enacted, schools will be prohibited from using six chemical dyes found to potentially harm student health.', 'The advancement of this bill highlights ongoing concerns about food safety in schools. While it is critical to protect children\'s health, the debate around food additives also requires a balanced examination of regulatory standards.', NULL, NULL, NULL, NULL, 'Gov. Gavin Newsom , Assemblymember Jesse Gabriel , Tasha Stoiber , Melanie Benesh', 'California , food dyes , Governor Newsom , health risks , school meals , Child health , food safety', NULL, 75, 9, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(398, 2, 'https://www.newsbreak.com/yourcentralvalley-com-1589714/3579853624216-3-central-valley-dairies-come-down-with-the-bovine-bird-flu', NULL, 'California Reports Avian Flu Cases in Cows, Urges Farm Safety', 'The California Department of Food and Agriculture has confirmed three cases of avian flu in cows in the Central Valley. While no immediate threat to consumers appears present, officials stress the importance of monitoring livestock health and protecting farm employees from potential virus transmission.', NULL, NULL, NULL, NULL, NULL, 'Ryan Jacobsen', 'avian flu , cows , California , Fresno , agriculture , farm safety , livestock', NULL, 70, 9, NULL, 'neutral', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(399, 4, 'https://www.newsbreak.com/tv-tech-1711406/3579507768266-interra-systems-to-show-latest-innovations-to-orion-monitoring-suite-at-ibc2024', 'Interra Systems', 'Interra Systems Unveils Enhanced ORION Content Monitoring Suite Ahead of IBC 2024', 'Interra Systems has announced major updates to its ORION content monitoring suite, focusing on improving OTT streaming quality. The new features include IPv6 support, enhanced root-cause analysis, and end-to-end ad insertion monitoring. These advancements will be showcased at IBC 2024, highlighting Interra\'s commitment to optimization in the competitive streaming landscape.', 'The recent updates to Interra’s ORION monitoring suite showcase a significant step forward in video content quality management, addressing the complex demands of modern streaming services. This enhancement reflects industry trends towards higher quality and reliability in content delivery, which is increasingly crucial in attracting and retaining viewers.', NULL, NULL, 'USA', 'California', 'Anupama Anantharaman', 'ORION , content monitoring , streaming quality , IPv6 , ad insertion monitoring , root cause analysis , IBC 2024', NULL, 75, 9, NULL, 'neutral', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(400, 2, 'https://www.newsbreak.com/ksby-news-563656/3580046898653-how-california-s-meal-mandate-expansion-affects-students-on-the-central-coast', NULL, 'California Expands Free Meal Program for All K-12 Students', 'California has mandated that all public schools provide free breakfast and lunch for students in transitional kindergarten through 12th grade, regardless of their financial situation. This initiative, part of the state\'s universal meal program, aims to alleviate the financial burden on families and ensure that all students have equitable access to nutritious food.', 'The expansion of California\'s free meal program serves an essential role in addressing food insecurity among students. By providing daily meals regardless of eligibility, this initiative not only supports families financially but also promotes better health and learning outcomes for children.', 'This progressive measure highlights the growing necessity for universal basic services in education. By ensuring that every child receives nutritious meals, California is setting a precedent for other states to follow and is taking important steps toward eradicating childhood poverty.', 'While the intention behind free meals is commendable, it raises questions about dependency on government welfare. Parents should be encouraged to provide for their children rather than rely on state programs, which could inadvertently foster a culture of entitlement.', NULL, NULL, 'Maggie Arndt , Hillary Ruiz , Jessie Wesch , Colby Vock', 'California , free meals , universal meals program , education , food security', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
