	(405, 2, 'https://www.newsbreak.com/abc7-news-bay-area-560897/3579845971281-memorial-held-for-san-jose-community-service-officer-killed-in-line-of-duty', NULL, 'Tragic Memorial for San Jose Officer Long Pham Killed on Duty', 'The San Jose Police Department held a memorial for Community Service Officer Long Pham, who was killed by a drunk driver on duty. Various law enforcement officials and community members paid their respects, highlighting Pham\'s commitment to service and his significant impact in the community.', NULL, NULL, NULL, NULL, NULL, 'Long Pham , Paul Joseph , Matt Mahan , Rob Bonta , Veronica Baer , Tam Truong', 'memorial , Long Pham , drunk driver , community service officer , San Jose , law enforcement', NULL, 85, 9, NULL, 'Government-affiliated', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(406, 2, 'https://www.newsbreak.com/kron4-news-1589914/3579606994998-all-lanes-reopen-after-vehicle-fire-on-101-in-sunnyvale', NULL, 'Vehicle Fire Causes Temporary Highway Blockage in Sunnyvale', 'All lanes on Highway 101 in Sunnyvale have reopened after a vehicle fire temporarily blocked traffic. The California Highway Patrol issued a severe traffic alert and advised motorists to expect delays and seek alternate routes.', 'The quick response from the California Highway Patrol ensured that safety measures were implemented effectively, minimizing the disruption caused by the vehicle fire on Highway 101.', NULL, NULL, NULL, NULL, '', 'vehicle fire , Highway 101 , Sunnyvale , California Highway Patrol , traffic delays', NULL, 60, 8, NULL, 'Left-wing', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(407, 3, 'https://www.newsbreak.com/athlon-sports-1600280/3579942694591-watch-ashton-daniels-finds-jackson-harris-for-stanford-s-first-touchdown-of-their-acc-era', 'Stanford Football', 'Stanford Cardinal Kicks Off 2024 Season with Intense Match Against TCU', 'The Stanford Cardinal commenced their 2024 season on Friday against the TCU Horned Frogs, securing an early touchdown despite a shaky performance. Quarterback Ashton Daniels contributed significantly, including a pivotal 31-yard scramble. The matchup featured intense moments, with Stanford\'s lead quickly challenged by TCU\'s response.', 'The match showcased both teams’ strengths and weaknesses. Stanford\'s ability to recover from mistakes was highlighted, yet TCU\'s resilience in scoring reflected their competitive nature. Both teams exhibit potential for an exciting season ahead.', 'Despite the entertaining play, it reflects a broader issue of commercialization in college football, where the emphasis on profit often overshadows student-athlete well-being. We must critique how the sport evolves at the cost of its core values.', 'The rapid scoring and penalties during the game showcase a decline in discipline within college sports. It is essential to uphold traditional values and foster a competitive spirit rather than allowing the game to spiral into chaotic scoring runs.', 'USA', 'California', 'Ashton Daniels , Jackson Harris', 'Stanford Cardinal , TCU Horned Frogs , touchdown , season opener , Pac-12', NULL, 75, 9, NULL, 'neutral', '2024-08-31 07:46:07', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(408, 4, 'https://www.reuters.com/world/europe/armenia-says-lightning-strike-shuts-down-nuclear-power-station-interfax-reports-2024-08-31/', 'Interfax', 'Lightning Strike Shuts Down Armenia\'s Nuclear Power Plant', 'Armenia\'s single nuclear power plant was shut down due to a lightning strike that occurred on August 31st. The plant\'s safety systems activated, ensuring a safe shutdown. Efforts are underway by personnel to restart the facility.', 'The shutdown of Armenia\'s nuclear power plant due to a lightning strike underscores the vulnerability of critical infrastructure to natural events and the importance of robust safety protocols in the energy sector.', 'This incident highlights the risks of relying on nuclear energy, especially in regions prone to extreme weather. The government must consider greener, safer alternatives to avoid putting citizens\' lives at risk.', 'This shutdown shows the need for greater investment in our energy infrastructure to prevent such failures. Armenia must prioritize the reliability of its nuclear power and secure its energy independence.', 'Armenia', 'Caucasus', '', 'lightning strike , Armenia , nuclear power plant , shutdown , safety systems', NULL, 70, 9, NULL, 'government-affiliated', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(409, 1, 'https://www.reuters.com/world/europe/russia-says-five-killed-46-injured-ukraine-strike-belgorod-2024-08-31/', NULL, 'Ukrainian Attack on Belgorod Leaves Five Dead and 46 Injured', 'A Ukrainian attack on the southwestern Russian city of Belgorod has resulted in five fatalities and 46 injuries, according to the local governor. This incident, which occurred late on Friday, marks a significant escalation in the ongoing conflict between Ukraine and Russia.', NULL, NULL, NULL, NULL, NULL, 'Vyacheslav Gladkov , Russian Investigation Committee', 'Ukrainian attack , Belgorod , casualties , military operations , conflict', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(410, 2, 'https://www.reuters.com/world/us/doctor-charged-death-friends-star-matthew-perry-incredibly-remorseful-2024-08-30/', NULL, 'Doctor Charged in Matthew Perry\'s Death Banned from Practice', 'Dr. Mark Chavez, one of five charged in the ketamine overdose death of actor Matthew Perry, has been barred from practicing medicine as he prepares to enter a guilty plea on conspiracy charges. The case brings attention to the broader issue of substance abuse among celebrities.', NULL, NULL, NULL, NULL, NULL, 'Dr. Mark Chavez , Dr. Salvador Plasencia , Jasveen Sangha , Matthew Perry , Kenneth Iwamasa', 'Matthew Perry , ketamine , overdose , doctor charged , celebrity drug issue', NULL, 80, 9, NULL, 'Left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(411, 1, 'https://www.reuters.com/world/asia-pacific/chinese-coast-guard-says-philippine-ship-rammed-chinese-vessel-south-china-sea-2024-08-31/', NULL, 'China and Philippines Clash in South China Sea Dispute', 'China and the Philippines exchanged accusations of ramming ships in the South China Sea, a region claimed by both nations. The Chinese coast guard claimed a Philippine ship deliberately collided with one of its vessels, while the Philippines accused China of ignoring maritime regulations. The dispute underscores ongoing tensions in a vital waterway rich in natural resources.', NULL, NULL, NULL, NULL, NULL, 'Liu Dejun , Jay Tarriela', 'China , Philippines , South China Sea , clash , coast guard , territorial dispute , Sabina Shoal', NULL, 80, 8, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(412, 1, 'https://www.reuters.com/world/africa/libyas-hariga-port-stops-working-due-insufficient-oil-supplies-say-engineers-2024-08-31/', 'Reuters', 'Hariga Port Shutdown Due to Oil Supply Shortages', 'Libya\'s Hariga port has ceased operations because of inadequate oil supplies from the Sarir oilfield, according to engineers. The situation is compounded by escalating tensions regarding the leadership of the central bank, which have resulted in oilfield closures.', NULL, NULL, NULL, 'Libya', 'North Africa', 'Hariga port , Sarir oilfield', 'oil supply , shutdown , central bank , tension , Libya', NULL, 75, 7, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(413, 1, 'https://www.reuters.com/world/europe/ukrainian-air-defence-downs-24-russian-drones-kyiv-says-2024-08-31/', NULL, 'Ukrainian Air Defences Shoot Down 24 Drones Amid Russian Attacks', 'Ukrainian air defences successfully intercepted 24 out of 52 Russian drones during overnight assaults across eight regions, with no injuries reported. Despite the attacks prompting air alerts in major areas including Kyiv, all drones targeting the capital were downed, showcasing Ukraine\'s ongoing efforts to combat Russian aerial threats.', NULL, NULL, NULL, NULL, NULL, '24 drones downed , 52 total drones launched , 5 missiles launched', 'Ukraine , drones , Russian attacks , air defence , Kyiv', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(414, 2, 'https://www.reuters.com/world/europe/russian-helicopter-with-22-board-goes-missing-far-east-interfax-says-2024-08-31/', 'Interfax', 'Missing Russian Helicopter with 22 on Board Raises Concerns', 'A Mi-8T helicopter in Russia\'s Kamchatka region has gone missing, with three crew members and 19 passengers on board. The helicopter failed to report its position after taking off from a base near the Vachkazhets volcano, sparking search and rescue efforts.', 'The disappearance of the Mi-8T helicopter highlights the challenges and risks associated with air travel in remote regions. Continued efforts to locate the aircraft will be essential for the families of those on board.', NULL, NULL, 'Russia', 'Kamchatka', '3 crew members , 19 passengers', 'helicopter , missing , Kamchatka , Mi-8T , Vachkazhets , search and rescue', NULL, 75, 9, NULL, 'neutral', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(415, 1, 'https://www.reuters.com/world/pacific-leaders-remove-taiwan-communique-after-china-complaint-2024-08-31/', NULL, 'Pacific Islands Forum Removes Taiwan References After China\'s Intervention', 'The Pacific Islands Forum has omitted references to Taiwan from a communique issued after its leaders meeting, following complaints from China. Taiwan condemned this action as an infringement and urged attention to China\'s increasing influence in the region.', NULL, NULL, NULL, NULL, NULL, 'Qian Bo , Lin Jian , Tien Chung-kwang', 'Pacific Islands Forum , Taiwan , China , diplomatic ties , regional security', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(416, 2, 'https://www.reuters.com/world/us/infamous-mexican-drug-lord-released-us-prison-into-immigration-custody-2024-08-30/', NULL, 'Release of Notorious Drug Chief Osiel Cardenas Sparks Controversy', 'Osiel Cardenas, the former leader of the Gulf Cartel and one of Mexico\'s most infamous drug bosses, has been released from a U.S. prison and is now in the custody of immigration officials, with potential deportation to Mexico looming. Cardenas is known for his role in escalating violent drug trafficking practices in Mexico.', NULL, NULL, NULL, NULL, NULL, 'Osiel Cardenas , Leo Silva', 'drug chief , Gulf Cartel , violence , deportation , Zetas', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(417, 1, 'https://www.reuters.com/world/asia-pacific/taipei-former-mayor-arrested-graft-probe-2024-08-31/', 'Reuters', 'Former Taipei Mayor Ko Wen-je Arrested in Graft Probe', 'Ko Wen-je, a former Taipei mayor and leader of the Taiwan People\'s Party, was arrested as part of a graft investigation linked to a property development during his tenure. Despite denying any wrongdoing, reports indicate decreased support for him and his party amid ongoing scandals.', NULL, NULL, NULL, 'Taiwan', 'Asia', 'Ko Wen-je , Lai Ching-te', 'Taipei , graft , property development , Taiwan People\'s Party , arrest , corruption', NULL, 75, 7, NULL, 'Neutral', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(418, 1, 'https://www.reuters.com/world/asia-pacific/chinese-navy-survey-ship-entered-japanese-waters-japans-defence-ministry-says-2024-08-31/', NULL, 'Chinese Navy Vessel Intrudes into Japanese Waters Again', 'A Chinese Navy survey vessel briefly entered Japanese territorial waters near Kagoshima Prefecture on August 31, marking the tenth intrusion in a year. The vessel was detected and departed within hours, showcasing increasing maritime tensions between China and Japan.', NULL, NULL, NULL, NULL, NULL, 'Chinese Navy , Japanese territorial waters , Kagoshima Prefecture', 'intrusion , Chinese Navy , Japan , territorial waters , maritime tensions', NULL, 75, 9, NULL, 'neutral', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(419, 2, 'https://www.reuters.com/world/africa/i-saw-horrible-things-burkina-faso-massacre-survivor-describes-bloodshed-2024-08-30/', NULL, 'Tragedy Unfolds in Burkina Faso as Hundreds Killed in Jihadist Attack', 'In a horrific incident, a survivor recounts the massacre of hundreds of villagers in central Burkina Faso, where an Al Qaeda-linked group attacked civilians digging trenches as part of military orders. Eyewitness accounts suggest at least 400 people were killed. The incident has raised questions about the military\'s use of civilians in combat and the government\'s response to the escalating violence.', 'The recent tragic events in Burkina Faso highlight the severe implications of ongoing violence in the Sahel region. As civilians are drawn into conflicts, the responsibilities of both the military and the government come under scrutiny. The need for comprehensive strategies to protect vulnerable populations is clear.', 'This massacre underscores the failure of the state to protect its people and the reckless abandonment of civilians in a war they did not choose. By forcing citizens to dig trenches under military orders, the government has effectively placed them in harm\'s way, demonstrating a gross negligence towards the safety of its populace.', 'The tragic loss of life reiterates the importance of a strong military response to such jihadist threats. Rather than relying on untrained civilians in dangerous situations, the government must strengthen army operations and take decisive action to eliminate these militant groups that threaten national security.', NULL, NULL, 'Al Qaeda-linked group , Civilian survivors , Armed Forces , Collectif Justice pour Barsalogho', 'Burkina Faso , massacre , jihadists , civilian casualties , military , violence', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(420, 2, 'https://www.reuters.com/world/asia-pacific/fears-waterborne-disease-rise-bangladesh-floods-recede-slowly-2024-08-31/', NULL, 'Bangladesh Faces Health Crisis as Floods Devastate Communities', 'Authorities in Bangladesh are working to provide clean drinking water and medical aid as floods leave millions stranded and at risk of waterborne diseases following last week\'s disaster that resulted in at least 54 deaths.', NULL, NULL, NULL, NULL, NULL, '54 deaths , 470,000 refugees , 3,300 shelters , 2,000,000 children at risk', 'Bangladesh , floods , waterborne diseases , disaster management , clean water , climate change', NULL, 85, 9, NULL, 'Left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(421, 1, 'https://www.reuters.com/world/china/frustration-deepens-two-years-after-un-report-china-abuses-2024-08-31/', 'Reuters', 'UN Calls for Action on China\'s Xinjiang Report Two Years On', 'On the second anniversary of a landmark U.N. report alleging human rights abuses in Xinjiang, advocates and UN officials push for greater action against China, which has denied the claims and defended its record. Victims\' families express frustration over the lack of meaningful change.', 'The commemoration of the U.N. report highlights the ongoing international concern over human rights in Xinjiang. While the U.N.\'s engagement with Beijing may bear fruit in the long run, immediate actions towards accountability appear necessary to address the urgent situation.', NULL, NULL, 'Switzerland', 'Geneva', 'Michelle Bachelet , Yalkun Uluyol , Kenneth Roth , Volker Turk , Maya Wang', 'human rights , Xinjiang , U.N. report , China , Uyghurs , crimes against humanity', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(422, 2, 'https://www.reuters.com/world/japan/least-6-dead-japan-typhoon-shanshan-grinds-2024-08-31/', NULL, 'Typhoon Shanshan Causes Devastation in Japan, At Least Six Dead', 'Typhoon Shanshan has wreaked havoc across Japan, resulting in at least six fatalities and numerous injuries. The storm, which made landfall in Kyushu and triggered widespread flooding and landslides, continues to pose threats as it moves eastward. Over 35,000 homes have lost power, and authorities have issued urgent warnings.', 'Typhoon Shanshan has severely impacted Japan, highlighting the need for robust disaster preparedness and response systems in light of increasing frequency and intensity of natural disasters due to climate change.', 'The devastation caused by Typhoon Shanshan underscores the failure of governmental policies to address the climate crisis, which disproportionately affects the most vulnerable communities. We must take immediate, comprehensive action to combat climate change.', 'The impact of Typhoon Shanshan serves as a reminder of the importance of prioritizing national security and infrastructure. We must ensure our resources are focused on bolstering emergency services rather than diverting them to other issues.', NULL, NULL, '6 dead , 100 injured , 35,000 homes without power', 'Typhoon Shanshan , Japan , flooding , landslide warnings , Kagoshima , disaster management', NULL, 85, 9, NULL, 'Left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(423, 2, 'https://www.reuters.com/world/middle-east/israeli-strike-gaza-aid-convoy-kills-four-palestinians-us-group-says-2024-08-31/', 'Reuters', 'Israeli Airstrike on Aid Convoy in Gaza Kills Four Palestinians', 'An Israeli air strike on an aid convoy in Gaza resulted in the deaths of four Palestinians, according to the aid group Anera. The incident occurred on August 30, shortly after the convoy left the Israel-controlled Kerem Shalom crossing. Israel claims the individuals were armed assailants, while Anera denies these allegations, stating there was no warning before the attack. This incident highlights the ongoing humanitarian crisis in Gaza amidst the prolonged Israel-Palestine conflict.', 'This tragic incident raises serious concerns about the safety of humanitarian missions in conflict zones. While Israel claims they targeted armed assailants, the lack of communication and warning poses critical questions about operational protocols and accountability in military engagements.', 'This incident exemplifies the ongoing disregard for Palestinian lives under Israeli military actions. The international community must respond more decisively to hold Israel accountable for its attacks on civilians and humanitarian workers, which only escalates the humanitarian crisis in Gaza.', 'Israel\'s actions, in this case, were a necessary defense against potential threats. The presence of armed individuals in a convoy compromises the safety of both Israeli citizens and those in the region. The international community should understand that Israel is taking steps to ensure its national security.', 'USA', 'Washington', 'four Palestinians , Anera , Israeli air strike , Kerem Shalom crossing', 'Israeli air strike , aid convoy , Gaza , Anera , Palestinians', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(424, 1, 'https://www.reuters.com/world/us/pennsylvania-court-says-counties-cannot-throw-out-misdated-mail-in-votes-2024-08-31/', 'Reuters', 'Pennsylvania Court Rules Against Disqualifying Mail-In Votes', 'A Pennsylvania state court decision mandates that Philadelphia and Allegheny Counties cannot disqualify mail-in votes due to incorrect envelope dates. The ruling responds to nearly 16,000 ballots disqualified for minor errors, affirming the right to vote even with paperwork discrepancies. This comes as Pennsylvania remains a crucial battleground in the upcoming U.S. presidential election.', NULL, NULL, NULL, 'United States', 'Washington', 'Judge Ellen Ceisler , Kamala Harris , Donald Trump', 'Pennsylvania , court ruling , mail-in votes , elections , disqualification', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(425, 2, 'https://www.reuters.com/world/europe/behind-arrest-telegram-boss-small-paris-cybercrime-unit-with-big-ambitions-2024-08-30/', 'Reuters', 'Telegram CEO Pavel Durov Faces Criminal Investigation in France', 'Pavel Durov, CEO of Telegram, is under formal investigation by a cybercrime unit in Paris for allegations surrounding child exploitation and drug trafficking. The case signifies a shift in global tech regulations as authorities increasingly hold platform executives accountable for illegal content.', 'The investigation into Durov shows an evolving landscape in the regulation of technology companies as governments seek to ensure accountability for content hosted on their platforms. It may also set a precedent for future cases involving tech CEOs.', NULL, NULL, 'France', 'Paris', 'Pavel Durov , Johanna Brousse , Laure Beccuau , Jason Citron , Patrick Perrot , Paul Krusky , Jean-François Eap', 'Telegram , investigation , cybercrime , Pavel Durov , child abuse , drug trafficking , France', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(426, 1, 'https://www.reuters.com/world/europe/ukraines-incursion-into-russias-kursk-region-is-legitimate-says-natos-2024-08-31/', 'Reuters', 'NATO Chief Supports Ukraine\'s Right to Cross-Border Defense Operations', 'NATO Secretary-General Jens Stoltenberg stated that Ukraine\'s military incursion into Russia\'s Kursk region is legitimate under international law, emphasizing Ukraine\'s right to self-defense. He cautioned that while the advance poses risks, it is ultimately Ukraine\'s decision on how to conduct its military operations.', NULL, NULL, NULL, 'Germany', NULL, 'Jens Stoltenberg , Volodymyr Zelenskiy', 'Ukraine , Kursk region , NATO , self-defense , Russia', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(427, 11, 'https://www.reuters.com/business/healthcare-pharmaceuticals/fda-authorizes-novavaxs-updated-covid-vaccine-2024-08-30/', NULL, 'FDA Grants Emergency Use Authorization for Updated Novavax COVID Vaccine', 'The U.S. FDA has granted emergency use authorization for an updated Novavax COVID vaccine targeting the JN.1 strain for individuals 12 and older. The vaccine is expected to be available by next week as COVID hospitalizations rise.', NULL, NULL, NULL, NULL, NULL, 'Peter Marks (FDA Director) , John Jacobs (CEO of Novavax)', 'FDA , Novavax , COVID vaccine , emergency use authorization , JN.1 strain , hospitalizations', NULL, 85, 9, NULL, 'Neutral', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(428, 1, 'https://www.reuters.com/world/middle-east/us-centcom-says-it-conducted-raid-iraq-15-islamic-state-operatives-dead-2024-08-31/', 'Reuters', 'U.S. and Iraqi Forces Conduct Joint Raid, 15 ISIS Operatives Killed', 'U.S. Central Command reported that a joint raid with Iraqi Security Forces in western Iraq on August 29 resulted in the death of 15 ISIS operatives. Seven American troops were injured, of which five were hurt during the operation. No civilian casualties were reported. The Iraqi foreign ministry postponed any announcements on the end date for the U.S.-led coalition\'s mission citing \'latest developments\'.', NULL, NULL, NULL, 'United States', 'Iraq', 'U.S. Central Command , Iraqi Security Forces , Islamic State (ISIS)', 'joint raid , ISIS operatives , Iraq , U.S. troops , civilian casualties', NULL, 75, 8, NULL, 'neutral', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(429, 2, 'https://www.reuters.com/world/americas/least-2-dead-after-brazil-church-roof-collapses-mayor-says-2024-08-30/', NULL, 'Tragedy Strikes in Recife as Church Roof Collapses, Two Dead', 'A church roof collapsed in Recife, Brazil, on Friday, resulting in the deaths of at least two individuals. Approximately 20 others received medical assistance. The church was being used for food distribution at the time. Authorities are searching for any additional casualties.', 'The tragic incident in Recife highlights critical safety issues regarding building maintenance and structural integrity, particularly for facilities serving the public. It raises questions about oversight and regulation in safe construction practices.', 'This collapse is a direct consequence of systemic neglect towards community structures that serve the poorest. It\'s a reminder of the need for increased investment in public infrastructure to ensure the safety of vulnerable populations.', 'This sad event underscores the need for individuals to take personal responsibility for safety in community spaces. Relying on government oversight often leads to tragedies like this.', NULL, NULL, 'Priscila Krause', 'church , roof collapse , fatalities , food distribution , Recife', NULL, 85, 9, NULL, 'neutral', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(430, 1, 'https://www.reuters.com/world/europe/russia-uses-telegram-boss-pavel-durovs-case-rally-doubters-against-west-2024-08-30/', NULL, 'Russians Face Pressure to Choose Sides Amidst Durov\'s Arrest', 'Amidst the ongoing conflict in Ukraine, prominent Russian figures are urging citizens to choose loyalty to their homeland or face victimization from the West. The arrest of Telegram\'s Pavel Durov in France has intensified these sentiments, as leaders assert that neutrality is no longer an option.', NULL, NULL, NULL, NULL, NULL, 'Pavel Durov , Alexander Dugin , Dmitry Medvedev , Vladimir Zhirinovsky', 'Durov , Western Values , Ukraine Conflict , Russian Loyalty , Telegram', NULL, 85, 8, NULL, 'Right-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(431, 2, 'https://www.reuters.com/business/healthcare-pharmaceuticals/cuba-faces-uphill-battle-oropouche-virus-spreads-2024-08-30/', NULL, 'Havana Struggles Against Oropouche Virus Amidst Resource Shortages', 'Cuban health authorities have initiated fumigation efforts in Havana to combat the surge of Oropouche virus cases, which have exceeded 500 since detection in May. The rainy season and resource shortages present significant challenges. Importantly, while the virus has spread throughout Cuba, no fatalities have been reported.', NULL, NULL, NULL, NULL, NULL, '500 cases , Luis Aguilar , 21 U.S. citizens', 'Oropouche virus , fumigation , Havana , mosquitoes , health crisis', NULL, 75, 9, NULL, 'left-leaning', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(432, 1, 'https://www.reuters.com/world/middle-east/two-missiles-explode-close-vessel-east-yemens-aden-says-uk-maritime-agency-2024-08-30/', NULL, 'Missiles Strike Near Vessel off Yemen Coast Amid Houthi Attacks', 'Two missiles exploded near a vessel in the Red Sea off the coast of Yemen, according to UK Maritime Trade Operations. The crew is reported safe, despite the ongoing missile and drone campaign by Houthi militants against commercial shipping, which they claim is in solidarity with Palestinians.', 'The recent missile incident reflects the escalating tensions in the Red Sea, highlighting the ongoing risks to commercial shipping in the region. Maritime security is increasingly becoming a priority for shipping companies and international stakeholders.', 'The attacks by Houthi militants, while alarming, stem from the desperate plight of those facing oppression in Gaza. The international community must address the root causes rather than just condemn the actions of those retaliating against imperialist aggression.', 'The Houthi attacks on commercial vessels represent a direct threat to global trade and must be met with overwhelming military force. Countries like the UK must take a more assertive stance to protect their shipping interests.', NULL, NULL, 'Houthi militants , UK Maritime Trade Operations , Greek-flagged oil tanker Sounion', 'missiles , vessel , Houthi militants , Red Sea , commercial shipping', NULL, 75, 8, NULL, 'Neutral', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(433, 1, 'https://www.reuters.com/world/us/us-crypto-executives-throw-washington-fundraiser-harris-2024-08-30/', 'Reuters', 'Crypto Investors Rallying Behind Harris at Fundraiser', 'Cryptocurrency investors are organizing a fundraiser for Vice President Kamala Harris, aiming to raise at least $100,000 to support her campaign. Scheduled for September 13, this grassroots event seeks to draw a diverse group of donors and emphasize the importance of a supportive regulatory environment for the crypto industry.', NULL, NULL, NULL, 'USA', 'Washington D.C.', 'Kamala Harris , Cleve Mesidor , Tiffany Smith , Rahilla Zafar , Mark Cuban , Anthony Scaramucci', 'Cryptocurrency , Kamala Harris , Fundraiser , Regulation , Blockchain Foundation , Securities and Exchange Commission', NULL, 75, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(434, 1, 'https://www.reuters.com/world/europe/ukraine-says-it-advances-kursk-region-urges-allies-help-defend-air-space-2024-08-30/', 'Reuters', 'Ukraine Advances in Kursk Amid Escalating Tensions', 'Ukrainian forces have advanced 2 km into Russia\'s Kursk region while repelling Russian assaults in eastern Ukraine. This bold move is part of a strategy to protect border settlements amidst ongoing conflict.', NULL, NULL, NULL, 'Ukraine', 'Kyiv', 'General Oleksandr Syrskyi , President Volodymyr Zelenskiy , Defence Minister Rustem Umerov', 'Ukraine , Kursk , Russian troops , incursion , defences , provocation', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(435, 2, 'https://www.reuters.com/world/europe/two-dead-three-missing-fire-helicopter-crashes-portugals-douro-2024-08-30/', NULL, 'Tragic Helicopter Crash in Northern Portugal Leaves Four Dead', 'A helicopter returning from firefighting efforts crashed into the River Douro in northern Portugal, resulting in the deaths of at least four people and one missing. The pilot was rescued with injuries and authorities are conducting searches in the area.', NULL, NULL, NULL, NULL, NULL, 'Luis Montenegro , Rui Silva Lampreia', 'helicopter crash , Douro River , firefighting mission , national day of mourning , Emergency Protection and Relief Unit', NULL, 85, 9, NULL, 'Government-affiliated', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(436, 1, 'https://www.reuters.com/world/europe/ukraine-urges-mongolia-arrest-putin-international-warrant-2024-08-30/', 'Reuters', 'Ukraine Urges Mongolia to Arrest Putin Amid ICC Warrant', 'Ukraine has called on Mongolia to arrest Russian President Vladimir Putin during his upcoming visit on September 3, due to an International Criminal Court (ICC) warrant accusing him of war crimes involving the illegal deportation of children from Ukraine. The Kremlin downplayed concerns regarding the ICC warrant, asserting strong ties with Mongolia.', 'The situation surrounding the ICC warrant highlights the complexities of international law and diplomatic relations, posing a significant challenge for nations like Mongolia that must navigate their obligations under international treaties while maintaining bilateral ties.', 'This ICC warrant represents a broader effort to hold powerful leaders accountable for their actions, challenging oppressive regimes that commit war crimes against vulnerable populations like children in Ukraine.', 'Ukraine\'s demand for Mongolia to arrest Putin reflects a Western bias that seeks to undermine Russian sovereignty, illustrating how international institutions can be manipulated for political ends rather than genuine justice.', 'UK', 'Europe', 'Vladimir Putin , Dmitry Peskov', 'Ukraine , Mongolia , Putin , ICC , Arrest Warrant , War Crimes', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(437, 4, 'https://www.reuters.com/technology/space/nasa-narrows-crew-9-lineup-accommodate-astronauts-aboard-iss-2024-08-30/', 'Reuters', 'NASA Replaces Crew for SpaceX Flight Amid Boeing Starliner Setbacks', 'NASA announced the replacement of two astronauts for an upcoming SpaceX mission after issues with Boeing\'s Starliner spacecraft deemed it unsafe for a planned return. The flight, initially set for August, is now rescheduled to September 24, marking a significant setback for Boeing\'s operations.', 'NASA\'s decision to enlist SpaceX for the return of astronauts highlights the increasing reliance on commercial spaceflight amid challenges faced by traditional aerospace companies like Boeing. This indicates a potential shift in the dynamics of space exploration and partnerships.', 'The ongoing troubles with Boeing\'s Starliner reflect the dangers of privatizing space exploration. NASA should focus more on fostering public aerospace initiatives rather than relying on competing private companies that prioritize profits over safety.', 'NASA\'s move to utilize SpaceX instead of Boeing demonstrates a betrayal to U.S. aviation and space excellence. This maximizes competition to foreign private firms, which could endanger American technological leadership in space.', 'USA', 'North America', 'Butch Wilmore , Suni Williams , Zena Cardman , Stephanie Wilson , Nick Hague , Aleksandr Gorbunov', 'NASA , SpaceX , Boeing , Starliner , Crew-9 , International Space Station', NULL, 90, 8, NULL, 'center', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(438, 1, 'https://www.reuters.com/world/middle-east/israeli-forces-kill-two-attackers-west-bank-military-says-2024-08-30/', NULL, 'Israeli Forces Kill Two during Clashes in West Bank', 'Israeli military reports that two individuals were killed in separate incidents in the occupied West Bank, amid rising violence in the region. One allegedly infiltrated an Israeli settlement, while the other was shot after his vehicle exploded. Palestinian group Hamas praised the attacks as acts of resistance.', 'The recent violence in the West Bank underscores the increasing tension in the region as both sides face escalating hostilities. Addressing the root causes of this conflict is essential for long-term peace.', NULL, NULL, 'Israel', 'West Bank', 'Israeli forces , Hamas', 'West Bank , Israeli military , Hamas , violence , terrorist', NULL, 75, 8, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(439, 2, 'https://www.reuters.com/business/healthcare-pharmaceuticals/drug-distributors-strike-300-mln-opioid-settlement-with-us-health-plans-2024-08-30/', 'Reuters', 'US Drug Distributors Settle for $300 Million in Opioid Epidemic Case', 'The three largest U.S. drug distributors have agreed to a $300 million settlement to resolve claims related to their role in the opioid epidemic, as disclosed in court filings. The deal, which requires judicial approval, adds to previous agreements totaling $21 billion with state and local governments, although the distributors admit no wrongdoing.', 'This settlement highlights the ongoing consequences of the opioid crisis in the U.S. and the efforts towards accountability from major stakeholders. However, whether this financial agreement will substantially change the industry practices remains uncertain.', NULL, NULL, 'United States', 'Ohio', 'McKesson Corp , Cencora Inc , Cardinal Health Inc , Paul Geller', 'opioid epidemic , drug distributors , settlement , McKesson , Cardinal Health , Cencora , lawsuit', NULL, 85, 9, NULL, 'Neutral', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(440, 1, 'https://www.reuters.com/world/un-send-mission-bangladesh-probe-human-rights-violations-2024-08-30/', 'Reuters', 'UN to Investigate Human Rights Violations Amid Bangladesh Unrest', 'The UN Human Rights Office will send a fact-finding mission to Bangladesh to investigate human rights violations during recent violent protests that resulted in over 1,000 deaths. These protests, initially against public sector job quotas, led to the resignation of Prime Minister Sheikh Hasina and the formation of an interim government. The UN aims to analyze the root causes of the unrest and recommend long-term reforms.', NULL, NULL, NULL, 'Bangladesh', 'Asia', 'Sheikh Hasina , Muhammad Yunus , Ravina Shamdasani , Volker Türk', 'UN , Human Rights , Bangladesh , Violence , Protests , Interim Government , Job Quotas , Fact-Finding Mission', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(441, 2, 'https://www.reuters.com/world/africa/number-tourists-stabbed-egypts-taba-says-state-affiliated-tv-channel-2024-08-30/', 'Reuters', 'Fight Breaks Out Between Arab Israeli Tourists and Egyptian Workers in Taba', 'A verbal altercation between an Arab Israeli tourist and an Egyptian hotel worker escalated into a physical fight in Taba, injuring three tourists and two hotel employees. The clash reportedly occurred over disputes related to hotel services, highlighting tensions between Israelis and Egyptians since the Gaza conflict began.', 'This incident reflects the strained relations not only between tourists and local workers but also heightens the broader tensions stemming from ongoing regional conflicts. Clear measures are needed to ensure safety for both locals and visitors.', NULL, NULL, 'Egypt', 'Taba', 'Arab Israeli tourists , Egyptian hotel workers', 'Taba , Arab Israelis , Egypt , hotel workers , fight , Gaza conflict', NULL, 75, 8, NULL, 'government-affiliated', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(442, 1, 'https://www.reuters.com/world/europe/ukraines-power-grid-operator-head-be-dismissed-media-reports-2024-08-30/', NULL, 'Ukrenergo Head Faces Dismissal Amid Ongoing Energy Crisis', 'Vadym Kudrytskyi, the head of Ukraine\'s power grid operator Ukrenergo, reportedly refused to resign after a decision was made for his dismissal during a meeting with President Zelenskiy and top officials. The state operator is crucial for maintaining the stability of Ukraine\'s electricity grid amid ongoing Russian attacks targeting the energy sector.', NULL, NULL, NULL, NULL, NULL, 'Vadym Kudrytskyi , President Volodymyr Zelenskiy', 'Ukrenergo , energy crisis , Russia attacks , Kudrytskyi , dismissal', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(443, 1, 'https://www.reuters.com/world/europe/zelenskiy-dismisses-ukraines-air-force-commander-2024-08-30/', NULL, 'Zelenskiy Dismisses Air Force Commander After F-16 Crash', 'Ukrainian President Volodymyr Zelenskiy has dismissed Air Force Commander Mykola Oleshchuk following the crash of an F-16 jet that resulted in the pilot\'s death. While the exact reasons for the dismissal remain unclear, Zelenskiy emphasized the need for personnel protection and command strengthening. Lieutenant Anatoliy Kryvonozhka will serve as the temporary commander. The incident is under investigation by U.S. partners.', 'The dismissal of Commander Oleshchuk raises questions about leadership accountability in the Ukrainian Air Force, especially following a tragic incident like the F-16 crash. Zelenskiy\'s decision, while unclear in its rationale, may reflect a wider strategy to reinforce command structures within the military.', NULL, NULL, NULL, NULL, 'Volodymyr Zelenskiy , Mykola Oleshchuk , Anatoliy Kryvonozhka', 'Zelenskiy , Air Force , Oleshchuk , F-16 , crash , pilot death', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(444, 1, 'https://www.reuters.com/technology/brazil-judge-takes-musks-x-fake-news-crusade-ramps-up-2024-08-30/', NULL, 'Brazilian Judge Suspends Elon Musk\'s X Over Compliance Dispute', 'Brazilian judge Alexandre de Moraes has ordered the suspension of Elon Musk\'s social media platform X after it failed to comply with various court orders, including a hefty fine. Moraes argues that the suspension is vital to protect democracy, while critics accuse him of overreach.', 'The judge\'s decision to suspend X highlights the ongoing global struggle between regulatory authorities and social media platforms regarding compliance with local laws. This incident raises important questions about the balance of power and the interpretation of free speech in the digital age.', 'This action by Judge Moraes is commendable; it shines a light on the dangers of misinformation propagated through social media. This is a necessary intervention to ensure that platforms like X do not become tools for fascist ideologies to undermine democracy.', 'Judge Moraes is an authoritarian in disguise, using his position to silence dissenting voices like Elon Musk. This decision to suspend X is a blatant example of government overreach and a violation of individual rights and free speech.', NULL, NULL, 'Alexandre de Moraes , Elon Musk , André Cesar , Jair Bolsonaro , Luiz Inacio Lula da Silva', 'suspension , Elon Musk , X , disinformation , democracy , court orders , Brazil', NULL, 85, 9, NULL, 'Government-affiliated', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(445, 1, 'https://www.reuters.com/world/top-ukrainian-officials-begin-visit-washington-2024-08-30/', NULL, 'Ukrainian Officials Discuss Urgent Defense Needs in Washington Amidst Escalating Attacks', 'Top Ukrainian officials have arrived in Washington to discuss urgent military support with U.S. Defense Secretary Lloyd Austin, emphasizing the need for increased air defense as Russia launches over 400 missiles and drones against Ukraine this week.', NULL, NULL, NULL, NULL, NULL, 'Yulia Svyrydenko , Rustem Umerov , Andriy Yermak , Lloyd Austin', 'Ukrainian officials , meeting , U.S. Defense Secretary , air defense , missiles , drones', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(446, 1, 'https://www.reuters.com/world/europe/eu-rebuffs-kyivs-request-train-troops-inside-ukraine-2024-08-30/', NULL, 'EU Rebuffs Kyiv\'s Request for Soldier Training in Ukraine', 'The European Union has denied Ukraine\'s request for training its soldiers within its borders, opting instead to conduct training as close as possible to Ukrainian territory. EU foreign policy chief Josep Borrell confirmed that the EU aims to train an additional 15,000 Ukrainian soldiers by year-end, but emphasized safety concerns and logistical challenges in establishing training facilities inside Ukraine.', 'The EU\'s decision to deny Ukraine\'s request reflects a cautious approach to the ongoing conflict, prioritizing the safety of its members while trying to support Ukraine\'s military needs. The notion of training as close as possible to the frontline is a strategic compromise, albeit one that raises questions about logistical efficiency.', 'The EU\'s reluctance to train soldiers directly in Ukraine reflects a lack of commitment to fully support the Ukrainian defense against Russian aggression. This decision not only jeopardizes the effectiveness of training but also communicates a message of hesitation in standing firmly against external threats.', 'The EU\'s decision to train Ukrainian soldiers outside of Ukraine demonstrates a worrying trend of indecisiveness and a lack of resolve. Instead of taking strong action to defend an ally, the EU opts for a cautious approach that could prolong the conflict and jeopardize European security.', NULL, NULL, 'Josep Borrell , 60,000 , 15,000 , 650,000 , 1 million', 'EU , Ukraine , soldier training , Borrell , military aid', NULL, 85, 9, NULL, 'Center-left', '2024-08-31 08:01:44', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(447, 2, 'https://www.aljazeera.com/features/2024/8/31/whatsapp-novelists-use-messaging-app-to-write-and-sell-books-in-zimbabwe', 'Al Jazeera', 'WhatsApp Revolutionizes Book Publishing for Zimbabwean Authors', 'Emerging authors in Zimbabwe, like Kingston Dhewa, are turning to WhatsApp for affordable self-publishing and direct reader engagement. This new model challenges traditional publishing due to economic hardships, enabling authors to share local stories and expand their audience despite financial limitations.', NULL, NULL, NULL, 'Zimbabwe', 'Harare', 'Kingston Dhewa , Clever Pada , Pamela Ngirazi , Philip Chidavaenzi , Irene Staunton', 'WhatsApp , self-publishing , Zimbabwe , authors , literature , economic crisis , digital publishing', NULL, 75, 8, NULL, 'left-wing', '2024-08-31 11:44:27', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(448, 1, 'https://www.aljazeera.com/news/2024/8/31/brazil-moves-to-block-access-to-musks-x-amid-disinformation-row', 'Al Jazeera', 'Brazilian Court Suspends X Operations Amid Musk Controversy', 'In Brazil, a Supreme Court ruling has led to the suspension of social media platform X, owned by Elon Musk, over failure to comply with legal requirements. The court\'s decision follows months of conflict regarding disinformation and censorship, putting millions of Brazilian users at risk of losing access.', NULL, NULL, NULL, 'Brazil', 'South America', 'Elon Musk , Alexandre de Moraes , Luiz Inacio Lula da Silva', 'X , Brazil , Supreme Court , Musk , disinformation , censorship', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 11:44:27', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(449, 1, 'https://www.aljazeera.com/news/2024/8/31/russia-ukraine-war-list-of-key-events-day-918', NULL, 'War Enters 918th Day: Key Developments from August 31, 2024', 'As the conflict continues into its 918th day, significant developments have emerged regarding military strategies and international responses to the war. Latest reports highlight shifting control of key territories and the involvement of various global powers, affecting both the regional and global political landscape.', 'The ongoing war is presenting a complex situation that requires careful monitoring. With each passing day, the strategies employed by both sides evolve, prompting a need for diplomatic engagement from the international community to prevent further escalation.', 'This prolonged conflict demonstrates the failures of capitalist powers in seeking profit through war, often at the expense of human lives. It highlights the necessity for social movements to arise, advocating for peace and justice across the affected nations.', 'The war\'s continuation reflects the weakening resolve of Western nations to support their allies. A stronger military stance is crucial to deter aggression from opposing forces and to maintain global power dynamics in favor of national interests.', NULL, NULL, 'Military Leaders , Global Powers , Political Analysts', 'War , Conflict , International Responses , Territory Control', 8, 85, 9, 'Global News Network is known for its comprehensive coverage but occasionally favors left-leaning narratives.', 'Left-wing', '2024-08-31 11:44:27', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(450, 1, 'https://www.aljazeera.com/news/2024/8/31/why-are-we-always-talking-about-the-west-bank', 'Al Jazeera', 'Israeli Assaults on Occupied West Bank Refugee Camps Result in Deaths', 'Israeli military actions targeting refugee camps in the occupied West Bank have resulted in at least 20 Palestinian casualties. The ongoing situation highlights the long-standing issues of occupation, illegal settlements, and the humanitarian crisis faced by Palestinians in the region.', 'The recent Israeli assaults on refugee camps in the West Bank showcase the continuing cycle of violence and unrest in the region, exacerbating the already critical humanitarian situation for Palestinians. It\'s essential for the international community to address these issues to seek a peaceful resolution.', NULL, NULL, 'Qatar', 'Middle East', '20 Palestinian casualties , 3 million Palestinians in West Bank , 871,000 registered refugees , 700,000 Israelis in the West Bank', 'Israel , West Bank , refugee camps , occupation , settlements , Palestinians , Gaza', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 11:44:27', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(451, 1, 'https://www.aljazeera.com/news/2024/8/31/us-military-says-15-isil-fighters-killed-in-joint-raid-with-iraqi-forces', 'Associated Press', 'Seven US Soldiers Injured in Joint Raid Against ISIS in Iraq', 'A joint operation between US forces and Iraqi security resulted in the injury of seven US soldiers and the death of 15 ISIS fighters. The raid, which is part of ongoing US-Iraq security talks, saw no civilian casualties reported. The US military remains committed to countering ISIS, emphasizing continued operations alongside coalition and Iraqi partners.', 'The recent joint operation highlights the ongoing challenges both the US and Iraq face in combating ISIS remnants in the region. As tensions rise, it\'s crucial for both nations to maintain a collaborative approach to ensure security and stability.', 'Once again, the military actions in Iraq reveal the destructive consequences of foreign intervention. The presence of US soldiers is a constant provocation, and it only serves to exacerbate the violence and instability in the region, hindering any chance for peace.', 'This operation underscores the importance of a strong military presence in the Middle East. As long as ISIS poses a threat, the US must not withdraw its forces but rather increase its efforts to eliminate this menace permanently.', 'USA', 'Iraq', 'ISIS Fighters , US Soldiers , US Central Command (CENTCOM) , Iraqi Security Forces', 'US soldiers , ISIS , Iraq , joint raid , military operation , CENTCOM , air strikes', NULL, 75, 8, NULL, 'neutral', '2024-08-31 11:44:27', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(452, 1, 'https://www.aljazeera.com/news/2024/8/31/israeli-soldiers-besiege-jenin-as-assault-on-west-bank-enters-fourth-day', NULL, 'Israel Launches Largest Military Operation in Decades, 20 Killed', 'In an unprecedented military operation, Israel has conducted raids in Jenin, West Bank, leading to the deaths of at least 20 people. Israeli forces targeted various areas, blocking access to aid and resulting in significant destruction and casualties among Palestinians. The situation has drawn international scrutiny and raised concerns over humanitarian access.', NULL, NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, NULL, '2024-08-31 11:44:27', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(453, 1, 'https://www.aljazeera.com/news/2024/8/31/philippines-china-trade-accusations-of-ramming-ships-in-south-china-sea', NULL, 'Rising Tensions at Sabina Shoal: China and Philippines Clash Over Maritime Rights', 'Tensions between China and the Philippines have escalated as both sides accuse each other of ramming ships at the disputed Sabina Shoal in the South China Sea. China\'s coastguard claims a Philippine ship \'illegally stranded\' at the shoal deliberately rammed a Chinese vessel, while the Philippine coastguard reports the reverse. Both nations emphasize their claims to the area amidst the backdrop of international law and a recent arbitration ruling.', 'The ongoing maritime confrontations between China and the Philippines highlight the complexities of territorial disputes in the South China Sea. Both nations must seek diplomatic solutions to avoid escalating tensions and ensure the safety of their vessels in disputed waters.', NULL, NULL, NULL, NULL, 'Liu Dejun , Jay Tarriela', 'Sabina Shoal , Philippines , China , coastguard , maritime rights , South China Sea , territorial sovereignty', NULL, 85, 9, NULL, 'Right-wing', '2024-08-31 11:44:27', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(454, 2, 'https://www.aljazeera.com/news/2024/8/31/helicopter-goes-missing-in-far-eastern-russia-with-22-people-on-board', 'TASS', 'Helicopter with 22 People Missing Over Kamchatka Peninsula', 'An Mi-8 helicopter with 22 people on board, including 19 tourists, has gone missing in Russia\'s Kamchatka peninsula. Authorities report loss of communication shortly after takeoff, with rescue teams searching the area. This incident highlights ongoing concerns about aviation safety in this remote region.', 'The disappearance of the helicopter brings attention to the ongoing safety issues surrounding aviation in Russia, particularly in remote areas like Kamchatka where harsh weather conditions complicate rescue operations.', NULL, NULL, 'Russia', 'Kamchatka Peninsula', 'Vladimir Solodov , 22 people on board', 'helicopter , missing , Kamchatka , tourists , aviation safety , Mi-8', NULL, 85, 8, NULL, 'government-affiliated', '2024-08-31 11:44:27', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(455, 1, 'https://www.bbc.com/news/articles/cx2erwedxz5o', NULL, 'Tensions Escalate as China and Philippines Accuse Each Other of Coast Guard Aggression', 'China and the Philippines are embroiled in escalating tensions in the South China Sea, with each nation accusing the other of ramming their coast guard vessels. The latest incident occurred near the disputed Sabina Shoal, intensifying an ongoing territorial dispute. The U.S. has condemned China\'s actions, further complicating the geopolitical situation.', NULL, NULL, NULL, NULL, NULL, 'MaryKay L Carlson , Jay Tarriela', 'South China Sea , China , Philippines , coast guard , Sabina Shoal , territorial dispute', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 11:48:13', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(456, 3, 'https://www.bbc.com/sport/articles/ckg2ljx810no', NULL, 'Zakia Khudadadi Makes History with Bronze at Paris Paralympics', 'Zakia Khudadadi, an Afghan Para-taekwondo athlete, has won a bronze medal in the K44 -47kg category at the Paris Paralympics, marking her remarkable comeback after her country\'s political turmoil under Taliban rule. She emphasizes the importance of her win for women in Afghanistan and expresses hopes for a better future.', NULL, NULL, NULL, NULL, NULL, 'Zakia Khudadadi', 'Paris Paralympics , Bronze Medal , Afghan Women , Taliban , Para-taekwondo', NULL, 85, 8, NULL, 'left-wing', '2024-08-31 11:48:13', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(457, 2, 'https://www.bbc.com/news/articles/cqxjd1lr5lro', NULL, 'Australia\'s Smoking Regulations: A Model for the UK?', 'Australia has implemented strict smoking regulations in pubs and outdoor settings, leading to a significant decline in smoking rates. With the UK government considering similar measures, experts weigh the success of these Australian policies in protecting public health.', NULL, NULL, NULL, NULL, NULL, 'Jack Berman , Kenny James , Rob , Becky Freeman , Craig Shannon , Mick Bain', 'smoking regulations , Australia , pubs , secondhand smoke , government policy , public health', NULL, 75, 7, NULL, 'left-wing', '2024-08-31 11:48:13', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(458, 2, 'https://www.bbc.com/news/articles/c1k3rjwlx8do', 'BBC News', 'Dr. Mark Chavez Charged in Perry\'s Death, Agrees to Stop Practicing Medicine', 'Dr. Mark Chavez has been granted bail after agreeing to stop practicing medicine as he faces charges related to the death of actor Matthew Perry. Prosecutors unveiled a drug distribution network linked to Perry\'s death, which included high levels of ketamine in his system. Chavez admitted conspiracy to distribute ketamine amidst others charged, raising concerns about medical ethics and drug misuse.', NULL, NULL, NULL, 'United States', 'California', 'Mark Chavez , Matthew Perry , Salvador Plasencia , Kenneth Iwamasa , Jasveen Sangha', 'Dr. Mark Chavez , Matthew Perry , ketamine , drug distribution , conspiracy , medical ethics', NULL, 85, 7, NULL, 'Neutral', '2024-08-31 11:48:13', 'en', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(459, 2, 'https://www.bbc.com/news/articles/c62rl70jge3o', NULL, 'Devastating Typhoon Shanshan Strikes Japan, Leaving Six Dead and Hundreds Injured', 'Typhoon Shanshan has made landfall in southwestern Japan, resulting in at least six fatalities and over 100 injuries. The storm, now downgraded to a tropical storm, is still causing significant damage and disruption, with warnings of landslides and flooding in affected areas. Thousands remain without power as recovery efforts commence.', NULL, NULL, NULL, NULL, NULL, '6 dead , 100+ injured , 90 km/h winds , 252 km/h winds , 300mm rainfall expected', 'Typhoon Shanshan , Japan , landfall , injuries , flooding , climate change', NULL, 85, 9, NULL, 'Neutral', '2024-08-31 11:48:13', 'en', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(460, 1, 'https://www.channelnewsasia.com/watch/fears-conflict-between-israel-and-hezbollah-both-sides-border-run-high-4578876', NULL, 'Tensions Eased Between Israel and Hezbollah After Recent Clashes', 'Fears of an all-out war between Israel and the Lebanese militant group Hezbollah have eased as both sides have pulled back after heavy fire exchanges on August 25, although tensions remain high, particularly among residents in conflict zones.', 'While the recent pullback is a positive sign, it is essential to continue monitoring the situation as underlying tensions persist, especially given the volatile history between Israel and Hezbollah.', 'The international community must take stronger actions against Israel’s continued aggression, and support peace initiatives that emphasize the end of military actions in the region.', 'Israel\'s restraint in the face of Hezbollah\'s provocations is commendable, but security measures must be fortified to prevent any future assaults on its territory.', NULL, NULL, '', 'Israel , Hezbollah , tensions , war , militant , retreat , August 25', NULL, 85, 7, NULL, 'left-wing', '2024-08-31 11:51:55', 'en', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(461, 1, 'https://www.channelnewsasia.com/world/israel-hamas-gaza-deadly-west-bank-raid-enters-fourth-day-4579076', NULL, 'Intensified Violence in West Bank Amid Ongoing Gaza Conflict', 'Israel has continued its military operations in the occupied West Bank for a fourth day, resulting in multiple fatalities among Palestinians, including militants, as fierce fighting continues amid the ongoing Gaza war. Clashes have escalated particularly in Jenin, with significant international concern expressed over the violence.', NULL, NULL, NULL, NULL, NULL, 'Benjamin Netanyahu , Wisam Bakr , 20 Palestinians killed , 1,199 deaths from Oct 7 attack , 40,602 deaths in Gaza', 'Israel , Palestine , West Bank , Gaza , military operation , violence , Hamas , Islamic Jihad , casualties', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 11:51:55', 'en', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(462, 1, 'https://www.euronews.com/my-europe/2024/08/31/a-rundown-of-the-latest-nominations-for-eu-commission', NULL, 'EU Member States Nominate Key Candidates Amid Gender Balance Push', 'As the deadline for EU commissioner nominations approaches, Bulgaria, Italy, and Denmark have announced their candidates, while Belgium struggles with political turmoil. Bulgaria is the only country to fulfill President Ursula von der Leyen’s request for both male and female candidates by the deadline. The nominations reflect ongoing challenges, particularly regarding gender representation.', NULL, NULL, NULL, NULL, NULL, 'Ekaterina Zaharieva , Julian Popov , Rumen Radev , Dimitar Glavchev , Raffaele Fitto , Dan Jørgensen , Mette Frederiksen', 'EU Commission , gender balance , nominations , commissioner candidates , political turmoil , Bulgaria , Italy , Denmark , Belgium', NULL, 75, 8, NULL, 'Government-affiliated', '2024-08-31 11:53:17', 'en', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(463, 4, 'https://www.euronews.com/next/2024/08/31/telegrams-double-dilemma-what-pavel-durov-does-next-could-impact-apps-reputation-analysts-', NULL, 'Telegram CEO Faces Charges Amidst Controversy Over Content Moderation', 'Telegram\'s CEO Pavel Durov is charged in France for allowing illegal content on the platform, including child sexual abuse material and drug trafficking. While Telegram is perceived as a tool for anti-government protests, it struggles with its public image as it contemplates compliance with French laws, risking its core values of minimal moderation and user privacy.', NULL, NULL, NULL, NULL, NULL, 'Pavel Durov , Yevgeniy Golovchenko , William Echikson , Alexei Navalny', 'Telegram , Pavel Durov , content moderation , illegal activities , anti-government protests , France , child sexual abuse material , drug trafficking', NULL, 85, 7, NULL, 'left-wing', '2024-08-31 11:53:17', 'en', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(464, 2, 'https://www.euronews.com/culture/2024/08/31/geneva-watch-days-haute-horlogerie-celebrates-back-to-school-with-mind-blowing-innovations', NULL, 'Geneva Watch Days: A New Era for Horology Enthusiasts', 'Geneva Watch Days, now in its fifth edition, unites over 52 luxury watch brands and thousands of collectors and journalists in Geneva. Launched amid the pandemic, the decentralized event offers an informal setting imbued with innovation and diversity in the watchmaking industry.', 'The Geneva Watch Days have emerged as a significant event in the watchmaking calendar, reflecting the industry\'s resilience and adaptability in a post-pandemic world. It brings together a diverse array of brands and enthusiasts, highlighting the evolution of consumer engagement within the luxury goods sector.', NULL, NULL, NULL, NULL, 'Jean-Christophe Babin , Georges Kern , Rolf Studer , Patrick Pruniaux , Delphine Bachmann', 'Geneva Watch Days , luxury watches , watchmaking , Breitling , Bulgari , innovation , collections , expo', NULL, 75, 9, NULL, 'neutral', '2024-08-31 11:53:17', 'en', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(465, 1, 'https://www.euronews.com/my-europe/2024/08/31/crucial-regional-elections-to-take-place-in-germany-with-spotlight-on-far-right-afd', 'Euronews', 'Upcoming Elections in Saxony and Thuringia Raise Concerns Over Far-Right Surge', 'Voters in Saxony and Thuringia head to the polls this Sunday in regional elections, which are crucial for assessing the public\'s sentiment towards Germany\'s coalition government. The far-right Alternative for Germany (AfD) is projected to perform strongly, potentially complicating coalition-building for traditional parties like the Christian Democratic Union (CDU) amidst rising anti-immigration sentiment following extremist attacks.', NULL, NULL, NULL, 'Germany', NULL, 'Remko Leemhuis , Alternative for Germany (AfD) , Christian Democratic Union (CDU) , German Green Party , Social Democratic Party (SPD)', 'Saxony , Thuringia , far-right , Alternative for Germany , CDU , elections , extremism , anti-immigration', NULL, 85, 9, NULL, 'left-wing', '2024-08-31 11:53:17', 'en', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(466, 4, 'https://www.japantimes.co.jp/business/2024/08/31/rapidus-invest-japan-government/', NULL, 'Japan\'s Government Eyes Investment in Chipmaker Rapidus to Boost Credibility and Investment', 'The Japanese government is considering investing in Rapidus Corp., a chipmaker that plans to start mass production of next-generation semiconductors by 2027. This initiative aims to enhance the company\'s credibility, potentially encouraging private-sector investments and loans as it builds a new plant in Hokkaido.', NULL, NULL, NULL, NULL, NULL, 'Rapidus Corp. , Japanese government , Chitose , Hokkaido Prefecture', 'investment , semiconductor , government , Rapidus , Hokkaido', NULL, 75, 8, NULL, 'government-affiliated', '2024-08-31 11:55:09', 'en', '2024-09-02 00:44:51', '2024-09-02 00:44:51');
