INSERT INTO `translations` (`id`, `translateable_type`, `translateable_id`, `locale`, `column`, `value`, `created_at`, `updated_at`) VALUES
	(1, 'App\\Models\\News', 1, 'cn', 'title', '美国国家安全顾问在中美紧张关系下会见习近平', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(2, 'App\\Models\\News', 1, 'cn', 'summary', '美国国家安全顾问杰克·沙利文结束了对中国的重要访问，会见了习近平主席和高级军事官员，讨论了台湾、南中国海及地区冲突等日益紧张的问题。这次讨论旨在促进沟通、减轻即将到来的美国总统选举前的潜在冲突。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(3, 'App\\Models\\News', 1, 'cn', 'comment_neutral', '美中官员之间的最近会晤表明在复杂的地缘政治动态中缓解双边紧张关系的谨慎尝试。双方均表示希望进行对话，但有关台湾和领土争端等根深蒂固的问题仍然令人挑战。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(4, 'App\\Models\\News', 1, 'cn', 'comment_left', '此次访问不过是外交的幌子，掩盖了美国继续威胁中国主权的侵略性帝国主义政策。虽然美国声称寻求稳定，但其在该地区的军事联盟直接破坏了任何和平解决方案。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(5, 'App\\Models\\News', 1, 'cn', 'comment_right', '拜登政府愿意与中国这样一个对手进行谈判显示了软弱。美国必须采取更坚定的立场，以遏制中国的侵略，特别是在台湾问题上，而不是沉溺于没有结果的外交谈话。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(6, 'App\\Models\\News', 2, 'cn', 'title', '联合国警告加沙人道主义危机 美方仍保持沉默', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(7, 'App\\Models\\News', 2, 'cn', 'summary', '联合国对因以色列行动导致加沙人道主义危机表示警告，而美国政府没有对以色列施加显著的公共压力。营养不良和小儿麻痹症病例的增加，使得各方呼吁在冲突中暂停人道主义救助。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(8, 'App\\Models\\News', 2, 'cn', 'comment_neutral', '加沙的情况非常严峻，国际社会对危机的回应，尤其是美国的回应，是至关重要的。人道问题应当始终优先于政治联盟。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(9, 'App\\Models\\News', 2, 'cn', 'comment_left', '拜登政府的沉默或无作为清楚地表明了对以色列针对巴勒斯坦人压迫行动的默认。继续提供军事支持而忽视人道主义需求是不可接受的，是对人权的侵犯。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(10, 'App\\Models\\News', 2, 'cn', 'comment_right', '媒体夸大了人道危机，以质疑以色列自我防卫的权利。焦点应首先放在以色列的安全上，而不是外部的政治压力。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(11, 'App\\Models\\News', 3, 'cn', 'title', '反对派呼吁引渡：孟加拉国反对派要求将谢赫·哈西娜送回', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(12, 'App\\Models\\News', 3, 'cn', 'summary', '在谢赫·哈西娜在孟加拉国被推翻后，反对派领导人要求她从印度引渡，印度是她寻求庇护的地方。这加剧了两国之间的紧张关系，并且伴随着对印度在她政府过去行为中共谋的指控。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(13, 'App\\Models\\News', 3, 'cn', 'comment_neutral', '孟加拉国最近的动乱和对谢赫·哈西娜引渡的呼声反映了该国政治动荡的重大变化。这突显了地区关系的复杂性以及印度在多年支持哈西娜政府中的作用。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(14, 'App\\Models\\News', 3, 'cn', 'comment_left', '对哈西娜引渡的要求是追求她政府违规行为问责的重要一步。印度必须认识到其在支持孟加拉国压迫政权中的历史角色，并寻求真正的民主支持。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(15, 'App\\Models\\News', 3, 'cn', 'comment_right', '如果印度引渡哈西娜，这将维护地区稳定，并清楚地表明反对外部干预内政的信息。印度应优先考虑国家利益，加强与孟加拉国的主权问题。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(16, 'App\\Models\\News', 4, 'cn', 'title', '俾路支省大屠杀：对旁遮普工人的种族针对', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(17, 'App\\Models\\News', 4, 'cn', 'summary', '在俾路支省的近期袭击中，至少70人遇害，其中包括大量被俾路支解放军针对的旁遮普族人。这种暴力反映了该贫困地区在资源开采等方面持续存在的种族紧张关系和冲突。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(18, 'App\\Models\\News', 4, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(19, 'App\\Models\\News', 4, 'cn', 'comment_left', NULL, '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(20, 'App\\Models\\News', 4, 'cn', 'comment_right', NULL, '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(21, 'App\\Models\\News', 5, 'cn', 'title', '美国东部马脑炎病例激增引发警报', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(22, 'App\\Models\\News', 5, 'cn', 'summary', '美国今年确认五例东部马脑炎（EEE）病例，包括新罕布什尔州的一例死亡。这是该州十年来的首例人类病例，突显了这种罕见的蚊媒病毒所带来的严重风险，促使公共卫生措施的加强。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(23, 'App\\Models\\News', 5, 'cn', 'comment_neutral', '东部马脑炎病例的出现强调了严格公共卫生应对策略的必要性，鉴于该病毒对人类神经系统的严重影响，尽管其罕见。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(24, 'App\\Models\\News', 5, 'cn', 'comment_left', NULL, '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(25, 'App\\Models\\News', 5, 'cn', 'comment_right', NULL, '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(26, 'App\\Models\\News', 6, 'cn', 'title', 'PetroSaudi高管因1MDB诈骗案被判刑', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(27, 'App\\Models\\News', 6, 'cn', 'summary', 'PetroSaudi的两名高管因涉及从马来西亚的1MDB基金中挪用超过18亿美元而被判处六年和七年的监禁。这两项定罪标志着围绕1MDB的国际腐败丑闻的持续篇章，牵涉到众多全球金融机构。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(28, 'App\\Models\\News', 6, 'cn', 'comment_neutral', '帕特里克·马霍尼和塔里克·奥巴伊的定罪突显了1MDB丑闻持续的影响，揭示了国际金融系统内腐败的程度。他们的判刑提醒我们，在公司治理中追求问责制的重要性。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(29, 'App\\Models\\News', 6, 'cn', 'comment_left', NULL, '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(30, 'App\\Models\\News', 6, 'cn', 'comment_right', NULL, '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(31, 'App\\Models\\News', 7, 'cn', 'title', 'Telegram首席执行官帕维尔·杜罗夫在法国刑事调查中获释保释', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(32, 'App\\Models\\News', 7, 'cn', 'summary', 'Telegram首席执行官帕维尔·杜罗夫在被法国正式调查后，以五百万欧元的保释金获释，涉嫌通过该即时通讯应用促进有组织犯罪。该案件引发了关于应用所有者刑事责任和言论自由的争议。', '2024-09-02 00:44:38', '2024-09-02 00:44:38'),
	(33, 'App\\Models\\News', 7, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(34, 'App\\Models\\News', 7, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(35, 'App\\Models\\News', 7, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(36, 'App\\Models\\News', 8, 'cn', 'title', '美国对以色列定居者团体实施制裁，因对巴勒斯坦人暴力升级', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(37, 'App\\Models\\News', 8, 'cn', 'summary', '拜登政府因被占领的西岸地区对巴勒斯坦平民的暴力升级而对一个以色列定居者团体和一名民间安全警卫实施制裁。美国呼吁对定居者暴力负责，并强调这些行为危害以色列安全，削弱地区和平前景。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(38, 'App\\Models\\News', 8, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(39, 'App\\Models\\News', 8, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(40, 'App\\Models\\News', 8, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(41, 'App\\Models\\News', 9, 'cn', 'title', '以色列在西岸发起重大攻击，死亡人数上升', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(42, 'App\\Models\\News', 9, 'cn', 'summary', '以色列军队在西岸进行20年来规模最大的行动，导致至少10名巴勒斯坦人死亡，理由是针对其声称的武装组织的威胁。巴勒斯坦权力机构对袭击表示谴责，并警告可能产生严重后果。这一升级发生在加沙持续冲突和新的巴勒斯坦运动兴起的背景下，后者寻求对抗以色列的占领。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(43, 'App\\Models\\News', 9, 'cn', 'comment_neutral', '最近在西岸的军事行动突显了以色列-巴勒斯坦冲突的复杂性，日益升级的暴力引发了对地区稳定的重大担忧。分析人士指出，这些行动可能受到以色列内部政治压力的影响。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(44, 'App\\Models\\News', 9, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(45, 'App\\Models\\News', 9, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(46, 'App\\Models\\News', 10, 'cn', 'title', '联邦调查局详细揭示袭击特朗普集会的枪手计划', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(47, 'App\\Models\\News', 10, 'cn', 'summary', '联邦调查局报告称，20岁的托马斯·克鲁克斯在选择目标前进行了“持续且详细的努力”以计划针对主要事件的袭击，最终选择在宾夕法尼亚州的一场特朗普集会中实施。克鲁克斯在线进行了大量关于特朗普的搜索，目前未发现他受到任何特定意识形态动机的影响。该机构继续调查他的心态以及此次袭击的安全漏洞。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(48, 'App\\Models\\News', 10, 'cn', 'comment_neutral', '联邦调查局的发现突显了美国针对政治暴力的一个令人不安的趋势。缺乏明确的意识形态动机使得我们对这些事件的理解变得复杂，迫使执法部门必须在政治活动中保持警惕，以保护公众安全。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(49, 'App\\Models\\News', 10, 'cn', 'comment_left', '这一事件强调了右翼极端主义所带来的危险。年轻人针对像特朗普这样的政治人物进行了重大努力，说明政治暴力文化已经恶化到何种程度。我们必须面对助长这种仇恨的系统性问题。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(50, 'App\\Models\\News', 10, 'cn', 'comment_right', '尽管对特朗普生命的袭击令人极其不安，但我们也必须考虑到针对右翼人物的政治侵略的更广泛背景。这一令人震惊的事件可能是由于媒体和文化中对保守派声音的持续诽谤，导致个别人采取如此绝望的行动。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(51, 'App\\Models\\News', 11, 'cn', 'title', '委内瑞拉抗议活动爆发，马杜罗在争议中宣称胜利', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(52, 'App\\Models\\News', 11, 'cn', 'summary', '反对派领袖玛丽亚·科琳娜·马查多表示，尼古拉斯·马杜罗总统在上月有争议的选举后正变得“更加孤立”。在重新出现的抗议和国际谴责下，委内瑞拉民众呼吁选举过程透明，同时还面临政府的镇压。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(53, 'App\\Models\\News', 11, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(54, 'App\\Models\\News', 11, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(55, 'App\\Models\\News', 11, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(56, 'App\\Models\\News', 12, 'cn', 'title', '巴黎残奥会在市中心举行开幕式，拉开帷幕', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(57, 'App\\Models\\News', 12, 'cn', 'summary', '巴黎残奥会的开幕式在协和广场举行，法国总统马克龙出席，拉开了为期11天的比赛。这是第一次在主体育场以外举行典礼，已有超过200万张门票售出。国际残奥委员会主席安德鲁·帕森斯表示，此次活动旨在将残疾人士面临的问题带到全球关注的焦点。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(58, 'App\\Models\\News', 12, 'cn', 'comment_neutral', '巴黎残奥会不仅是一项体育赛事，也是一个解决残疾人士面临的更广泛社会问题的平台。举办地点的选择和预期的观众反映了对包容性日益增长的认识和支持。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(59, 'App\\Models\\News', 12, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(60, 'App\\Models\\News', 12, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(61, 'App\\Models\\News', 13, 'cn', 'title', '香港记者面临标志性煽动罪指控，媒体打压加剧', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(62, 'App\\Models\\News', 13, 'cn', 'summary', '香港Stand News前编辑钟佩券和林峯因煽动罪接受审判，预计本周作出裁决。此标志性案件凸显了对独立媒体的打压，可能会影响该市在收紧国安法下的新闻业未来。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(63, 'App\\Models\\News', 13, 'cn', 'comment_neutral', '钟佩券和林峯的审判是香港新闻自由的关键时刻，突显了国家安全与新闻独立之间的紧张关系。结果可能设定未来报道的先例。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(64, 'App\\Models\\News', 13, 'cn', 'comment_left', '这场审判是镇压异议、消除香港民主声音的更大努力的一部分。煽动罪的指控对言论自由构成侮辱，反映出一个压迫政权对曝光的恐惧。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(65, 'App\\Models\\News', 13, 'cn', 'comment_right', '香港政府在实施煽动法以防止混乱和保护国家安全方面是正当的。Stand News 编辑的行为明显无视维护秩序所必需的法律。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(66, 'App\\Models\\News', 14, 'cn', 'title', '战争进入第916天：2024年8月29日的重要进展', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(67, 'App\\Models\\News', 14, 'cn', 'summary', '随着冲突进入第916天，重要进展已经展开，包括外交谈判、军事动向和人道主义努力。本文概述了最新动态及其对该地区的影响。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(68, 'App\\Models\\News', 14, 'cn', 'comment_neutral', '持续的冲突不断变化，各方利益相关者根据不断发展的局势调整策略。保持对这些动态的知情视角至关重要，因为它们不仅影响立即的地区，也关系到全球稳定。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(69, 'App\\Models\\News', 14, 'cn', 'comment_left', '这场持久的战争突显了该地区帝国主义政策的失败。必须质疑加剧冲突而非促进和平解决的外部势力的动机。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(70, 'App\\Models\\News', 14, 'cn', 'comment_right', '持续的冲突清楚地表明了领导力缺失的后果。我们需要强有力和果断的行动来保护我们的国家利益，防止这一重要地区进一步混乱。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(71, 'App\\Models\\News', 15, 'cn', 'title', '拉斯维加斯前管理员因谋杀记者杰夫·德国被判终身监禁', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(72, 'App\\Models\\News', 15, 'cn', 'summary', '罗伯特·泰尔斯因在2022年谋杀记者杰夫·德国而被判终身监禁。此次案件凸显了记者面临的危险以及保护新闻自由的必要性。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(73, 'App\\Models\\News', 15, 'cn', 'comment_neutral', '罗伯特·泰尔斯的判刑标志着对对记者暴力行为的坚决立场，重申了在民主社会中保护新闻自由的重要性。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(74, 'App\\Models\\News', 15, 'cn', 'comment_left', '此案件体现了政治领域内的系统性问题，滥用权力的公职人员必须面对正义，尤其是当他们试图压制异议声音时。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(75, 'App\\Models\\News', 15, 'cn', 'comment_right', '虽然定罪是合理的，但这引发了对媒体如何影响政治竞选和操控叙事以伤害公职人员的担忧，这可能导致更多的报复性暴力。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(76, 'App\\Models\\News', 16, 'cn', 'title', 'Telegram首席执行官被拘留引发言论自由辩论', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(77, 'App\\Models\\News', 16, 'cn', 'summary', 'Telegram首席执行官帕维尔·杜罗夫在法国因涉嫌协助犯罪活动而被拘留。这一逮捕引发了对言论自由的激烈辩论，包括俄罗斯政府在内的一些人称这是对个人自由的攻击。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(78, 'App\\Models\\News', 16, 'cn', 'comment_neutral', '帕维尔·杜罗夫的被捕引发了关于技术与执法交集的重要问题。虽然对言论自由的关注是有效的，但同样重要的是评估针对他的法律指控。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(79, 'App\\Models\\News', 16, 'cn', 'comment_left', '杜罗夫的拘留显然是国家对数字领域的进一步干预。政府不应干预那些优先考虑言论自由和隐私的平台，尤其是当它们受到专制政权的压力时。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(80, 'App\\Models\\News', 16, 'cn', 'comment_right', '这一逮捕强调了允许大型科技公司在没有监管的情况下运营的危险。虽然言论自由很重要，但我们必须确保这些平台不成为犯罪活动的工具。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(81, 'App\\Models\\News', 17, 'cn', 'title', '台风珊珊袭击日本：数十人受伤，数百航班被取消', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(82, 'App\\Models\\News', 17, 'cn', 'summary', '台风珊珊在日本西南部登陆，风速达到252公里/小时，造成严重破坏、伤亡和大面积停电。由于当局预期严重洪水，发布了5级紧急警报。主要汽车制造商的生产已暂停，航班取消普遍。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(83, 'App\\Models\\News', 17, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(84, 'App\\Models\\News', 17, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(85, 'App\\Models\\News', 17, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(86, 'App\\Models\\News', 18, 'cn', 'title', '巴黎盛大开启2024残奥会开幕式', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(87, 'App\\Models\\News', 18, 'cn', 'summary', '巴黎举行了2024年残奥会的开幕式，展示了4000多名运动员，庆祝包容性和运动精神。法国总统马克龙在香榭丽舍大街举办的盛大仪式上宣布开幕，强调此次活动在推广残疾人体育及超越体育的包容性方面的重要意义。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(88, 'App\\Models\\News', 18, 'cn', 'comment_neutral', '2024年巴黎残奥会的开幕式生动展示了包容性和多样性的精神，将成千上万来自不同背景和能力的运动员团结在一起。这个事件有力提醒了我们在残疾人权利和代表性方面取得的进展。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(89, 'App\\Models\\News', 18, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(90, 'App\\Models\\News', 18, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(91, 'App\\Models\\News', 19, 'cn', 'title', '世界粮食计划署在人道主义车辆遭袭后暂停加沙行动', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(92, 'App\\Models\\News', 19, 'cn', 'summary', '世界粮食计划署（WFP）在其一辆车辆在以色列检查站附近遭多次枪击后暂停了在加沙地带的行动。联合国发言人斯特凡·杜贾里克表示，尽管与以色列军方事先协调，该有人道主义车仍受到了攻击。WFP执行董事辛迪·麦凯恩称该事件不可接受，并强调了对援助工作人员安全协议的失败。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(93, 'App\\Models\\News', 19, 'cn', 'comment_neutral', '针对WFP车辆的攻击突显了人道主义工作人员在冲突区域面临的危险环境，尤其是在加沙。尽管采取了预防措施，但这一事件表明有必要加强协调和安全保障，以确保援助行动的安全。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(94, 'App\\Models\\News', 19, 'cn', 'comment_left', '这一事件反映了以色列军队对人道主义法律的持续漠视，继续危及无辜生命并干扰重要援助。国际社会必须追究以色列的责任，并倡导保护人道主义工作者。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(95, 'App\\Models\\News', 19, 'cn', 'comment_right', 'WFP在加沙的行动存在问题，因为它们常常与反对以色列的团体相一致。可以将此事件视为这种一致性的结果，并呼吁对潜在敌对地区的人道主义活动进行更好控制。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(96, 'App\\Models\\News', 20, 'cn', 'title', '德约科维奇瞄准第25个大满贯冠军，美国明星在美国公开赛上闪耀', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(97, 'App\\Models\\News', 20, 'cn', 'summary', '卫冕冠军科科·高夫和12号种子泰勒·弗里茨在美国公开赛中晋级第三轮，与此同样晋级的还有诺瓦克·德约科维奇，他在追逐第25个大满贯冠军的过程中，因对手因伤退赛而继续前进。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(98, 'App\\Models\\News', 20, 'cn', 'comment_neutral', '美国公开赛继续展现卓越的才能，德约科维奇在追求历史的同时，美国球员在艰难的情况下表现出色。这一动态为赛事增添了兴奋感。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(99, 'App\\Models\\News', 20, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(100, 'App\\Models\\News', 20, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(101, 'App\\Models\\News', 21, 'cn', 'title', '英国监狱面临过度拥挤危机，容量显著减少', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(102, 'App\\Models\\News', 21, 'cn', 'summary', '英格兰和威尔士的监狱正面临严重的过度拥挤，官方报告显示男性监狱仅剩83个空位。因此，裁判官被指示延迟对可能被监禁的罪犯的听证。此次危机归因于监禁率历史性的上升以及近年来政府在扩建监狱设施方面的不足行动。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(103, 'App\\Models\\News', 21, 'cn', 'comment_neutral', '监狱的过度拥挤危机凸显出急需对英国刑事司法系统进行全面审查。随着监狱人口的持续增加，政府必须解决案件积压的问题，并探讨替代监禁的解决方案。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(104, 'App\\Models\\News', 21, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(105, 'App\\Models\\News', 21, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(106, 'App\\Models\\News', 22, 'cn', 'title', '约旦河西岸暴力升级：多个巴勒斯坦人死伤', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(107, 'App\\Models\\News', 22, 'cn', 'summary', '以色列军队对被占领的约旦河西岸进行的加强 assault 已导致至少18名巴勒斯坦人死亡和许多受伤，这引起了全球的广泛谴责。随着军事行动的扩展，地区的紧张局势显著升级。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(108, 'App\\Models\\News', 22, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
