	(111, 'App\\Models\\News', 23, 'cn', 'title', '前《立场新闻》主编因煽动罪被认定有罪，具有里程碑意义的案件', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(112, 'App\\Models\\News', 23, 'cn', 'summary', '香港法院认定两位前《立场新闻》主编因煽动罪有罪，此案被视为在加强安全措施下对该市新闻自由的重要考验。他们可能根据一项殖民时代的煽动法面临监禁。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
