	(115, 'App\\Models\\News', 23, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(116, 'App\\Models\\News', 24, 'cn', 'title', 'NCT成员泰尔因性犯罪指控离队', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(117, 'App\\Models\\News', 24, 'cn', 'summary', 'SM娱乐宣布，K-pop男子团体NCT成员泰尔因涉嫌性犯罪指控而离开团体。这位歌手目前正在配合警方的调查，但具体细节尚未披露。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(118, 'App\\Models\\News', 24, 'cn', 'comment_neutral', '泰尔从NCT的离开凸显了K-pop行业中对不当行为指控的持续问题。调查必须透明进行，以确保所有相关方的公平性。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(119, 'App\\Models\\News', 24, 'cn', 'comment_left', '这一事件凸显了K-pop行业迫切需要进行改革的必要性，艺术家常常处于被利用的脆弱状态。经纪公司必须对这些指控承担责任，并保护他们的艺人。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(120, 'App\\Models\\News', 24, 'cn', 'comment_right', '此类指控通常是虚构或夸大的，媒体常常在没有证据的情况下渲染这些故事。重要的是在所有事实完全呈现和验证之前保留判断。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(121, 'App\\Models\\News', 25, 'cn', 'title', '乌克兰呼吁盟友提供更多空中防御，压力加大针对俄罗斯', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(122, 'App\\Models\\News', 25, 'cn', 'summary', '乌克兰正在呼吁增强空中防御并取消对西方武器在俄罗斯目标上使用的限制。欧盟外交官约瑟夫·博雷尔支持乌克兰的立场，声称当前的限制使武器无效。乌克兰声称成功拦截无人机和导弹，其官员警告盟友必须采取果断行动以防止俄罗斯获胜。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(123, 'App\\Models\\News', 25, 'cn', 'comment_neutral', '乌克兰的持续冲突凸显了国际军事支持的复杂性。尽管乌克兰希望更有效地利用西方武器，但解除限制的影响必须小心考虑，以避免冲突升级。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(124, 'App\\Models\\News', 25, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(125, 'App\\Models\\News', 25, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(126, 'App\\Models\\News', 26, 'cn', 'title', '暴力升级：以色列军事 Offensive 在国际抗议中继续占领约旦河西岸', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(127, 'App\\Models\\News', 26, 'cn', 'summary', '以色列军方在被占领的约旦河西岸继续其攻势，根据巴勒斯坦报道，至少有18人遇难。军事行动主要集中在北部城市，尽管联合国呼吁立即停止敌对行动，担忧医院附近医疗队的安全。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(128, 'App\\Models\\News', 26, 'cn', 'comment_neutral', '以色列在约旦河西岸的军事行动反映了以巴冲突复杂而多面的性质。每一次升级都会导致生命的损失，并引发人们对军事行动人道影响的质疑，尤其是那些靠近医疗设施的地区。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(129, 'App\\Models\\News', 26, 'cn', 'comment_left', '以色列军队在约旦河西岸施加的无差别暴力，清楚地提醒我们巴勒斯坦人民所面临的持续压迫。国际社会不仅必须谴责这些行为，还应采取果断措施，追究以色列违反国际法的责任。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(130, 'App\\Models\\News', 26, 'cn', 'comment_right', '以色列的军事行动是对该地区武装团体所构成的恐怖主义和威胁的必要回应。以色列公民的安全和保障必须优先考虑，国际压力不应妨碍以色列自我防卫的权利。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(131, 'App\\Models\\News', 27, 'cn', 'title', 'Mpox疫情在肯尼亚-乌干达边境引发警报', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(132, 'App\\Models\\News', 27, 'cn', 'summary', '随着一种新的mpox病毒株从刚果民主共和国（DRC）传播到东非，特别是肯尼亚-乌干达边境地区，卫生部门正在增加健康筛查和警报。在首次记录到新的Clade 1b株病例后，卫生官员加大了预防措施的力度，这引发了对频繁往返于这些国家的人们的担忧。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(133, 'App\\Models\\News', 27, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(134, 'App\\Models\\News', 27, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(135, 'App\\Models\\News', 27, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(136, 'App\\Models\\News', 28, 'cn', 'title', '西班牙厨师因谋杀哥伦比亚外科医生被判终身监禁', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(137, 'App\\Models\\News', 28, 'cn', 'summary', '西班牙厨师丹尼尔·桑乔·布朗查洛因谋杀和肢解哥伦比亚整形外科医生埃德温·阿里埃塔·阿尔特阿加被泰国法院判处终身监禁。法院在考虑桑乔的自卫辩护后将死刑减为终身监禁。由于桑乔在西班牙的家庭关系，此案引起了媒体广泛关注。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(138, 'App\\Models\\News', 28, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(139, 'App\\Models\\News', 28, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(140, 'App\\Models\\News', 28, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(141, 'App\\Models\\News', 29, 'cn', 'title', '欧盟外交政策首席呼吁对以色列部长实施因仇恨言论的制裁', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(142, 'App\\Models\\News', 29, 'cn', 'summary', '欧盟外交政策首席约瑟夫·博雷尔呼吁27个欧盟成员国考虑对以色列部长实施制裁，因其对巴勒斯坦人的仇恨言论，他声称这些言论煽动战争罪。此呼吁反响不一，部分欧盟国家表示支持，而另一些国家则反对。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(143, 'App\\Models\\News', 29, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(144, 'App\\Models\\News', 29, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(145, 'App\\Models\\News', 29, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(146, 'App\\Models\\News', 30, 'cn', 'title', '法院裁决振兴突尼斯总统选举中的反对派', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(147, 'App\\Models\\News', 30, 'cn', 'summary', '突尼斯法院允许前部长蒙德赫·扎伊迪参加10月6日的总统选举，推翻了因选票签名不足而禁止他的先前裁决。扎伊迪与其他反对派候选人同台，而凯斯·赛义德总统在受指控政治压迫的情况下面临着更大的审查。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(148, 'App\\Models\\News', 30, 'cn', 'comment_neutral', '法院的裁决为即将到来的突尼斯总统选举增添了重要的复杂性。这反映了统治政权与反对势力之间持续斗争的重要性，凸显了透明选举过程的重要性。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(149, 'App\\Models\\News', 30, 'cn', 'comment_left', '这一裁决是突尼斯民主的一小胜利，但也凸显了赛义德政权下仍然存在的系统性问题。权力操纵选举过程是一个危险的先例，国际社会必须关注这些滥用现象。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(150, 'App\\Models\\News', 30, 'cn', 'comment_right', '允许扎伊迪参选可能只会进一步复杂化政治局势。凯斯·赛义德的领导虽然受到挑战，但根植于对国家完整性的承诺。任何反对派都可能破坏突尼斯复苏所需的稳定。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(151, 'App\\Models\\News', 31, 'cn', 'title', '西岸冲突升级：以色列国防军突袭致五名巴勒斯坦人死亡', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(152, 'App\\Models\\News', 31, 'cn', 'summary', '在被占领的西岸，五名巴勒斯坦人在以色列军队的持续行动中被杀，联合国呼吁降级。以色列国防军声称死者是参与对以色列人进行各种攻击的武装分子。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(153, 'App\\Models\\News', 31, 'cn', 'comment_neutral', '西岸的局势仍然高度不稳定，以色列和巴勒斯坦双方的叙述出现冲突。随着暴力升级，各方进行对话以实现和平解决至关重要。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(154, 'App\\Models\\News', 31, 'cn', 'comment_left', '以色列国防军持续的军事行动代表了对人权的严重侵犯，并且是针对巴勒斯坦人民的侵略行为。国际社会必须对这些暴行采取立场，并推动立即对以色列实施制裁。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(155, 'App\\Models\\News', 31, 'cn', 'comment_right', '以色列的行动是出于自我防卫，针对武装威胁。考虑到哈马斯和其他集团最近的攻击，以色列国防军必须继续追捕并消灭那些威胁以色列平民的人。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(156, 'App\\Models\\News', 32, 'cn', 'title', '高梅斯引领新英格兰U21阵容，应对重大变革', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(157, 'App\\Models\\News', 32, 'cn', 'summary', '英格兰U21主帅卡尔斯利宣布了包括高梅斯在内的阵容，高梅斯是第一位在英超联赛出场的2000年出生的球员。伤病和退役显著改组了球队，球队将在即将迎来的国家联赛中对阵爱尔兰共和国和芬兰。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(158, 'App\\Models\\News', 32, 'cn', 'comment_neutral', '英格兰U21阵容的重塑反映了一个重要的过渡阶段，一些有重要贡献的球员退出了。像高梅斯这样的年轻人才的加入显示了对未来潜力的关注。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(159, 'App\\Models\\News', 32, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
