	(161, 'App\\Models\\News', 33, 'cn', 'title', '费德里科·基耶萨在成功的2024年欧洲杯赛事后加盟利物浦', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(162, 'App\\Models\\News', 33, 'cn', 'summary', '费德里科·基耶萨在2024年欧洲杯上的杰出表现后与利物浦签署了一份为期四年的合同。这位前锋对加入这个历史悠久的俱乐部表示热情，称其对球迷的重要性。基耶萨在尤文图斯经历了一段挑战重重的日子，主要由于受伤，他希望在英超联赛中重振职业生涯。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(163, 'App\\Models\\News', 33, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(164, 'App\\Models\\News', 33, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(165, 'App\\Models\\News', 33, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(166, 'App\\Models\\News', 34, 'cn', 'title', '梅赛德斯选择年轻才俊，维斯塔潘留在红牛', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(167, 'App\\Models\\News', 34, 'cn', 'summary', '梅赛德斯车队首席托托·沃尔夫放弃了签下马克斯·维斯塔潘的计划，而是选择将年轻车手安德烈·基米·安东内利晋升为下赛季的车手。沃尔夫承认在红牛动荡之际与维斯塔潘进行了讨论，但确认安东内利将与乔治·拉塞尔搭档参加下赛季的比赛。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(168, 'App\\Models\\News', 34, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(169, 'App\\Models\\News', 34, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(170, 'App\\Models\\News', 34, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(171, 'App\\Models\\News', 35, 'cn', 'title', '前内华达州政治家被判犯有记者谋杀罪', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(172, 'App\\Models\\News', 35, 'cn', 'summary', '前内华达州政治家罗伯特·泰勒斯因谋杀记者杰夫·德国而被判一级谋杀罪。该记者曾对泰勒斯进行过批评性报道。陪审团在审议两天后达成一致意见。泰勒斯被判终身监禁，20年后有资格保释。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(173, 'App\\Models\\News', 35, 'cn', 'comment_neutral', '罗伯特·泰勒斯的定罪凸显了新闻自由的关键重要性，以及当公众人物承担其行为责任时可能产生的危险后果。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(174, 'App\\Models\\News', 35, 'cn', 'comment_left', '此案件突显了我们政治系统内的系统性问题，掌权者感到有权压制异议。记者在我们的民主中扮演着至关重要的角色，针对他们的暴力行为必须受到谴责。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(175, 'App\\Models\\News', 35, 'cn', 'comment_right', '虽然这桩谋杀案是一场悲剧，但这个案件也引发了对媒体偏见的质疑，许多老牌媒体常常关注轰动效应而非真相。泰勒斯可能因媒体的描绘而被不公正地针对。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(176, 'App\\Models\\News', 36, 'cn', 'title', '乌克兰的无人机战略：西方技术驱动下的俄罗斯境内远程打击', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(177, 'App\\Models\\News', 36, 'cn', 'summary', '尽管北约盟国对进一步的军事权限犹豫不决，乌克兰正在利用西方技术和支持在俄罗斯境内进行远程无人机打击。乌克兰公司迅速生产廉价无人机，对俄罗斯的军事能力产生了重大影响，并给莫斯科提出了战略困境。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(178, 'App\\Models\\News', 36, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(179, 'App\\Models\\News', 36, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(180, 'App\\Models\\News', 36, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(181, 'App\\Models\\News', 37, 'cn', 'title', '喀拉拉邦影视圈因性虐待指控面临危机', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(182, 'App\\Models\\News', 37, 'cn', 'summary', '喀拉拉邦电影行业因一份详细说明普遍性骚扰和虐待的报告而陷入重大动荡。赫马委员会的发现引发了对男性明星的多项指控，导致辞职和警方投诉，并呼吁对行业的做法进行彻底调查。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(183, 'App\\Models\\News', 37, 'cn', 'comment_neutral', '喀拉拉邦电影行业的近期指控强调了系统性变革的必要性，反映了更广泛的社会问题，涉及女性的安全和权益。政府和行业领袖必须促成彻底调查，以恢复电影制作过程中的诚信和信任。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(184, 'App\\Models\\News', 37, 'cn', 'comment_left', '喀拉拉邦电影行业的性骚扰揭露突显了长期剥削和压制女性的父权文化。事态的紧迫性呼吁对行业实践进行彻底改造，加强对幸存者的支持，并追究施害者的责任。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(185, 'App\\Models\\News', 37, 'cn', 'comment_right', '尽管指控很严重，但我们必须谨慎，不要将所有行业中的男性妖魔化。这一波指控可能会迅速失控，造成比带来好处更多的伤害，并威胁到无辜个体的生计。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(186, 'App\\Models\\News', 38, 'cn', 'title', 'Telegram的杜罗夫被捕：社交媒体问责的先例', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(187, 'App\\Models\\News', 38, 'cn', 'summary', 'Telegram创始人帕维尔·杜罗夫在巴黎被捕后，被置于司法监督之下，引发了关于言论自由和社交媒体问责的辩论。他面临控罪，但未被拘留，并需支付500万欧元的保证金。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(188, 'App\\Models\\News', 38, 'cn', 'comment_neutral', '帕维尔·杜罗夫的逮捕凸显了社交媒体平台所有者责任的重要问题。此案的影响可能为未来技术领导者的问责和监管行动设置基准。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(189, 'App\\Models\\News', 38, 'cn', 'comment_left', '杜罗夫的逮捕是反对政府审查和压制言论自由斗争中的一个关键时刻。各国政府日益将异议和独立思想犯罪化，这一逮捕事件突显了这一点。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(190, 'App\\Models\\News', 38, 'cn', 'comment_right', '这又是“自由精英”试图压制挑战其叙事的声音的例证。帕维尔·杜罗夫的逮捕显示了国家权力的过度扩张，这威胁着个人自由和自由企业的价值。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(191, 'App\\Models\\News', 39, 'cn', 'title', '人工智能食谱革命：迪拜及其他地区的烹饪创新', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(192, 'App\\Models\\News', 39, 'cn', 'summary', '像迪拜的Dodo Pizza和美国的Velvet Taco这样的餐厅正在利用人工智能创造反映文化多样性的创新菜单项目。尽管一些菜肴取得了成功，但并非所有AI生成的食谱都能成功。专家强调了食谱验证中人类监督的重要性，在AI的创造潜力与烹饪传统之间找到平衡。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(193, 'App\\Models\\News', 39, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(194, 'App\\Models\\News', 39, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(195, 'App\\Models\\News', 39, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(196, 'App\\Models\\News', 40, 'cn', 'title', '在藻华危机中拯救海牛：社区的成功故事', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(197, 'App\\Models\\News', 40, 'cn', 'summary', '在佛罗里达州的亨特温泉，社区对鳗草床的恢复工作使海牛数量显著增加，尽管之前面临藻华的威胁。值得一提的是，杰森·古利博士拍摄的引人入胜的海牛行为照片在野生动物摄影师年度大赛中获得认可。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(198, 'App\\Models\\News', 40, 'cn', 'comment_neutral', '当地社区对鳗草床的恢复工作展现了美好的成效，突显了社区参与环境问题的重要性。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(199, 'App\\Models\\News', 40, 'cn', 'comment_left', '这一情况证明了政府政策在充足保护海洋野生动物和栖息地方面的失职。没有来自社区的基础性努力，海牛将继续脆弱并进一步濒危。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(200, 'App\\Models\\News', 40, 'cn', 'comment_right', '尽管恢复工作值得称赞，但这引发了有关妨碍经济发展的环境法规的质疑。我们应该优先考虑人类利益，而不是野生动物保护。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(201, 'App\\Models\\News', 41, 'cn', 'title', '乌克兰残奥运动员在战争中蓬勃发展：韧性的故事', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(202, 'App\\Models\\News', 41, 'cn', 'summary', '尽管乌克兰的冲突持续，残奥运动员展现了非凡的韧性并在体育上取得成功。丹尼洛·楚法罗夫从在马里乌波尔的围攻中生存到成为世界冠军的旅程，彰显了他和其他运动员的力量和决心，同时他们仍然面临战争带来的挑战。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(203, 'App\\Models\\News', 41, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(204, 'App\\Models\\News', 41, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(205, 'App\\Models\\News', 41, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(206, 'App\\Models\\News', 42, 'cn', 'title', '2023残奥会：新星在首日大放异彩', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(207, 'App\\Models\\News', 42, 'cn', 'summary', '青少年运动员威廉·埃拉德和奥利维亚·纽曼-巴罗尼乌斯在残奥会的S14蝶泳预赛中表现出色，而老将如大卫·史密斯和卡迪娜·考克斯也在争夺金牌。今天的赛事包括克里斯蒂·雷利-克罗斯利的世界纪录以及怀孕射手乔迪·格林汉姆的历史性参赛。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(208, 'App\\Models\\News', 42, 'cn', 'comment_neutral', '年轻运动员在残奥会上的表现突显了适应性运动中新一代的崭露头角，展示了他们在竞争环境中的才能和毅力。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(209, 'App\\Models\\News', 42, 'cn', 'comment_left', '尽管这些运动员的成功令人欣慰，但必须正视体育资金和无障碍设施中的系统性问题，仍然使许多残疾运动员无法实现他们的梦想。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(210, 'App\\Models\\News', 42, 'cn', 'comment_right', '媒体对年轻、未经考验的运动员的关注胜过资深冠军，这削弱了传统体育价值观。在奖牌比赛中，经验应该被看重和优先考虑。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(211, 'App\\Models\\News', 43, 'cn', 'title', '意大利残奥明星将在2024年巴黎大放异彩', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(212, 'App\\Models\\News', 43, 'cn', 'summary', '意大利残奥代表团由游泳明星西蒙·巴拉姆领衔，目标是在2024年巴黎残奥会上争夺荣耀，比赛将有22项体育项目和549枚金牌，横跨11天的比赛。运动员如迪德·德·格鲁特、马塞尔·哈格、奥克萨娜·马斯特斯和亚历克西斯·汉昆坎特准备展示他们的才能。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(213, 'App\\Models\\News', 43, 'cn', 'comment_neutral', '即将举行的巴黎残奥会为运动员们提供了重要机遇，突显了他们的奉献和韧性。西蒙·巴拉姆的带头角色很好地表明了个人如何克服挑战并取得卓越成就。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(214, 'App\\Models\\News', 43, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(215, 'App\\Models\\News', 43, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(216, 'App\\Models\\News', 44, 'cn', 'title', '巴黎2024残奥会设有盲文奖牌和标志性开幕仪式', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(217, 'App\\Models\\News', 44, 'cn', 'summary', '2024年巴黎残奥会将展示来自168个代表团的4400名运动员的创纪录，其中包括以“人民游行”为特色的独特开幕式，游行将穿过巴黎的标志性地标。残奥会将于8月28日开幕，共设有22个项目，颁发549枚金牌。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(218, 'App\\Models\\News', 44, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(219, 'App\\Models\\News', 44, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(220, 'App\\Models\\News', 44, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(221, 'App\\Models\\News', 45, 'cn', 'title', 'Telegram创始人帕维尔·杜罗夫在法国接受调查', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(222, 'App\\Models\\News', 45, 'cn', 'summary', 'Telegram创始人帕维尔·杜罗夫因与该消息应用程序相关的有组织犯罪被法国正式调查。他须支付500万欧元的保证金，并在法国的司法监督下保持在法国境内。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(223, 'App\\Models\\News', 45, 'cn', 'comment_neutral', '对帕维尔·杜罗夫的调查引发了关于社交媒体平台所有者责任及其在非法活动中的问责的重要问题。虽然这并不意味着他的有罪，但这表明了科技行业监管措施的重要性。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(224, 'App\\Models\\News', 45, 'cn', 'comment_left', '此案件展示了西方国家在声称保护言论自由的同时，打压独立声音和平台的虚伪。杜罗夫的拘留是资本主义如何利用国家权力压制异议和控制叙事的一课。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(225, 'App\\Models\\News', 45, 'cn', 'comment_right', '杜罗夫代表了对抗审查和威权主义的斗争。他的调查只是西方国家最近一项破坏数字时代言论自由的阴谋，这显然显示了政府对私人企业的干预带来的危险。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(226, 'App\\Models\\News', 46, 'cn', 'title', 'NCT成员Taeil因性犯罪指控离开团队', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(227, 'App\\Models\\News', 46, 'cn', 'summary', '韩国歌手Taeil因性犯罪指控离开NCT。他的经纪公司SM娱乐确认了他的离开，并表示他正在配合警方调查。指控的具体性质尚未透露。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(228, 'App\\Models\\News', 46, 'cn', 'comment_neutral', 'Taeil离开NCT的事件突显了娱乐行业中性犯罪指控的严重后果。这强调了对所有相关人员进行彻底调查和公正对待的重要性。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(229, 'App\\Models\\News', 46, 'cn', 'comment_left', '这一事件引发了对K-pop行业内普遍存在的权力动态和剥削的严重关切，艺术家们往往面临巨大的压力和审视。应重点关注为所有表演者创造一个安全的环境。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(230, 'App\\Models\\News', 46, 'cn', 'comment_right', '虽然指控应引起重视，但在此类案件中急于下结论可能会在没有足够证据的情况下摧毁人生和职业。我们需要确保在证据确凿之前维护无罪推定。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(231, 'App\\Models\\News', 47, 'cn', 'title', '阿里克尔首席执行官因韩国致命工厂火灾被捕', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(232, 'App\\Models\\News', 47, 'cn', 'summary', '韩国锂电池公司阿里克尔首席执行官朴洵宽因6月工厂火灾被捕，火灾造成23人死亡，9人受伤。调查人员指出安全隐患和管理不善，包括赶工期和雇佣技术水平较低的工人。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(233, 'App\\Models\\News', 47, 'cn', 'comment_neutral', '朴洵宽的被捕引发了关于韩国制造业工作场所安全和管理责任的严重质疑。这凸显了加强监管监督的迫切需求，以防止未来发生这样的悲剧。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(234, 'App\\Models\\News', 47, 'cn', 'comment_left', '这一事件突显了资本主义体系的剥削本质，在这个体系中，利润优先于人命。政府必须对安全违规行为采取更强硬的立场，并追究企业的不当行为。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(235, 'App\\Models\\News', 47, 'cn', 'comment_right', '虽然问责重要，但这种情况说明外国工人常常被雇主置于危险境地。公司应在仍然负责任的同时，享有更多运营自由，而不受过多监管。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(236, 'App\\Models\\News', 48, 'cn', 'title', '科罗拉多州远足者在公司团建中被落下后获救', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(237, 'App\\Models\\News', 48, 'cn', 'summary', '一名科罗拉多州远足者在公司团建中被落下后获救。他迷路并忍受了恶劣天气，最终恢复手机信号并拨打求助电话。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
