	(241, 'App\\Models\\News', 49, 'cn', 'title', '塔利班在阿富汗禁止综合格斗，称其与伊斯兰法律不符', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(242, 'App\\Models\\News', 49, 'cn', 'summary', '塔利班政府正式禁止阿富汗的综合格斗（MMA），称其违反伊斯兰法律并对参与者构成风险。该决定是在塔利班道德警察进行审查后作出的，引起了运动当地粉丝的担忧。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
