	(246, 'App\\Models\\News', 50, 'cn', 'title', '香港记者在具有里程碑意义的案件中被判犯有煽动罪', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(247, 'App\\Models\\News', 50, 'cn', 'summary', '两名已停刊的《立场新闻》编辑被判犯有煽动罪，可能面临最长两年监禁。这是1997年以来香港第一宗对记者的煽动罪案件，令外界对该地区的新闻自由和司法独立产生重大担忧。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(248, 'App\\Models\\News', 50, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(249, 'App\\Models\\News', 50, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(250, 'App\\Models\\News', 50, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(251, 'App\\Models\\News', 51, 'cn', 'title', '飞机厕所锁闭幼儿事件引发中国争议', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(252, 'App\\Models\\News', 51, 'cn', 'summary', '两名女性在飞机厕所锁住哭泣幼儿的事件在中国引发了关于公共空间儿童行为的争论。航空公司确认该儿童的祖母授权女性的介入，但网上许多人批评这一行为缺乏同理心。这引发了更广泛的讨论，探讨如何管理“熊孩子”，并创造更能容纳年轻儿童的环境。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(253, 'App\\Models\\News', 51, 'cn', 'comment_neutral', '尽管航空公司表示儿童的祖母同意女性的行为，但此事件引发了关于这种干预是否适当的关键问题。社会必须在照顾儿童和保持公共空间的安宁之间寻求平衡。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(254, 'App\\Models\\News', 51, 'cn', 'comment_left', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(255, 'App\\Models\\News', 51, 'cn', 'comment_right', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(256, 'App\\Models\\News', 52, 'cn', 'title', '古吉拉特邦严重洪灾造成28人死亡，超过24000人被迫迁移', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(257, 'App\\Models\\News', 52, 'cn', 'summary', '在印度古吉拉特邦，持续的大雨导致严重洪灾，造成至少28人死亡和超过24000居民被迫迁移。印度军队和灾害应急队伍正在最受影响地区进行救援行动，天气预报显示重磅降雨仍将持续。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(258, 'App\\Models\\News', 52, 'cn', 'comment_neutral', '古吉拉特邦的洪灾凸显了该地区在雨季对极端天气事件的持续脆弱性。这些数据显示，改善基础设施和灾害管理策略的必要性非常重要。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(259, 'App\\Models\\News', 52, 'cn', 'comment_left', '这场悲剧生动地提醒我们政府在灾害准备和响应方面的失败。采取积极的环境政策对于防止此类灾害重演至关重要。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(260, 'App\\Models\\News', 52, 'cn', 'comment_right', '像这次洪灾这样的自然灾害往往可以归因于自然资源的管理不善。迫切需要对脆弱地区的土地使用和开发制定更严格的法规。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(261, 'App\\Models\\News', 53, 'cn', 'title', '迪士尼与信实工业公司850亿美元合并获得临时批准', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(262, 'App\\Models\\News', 53, 'cn', 'summary', '印度竞争监管机构已临时批准迪士尼与信实工业公司850亿美元的合并，使新实体成为印度最大的娱乐公司。该合并引发了有关广播权和广告价格的担忧，但双方承诺解决这些问题。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(263, 'App\\Models\\News', 53, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
