	(267, 'App\\Models\\News', 54, 'cn', 'summary', '西班牙演员罗道夫·桑乔·阿吉雷的儿子丹尼尔·桑乔·布隆查罗因在泰国策划谋杀和肢解哥伦比亚整形外科医生埃德温·阿里埃塔·阿尔特阿加被判终身监禁。此案引起了西班牙媒体的广泛关注，桑乔在审判中声称是出于自卫。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
