	(272, 'App\\Models\\News', 55, 'cn', 'summary', 'Telegram的联合创始人帕维尔·杜罗夫因其应用程序上关于非法内容的严重指控在巴黎获释保释。作为俄罗斯国籍的杜罗夫，必须每周向警方报到两次，并被限制离开法国。克里姆林宫警告提及其指控可能存在政治动机。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
