	(276, 'App\\Models\\News', 56, 'cn', 'title', '中国人口下降：对自然世界的机遇还是危机？', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(277, 'App\\Models\\News', 56, 'cn', 'summary', '2023年，中国人口加速下降，延续了六十多年的趋势。专家们争论这一人口减少是否会缓解环境压力，背景是该国面临的的人口挑战。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
