	(281, 'App\\Models\\News', 57, 'cn', 'title', '在日益紧张局势中，拜登与习近平的谈话备受期待', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
	(282, 'App\\Models\\News', 57, 'cn', 'summary', '中国与美国官员在北京举行的高级别会议预示着拜登与习近平总统之间计划进行新的讨论，背景是日益加剧的紧张局势和即将到来的美国选举。此次会谈旨在解决一系列争议性问题并维护印太地区的和平，尤其是有关台湾的议题。', '2024-09-02 00:44:39', '2024-09-02 00:44:39'),
