	(291, 'App\\Models\\News', 59, 'cn', 'title', '在持续冲突中，加沙面临严重食品短缺', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(292, 'App\\Models\\News', 59, 'cn', 'summary', '在以色列冲突持续的情况下，加沙居民面临飞涨的食品价格和严重短缺。基本商品价格已上涨超过400%，加剧了该地区的人道主义危机。许多人依赖人道主义援助，而报告显示超过495,000人正经历严重的粮食不安全问题。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
