	(297, 'App\\Models\\News', 60, 'cn', 'summary', '2023全球科技峰会展示了创新技术，并促进了关于人工智能、可再生能源和数字隐私的未来讨论，吸引了来自世界各地的与会者。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
