	(301, 'App\\Models\\News', 61, 'cn', 'title', 'Telegram创始人帕维尔·杜罗夫因争议被调查', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(302, 'App\\Models\\News', 61, 'cn', 'summary', 'Telegram创始人帕维尔·杜罗夫因应用程序用户超过9亿而受到瞩目。在有关不当内容的指控和未能与法国当局合作的情况下，支持者称他为言论自由的倡导者，而批评者则指责他导致Telegram环境失控。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
