	(306, 'App\\Models\\News', 62, 'cn', 'title', '巴黎2024年残奥会盛大开幕庆祝包容', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(307, 'App\\Models\\News', 62, 'cn', 'summary', '2024年残奥会于8月28日在巴黎拉开帷幕，开幕式吸引了3万名观众。法国总统马克龙主持开幕仪式，强调了包容与希望的主题，来自168个代表团的运动员在晴朗的天空下展示了他们的才华。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(308, 'App\\Models\\News', 62, 'cn', 'comment_neutral', '巴黎2024年残奥会的开幕式标志着全球体育的重要时刻，展示了残疾运动员的奉献精神和技能。在主场馆之外举行开幕式的举措体现了体育领域在包容性方面的进步。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(309, 'App\\Models\\News', 62, 'cn', 'comment_left', '尽管残奥会为残疾运动员提供了一个平台，但关注点必须超越单纯的表现庆祝，应该解决全球残疾人士面临的系统性不平等。任何在赛事后进行的讨论应优先考虑增强残疾社区的可及性和支持的政策。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(310, 'App\\Models\\News', 62, 'cn', 'comment_right', '焦点应该保持在健全运动员身上，因为他们的成就和贡献通常更能引起民族自豪感。尽管残奥会值得赞扬，但不应掩盖传统体育事业在塑造我们国家身份方面的重要性。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(311, 'App\\Models\\News', 63, 'cn', 'title', '联合国因枪击事件暂停在加沙的WFP行动', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(312, 'App\\Models\\News', 63, 'cn', 'summary', '联合国世界粮食计划署在加沙暂时暂停行动，因为其一辆车辆在靠近以色列军事检查站时遭到枪击。联合国安理会将在以英国和瑞士的请求下，讨论在以色列-哈马斯冲突中日益严峻的人道主义情况，预计将开展针对小儿麻痹症的疫苗接种运动。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(313, 'App\\Models\\News', 63, 'cn', 'comment_neutral', '最近涉及WFP的枪击事件引发了对冲突地区人道主义行动安全的严重担忧。国际间的合作与沟通对于确保加沙地区援助的安全交付至关重要。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
