	(337, 'App\\Models\\News', 68, 'cn', 'summary', '利比亚中央银行正面临领导危机，行长萨迪克·阿尔-卡比尔在武装民兵威胁下逃离。与此同时，新董事会已被任命，导致银行业务暂停，员工和市民普遍感到困惑。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
