	(342, 'App\\Models\\News', 69, 'cn', 'summary', '新西兰毛利国王基英基·图希提亚·普塔陶·特·惠罗威霍七世在69岁时因心脏手术并发症去世。他的去世引发了全国哀悼，包括新西兰总理克里斯托弗·卢克森和英国查尔斯三世在内的政界人士纷纷致以悼念。国王在毛利文化和政治中扮演着重要角色，倡导毛利人民的权利和尊严。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
