	(347, 'App\\Models\\News', 70, 'cn', 'summary', '生活在国外的委内瑞拉公民正在动员要求选举结果的透明度，指责马杜罗政府存在选举欺诈。拥有近800万人的庞大侨民，他们通过游说外国政府和举行抗议活动，迫使公开投票数据。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(348, 'App\\Models\\News', 70, 'cn', 'comment_neutral', '委内瑞拉的局势凸显了侨民在倡导民主进程中的关键作用。他们的集体行动吸引了国际关注，可能会迫使马杜罗政府提供更清晰的选举结果。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
