	(352, 'App\\Models\\News', 71, 'cn', 'summary', '在自第二次大起义以来最大的以色列军事袭击中，耶宁市及其难民营面临严重攻击，造成伤亡和医疗设施被封闭。这一局势反映了暴力的长期循环以及该地区巴勒斯坦人面临的严重人道主义条件。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(353, 'App\\Models\\News', 71, 'cn', 'comment_neutral', '耶宁的持续军事行动突显了以色列和巴勒斯坦冲突的复杂层面，包括人道主义危机、政治斗争和系统性暴力。理解这些动态是任何旨在解决争端的对话所必需的。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(354, 'App\\Models\\News', 71, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
