	(357, 'App\\Models\\News', 72, 'cn', 'summary', '美国副总统卡马拉·哈里斯面临对其在移民、加沙和通胀等关键问题上模糊立场的批评，计划首次在CNN接受重大采访。批评者称她的做法谨慎且缺乏信息，尤其是在她试图在总统竞选中界定自己的议程时。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
