	(361, 'App\\Models\\News', 73, 'cn', 'title', '弗朗哥·科拉平托登场F1，被称为“F1的梅西”', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(362, 'App\\Models\\News', 73, 'cn', 'summary', '21岁的阿根廷新秀弗朗哥·科拉平托将在意大利大奖赛莫扎亮相，成为20多年来首位参加F1的阿根廷车手。他淡化了与足球明星梅西的比较，强调自己希望关注表现在而不是外界期待。科拉平托取代了表现不佳的洛根·萨金特，车队的粉丝们对他的入场感到乐观。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(363, 'App\\Models\\News', 73, 'cn', 'comment_neutral', '弗朗哥·科拉平托的加入意味着阿根廷汽车运动的新时代。尽管与梅西的比较可能显得夸张，但它突显了围绕他首秀的兴奋气氛。他对比赛的谨慎态度体现了超越他年纪的成熟，粉丝们期待看到他在压力下的表现。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(364, 'App\\Models\\News', 73, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(365, 'App\\Models\\News', 73, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(366, 'App\\Models\\News', 74, 'cn', 'title', 'ABBA及其他艺术家要求特朗普停止使用他们的音乐', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(367, 'App\\Models\\News', 74, 'cn', 'summary', '包括瑞典乐队ABBA在内的众多艺术家对唐纳德·特朗普在竞选活动中未经授权使用他们的音乐表示抗议，要求立即停止使用。这是继其他艺术家例如以赛亚·海斯和西妮德·奥康纳的音乐同样未经许可被使用后的又一起事件。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(368, 'App\\Models\\News', 74, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(369, 'App\\Models\\News', 74, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(370, 'App\\Models\\News', 74, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(371, 'App\\Models\\News', 75, 'cn', 'title', '世卫组织在加沙危机中达成疫苗接种协议', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(372, 'App\\Models\\News', 75, 'cn', 'summary', '世卫组织宣布达成临时人道协议，以便在加沙为640,000名儿童提供脊髓灰质炎疫苗接种。将在九天内的三次分开暂停，从早上六点到下午三点，方便在不同地区分发疫苗，因为恶化的条件助长疾病传播。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(373, 'App\\Models\\News', 75, 'cn', 'comment_neutral', '此疫苗接种的临时暂停标志着保护加沙脆弱儿童的重要干预，但也突显了该地区持续的人道主义危机。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(374, 'App\\Models\\News', 75, 'cn', 'comment_left', '虽然世卫组织的协议是应对严峻健康状况的一个步骤，但考虑到以色列持续的军事行动加剧人道主义局势，这仅仅是一个临时解决办法。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(375, 'App\\Models\\News', 75, 'cn', 'comment_right', '这一疫苗接种计划似乎是对不存在的脊髓灰质炎危机的夸大反应；应关注确保安全，而不是人道援助。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(376, 'App\\Models\\News', 76, 'cn', 'title', '胡塞爆炸威胁红海重大漏油事件', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(377, 'App\\Models\\News', 76, 'cn', 'summary', '也门胡塞武装发布视频显示在Sounion油轮上的爆炸，令潜在漏油事件备受关注。这艘运载近一百万桶原油的船在胡塞武装针对与以色列有关的船只的运动中遭到攻击。这一情况对红海的海洋生态系统和全球航运线路构成了严重威胁。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(378, 'App\\Models\\News', 76, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
