	(381, 'App\\Models\\News', 77, 'cn', 'title', '塞尔维亚与法国签署30亿美元的阵风战斗机交易', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(382, 'App\\Models\\News', 77, 'cn', 'summary', '塞尔维亚与法国签署了一项价值30亿美元的协议，购买12架阵风战斗机，以加强与西方国家的关系，并减少对俄罗斯的依赖，这标志着自2006年以来对塞尔维亚最大的武器销售。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(383, 'App\\Models\\News', 77, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
