	(386, 'App\\Models\\News', 78, 'cn', 'title', '埃隆·马斯克的Starlink在与法官的持续争执中面临巴西的财务封锁', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(387, 'App\\Models\\News', 78, 'cn', 'summary', '巴西法官亚历山大·德·莫拉斯因社交媒体审查和虚假信息的持续争执，已下令禁止埃隆·马斯克的Starlink进行财务交易。马斯克对法官的行为表示强烈批评，称其为违反宪法和言论自由的行为。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(388, 'App\\Models\\News', 78, 'cn', 'comment_neutral', '埃隆·马斯克与亚历山大·德·莫拉斯法官之间的持续冲突突显了全球范围内监管在线平台和言论自由的复杂性。德·莫拉斯的行为可能被视为执行巴西法律的尝试，而马斯克的回应则表明企业利益与政府权威之间的紧张关系。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(389, 'App\\Models\\News', 78, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(390, 'App\\Models\\News', 78, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(391, 'App\\Models\\News', 79, 'cn', 'title', '战争更新：第917天 - 关键进展', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(392, 'App\\Models\\News', 79, 'cn', 'summary', '随着战争进入第917天，关于部队调动、和平谈判和人道主义努力的重要进展逐渐出现。 2024年8月30日，局势仍然严峻，冲突不断，确保停火的努力仍在继续。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(393, 'App\\Models\\News', 79, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(394, 'App\\Models\\News', 79, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(395, 'App\\Models\\News', 79, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(396, 'App\\Models\\News', 80, 'cn', 'title', '马克龙为被起诉的Telegram首席执行官快速入籍辩护', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(397, 'App\\Models\\News', 80, 'cn', 'summary', '法国总统埃马纽埃尔·马克龙为在被多项指控下的Telegram首席执行官帕维尔·杜罗夫快速入籍一事辩护，尽管他最近被逮捕。马克龙声称他之前并不知道杜罗夫的访问，并将此次逮捕视为独立的司法行为。该案件引发了关于言论自由和在线隐私的担忧，受到科技领袖和俄罗斯官员的批评。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(398, 'App\\Models\\News', 80, 'cn', 'comment_neutral', '这一情况似乎是一场司法与国籍之间复杂的互动，马克龙强调学习法语的重要性，同时对杜罗夫面临的严重指控保持关注。关于言论自由和在线隐私的更广泛影响需谨慎考量。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(399, 'App\\Models\\News', 80, 'cn', 'comment_left', '这起事件体现了西方国家声称捍卫言论自由的虚伪，同时通过有针对性的法律行动主动削弱它。杜罗夫的逮捕是对技术创新的公然攻击，所有珍视无障碍交流的人都应谴责这一行为。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(400, 'App\\Models\\News', 80, 'cn', 'comment_right', '我们再次看到，欧洲国家对成功的企业家施加压力，试图以司法的名义扼杀创新。马克龙的言论揭示了对技术创始人控制和监管的潜在叙事，这破坏了自由市场资本主义的基本原则。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(401, 'App\\Models\\News', 81, 'cn', 'title', '岸田文雄宣告辞职，呼吁改革于争议中', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(402, 'App\\Models\\News', 81, 'cn', 'summary', '岸田文雄宣告将辞去日本首相职务，此前他在任期内经历了低支持率及自民党内的腐败丑闻。他的辞职旨在表明该党急需进行政治改革，并为9月份的领导选举做准备。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(403, 'App\\Models\\News', 81, 'cn', 'comment_neutral', '岸田的突然辞职反映了日本政治中一种更广泛的趋势，即领导人面临公众不满和党内动态的巨大压力。即将到来的领导选举对确定自民党的未来发展方向和重建公众信任至关重要。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(404, 'App\\Models\\News', 81, 'cn', 'comment_left', '岸田未能解决腐败和生活成本上升等系统性问题，暴露了执政精英的失败。日本政治格局需要向透明度和问责制的激进转变，下任领导必须体现这些原则，以重建公众对治理的信任。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(405, 'App\\Models\\News', 81, 'cn', 'comment_right', '自民党内政治派系的崩溃显示了潜在的不稳定，这可能危及日本的国际战略政策。为了在全球挑战尤其是国防政策中维护国家利益，一个更精简、更强大的政党是必要的。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(406, 'App\\Models\\News', 82, 'cn', 'title', '乌克兰首架F-16战机在猛烈的俄罗斯轰炸中坠毁', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(407, 'App\\Models\\News', 82, 'cn', 'summary', '乌克兰首架F-16战机在阻挡重大俄罗斯导弹和无人机攻击时坠毁，导致飞行员奥列克西·梅斯身亡。此事件突显了冲突的持续激烈程度，乌克兰的防空力量不断面临挑战。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(408, 'App\\Models\\News', 82, 'cn', 'comment_neutral', 'F-16的坠毁凸显了乌克兰飞行员在持续冲突中面临的危险。调查仍在进行，以确定原因，这一事件在乌克兰使用新获得的西方飞机进行的军事努力中标志着一个重要时刻。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(409, 'App\\Models\\News', 82, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(410, 'App\\Models\\News', 82, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(411, 'App\\Models\\News', 83, 'cn', 'title', '特朗普在生育问题上的温和立场转变', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(412, 'App\\Models\\News', 83, 'cn', 'summary', '前总统唐纳德·特朗普承诺为女性提供免费体外受精（IVF）服务，并批评佛罗里达州的六周堕胎禁令，试图在竞选总统期间呈现出温和的生育权形象。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(413, 'App\\Models\\News', 83, 'cn', 'comment_neutral', '特朗普最近对生育问题的评论可能反映了一种战略转向，旨在赢得更多女性选票，但他过去的行为可能使这一努力变得复杂。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(414, 'App\\Models\\News', 83, 'cn', 'comment_left', '考虑到他过去的反堕胎立场，特朗普对IVF覆盖的承诺让人感到不真诚。这纯粹是为了吸引温和选民的策略，同时保持对保守派的支持。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(415, 'App\\Models\\News', 83, 'cn', 'comment_right', '特朗普的言论削弱了生命权运动的核心价值观；他在堕胎问题上朝更自由立场的转变可能会疏远让他当选的基础选民。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(416, 'App\\Models\\News', 84, 'cn', 'title', '特朗普对阿林顿国家公墓的争议访问引发愤怒', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(417, 'App\\Models\\News', 84, 'cn', 'summary', '前总统唐纳德·特朗普最近访问阿林顿国家公墓的第60区引发了重大反响，特别是因其竞选团队在该地区拍摄的视频违反了军方规定。军方为一名在事件中被干扰的员工辩护。特朗普的竞选活动中，军队可能被政治化的担忧加剧。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(418, 'App\\Models\\News', 84, 'cn', 'comment_neutral', '这一事件展示了在尊重军事牺牲和政治化这些神圣空间之间的微妙界线。保持对埋葬在第60区的人的尊重，同时关注政治人物访问这些区域的潜在影响是至关重要的。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(419, 'App\\Models\\News', 84, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
