	(421, 'App\\Models\\News', 85, 'cn', 'title', '约翰内斯堡当局对2023年导致76人遇难的火灾负责', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(422, 'App\\Models\\News', 85, 'cn', 'summary', '一项调查发现，约翰内斯堡市因2023年8月在Usindiso大楼发生的致命火灾导致76人遇难而负有失职责任。幸存者继续在临时庇护所中面临严峻的居住条件，而市政府努力提供足够的住房。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
