	(426, 'App\\Models\\News', 86, 'cn', 'title', '毒枭被捕后锡那罗亚州暴力事件再次升级', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(427, 'App\\Models\\News', 86, 'cn', 'summary', '墨西哥锡那罗亚州在美国逮捕毒枭华金·古兹曼·洛佩斯和伊斯梅尔·‘梅奥’·贾姆达后，暴力事件再度升级。报告称，军人遭到袭击，路障在库利亚坎周围设置，这加剧了人们对这一锡那罗亚贩毒集团据点的更大动乱的担忧。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(428, 'App\\Models\\News', 86, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
