	(431, 'App\\Models\\News', 87, 'cn', 'title', '暴力升级：以色列军队撤离图尔卡雷姆，加大对杰宁的攻击', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(432, 'App\\Models\\News', 87, 'cn', 'summary', '以色列军队在西岸实施的20年来最大规模的军事行动导致图尔卡雷姆的严重破坏，并加大了对杰宁的攻击，报告称有多名人员伤亡。军方声称其目标是武装团体，而居民则担心这是推动巴勒斯坦人流离失所的战略。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
