	(434, 'App\\Models\\News', 87, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(435, 'App\\Models\\News', 87, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(436, 'App\\Models\\News', 88, 'cn', 'title', '德国因安全忧虑遣返被定罪罪犯至阿富汗', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(437, 'App\\Models\\News', 88, 'cn', 'summary', '德国已遣返28名阿富汗国籍的被定罪罪犯，内政部长称此举对国家安全至关重要。这是自2021年塔利班重新掌权以来的第一次遣返，此次行动通过与卡塔尔的秘密谈判进行，德国与塔利班断绝了关系。遣返活动在近期关于移民政策的辩论之后进行，特别是在索林根发生的暴力袭击事件之后。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(438, 'App\\Models\\News', 88, 'cn', 'comment_neutral', '德国最近对阿富汗国民的遣返引发了关于国家安全与人权之间平衡的重要问题。它承认在近期暴力事件和德国政治形势演变的背景下，移民政策的复杂性。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(439, 'App\\Models\\News', 88, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(440, 'App\\Models\\News', 88, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(441, 'App\\Models\\News', 89, 'cn', 'title', '纳米比亚面临干旱危机，数千只野生动物被屠杀以供食品', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(442, 'App\\Models\\News', 89, 'cn', 'summary', '纳米比亚正经历几十年来最严重的干旱，导致严重的人道主义危机。700多只野生动物，包括大象和河马，正在被屠杀以提供肉类给该国饥饿的人口，约84%的食品储备已耗尽。这场因气候变化加剧的干旱，使近一半的人口面临严重的食品不安全问题。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(443, 'App\\Models\\News', 89, 'cn', 'comment_neutral', '纳米比亚人道主义危机的严重程度需要国家和国际社会的紧急关注。虽然屠杀野生动物可以提供即时的缓解，但这也引发了关于野生动物管理和可持续性实践的复杂讨论。长期解决方案必须集中在改善水资源管理和增强农业抗逆性上。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(444, 'App\\Models\\News', 89, 'cn', 'comment_left', '纳米比亚对野生动物的屠杀 stark 代表了应对气候危机及其对边缘化社区影响的系统性失败。政府不应采取毁灭性的措施，而应优先考虑可持续发展和公平的食品分配系统，以保护人民和野生动物。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(445, 'App\\Models\\News', 89, 'cn', 'comment_right', '这一屠杀野生动物的极端举措反映出必须优先考虑人类福利而非野生动物保护。纳米比亚应当因作出确保国民食品安全的艰难决定而受到称赞，抵制那些没有看到更大图景的误导动物权利活动人士。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(446, 'App\\Models\\News', 90, 'cn', 'title', '卡马拉·哈里斯在总统竞选中为向温和政策的转变辩护', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(447, 'App\\Models\\News', 90, 'cn', 'summary', '在宣布参加总统竞选后的首次采访中，副总统卡马拉·哈里斯为她在移民和气候政策上的立场变化辩护，坚称她的核心价值观保持一致。作为她的共和党对手唐纳德·特朗普称她为欺诈者，哈里斯强调寻求共识和两党合作的重要性，并探讨了经济和以色列-巴勒斯坦冲突等问题。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(448, 'App\\Models\\News', 90, 'cn', 'comment_neutral', '卡马拉·哈里斯的采访突显了政治立场的复杂性以及在应对变化的环境中对政策进行调整的必要性。她解释自己立场变化的能力可能会吸引来自各个选民群体的批评与支持。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(449, 'App\\Models\\News', 90, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(450, 'App\\Models\\News', 90, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(451, 'App\\Models\\News', 91, 'cn', 'title', '伊凡·托尼可能转会阿尔阿赫利的交易正逐步推进', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(452, 'App\\Models\\News', 91, 'cn', 'summary', '英格兰前锋伊凡·托尼即将完成转会沙特俱乐部阿尔阿赫利，消息来源称交易已接近达成。由于八个月的禁赛，托尼本赛季尚未出场，并被排除在即将进行的英格兰比赛名单之外。沙特的转会窗口仍开放至9月2日。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(453, 'App\\Models\\News', 91, 'cn', 'comment_neutral', '伊凡·托尼可能转会阿尔阿赫利可能标志着他职业生涯的重要转折。尽管前一赛季经历了动荡，但作为前锋的技能毋庸置疑，这次转会不仅可能带来经济利益，还可能为他提供一个新的起点。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(454, 'App\\Models\\News', 91, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
