	(456, 'App\\Models\\News', 92, 'cn', 'title', '乔·鲁特的坚韧世纪：对其持久遗产的见证', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(457, 'App\\Models\\News', 92, 'cn', 'summary', '乔·鲁特在与斯里兰卡的第二场测试赛中打下精彩的143分，带领英格兰队在首日取得胜利。他的表现展示了其坚定的决心和技巧，重申了他作为板球历史上最伟大击球手之一的地位。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
