	(461, 'App\\Models\\News', 93, 'cn', 'title', '俄罗斯记者因报道乌克兰平民死亡被判刑', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(462, 'App\\Models\\News', 93, 'cn', 'summary', '俄罗斯视频记者谢尔盖·卡雷林因\'故意传播虚假信息\'被判入狱，此前他报道了布恰和马里乌波尔的平民死亡事件。此案突显了在乌克兰冲突中，俄罗斯对异议声音的持续压制。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
