	(467, 'App\\Models\\News', 94, 'cn', 'summary', '欧盟外交政策负责人何塞普·博雷尔呼吁成员国考虑对涉嫌煽动仇恨和战争罪的未具名以色列官员实施制裁，引发欧盟内部的不同反响。莎拉·科茨在特拉维夫报道。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
