	(471, 'App\\Models\\News', 95, 'cn', 'title', '德国政府将在索林根袭击后加强刀具管控', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(472, 'App\\Models\\News', 95, 'cn', 'summary', '德国政府在索林根发生造成三人死亡的刀具袭击后，宣布加强刀具管控和限制非法移民的福利。该袭击是由一名与伊斯兰国有联系的叙利亚人实施的，已经在重要的地区选举前加剧了德国的移民辩论。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
