	(476, 'App\\Models\\News', 96, 'cn', 'title', '加沙地区25年来首次报告脊髓灰质炎病例', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(477, 'App\\Models\\News', 96, 'cn', 'summary', '世界卫生组织（WHO）确认，巴勒斯坦男孩阿卜杜勒·拉赫曼·阿布·阿尔-吉迪扬（Abdul Rahman Abu Al-Jidyan）是加沙地区25年来首位感染脊髓灰质炎的人。在持续冲突的背景下，紧急呼吁疫苗接种活动，以保护超过65万名儿童，同时地方和国际官员协调努力对抗疫情。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(478, 'App\\Models\\News', 96, 'cn', 'comment_neutral', '加沙地区脊髓灰质炎的出现突显了持续冲突中医疗获取的关键缺口。这强调了国际合作和持续疫苗接种努力的重要性，以防止疾病疫情的爆发。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(479, 'App\\Models\\News', 96, 'cn', 'comment_left', '这一情况例证了以色列封锁所造成的严重人道主义条件。国际社会必须加大对以色列的压力，以允许对被围困的巴勒斯坦人口提供不受阻碍的医疗供应。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(480, 'App\\Models\\News', 96, 'cn', 'comment_right', '脊髓灰质炎的复发是哈马斯在军事活动中忽视公共卫生优先事项的结果。对以色列来说，在确保人道主义通道的同时维护安全至关重要。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(481, 'App\\Models\\News', 97, 'cn', 'title', '杜罗夫的Telegram在法国面临加密辩论的审查', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(482, 'App\\Models\\News', 97, 'cn', 'summary', 'Telegram的创始人帕维尔·杜罗夫作为法国公民在法国受到审查，执法机构对加密消息服务表示担忧。与竞争对手不同，Telegram原则上拒绝政府的删除命令，这可能为未来对加密平台的监管设定了先例。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(483, 'App\\Models\\News', 97, 'cn', 'comment_neutral', '对Telegram在法国的审查突显了全球范围内关于隐私与执法机关获取加密通信的平衡的持续辩论。这一情况强化了科技公司必须在复杂的监管环境中航行，特别是在用户数据安全方面的观念。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(484, 'App\\Models\\News', 97, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(485, 'App\\Models\\News', 97, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(486, 'App\\Models\\News', 98, 'cn', 'title', 'Telegram因创始人面临刑事指控而陷入欧盟审查', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(487, 'App\\Models\\News', 98, 'cn', 'summary', '受欢迎的消息应用Telegram正受到欧盟监管机构的调查，以确定其在欧盟的用户基础是否超过其报告的数字。这一审查是在其创始人帕维尔·杜罗夫因未能控制极端主义内容在法国被逮捕后进行的。根据《数字服务法案》(DSA)，Telegram必须每六个月提供精准的用户数据。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(488, 'App\\Models\\News', 98, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(489, 'App\\Models\\News', 98, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(490, 'App\\Models\\News', 98, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(491, 'App\\Models\\News', 99, 'cn', 'title', '以色列部队在西岸冲突中击毙伊斯兰圣战指挥官及四名武装分子', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(492, 'App\\Models\\News', 99, 'cn', 'summary', '以色列在西岸的军事行动导致伊斯兰圣战指挥官穆罕默德·贾巴和其他四名武装分子在图尔卡姆的枪战中死亡。这场暴力事件是在以色列为应对哈马斯在加沙的持续冲突而采取的加强行动下发生的。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(493, 'App\\Models\\News', 99, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(494, 'App\\Models\\News', 99, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(495, 'App\\Models\\News', 99, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(496, 'App\\Models\\News', 100, 'cn', 'title', '中央情报局成功阻止针对泰勒·斯威夫特音乐会的大规模袭击', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(497, 'App\\Models\\News', 100, 'cn', 'summary', '中央情报局副局长大卫·科恩在情报与国家安全峰会上宣布，伊斯兰国有关的未遂阴谋旨在攻击泰勒·斯威夫特在维也纳的音乐会，造成数万名观众的生命危险。相关逮捕导致三场演出被取消，令粉丝们感到震惊，并突出持续存在的恐怖主义威胁。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(498, 'App\\Models\\News', 100, 'cn', 'comment_neutral', '这一事件突显了公共活动中持续的恐怖主义威胁及加强情报工作的必要性。中央情报局的干预避免了一场可能的悲剧，显示了国际安全合作的重要性。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(499, 'App\\Models\\News', 100, 'cn', 'comment_left', '尽管中央情报局在防止恐怖阴谋方面的角色值得关注，但此案同时揭示了政府机构对监视和情报行动的过度使用。这类行动可能侵犯个人自由，并以安全名义不成比例地针对特定社群。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(500, 'App\\Models\\News', 100, 'cn', 'comment_right', '这次未遂袭击清楚地提醒了我们极端伊斯兰团体所带来的持续危险。加强国家安全措施，以保护公民免受此类威胁，尤其是在音乐会这样的重大活动中，是至关重要的。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(501, 'App\\Models\\News', 101, 'cn', 'title', '世卫组织加速获取Mpox诊断测试以应对全球担忧', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(502, 'App\\Models\\News', 101, 'cn', 'summary', '世界卫生组织呼吁对Mpox诊断测试进行紧急审查，以增强，特别是低收入群体中的可获取性，因为新的病毒变异引发警惕。世卫组织计划与制造商合作，采购必要的测试产品，以应对刚果民主共和国的疑似病例激增。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(503, 'App\\Models\\News', 101, 'cn', 'comment_neutral', '世卫组织加速Mpox诊断测试的倡议是及时而关键的，尤其是在低收入国家面临的挑战下。此举可能显著增强潜在疫情的早期检测和管理。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(504, 'App\\Models\\News', 101, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(505, 'App\\Models\\News', 101, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(506, 'App\\Models\\News', 102, 'cn', 'title', 'Telegram首席执行官帕维尔·杜罗夫因与有组织犯罪关联在法国被起诉', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(507, 'App\\Models\\News', 102, 'cn', 'summary', 'Telegram创始人帕维尔·杜罗夫因在平台上帮助传播儿童色情和毒品贩卖等罪名在法国被起诉，此举是针对有组织犯罪调查的一部分。在被拘留后，他获得保释，但仍然留在该国。该案件引发了关于科技高管对用户内容责任的重要问题。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(508, 'App\\Models\\News', 102, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(509, 'App\\Models\\News', 102, 'cn', 'comment_left', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(510, 'App\\Models\\News', 102, 'cn', 'comment_right', NULL, '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(511, 'App\\Models\\News', 103, 'cn', 'title', '卡马拉·哈里斯在对特朗普的竞选活动中瞄准中间派选民', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(512, 'App\\Models\\News', 103, 'cn', 'summary', '作为民主党总统候选人的卡马拉·哈里斯表示，她相信美国人准备超越唐纳德·特朗普，因为她在竞选中寻求吸引中间派选民。她重申了自己在移民和压裂方面的立场，同时坚持自己的自由派价值观，这也是她自参选以来的第一次采访。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
