	(517, 'App\\Models\\News', 104, 'cn', 'summary', '87岁的教皇方济各在健康问题的背景下开始为期12天的印尼、巴布亚新几内亚和东帝汶之行。这次旅行标志着他在教皇任期内所到达的最远地点，随着对他履行职责能力的日益关注，他的健康状况引发了更大的关注。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
