	(522, 'App\\Models\\News', 105, 'cn', 'summary', '唐纳德·特朗普因声称支持生育权而被指责抛弃反堕胎运动，在保守派内部引发的反弹反映了共和党基础的紧张局势，正值选举前夕。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
