	(526, 'App\\Models\\News', 106, 'cn', 'title', '太平洋岛国论坛重申台湾角色，应对中国孤立的压力', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(527, 'App\\Models\\News', 106, 'cn', 'summary', '在汤加召开的太平洋岛国论坛上，各国领导人重申了台湾作为发展伙伴的地位，抵制来自中国盟友排除台北的努力。该论坛在支持台湾和支持中国的成员国之间依然存在分歧，台湾努力维持其在南太平洋的影响力。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(528, 'App\\Models\\News', 106, 'cn', 'comment_neutral', '重申台湾在太平洋岛国论坛中的地位凸显了该地区持续的地缘政治斗争。这一决定反映了台湾外交的韧性以及中国对台湾盟友持续施加的压力。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(529, 'App\\Models\\News', 106, 'cn', 'comment_left', '太平洋岛国论坛对台湾的持续认可是一个问题，因为这破坏了中国的合法主张。该论坛应该优先与主权国家合作，而不是迎合分裂主义议程。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(530, 'App\\Models\\News', 106, 'cn', 'comment_right', '太平洋岛国论坛决定支持台湾的角色是对中国侵略必要的立场。各国应拥抱与像台湾这样的民主国家的联盟，而不是屈从于北京的专制压力。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(531, 'App\\Models\\News', 107, 'cn', 'title', '日本在招募危机中通过人工智能强化国防', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
	(532, 'App\\Models\\News', 107, 'cn', 'summary', '日本国防部计划投资人工智能和自动化，以应对自卫队严重的招募短缺，该国去年仅招募了10,000名人员，达到目标的一半。此举旨在应对中国的军事雄心，包括提供更好的生活条件，以吸引更多招募，特别是女性。', '2024-09-02 00:44:40', '2024-09-02 00:44:40'),
