	(537, 'App\\Models\\News', 108, 'cn', 'summary', '以色列在西岸的空袭加剧，导致至少16名巴勒斯坦人丧生，伴随着更广泛的军事行动。联合国对人道危机表示担忧，双方均有伤亡。以色列将其行动称为反恐行动，而国际官员则敦促停止敌对行动。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
