	(541, 'App\\Models\\News', 109, 'cn', 'title', '特朗普的保密资金案件：法律团队寻求联邦法院审理', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(542, 'App\\Models\\News', 109, 'cn', 'summary', '唐纳德·特朗普的法律团队希望将他的保密资金案移至联邦法院，认为此案件侵犯了他作为2024年总统选举领先候选人的宪法权利。他们引用了最高法院关于总统豁免权的裁决，并声称曼哈顿存在地方偏见。预计将在不久后对此动议作出决定。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(543, 'App\\Models\\News', 109, 'cn', 'comment_neutral', '唐纳德·特朗普周围的持续法律斗争对于一位前总统来说是前所未有的。这些案件对政治格局以及即将到来的选举的影响是重大的，提出了关于法律与政治在美国交汇处的问题。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(544, 'App\\Models\\News', 109, 'cn', 'comment_left', '特朗普试图将案件移至联邦法院不过是逃避责任的绝望行为。他的行为破坏了法治，选民必须了解在多项刑事调查中选举某人的严重法律后果。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(545, 'App\\Models\\News', 109, 'cn', 'comment_right', '法律系统正在被用作对付特朗普这一即将选举的主要候选人的武器。这些反复的攻击感觉上是出于政治动机，并威胁到我们选举系统的完整性。支持他反对这一看似是党派努力破坏他竞选活动的行为至关重要。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(546, 'App\\Models\\News', 110, 'cn', 'title', '日本放弃争议婚姻奖励政策，女性不再获得乡村安置补贴', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(547, 'App\\Models\\News', 110, 'cn', 'summary', '日本政府已放弃一项提议，旨在鼓励女性从东京嫁到乡村地区，该计划包括高达60万日元的补贴。此决定在公众批评之后做出，官员们对早前有关财政提议的真实性进行了澄清。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(548, 'App\\Models\\News', 110, 'cn', 'comment_neutral', '取消这一支付计划反映了日本在面对人口趋势和乡村人口减少方面的复杂挑战。政府需要解决这一问题的根本原因，而不是依赖金钱激励。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
