	(557, 'App\\Models\\News', 112, 'cn', 'summary', '丰田汽车报告称，七月份全球销量增长0.7%，这是六个月来的首次增长，得益于欧洲和日本的强劲需求，尽管美国市场的召回问题仍然拖累了业绩。该公司全球销量为924,918辆，产量则小幅上涨0.6%。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
