	(582, 'App\\Models\\News', 117, 'cn', 'summary', '以色列军方与哈马斯达成协议，在加沙进行为640,000名儿童预防脊髓灰质炎的疫苗接种活动，实施为期三天的停火，活动将于周日开始。世界卫生组织协调了从早上6点到下午3点的停火，将涵盖加沙的中部、南部和北部地区。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
