	(587, 'App\\Models\\News', 118, 'cn', 'summary', '刘易斯·汉密尔顿确认他将离开梅赛德斯，加盟法拉利，并在转型前回顾了在蒙扎最后一次比赛的重大意义。这位拥有五场意大利大奖赛胜利的著名车手表示，他期待着这个周末与意大利球迷的联系。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
