	(592, 'App\\Models\\News', 119, 'cn', 'summary', '韩国最高法院裁定，该国气候变化法未能保护基本人权，缺乏对未来一代的有效目标。法院要求立法者在2026年2月之前修订碳中和法案，回应了气候活动人士的请愿，他们认为政府在气候变化方面的作为不足。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(593, 'App\\Models\\News', 119, 'cn', 'comment_neutral', '法院的决定凸显了在应对气候变化方面立法行动的迫切需要，表明法院在维护环境问题中的人权方面可能会采取更积极的角色。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
