	(597, 'App\\Models\\News', 120, 'cn', 'summary', '在一项里程碑式的裁决中，香港《立场新闻》的两名记者被判 conspiracy 发表煽动性材料。这一决定凸显了香港新闻自由的缩减，地方媒体自我审查，外国新闻机构在国家安全措施升级的情况下撤出其存在。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(598, 'App\\Models\\News', 120, 'cn', 'comment_neutral', '《立场新闻》记者的定罪反映了香港媒体如今面临的严重挑战。随着新闻自由的持续侵蚀，对公民自由和民主话语权的影响似乎愈加严峻。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
