	(601, 'App\\Models\\News', 121, 'cn', 'title', '大坂直美情感复出在美国公开赛第二轮败北', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(602, 'App\\Models\\News', 121, 'cn', 'summary', '大坂直美，这位两届美国公开赛冠军，在休息后重返比赛，但在第二轮输给了卡罗利娜·穆霍娃。尽管失利，大坂对球迷的支持表示感激，强调了她重返赛场的喜悦。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
