	(606, 'App\\Models\\News', 122, 'cn', 'title', '乌克兰F-16战斗机在俄罗斯空袭中坠毁，飞行员遇难', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(607, 'App\\Models\\News', 122, 'cn', 'summary', '一架乌克兰F-16战斗机在防御俄罗斯一次重大空袭时坠毁，飞行员遇难。这一事件对乌克兰来说是重大的损失，尤其是在交付的战斗机数量有限和乌克兰军队入侵俄罗斯库尔斯克地区的关键时刻。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(608, 'App\\Models\\News', 122, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(609, 'App\\Models\\News', 122, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(610, 'App\\Models\\News', 122, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(611, 'App\\Models\\News', 123, 'cn', 'title', '卡马拉·哈里斯在维持进步理念的同时吸引中间选民', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(612, 'App\\Models\\News', 123, 'cn', 'summary', '在她作为民主党总统候选人的第一次电视采访中，副总统卡马拉·哈里斯表示，她希望吸引中间选民，同时重申她的进步价值观。她表示愿意任命一位共和党人进入内阁，并驳斥了唐纳德·特朗普对她身份的质疑。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(613, 'App\\Models\\News', 123, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(614, 'App\\Models\\News', 123, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(615, 'App\\Models\\News', 123, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(616, 'App\\Models\\News', 124, 'cn', 'title', '主要中国游戏公司缩减对日本的投资', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(617, 'App\\Models\\News', 124, 'cn', 'summary', '腾讯和网易正在重新考虑他们在日本游戏工作室的投资，因为近年来在中国市场复苏的背景下，成功游戏数量寥寥无几。网易正在关闭东京的Ouka工作室，而腾讯则在缩减其资助承诺。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(618, 'App\\Models\\News', 124, 'cn', 'comment_neutral', '腾讯和网易缩减投资的决定反映了游戏行业更广泛的趋势，即公司正在根据市场现实和过去的表现重新评估他们的战略。这引发了对外国在日本游戏行业长期投资可行性的质疑。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(619, 'App\\Models\\News', 124, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(620, 'App\\Models\\News', 124, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(621, 'App\\Models\\News', 125, 'cn', 'title', '日本外交部请求2025年预算8146亿日元 应对日益增长的信息战争威胁', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(622, 'App\\Models\\News', 125, 'cn', 'summary', '日本外交部宣布请求2025财年的预算为8146亿日元，与前一年的预算相比增加了12.3%。这其中包括662亿日元，旨在加强应对信息战争的力度，尤其是针对虚假信息，通过利用人工智能等技术提升信息收集和分析能力。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(623, 'App\\Models\\News', 125, 'cn', 'comment_neutral', '所提出的预算反映了日本对信息战争及其对国家安全潜在影响的日益关注。通过投资先进技术，外交部正在承认需要建立强有力的防御机制来应对虚假信息。值得关注的是这些资金将如何有效利用。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(624, 'App\\Models\\News', 125, 'cn', 'comment_left', '这项预算请求对一个非问题的过度反应。政府不应该花费数十亿来对抗所谓的虚假信息，而应专注于扩展社交项目，解决公共失望的根本原因和公民的福利，而不是使用技术来监视和操纵舆论。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(625, 'App\\Models\\News', 125, 'cn', 'comment_right', '这个预算增加是保护日本信息环境免受外部和内部威胁的必要步骤。虚假信息的上升，尤其是来自外国对手的，危害了我们的国家完整性。投资于人工智能技术将使我们的外交部能够保护我们的主权并维护信息的可靠性。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(626, 'App\\Models\\News', 126, 'cn', 'title', '萨拉·瓦根肯特成为德国即将举行选举中的关键极左候选人', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(627, 'App\\Models\\News', 126, 'cn', 'summary', '极左派政治家萨拉·瓦根肯特有望在前东德的地区选举中发挥重要作用。她呼吁结束政府对乌克兰的支持以及实施严格的移民政策，并主张与普京进行谈判。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(628, 'App\\Models\\News', 126, 'cn', 'comment_neutral', '萨拉·瓦根肯特的崛起代表了德国政治格局的变化。她的提议可能吸引那些在不满和渴望变化的氛围中寻求替代方案的选民。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(629, 'App\\Models\\News', 126, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(630, 'App\\Models\\News', 126, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(631, 'App\\Models\\News', 127, 'cn', 'title', '日本因出生率下降，幼儿园等候名单创历史新低', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(632, 'App\\Models\\News', 127, 'cn', 'summary', '政府调查显示，日本的幼儿园等候名单人数已降至2567人，较去年减少4.2%，创历史新低。这一下降归因于该国持续低迷的出生率，尽管仍有一些地区由于幼儿教师短缺和人口增长等原因，等候名单变得更长。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(633, 'App\\Models\\News', 127, 'cn', 'comment_neutral', '幼儿园等候名单的持续下降反映了日本持续的人口挑战，特别是出生率低下。虽然这对提高教育可及性是一个积极的信号，但也引发了对未来劳动力和经济长期影响的担忧。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(634, 'App\\Models\\News', 127, 'cn', 'comment_left', '幼儿园儿童数量的减少表明，政府迫切需要重新思考其社会政策。政策不仅应关注经济增长，还必须优先考虑家庭支持和儿童福利，以鼓励人们多生孩子。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(635, 'App\\Models\\News', 127, 'cn', 'comment_right', '幼儿园儿童数量的下降表明日本社会存在令人担忧的趋势，即传统家庭价值观正在衰退。我们需要制定政策以维护和促进家庭和养育孩子的文化价值观，以扭转这一趋势。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(636, 'App\\Models\\News', 128, 'cn', 'title', '东京通货膨胀加速，预示着未来渐进加息', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(637, 'App\\Models\\News', 128, 'cn', 'summary', '东京8月份的消费者物价（不包括新鲜食品）上涨了2.4%，超出了预期，突显了日本银行继续逐步加息的潜力，因为经济显示出复苏的迹象。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(638, 'App\\Models\\News', 128, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(639, 'App\\Models\\News', 128, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(640, 'App\\Models\\News', 128, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(641, 'App\\Models\\News', 129, 'cn', 'title', '日本在安全担忧中请求创纪录的军事预算', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(642, 'App\\Models\\News', 129, 'cn', 'summary', '日本防卫省已提交2025年创纪录的8.5万亿日元（590亿美元）预算请求，这是应对中国日益增长的军事威胁的五年军事扩张计划的一部分。该预算着重于无人武器和人工智能，因为日本面临军人数量下降的问题。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(643, 'App\\Models\\News', 129, 'cn', 'comment_neutral', '考虑到当前的地缘政治气候，日本增加军事支出是重要的一步。这反映了政府在地区紧张局势背景下对提升防御能力的必要性认识。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(644, 'App\\Models\\News', 129, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
