	(646, 'App\\Models\\News', 130, 'cn', 'title', '埃隆·马斯克的X面临巴西关闭的审查战', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(647, 'App\\Models\\News', 130, 'cn', 'summary', '由于无法满足当地法律合规要求，巴西最高法院预计将命令埃隆·马斯克的社交媒体平台X关闭。马斯克的卫星互联网事业Starlink也面临影响，其银行账户因该冲突而被封锁。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(648, 'App\\Models\\News', 130, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(649, 'App\\Models\\News', 130, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(650, 'App\\Models\\News', 130, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(651, 'App\\Models\\News', 131, 'cn', 'title', '哈里斯在选举前最新民调中领先特朗普', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(652, 'App\\Models\\News', 131, 'cn', 'summary', '最新的Reuters/Ipsos民调显示，卡马拉·哈里斯在注册选民中以45%领先唐纳德·特朗普的41%，这标志着美国总统选举动态的显著变化。在她的竞选集会上，哈里斯在女性和西班牙裔选民中获得了尤其的支持，推动了她的候选人热情。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(653, 'App\\Models\\News', 131, 'cn', 'comment_neutral', '最近民调数据的变化凸显了激烈的竞争格局，两位候选人均试图在关键摇摆州影响未决定选民。哈里斯的好感度上升可能会重新塑造民主党和共和党的战略，因为他们将应对选民在选举前的担忧。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(654, 'App\\Models\\News', 131, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
