	(657, 'App\\Models\\News', 132, 'cn', 'summary', '在一次重大俄罗斯导弹和无人机袭击中，乌克兰新购的F-16战斗机坠毁，导致飞行员遇难。这一事件标志着乌克兰首次报告F-16的损失，而军方正面临持续的空袭。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(658, 'App\\Models\\News', 132, 'cn', 'comment_neutral', 'F-16的坠毁突显了乌克兰在防御工作中的危险境地。虽然引入了新的技术以对抗俄罗斯的推进，但俄罗斯空中力量的压倒性规模仍然是一个重大挑战。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(659, 'App\\Models\\News', 132, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
