	(662, 'App\\Models\\News', 133, 'cn', 'summary', 'Lululemon Athletica宣布在因顾客对其Breezethrough紧身裤的负面反馈而暂停销售后，将加速推出新款服装。首席执行官Calvin McDonald承认女性市场的失误，但对公司未来的战略持乐观态度。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(663, 'App\\Models\\News', 133, 'cn', 'comment_neutral', 'Lululemon对消费者反馈的反应显示出其在市场需求面前的灵活适应能力，尤其是之前因Breezethrough紧身裤带来的尴尬。他们对加速推出新款式的承诺可能有助于恢复品牌形象。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(664, 'App\\Models\\News', 133, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(665, 'App\\Models\\News', 133, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(666, 'App\\Models\\News', 134, 'cn', 'title', '马克龙捍卫杜罗夫的法国国籍，尽管面临法律挑战', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(667, 'App\\Models\\News', 134, 'cn', 'summary', '法国总统马克龙捍卫给予Telegram首席执行官杜罗夫法国外籍的决定，尽管他面临与其消息应用程序的非法内容相关的严重法律指控。杜罗夫近日在法国被拘留，引发了对他对数字通信重大贡献和他平台滥用指控的审查。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(668, 'App\\Models\\News', 134, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
