	(672, 'App\\Models\\News', 135, 'cn', 'summary', '加沙25年来首例脊髓灰质炎病例促使为64万名儿童发起协调疫苗接种活动，以色列和哈马斯同意停火暂停，以方便这一努力，世卫组织官员确认。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
