	(677, 'App\\Models\\News', 136, 'cn', 'summary', '德国首次驱逐28名阿富汗国籍人士，自2021年8月塔利班重新掌权以来。这一举动是在索林根发生近期刀袭击后，加剧的安全担忧和即将到来的地区选举移民政策辩论期间进行的。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
