	(680, 'App\\Models\\News', 136, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(681, 'App\\Models\\News', 137, 'cn', 'title', '卡马拉·哈里斯在乔治亚州的竞选集会上为温和立场辩护', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(682, 'App\\Models\\News', 137, 'cn', 'summary', '在乔治亚州萨凡纳的竞选集会上，副总统卡马拉·哈里斯为她向更温和立场的转变辩护，强调她的核心价值观没有改变。她面对关于以往对水力压裂和移民问题立场的质疑，同时倡导解决问题所需的理解与共识。此次集会发生在紧张的政治气候中，随着即将到来的选举，民主党人热情上涨。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(683, 'App\\Models\\News', 137, 'cn', 'comment_neutral', '哈里斯试图调整她的信息以吸引温和选民是一项战略举动，特别是考虑到即将到来的选举周期的竞争性。她承认过去的立场表明她愿意适应当前的政治格局，这反映了寻求更广泛支持的候选人通常采用的方法。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(684, 'App\\Models\\News', 137, 'cn', 'comment_left', '哈里斯向中间路线的转变令进步派感到失望，他们期待候选人愿意为大胆的改革而斗争。通过在水力压裂和移民等问题上妥协，她冒着疏远那些对环境和社会正义充满热情的选民的风险。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(685, 'App\\Models\\News', 137, 'cn', 'comment_right', '哈里斯从她之前立场的退却表明她愿意为获取选票而不择手段。她对非法移民施加后果的坚持，对需要坚决捍卫边境安全和个人自由的保守派选民来说，这是一种空洞的承诺。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(686, 'App\\Models\\News', 138, 'cn', 'title', '毛利王图海蒂亚去世，享年69岁，留下团结与文化的遗产', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(687, 'App\\Models\\News', 138, 'cn', 'summary', '新西兰毛利国王图海蒂亚·普塔塔乌·特·韦赫罗韦罗七世在心脏手术后去世，享年69岁。他的去世标志着基因腾格运动的重要篇章的结束，该运动旨在保护毛利文化并团结土著部落。新西兰总理克里斯托弗·卢克森和查尔斯三世国王表达了哀悼，强调了图海蒂亚对人民的奉献精神。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(688, 'App\\Models\\News', 138, 'cn', 'comment_neutral', '图海蒂亚国王的去世对毛利社区和整个新西兰意味着重大损失。他的统治以旨在保护毛利文化和促进土著部落团结的举措为特征，这对国家的社会结构至关重要。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(689, 'App\\Models\\News', 138, 'cn', 'comment_left', '图海蒂亚国王的去世突显了新西兰毛利权利的持续斗争。他的去世应该成为一个警钟，以解决破坏土著主权和身份的制度性不公正和政府政策。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(690, 'App\\Models\\News', 138, 'cn', 'comment_right', '尽管图海蒂亚国王受到尊敬，但对毛利王权的关注不应掩盖更广泛的新西兰身份。政府必须优先考虑能够团结所有公民的政策，而不是迎合特定群体的利益。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(691, 'App\\Models\\News', 139, 'cn', 'title', '旧金山观察派对对哈里斯-沃尔兹CNN采访褒贬不一', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(692, 'App\\Models\\News', 139, 'cn', 'summary', '旧金山湾区选民聚集在米申区的Manny\'s，观看了副总统卡马拉·哈里斯和蒂姆·沃尔兹的CNN采访。评价褒贬不一，有人称赞他们的表现，而另一些人则指出他们在讨论关键议题时过于拘泥于脚本，即将到来的选举迫在眉睫。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(693, 'App\\Models\\News', 139, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
