	(695, 'App\\Models\\News', 139, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(696, 'App\\Models\\News', 140, 'cn', 'title', '加州推进禁止塑料薄膜袋，作为环保举措的一部分', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(697, 'App\\Models\\News', 140, 'cn', 'summary', '加州立法者已通过两项法案，旨在扩大该州现有的塑料袋禁令，涵盖“可回收”的塑料薄膜袋。这些法案旨在消除这一法律漏洞，要求纸袋必须由100%回收材料制成。这一举措是加州减少塑料废物和处理环境问题努力的一部分。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(698, 'App\\Models\\News', 140, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(699, 'App\\Models\\News', 140, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(700, 'App\\Models\\News', 140, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(701, 'App\\Models\\News', 141, 'cn', 'title', '加利福尼亚州推出数字驾照引发争议', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(702, 'App\\Models\\News', 141, 'cn', 'summary', '加利福尼亚州州长加文·纽森宣布，将允许通过热门应用程序访问数字驾照的试点项目转变为全面适用的法律。然而，这些数字驾照的接受程度仍然有限，引发居民对各种场所可用性的问题。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(703, 'App\\Models\\News', 141, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(704, 'App\\Models\\News', 141, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(705, 'App\\Models\\News', 141, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(706, 'App\\Models\\News', 142, 'cn', 'title', '加利福尼亚州通过禁止地方选民身份证法案', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(707, 'App\\Models\\News', 142, 'cn', 'summary', '加利福尼亚州立法机构批准了一项法案，禁止地方政府为市政选举制定选民身份证法。这项立法推翻了最近的亨廷顿海滩法令，该法令要求选民出示身份证，认为会剥夺合法选民的投票权。加利福尼亚州总检察长罗伯·波恩塔对亨廷顿海滩的法律提出挑战，声称这违反州和联邦要求。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(708, 'App\\Models\\News', 142, 'cn', 'comment_neutral', 'SB 1174的通过揭示了美国关于选民身份证法律的持续辩论。支持者认为这些法律维护了选举的完整性，而反对者则认为它们抑制了选民的投票率。加利福尼亚州禁止地方身份证要求的决定强调了该州对投票可及性的承诺。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(709, 'App\\Models\\News', 142, 'cn', 'comment_left', '这项法案代表了对那些寻求剥夺边缘化社区投票权的不公正选民压制努力的重大胜利。选民身份证法对这些人群的不成比例影响的压倒性证据应促使所有州效仿加利福尼亚州，保护投票权。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(710, 'App\\Models\\News', 142, 'cn', 'comment_right', '通过禁止地方选民身份证法，加利福尼亚州继续破坏选举的完整性，并允许非公民影响地方治理。这项法律可能导致选举欺诈的增加，以及对民主过程的信任下降。选民身份证法是确保只有合格选民参与的常识措施。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(711, 'App\\Models\\News', 143, 'cn', 'title', '奥克兰高速公路枪击事件中四人被捕并查获AK-47', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(712, 'App\\Models\\News', 143, 'cn', 'summary', '加州公路巡警在奥克兰高速公路枪击事件后逮捕了四名嫌疑人，并查获一支AK-47突击步枪。追捕始于在奥克兰高速公路上开枪事件，最终在红木城结束。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
