	(716, 'App\\Models\\News', 144, 'cn', 'title', '爱国者日活动在高沙漠纪念9/11遇难者', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(717, 'App\\Models\\News', 144, 'cn', 'summary', '高沙漠将通过各种活动纪念在9/11恐怖袭击中遇难的人们，包括在维克托谷学院的旗帜设置和巴斯托的纪念仪式。成千上万的旗帜将被放置，以纪念2,977名遇难者，鼓励社区成员参与。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(718, 'App\\Models\\News', 144, 'cn', 'comment_neutral', '高沙漠组织的活动是对9/11对无数生命影响的深刻提醒。我们牢记过去以塑造未来是至关重要的。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(719, 'App\\Models\\News', 144, 'cn', 'comment_left', '虽然纪念9/11的受害者很重要，但这些活动也应该集中在防止未来暴力和解决导致此类悲剧的社会系统性问题上。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(720, 'App\\Models\\News', 144, 'cn', 'comment_right', '这些纪念活动不仅是为了纪念受害者，还旨在促进国家团结和对威胁我们祖国的抵抗力。我们必须保持警惕。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(721, 'App\\Models\\News', 145, 'cn', 'title', '加州法案允许无证移民获得州住房援助', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(722, 'App\\Models\\News', 145, 'cn', 'summary', '加州立法机构通过了一项法案，允许无证移民有资格获得州住房购买援助，这在立法者中引发了激烈辩论。法案作者哈奎因·阿伦布拉（Dr. Joaquin Arambula）表示，该法案旨在解决公平和住房危机的问题，而共和党人则认为应优先考虑合法居民。州长加文·纽森（Gavin Newsom）必须在九月底之前对该法案做出决定。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(723, 'App\\Models\\News', 145, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(724, 'App\\Models\\News', 145, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(725, 'App\\Models\\News', 145, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(726, 'App\\Models\\News', 146, 'cn', 'title', '加州公路巡警尽管加薪仍面临创纪录职位空缺', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(727, 'App\\Models\\News', 146, 'cn', 'summary', '加州公路巡警的六分之一职位空缺，超过16%，在加州州长加文·纽森( Gavin Newsom) 的政府签署一份价值4.89亿美元的合同并进行显著加薪之际，这一现象引发了人们的关注。尽管有招募新警员的努力，但空缺率自2019年以来飙升。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(728, 'App\\Models\\News', 146, 'cn', 'comment_neutral', '加州公路巡警的职位空缺率上升引发了人们对招聘策略和警员工作条件的关注。尽管已经实施了显著的加薪，但显然需要额外的策略来提高留任率。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(729, 'App\\Models\\News', 146, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(730, 'App\\Models\\News', 146, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(731, 'App\\Models\\News', 147, 'cn', 'title', '珍·史马特以590万美元上市恩西诺地产，24小时内接受报价', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(732, 'App\\Models\\News', 147, 'cn', 'summary', '好莱坞女演员珍·史马特迅速以590万美元的价格上市她在加利福尼亚恩西诺的地产，并在不到24小时内收到报价。这处房地产在保留历史魅力的同时进行了翻新，拥有七间卧室及奢华设施。史马特在与2002年以150万美元购买的房子告别时，回忆起已故丈夫对她事业的贡献。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(733, 'App\\Models\\News', 147, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(734, 'App\\Models\\News', 147, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(735, 'App\\Models\\News', 147, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(736, 'App\\Models\\News', 148, 'cn', 'title', '加州立法者提议法案以降低电费并推动可再生能源', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(737, 'App\\Models\\News', 148, 'cn', 'summary', '加州立法者公布了旨在降低消费者电力成本和加速可再生能源发展的新法案。这些被称为“加州制造”的举措是在州面临电力需求增加和可负担性问题的情况下提出的。因在之前的提案中遭遇反对，纽瑟姆州长不得不做出妥协，最终形成一项预计将让数百万居民受益的最后立法方案。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(738, 'App\\Models\\News', 148, 'cn', 'comment_neutral', '这些法案的提出代表了在可再生能源需求和加州消费者服务可负担性之间取得平衡的重要一步。未来面临的挑战将是如何有效实施这些措施，而不进一步增加纳税人的负担。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(739, 'App\\Models\\News', 148, 'cn', 'comment_left', '虽然这些措施试图应对能源危机，但仍然远远不够。州政府必须优先投资以社区为主导的可再生项目，并真正实现能源基础设施的民主化，以确保所有加州人，特别是弱势社区，能够平等受益。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(740, 'App\\Models\\News', 148, 'cn', 'comment_right', '这项立法方案是政府过度干预和管理不善的象征。与其浪费纳税人的钱用于可疑的能源项目和退税，不如专注于放松管制，赋权私营部门解决方案，以降低成本并增强能源市场的竞争性。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(741, 'App\\Models\\News', 149, 'cn', 'title', '时机关键：您应该在本季何时接种新冠疫苗？', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(742, 'App\\Models\\News', 149, 'cn', 'summary', '随着2024-25季新冠疫苗的推出，专家讨论了九月或十月接种疫苗的最佳时机。关键因素包括当前感染率、疫苗有效性时间和个人健康状况。CDC建议所有6个月及以上人群接种疫苗。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(743, 'App\\Models\\News', 149, 'cn', 'comment_neutral', '专家建议九月和十月都适合接种新冠疫苗。个人健康状况和当地感染率应指导接种的时机。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(744, 'App\\Models\\News', 149, 'cn', 'comment_left', '对公共健康而言，政府确保所有人都能负担得起和获得疫苗选择至关重要，推广疫苗接种作为集体责任而非个人选择。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(745, 'App\\Models\\News', 149, 'cn', 'comment_right', '疫苗接种的决定应保留为个人选择，免受政府强制。人们应根据自己的风险评估作出决定，而非公共卫生官员的建议。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(746, 'App\\Models\\News', 150, 'cn', 'title', '加利福尼亚州城市占据酒后驾驶最差城市榜单', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(747, 'App\\Models\\News', 150, 'cn', 'summary', 'LendingTree的一份报告显示，美国酒后驾驶率最高的十个城市中有八个位于加利福尼亚州，北卡罗来纳州的罗利市位居榜首。这项研究突出了不同人群中驾驶受损的问题，发现年轻驾驶者的比例尤其显著。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(748, 'App\\Models\\News', 150, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(749, 'App\\Models\\News', 150, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(750, 'App\\Models\\News', 150, 'cn', 'comment_right', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(751, 'App\\Models\\News', 151, 'cn', 'title', '加利福尼亚机动车辆管理局推出中文电子学习课程以更新驾驶执照', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(752, 'App\\Models\\News', 151, 'cn', 'summary', '加利福尼亚机动车辆管理局为需要更新驾驶执照的居民推出了传统中文电子学习课程。这项举措旨在提高对加州150万华裔美国人的可接触性，允许他们在参加课程时使用普通话音频，课程包括测验并允许无限次重考。', '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(753, 'App\\Models\\News', 151, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(754, 'App\\Models\\News', 151, 'cn', 'comment_left', NULL, '2024-09-02 00:44:41', '2024-09-02 00:44:41'),
	(755, 'App\\Models\\News', 151, 'cn', 'comment_right', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(756, 'App\\Models\\News', 152, 'cn', 'title', '加利福尼亚州法案保护消费者免受医疗债务对信用评分的影响，等待州长签字', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(757, 'App\\Models\\News', 152, 'cn', 'summary', '由州参议员莫尼克·利蒙（Monique Limón）提出的法案，禁止医疗债务影响信用评分，已在加利福尼亚州通过，正等待州长签字成为法律。如果法律生效，SB 1061将使加利福尼亚州成为第八个防止医疗债务出现在信用报告上的州，从而为数百万消费者提供救济。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(758, 'App\\Models\\News', 152, 'cn', 'comment_neutral', 'SB 1061的通过标志着消费者保护领域的重要进展，解决了医疗债务普遍存在的问题，这往往妨碍个人的经济机会。这项法律可能为其他州树立一个榜样。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(759, 'App\\Models\\News', 152, 'cn', 'comment_left', '这项法案是朝着拆解一个压迫性医疗债务的破碎医疗体系迈出的重要一步。我们必须继续奋战，反对优先考虑利益而非人民福祉的资本主义结构。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(760, 'App\\Models\\News', 152, 'cn', 'comment_right', '虽然SB 1061背后的意图值得称赞，但这可能会降低个人对财务选择的责任感。个人需要对自己的医疗支出负责，而不是期待政府来干预。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(761, 'App\\Models\\News', 153, 'cn', 'title', '加州推进官方蜗牛和螃蟹的设立', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(762, 'App\\Models\\News', 153, 'cn', 'summary', '加州立法机构正在考虑法案，以将香蕉蜗牛指定为官方蜗牛，将单头蟹指定为官方甲壳类动物。该法案由议员盖尔·佩勒林和吉姆·伍德提出，旨在表彰与加州身份和经济密切相关的符号。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(763, 'App\\Models\\News', 153, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(764, 'App\\Models\\News', 153, 'cn', 'comment_left', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(765, 'App\\Models\\News', 153, 'cn', 'comment_right', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(766, 'App\\Models\\News', 154, 'cn', 'title', '加州推进人工智能责任法案', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(767, 'App\\Models\\News', 154, 'cn', 'summary', '加州立法机关通过了第1047号参议院法案，旨在监管人工智能技术，要求公司实施安全措施。得到埃隆·马斯克等人的支持，该法案在科技行业引发争议。加州州长加文·纽瑟姆预计将在9月底之前采取行动。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(768, 'App\\Models\\News', 154, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
