	(770, 'App\\Models\\News', 154, 'cn', 'comment_right', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(771, 'App\\Models\\News', 155, 'cn', 'title', '加州奶牛群疑似感染H5N1禽流感', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(772, 'App\\Models\\News', 155, 'cn', 'summary', '加州食品和农业部正在调查位于中央山谷的三处奶牛群是否感染H5N1禽流感。虽然该病毒的存在尚未得到确认，但官员强调巴氏杀菌法能够有效消灭该病毒，因此对消费者没有安全隐患。如果确认，该病毒将使受影响的州和群体数量增加。专家呼吁在流感季节来临之前加强检测和监控。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(773, 'App\\Models\\News', 155, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(774, 'App\\Models\\News', 155, 'cn', 'comment_left', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(775, 'App\\Models\\News', 155, 'cn', 'comment_right', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(776, 'App\\Models\\News', 156, 'cn', 'title', '加州葡萄收成面临气候变化挑战', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(777, 'App\\Models\\News', 156, 'cn', 'summary', '在加州，种植者报告称，由于最近的热浪，今年的葡萄收成较小，尽管市场相比往年更加稳定。业内专家对此持谨慎乐观态度，但农民们强调气候对作物产量的持续影响。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(778, 'App\\Models\\News', 156, 'cn', 'comment_neutral', '葡萄农民面临的挑战突显了农业与气候条件之间的微妙平衡。尽管市场显现出稳定的迹象，但气候挑战将如何影响整体产量仍有待观察。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(779, 'App\\Models\\News', 156, 'cn', 'comment_left', '这一情况凸显了我们在农业实践和政策上进行系统性变革的迫切需要。气候变化的影响首先要由我们的农民来承受。我们必须投资可持续的农业技术，以缓解这些影响。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(780, 'App\\Models\\News', 156, 'cn', 'comment_right', '农业应更加关注适应这些自然事件，而不是依赖可能阻碍生产的政府干预或监管。增强农业的韧性至关重要，应该基于个人的主动性，而非外部帮助。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(781, 'App\\Models\\News', 157, 'cn', 'title', '加利福尼亚州通过法案保护儿童网红的收入', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(782, 'App\\Models\\News', 157, 'cn', 'summary', '加利福尼亚州立法者通过了一项法案，要求社交媒体创作者为其内容中出现的未成年人拨出一部分收入存入信托基金。由圣地亚哥参议员史蒂夫·帕迪拉赞助，该倡议更新了最初为儿童演员设立的库根法案下的财务保护，解决了在快速增长的网红经济中对剥削和安全的顾虑。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(783, 'App\\Models\\News', 157, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
