	(786, 'App\\Models\\News', 158, 'cn', 'title', '加州立法机构通过法案解决闲置油井问题', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(787, 'App\\Models\\News', 158, 'cn', 'summary', '由组员Gregg Hart撰写的法案，要求加州对闲置油井进行积极目标的堵塞，已通过州立法机构，等待州长签字。此立法旨在解决超过40,000个闲置井，特别关注靠近住宅区的闲置井，对大型运营商施加更严格的要求。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(788, 'App\\Models\\News', 158, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
