	(791, 'App\\Models\\News', 159, 'cn', 'title', '加州将于2028年禁止学校使用合成食品染料', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(792, 'App\\Models\\News', 159, 'cn', 'summary', '加州立法者已通过一项法案，计划从2028年开始禁止学校出售含有六种合成食品染料的产品，理由是这些染料对儿童的健康与学习能力有负面影响。尽管遭到食品行业团体的反对，但该法案得到了两党的支持。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(793, 'App\\Models\\News', 159, 'cn', 'comment_neutral', '禁止加州学校使用合成食品染料的决定反映了人们对食品安全和儿童健康日益增长的关注。通过关注链接这些添加剂与行为问题的科学研究，立法者正在采取主动措施保护学生。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(794, 'App\\Models\\News', 159, 'cn', 'comment_left', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
