	(796, 'App\\Models\\News', 160, 'cn', 'title', '加州社区大学呼吁申请财政援助，因申请人数下降', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(797, 'App\\Models\\News', 160, 'cn', 'summary', '随着数亿美元的无债务财政援助未被申请，今年申请财政援助的学生人数减少，冒着失去获得重要资金资格的风险。加州社区大学校长办公室呼吁学生在9月3日截止日期之前提交申请，以获得更多可用的援助。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(798, 'App\\Models\\News', 160, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
