	(801, 'App\\Models\\News', 161, 'cn', 'title', '加利福尼亚公路巡警启动劳动节周末酒驾打击行动', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(802, 'App\\Models\\News', 161, 'cn', 'summary', '加州公路巡警将在劳动节周末实施最大执法期，以打击酒后驾驶。去年同一时段，逮捕超过一千名酒驾司机，目标是防止酒驾事件的发生。警官凯莉·马斯尔曼强调了酒驾事件的个人影响，强调了个人责任和安全交通选择的重要性。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(803, 'App\\Models\\News', 161, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(804, 'App\\Models\\News', 161, 'cn', 'comment_left', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(805, 'App\\Models\\News', 161, 'cn', 'comment_right', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(806, 'App\\Models\\News', 162, 'cn', 'title', '加利福尼亚学校拟禁止流行小吃中的添加剂', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(807, 'App\\Models\\News', 162, 'cn', 'summary', '加利福尼亚州立法者投票决定禁止学校提供含有某些食品添加剂的小吃，这些添加剂与患有注意力缺陷多动症的儿童行为恶化有关。这项提案旨在保护儿童健康，尚待加州州长加文·纽森签署。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(808, 'App\\Models\\News', 162, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(809, 'App\\Models\\News', 162, 'cn', 'comment_left', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(810, 'App\\Models\\News', 162, 'cn', 'comment_right', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(811, 'App\\Models\\News', 163, 'cn', 'title', '加利福尼亚的油价困境：新闻传播的提案遭遇抨击', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(812, 'App\\Models\\News', 163, 'cn', 'summary', '加利福尼亚州州长加文·纽瑟姆提议赋予监管者更大权力，以减轻高油价，面临州内共和党人的批评。他们认为该计划将加剧供应问题，而不是缓解，并将其与总统候选人卡马拉·哈里斯的政策相联系。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(813, 'App\\Models\\News', 163, 'cn', 'comment_neutral', '州长纽瑟姆对油价进行监管的努力反映了对通货膨胀和能源成本的更广泛关注。虽然旨在保护消费者，但这些政策的有效性在专家中仍然存在争议。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(814, 'App\\Models\\News', 163, 'cn', 'comment_left', '纽瑟姆的监管提案是对企业贪婪的必要步骤。大型石油公司对价格的操控损害了普通公民，强有力的监管措施对保护消费者和促进公正定价至关重要。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(815, 'App\\Models\\News', 163, 'cn', 'comment_right', '加利福尼亚在纽瑟姆领导下的能源政策正在失败。与其降低价格，不如威胁到国内生产并伤害家庭。州政府应该专注于增加供应并减少监管。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(816, 'App\\Models\\News', 164, 'cn', 'title', '劳动节周末旅行激增标志着夏季结束', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(817, 'App\\Models\\News', 164, 'cn', 'summary', '随着劳动节周末的临近，国内旅行较去年增长了9%，旧金山成为热门目的地。旅行者被建议为机场交通增加做好准备，圣荷西米内塔国际机场预计将在接下来的九天内迎来数千名旅客。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(818, 'App\\Models\\News', 164, 'cn', 'comment_neutral', '劳动节周末国内旅行的增长反映了旅游行业的复苏。然而，旅行者应注意机场可能出现的拥堵，并做好相应的计划。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(819, 'App\\Models\\News', 164, 'cn', 'comment_left', '虽然增加的旅行受到欢迎，但这突显了享受休闲时间的人群之间的不平等。我们必须考虑不断上涨的旅行费用对低收入家庭的影响。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(820, 'App\\Models\\News', 164, 'cn', 'comment_right', '在美国人涌入机场庆祝劳动节之际，确保严格执行安全措施以保护公民免受潜在风险至关重要。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(821, 'App\\Models\\News', 165, 'cn', 'title', '加利福尼亚批准Allstate提高34%的家庭保险费', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(822, 'App\\Models\\News', 165, 'cn', 'summary', '加利福尼亚州已授权Allstate于11月起将家庭保险费用提高34%。此举是在State Farm宣布类似涨幅后进行的。州官员强调，加州的保险费仍低于几个其他州，涨幅归因于灾害和气候变化的影响。消费者被鼓励在对保险费有疑虑时联系官员。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(823, 'App\\Models\\News', 165, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(824, 'App\\Models\\News', 165, 'cn', 'comment_left', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(825, 'App\\Models\\News', 165, 'cn', 'comment_right', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(826, 'App\\Models\\News', 166, 'cn', 'title', '加州批准农贸市场直接销售大麻的法案', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(827, 'App\\Models\\News', 166, 'cn', 'summary', '加州立法机构最终批准了第1111号法案，允许持牌的大麻种植者在农贸市场直接销售他们的产品。该法案现在在等待州长加文·纽森的签字，预计2026年将允许临时事件许可证用于大麻销售。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(828, 'App\\Models\\News', 166, 'cn', 'comment_neutral', '第1111号法案的批准标志着加州在大麻合法化方面的重要一步，可能会增强小规模种植者的市场，同时确保消费者能够获得本地生产的产品。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(829, 'App\\Models\\News', 166, 'cn', 'comment_left', '这项法案是基层大麻生产者的胜利，他们长期以来被企业实体所掩盖。农贸市场的直接销售强调了社区和可持续性，应该进一步扩大！', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(830, 'App\\Models\\News', 166, 'cn', 'comment_right', '政府在我们的社区中进一步推广大麻是令人担忧的。虽然农贸市场是关于本地商品的，但在这一环境中引入大麻模糊了界限，并可能向我们的青年传达错误的信息。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(831, 'App\\Models\\News', 167, 'cn', 'title', 'HIV阳性囚犯悲惨死亡引发对监狱医疗保健的质疑', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(832, 'App\\Models\\News', 167, 'cn', 'summary', 'Nicholas Overfield，一名HIV阳性男子，在埃尔多拉多县监狱被拒绝必要药物后死亡，导致对监狱医疗保健提供商Wellpath提起诉讼。他的母亲称，系统性忽视导致了他的健康恶化和最终死亡。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(833, 'App\\Models\\News', 167, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
