	(836, 'App\\Models\\News', 168, 'cn', 'title', '《与星共舞》专业舞者阿尔忒弥斯·奇维恩采夫因家庭暴力被捕', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(837, 'App\\Models\\News', 168, 'cn', 'summary', '《与星共舞》的专业舞者阿尔忒弥斯·奇维恩采夫因涉嫌家庭暴力在湾区被捕，KRON4.com证实。42岁的奇维恩采夫被指控为重罪，已被拘留在纳帕县监狱，保释金为25,000美元。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(838, 'App\\Models\\News', 168, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
