	(841, 'App\\Models\\News', 169, 'cn', 'title', '圣荷西定位为下一个人工智能创新中心', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(842, 'App\\Models\\News', 169, 'cn', 'summary', '科技公司Couchbase迁至圣荷西，突显出该市作为人工智能创新中心的潜力，地方大学和城市领导的强力支持有助于吸引和培养科技人才。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(843, 'App\\Models\\News', 169, 'cn', 'comment_neutral', 'Couchbase迁移至圣荷西标志着该市在不断发展的人工智能领域的重要战略地位。随着企业离开旧金山等传统技术中心，圣荷西的支持性环境可能会导致人工智能创新的显著增长。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(844, 'App\\Models\\News', 169, 'cn', 'comment_left', '尽管圣荷西成为了科技中心，但我们必须质疑这种迁移的社会经济影响。这些企业巨头会为社区做出贡献，还是仅仅进一步推高房价并加深不平等？城市领导者必须制定政策，以保护地方利益而非企业利润，这一点至关重要。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(845, 'App\\Models\\News', 169, 'cn', 'comment_right', '圣荷西的城市领导者应该专注于维护有利于本地企业家的商业环境。我们不应允许过多的监管或税收来抑制创新。科技公司的涌入是经济增长的积极指标，惠及所有人。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(846, 'App\\Models\\News', 170, 'cn', 'title', '悲剧性高速公路碰撞导致14岁查理·奥尔森在圣荷西遇难', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(847, 'App\\Models\\News', 170, 'cn', 'summary', '14岁的查理·乔治·奥尔森在圣荷西一起涉及逆行卡车司机的悲惨车祸中遇难。查理与母亲瑞贝卡一起旅行，瑞贝卡在事故中也遭遇不幸。此次事件突显了鲁莽驾驶的危险，卡车司机在碰撞后被送往医院，目前尚不清楚他是否会面临指控。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
