	(852, 'App\\Models\\News', 171, 'cn', 'summary', '周四下午，圣荷西一名摩托车手在与半挂车相撞后被宣告在现场死亡。卡车司机正在配合警方调查，事发地区的交通受到严重影响。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
