	(856, 'App\\Models\\News', 172, 'cn', 'title', '加州22人因涉嫌盗窃大麻商店被捕', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(857, 'App\\Models\\News', 172, 'cn', 'summary', '加州检察长罗伯·邦塔宣布逮捕22名个人，他们参与了针对大麻商店的协调盗窃行动，涉及从索诺玛县到圣地亚哥的整个州。这项调查揭示了与奥克兰街头帮派的联系，并已经对这些人提出了商业盗窃和组织零售盗窃的指控。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(858, 'App\\Models\\News', 172, 'cn', 'comment_neutral', '这些逮捕突显了针对大麻商店的有组织犯罪日益严重的担忧，这是一个自合法化以来面临各种挑战的行业。然而，关键在于确保实施有效的措施以防止未来发生此类事件。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
