	(861, 'App\\Models\\News', 173, 'cn', 'title', '休斯顿毕业生在斯坦福完成暑期实习', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(862, 'App\\Models\\News', 173, 'cn', 'summary', '安迪·达汉，2023年休斯顿高中的毕业生，曾在斯坦福大学的卡夫利粒子天体物理与宇宙学研究所的艾哈迈德集团实习。他参与了冷却探测器的代码开发，这些探测器研究宇宙微波背景，助力对宇宙规模、年龄和暗物质候选体的理解。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(863, 'App\\Models\\News', 173, 'cn', 'comment_neutral', '这次实习展现了对有兴趣于物理学和天体物理学的高中毕业生可用的宝贵机会，促进了科学研究的早期参与。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(864, 'App\\Models\\News', 173, 'cn', 'comment_left', '虽然达汉等年轻人参与高水平研究是值得称赞的，但这样的机会应对所有人开放，无论经济背景如何，以确保科学领域的多样性。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(865, 'App\\Models\\News', 173, 'cn', 'comment_right', '达汉的成就反映了传统教育途径的重要性，在这些路径中，STEM领域的奉献和努力工作会引导到声望高的研究所的有意义的暑期实习。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(866, 'App\\Models\\News', 174, 'cn', 'title', '加州大学伯克利分校学生在加沙冲突中点燃亲巴勒斯坦抗议', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(867, 'App\\Models\\News', 174, 'cn', 'summary', '加州大学伯克利分校和其他湾区大学的亲巴勒斯坦示威者在秋季学期之初举行抗议活动，表达了他们对加沙战争的持续关切。这些抗议遵循了大学的规定，但显示出他们在整个学年继续倡导巴勒斯坦权益的决心。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
