	(871, 'App\\Models\\News', 175, 'cn', 'title', '威洛格伦高中因未确认炸弹威胁撤离学生', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(872, 'App\\Models\\News', 175, 'cn', 'summary', '圣荷西警方由于未确认的炸弹威胁于周四撤离了威洛格伦高中。作为安全措施，学生们被迅速撤离，家长被指示在樱桃大街接他们的孩子，警方正在调查此事。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
