	(876, 'App\\Models\\News', 176, 'cn', 'title', '联邦资金助力凯宁汉湖公园复兴', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(877, 'App\\Models\\News', 176, 'cn', 'summary', '阿尔温·库马尔和阿肖克·杰坦南达尼在东圣荷西的凯宁汉湖公园志愿服务已达20年。他们在抗击入侵物种方面的努力获得了85万美元的联邦资金支持，旨在增强公园的恢复和环境公平性。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(878, 'App\\Models\\News', 176, 'cn', 'comment_neutral', '凯宁汉湖公园的复兴工作凸显了社区在环境恢复项目中参与的重要性。联邦资金的注入是改善公园生态健康和为当地居民提供无障碍的重要一步。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(879, 'App\\Models\\News', 176, 'cn', 'comment_left', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
