	(881, 'App\\Models\\News', 177, 'cn', 'title', 'TNT体育分析师因伤害事件中的不当评论受到批评', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(882, 'App\\Models\\News', 177, 'cn', 'summary', '在圣何塞州立大学与萨克拉门托州立大学的大学橄榄球比赛中，TNT体育分析师达里乌斯·沃克因对受伤球员迈克尔·约翰逊的时间不当评论而受到反对。当约翰逊在一次重击后躺在场上时，沃克对教练建议和技术的关注被视为不合适，导致观众的批评。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(883, 'App\\Models\\News', 177, 'cn', 'comment_neutral', '达里乌斯·沃克在伤害事件中的评论引发了关于分析师在敏感时刻讨论技术的适当性的问题。尽管他关于球员安全的观点有其价值，但时机和背景选择不当。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(884, 'App\\Models\\News', 177, 'cn', 'comment_left', '达里乌斯·沃克的评论反映了体育媒体中的一个更大问题，即关注常常从运动员的福利转向指责运动员受伤。这凸显了体育评论中需要更加同情的方式。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(885, 'App\\Models\\News', 177, 'cn', 'comment_right', '尽管达里乌斯·沃克的观点时机不当，但突显了运动员需要接受适当训练的必要性。在运动员受伤后，不应该过于宠溺他们，而是应该强调运动中的责任和自我约束。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(886, 'App\\Models\\News', 178, 'cn', 'title', 'TCU与斯坦福：大学足球对决拉开第一周的帷幕', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(887, 'App\\Models\\News', 178, 'cn', 'summary', '大学足球赛季正在进行中，本周末将进行一系列比赛，其中TCU与斯坦福的对决成为亮点。被视为热门的TCU在与斯坦福的所有之前交锋中获胜，但不同的预测对他们是否能够达到盘口有所不同。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
