	(891, 'App\\Models\\News', 179, 'cn', 'title', '乌克兰F-16坠毁事件调查启动，事发时恰逢俄军空袭', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(892, 'App\\Models\\News', 179, 'cn', 'summary', '乌克兰空军指挥官表示，关于本周早些时候F-16坠毁事件的初步调查报告已与美国合作伙伴分享，他们正在协助调查。该飞行员在周一进行大型俄军空袭时接近目标时遇难。初步评估表明，坠毁并非由于俄方火力造成，但对飞行员错误和机械故障的调查仍在进行中。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
