	(897, 'App\\Models\\News', 180, 'cn', 'summary', '根据德国新闻社dpa的消息，德国当局已就从多个欧洲地点发送的包裹中发现的非传统易燃装置发出警告。国内情报局BfV和联邦犯罪局BKA已向航空公司和物流公司发出警报，称有包裹在运输过程中着火。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(898, 'App\\Models\\News', 180, 'cn', 'comment_neutral', '德国当局最近的警告突显了在物流和包裹递送体系中持续存在的安全问题。这引发了有关这些装置如何未被发现而跨境运输的问题。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
