	(902, 'App\\Models\\News', 181, 'cn', 'summary', '台风香山袭击日本，带来倾盆大雨，导致洪水和山体滑坡，并使旅行服务和工厂生产停滞。已经报告至少四人死亡和99人受伤，促使对超过330万人发布了撤离命令，尤其是在九州和日本东部地区。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
