	(907, 'App\\Models\\News', 182, 'cn', 'summary', '预计极右翼的德国选择党（AfD）将在即将到来的东部州选举中领先，这给总理施尔茨的联邦联盟带来了挑战，原因涉及经济、移民以及对乌克兰的支持。尽管AfD可能无法组建政府，但其崛起反映出德国政治日益分裂。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(908, 'App\\Models\\News', 182, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
