	(911, 'App\\Models\\News', 183, 'cn', 'title', '俄罗斯空袭乌克兰工厂致两人遇难', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(912, 'App\\Models\\News', 183, 'cn', 'summary', '乌克兰苏梅地区的俄罗斯空袭导致两名女性遇难，至少11人受伤，击中了一家生产婴儿食品和家庭用品包装的工厂。这次袭击发生在乌克兰和俄罗斯边界的紧张局势持续之际，双方间不断发生越境事件。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(913, 'App\\Models\\News', 183, 'cn', 'comment_neutral', '最近苏梅的空袭突显了冲突对乌克兰平民生活和基础设施的持续和悲剧性的影响，边境地区的攻击正在加剧。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(914, 'App\\Models\\News', 183, 'cn', 'comment_left', '这一事件强调了国际社会需要立即干预，以制止俄罗斯部队对无辜平民施加的暴力，突显了全球团结抵制侵略的紧迫性。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(915, 'App\\Models\\News', 183, 'cn', 'comment_right', '这次袭击提醒人们乌克兰所承诺的安全承诺未能兑现，并强调了北约需要提供更强大的军事支持以抵御俄罗斯持续的侵略。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(916, 'App\\Models\\News', 184, 'cn', 'title', '克里姆林宫否认与Telegram的杜罗夫达成任何协议，面临法律麻烦', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(917, 'App\\Models\\News', 184, 'cn', 'summary', '克里姆林宫在德国官员对Telegram创始人帕维尔·杜罗夫的正式调查后，否认与其有任何谈判。克里姆林宫发言人德米特里·佩斯科夫强调，杜罗夫与普京总统从未会面，并谴责将此案件解读为政治迫害的潜在可能性。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(918, 'App\\Models\\News', 184, 'cn', 'comment_neutral', '对帕维尔·杜罗夫的持续调查突显了技术与治理之间复杂的相互作用。这引发了关于数字平台在涉及非法活动时的责任的重要问题。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(919, 'App\\Models\\News', 184, 'cn', 'comment_left', '对杜罗夫的调查表明了国家对自由表达和数字平台的管控日益严重的趋势。全球各国政府越来越多地利用法律压力来压制挑战其权威的声音。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(920, 'App\\Models\\News', 184, 'cn', 'comment_right', '克里姆林宫对杜罗夫的捍卫表明了在控制对俄罗斯技术的外部影响方面维护国家主权的必要性。西方经常利用法律框架来削弱不屈服的企业家。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(921, 'App\\Models\\News', 185, 'cn', 'title', '孟加拉国活动家迈克尔·查克玛揭示被绑架五年的经历', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(922, 'App\\Models\\News', 185, 'cn', 'summary', '人权活动家迈克尔·查克玛讲述了他在孟加拉国被绑架和酷刑的五年经历，突显了前政府强制失踪的系统性问题。临时政府现在正在组建一个委员会来调查这些案件，背景是抗议和政治动荡的持续上演。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(923, 'App\\Models\\News', 185, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
