	(926, 'App\\Models\\News', 186, 'cn', 'title', '泰国调查前进党成员因对国王侮辱法修正案的支持', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(927, 'App\\Models\\News', 186, 'cn', 'summary', '泰国反腐败委员会正在调查44名被解散的前进党成员，其中包括25名现任国会议员，因他们支持修订国王侮辱法的立法。这是在该党因其选举承诺改变此法而被解散不久后的行动，批评者称该法抑制了反对派。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(928, 'App\\Models\\News', 186, 'cn', 'comment_neutral', '对前进党的调查反映了泰国政治中持续的紧张局势，特别是涉及与君主制相关的言论自由的法律。委员会确保公正调查并维护民主原则仍然至关重要。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
