	(931, 'App\\Models\\News', 187, 'cn', 'title', '捷克共和国准备应对俄罗斯石油供应可能中断', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(932, 'App\\Models\\News', 187, 'cn', 'summary', '捷克共和国能源安全特使瓦茨拉夫·巴图斯卡表示，来年通过德鲁日巴管道的俄罗斯石油供应中断对该国不会构成问题。捷克正在投资提升TAL管道的能力，确保在2025年前实现能源独立。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(933, 'App\\Models\\News', 187, 'cn', 'comment_neutral', '捷克共和国多元化其石油供应线路的做法体现了一种在能源安全上的前瞻性战略。投资替代基础设施对于减少与地缘政治紧张局势相关的风险至关重要。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(934, 'App\\Models\\News', 187, 'cn', 'comment_left', '虽然捷克共和国的准备值得赞扬，但仍急需转向可再生能源，而不是仅仅寻找俄罗斯化石燃料的替代品。真正的能源安全只能通过可持续的解决方案来实现。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(935, 'App\\Models\\News', 187, 'cn', 'comment_right', '捷克共和国努力摆脱对俄罗斯石油的依赖是朝着国家主权的重要举措。然而，依赖其他国家的进口可能带来类似的风险，更应强调国内能源生产。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(936, 'App\\Models\\News', 188, 'cn', 'title', '哥伦比亚大学抗议活动在新领导下重现', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(937, 'App\\Models\\News', 188, 'cn', 'summary', '随着新学年的临近，倡导巴勒斯坦权利的学生抗议重新出现在哥伦比亚大学。在校园安全和领导层的变化中，亲巴勒斯坦的联合体CUAD继续为撤资支持以色列在巴勒斯坦的军事存在的公司进行抗议。与此同时，大学在安全和言论自由之间的平衡面临着日益激烈的紧张局势。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
