	(942, 'App\\Models\\News', 189, 'cn', 'summary', '太平洋岛屿论坛批准了一项计划，以增加成员国间的警察力量，减少对外部势力的依赖，此倡议得到了所罗门群岛的强力支持。此项由澳大利亚支持的倡议旨在加强地区安全，以应对中国影响力的增长及持续的战略竞争。论坛领导人还讨论了新喀里多尼亚的危机，并重申与台湾的关系，遭到中国的批评。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
