	(947, 'App\\Models\\News', 190, 'cn', 'summary', '印度和巴基斯坦的当局在罕见的八月气旋威胁沿海城镇时，正在疏散数千人并关闭学校。大雨和强风导致城市洪水，当局警告渔民，并呼吁居民留在室内。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
