	(952, 'App\\Models\\News', 191, 'cn', 'summary', '救援行动计划在几天内开始，以回收在红海被胡塞武装袭击后搁浅的希腊油轮Sounion。这项行动因船只上装有爆炸装置而复杂化，因其装载约100万桶原油而构成重大环境风险。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
	(953, 'App\\Models\\News', 191, 'cn', 'comment_neutral', 'Sounion周围的情况突显了冲突地区海事救援行动的复杂挑战，特别是处理潜在危险材料和爆炸装置的风险。', '2024-09-02 00:44:42', '2024-09-02 00:44:42'),
