	(967, 'App\\Models\\News', 194, 'cn', 'summary', '瑞士政府已解除对新核电站的禁令，逆转了2017年退出核能的决定。然而，专家表示，政治和财政障碍将使得建设延迟数十年，预计运营可能直到2040年代中期甚至2060年代才能开始。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
