	(972, 'App\\Models\\News', 195, 'cn', 'summary', '为了应对最近在俾路支省造成超过50人死亡的叛乱者袭击，巴基斯坦军方已展开情报基础的行动。在这些行动中，五名叛乱者被杀，三人受伤，军方承诺将所有肇事者绳之以法。这些袭击由俾路支解放军声称负责，据信旨在针对与中国-巴基斯坦经济走廊相关的项目。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
