	(977, 'App\\Models\\News', 196, 'cn', 'summary', '突尼斯行政法院裁定支持政治家伊梅德·达伊米，使他得以参加定于10月6日的即将举行的总统选举。达伊米是第三位在法院干预后恢复候选资格的候选人，前两位是阿卜杜拉提夫·梅基和蒙德赫·兹奈迪。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(978, 'App\\Models\\News', 196, 'cn', 'comment_neutral', '突尼斯行政法院的裁决是朝向民主完整的重要一步，使得在选举过程中能够有更多声音，反映出政治上更具多样性的代表性。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
