	(982, 'App\\Models\\News', 197, 'cn', 'summary', '随着11月COP29的临近，各国在向发展中国家提供应对气候变化的资金上分歧严重，提议金额从4410亿美元到超过1万亿美元不等。在有关哪些国家应当贡献的主要争议中，中国的角色备受关注。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
