	(986, 'App\\Models\\News', 198, 'cn', 'title', '俄罗斯国防官员正面临腐败调查', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(987, 'App\\Models\\News', 198, 'cn', 'summary', '克里姆林宫证实，国防官员正面临严重的腐败调查，前副部长帕维尔·波波夫因与国防部相关的欺诈指控被拘留。这起丑闻标志着俄罗斯军事部门近年来最大的腐败调查，导致多名官员被捕，并在领导层中发生重大变化。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(988, 'App\\Models\\News', 198, 'cn', 'comment_neutral', '正在进行的腐败调查标志着俄罗斯国防部门的关键时刻，可能表明正在努力解决军事机构内部长期存在的管理不善和欺诈问题。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(989, 'App\\Models\\News', 198, 'cn', 'comment_left', '这些调查可能只是一种表面工作，是精英试图转移责任并掩盖军事工业复杂体内因投机腐败而加剧的系统性缺陷的尝试。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(990, 'App\\Models\\News', 198, 'cn', 'comment_right', '逮捕这些官员是清除俄罗斯军队软弱环节的必要步骤，并确保国防预算更有效地用于国家安全的管理。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(991, 'App\\Models\\News', 199, 'cn', 'title', '欧洲联盟被敦促加强武器生产以应对地缘政治威胁', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(992, 'App\\Models\\News', 199, 'cn', 'summary', '欧洲委员会主席乌尔苏拉·冯·德赖恩强调，欧盟需要增加武器生产，以应对地缘政治威胁，特别是俄罗斯对乌克兰的战争，称欧洲必须将安全作为首要任务。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(993, 'App\\Models\\News', 199, 'cn', 'comment_neutral', '对增加武器生产的呼吁反映了欧盟对在动荡的地缘政治环境中增强防御能力日益增长的认识。这表明了欧洲对安全认知的重大转变。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
