	(1002, 'App\\Models\\News', 201, 'cn', 'summary', '印尼政府将对巴厘岛的旅游业进行审计，以提高质量和保护当地文化。高级部长Luhut Pandjaitan强调了与外国游客有关的犯罪和过度开发等问题，承诺驱逐麻烦制造者并解决垃圾问题。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
