	(1007, 'App\\Models\\News', 202, 'cn', 'summary', '以色列军队在珍宁进行大规模行动时击毙了当地哈马斯指挥官瓦森·哈泽姆。此次行动暴力升级并造成平民伤亡，引发全球关注。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
