	(1012, 'App\\Models\\News', 203, 'cn', 'summary', '面对选举挫折，印度总理莫迪的联盟正在增加现金补助和福利以保持在即将到来的州选举中的受欢迎程度。分析师警告称，这一民粹主义策略可能会扰乱财政平衡和城市发展项目的资金。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1013, 'App\\Models\\News', 203, 'cn', 'comment_neutral', '莫迪政府向现金补助的转变凸显了一项重要的政治策略，旨在在最近选举失利后重新获得公众支持。然而，这种方法引发了人们对长期财政可持续性的担忧。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
