	(1017, 'App\\Models\\News', 204, 'cn', 'summary', '联合国已拨款1亿美元援助十个资金不足的人道主义危机，其中大部分资金将用于也门和埃塞俄比亚。联合国强调迫切需要持续的财政支持，以应对饥饿、流离失所和气候挑战等问题。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1018, 'App\\Models\\News', 204, 'cn', 'comment_neutral', '联合国拨款的资金凸显了各个地区迫切的人道主义需求。对于捐助国而言，保持对这些面临多重社会经济挑战的脆弱群体的支持至关重要。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
