	(1022, 'App\\Models\\News', 205, 'cn', 'summary', '根据世卫组织的消息，在9月1日针对超过64万名儿童进行脊髓灰质炎疫苗接种活动之前，已有120万剂疫苗被送往加沙，另外还将有40万剂疫苗在途中。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
