	(1027, 'App\\Models\\News', 206, 'cn', 'summary', '塞尔维亚和巴尔干地区创纪录的干旱导致了广泛的作物歉收，人们对气候变化对农业的影响感到担忧。尽管酿酒商可能因葡萄的甜度而受益，农民预计将遭受重大损失，玉米产量预计将下降20%。这一情况突显了该地区对增加灌溉的需求。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1028, 'App\\Models\\News', 206, 'cn', 'comment_neutral', '巴尔干地区的局势明确提醒我们气候变化如何通过极端天气表现出来。农业实践必须适应以减轻这些影响，特别是在灌溉和作物抗逆性方面。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
