	(1032, 'App\\Models\\News', 207, 'cn', 'summary', '2025年欧洲歌唱大赛将于5月17日在瑞士巴塞尔举行，预计将带来大量粉丝，促进经济增长。相关部门提议拨款3490万瑞士法郎以支持此次活动，预计将吸引47.3万参与者并为当地企业带来显著支出。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
