	(1037, 'App\\Models\\News', 208, 'cn', 'summary', '前红军成员莱昂纳多·贝图拉奇因严重罪行在阿根廷布宜诺斯艾利斯被捕，他是意大利通缉犯。在米莱总统的政府下，他失去了难民身份，面临27年的监禁，罪名包括绑架。意大利当局称赞了意大利、阿根廷和国际刑警之间的合作，这使得他的逮捕得以实现。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
