	(1042, 'App\\Models\\News', 209, 'cn', 'summary', '委内瑞拉几乎所有24个州遭遇大规模停电，政府在没有提供证据的情况下指责反对派蓄意破坏。通信和信息部长弗雷迪·纳涅斯称该国再次成为电网故意攻击的受害者。这次大停电是此前较小停电后的又一次，此时政治紧张局势因最近的选举而升级。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1043, 'App\\Models\\News', 209, 'cn', 'comment_neutral', '委内瑞拉的停电事件突显了基础设施问题的持续性，以及政府对反对派无证据指控的反复。这种事件引发了对公共服务可靠性和国家政治气候的担忧。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1044, 'App\\Models\\News', 209, 'cn', 'comment_left', '反对派力量的不断破坏企图反映了他们破坏马杜罗政府的绝望。这些停电是反对派进一步破坏国家的有组织努力，政府必须保持抵御这些攻击的弹性。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1045, 'App\\Models\\News', 209, 'cn', 'comment_right', '这次停电再次显示了马杜罗政权未能维持基本服务的失败。政府不应指责反对派，而应集中精力解决长期失败的基础设施问题，并对其低效工作负责。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1046, 'App\\Models\\News', 210, 'cn', 'title', '德国在选举前恢复遣返阿富汗罪犯', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1047, 'App\\Models\\News', 210, 'cn', 'summary', '德国恢复遣返有犯罪记录的阿富汗国民，与地区选举时期的移民问题成为焦点相吻合。这是在与阿富汗移民有关的一系列暴力事件之后，政府面临加大收紧庇护政策压力的情况下采取的举措。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
