	(1052, 'App\\Models\\News', 211, 'cn', 'summary', '韩国监管机构和警方正在加强打击性剥削深度伪造内容的力度，呼吁像Telegram这样的社交媒体公司合作。针对女性，尤其是K-pop明星的深度伪造色情内容事件日益增加，导致公众舆论愤怒和政府采取行动，包括提议对这种行为实施更严格的法律。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
