	(1057, 'App\\Models\\News', 212, 'cn', 'summary', '加沙地区卫生当局确认本月早些时候出现25年来的首例脊髓灰质炎病例，促使计划于9月1日启动针对儿童的大规模疫苗接种运动。此病例与在埃及发现的病毒株有关，归因于持续冲突和卫生条件恶化导致的疫苗接种率下降。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1058, 'App\\Models\\News', 212, 'cn', 'comment_neutral', '在冲突地区，25年来在加沙地区出现脊髓灰质炎凸显了持续疫苗接种工作的关键需求。对公共卫生系统面临的挑战进行全面分析并增加对医务人员的支持是至关重要的。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
