	(1067, 'App\\Models\\News', 214, 'cn', 'summary', '台湾驻海地大使馆已向海地国家警察和军队捐赠了400个防护装备套件，以帮助他们打击黑帮。这一捐赠反映了两国之间的深厚友谊，而海地正面临黑帮暴力和不稳定的困扰。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
