	(1072, 'App\\Models\\News', 215, 'cn', 'summary', '新西兰毛利国王图赫提亚·波塔图·特·维赫罗韦罗七世在心脏手术后以69岁高龄安详去世。他的去世使整个毛利社区和国家感到悲痛，标志着Kiingitanga运动历史上的一个重要时刻。接替他的王将在传统的葬礼仪式上被任命。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1073, 'App\\Models\\News', 215, 'cn', 'comment_neutral', '毛利国王图赫提亚的去世让新西兰人反思，突显了Kiingitanga运动的重要性以及毛利文化在国家身份中的角色。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
