	(1077, 'App\\Models\\News', 216, 'cn', 'summary', '巴拿马当局遣返了30名厄瓜多尔移民，使用美国资助的航班，这是一项旨在阻止非法过境的协议的一部分。此次行动继之前遣返哥伦比亚移民的航班之后，显示出通过危险的达连峡谷管理移民流动的持续努力。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
