	(1082, 'App\\Models\\News', 217, 'cn', 'summary', '越南和菲律宾同意在南海日益紧张的局势下加强国防和军事关系，并承诺在海洋安全方面合作。此次协议是在越南国防部长访问马尼拉期间达成的，双方计划在年底前签署正式的国防合作协议。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1083, 'App\\Models\\News', 217, 'cn', 'comment_neutral', '越南和菲律宾之间的这一合作代表了对抗中国在南海影响力的战略举措。两国正在根据国际法采取谨慎的措施，实现相互防御和和平解决争端。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
