	(1087, 'App\\Models\\News', 218, 'cn', 'summary', '中国发布的一份调查报告称，菲律宾关于萨宾纳浅滩珊瑚损坏的指控没有科学依据。该报告反驳了有关中国活动导致珊瑚褪色和死亡的指控，强调生境条件适合珊瑚生长。在南海，两国围绕该水域的控制权继续发生冲突。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1088, 'App\\Models\\News', 218, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
