	(1091, 'App\\Models\\News', 219, 'cn', 'title', '新喀里多尼亚议会主席意外被更换', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1092, 'App\\Models\\News', 219, 'cn', 'summary', '新喀里多尼亚议会的第一位卡纳克主席罗克·瓦米坦被维尔玛·法拉奥以微弱的票数替换。法拉奥作为“中间路线”候选人，旨在进行改革，并成为议会的第一位女性领导人，而瓦米坦因其与亲独立卡纳克集团和法国的交易而受到批评。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
