	(1096, 'App\\Models\\News', 220, 'cn', 'title', '英国对以色列在约旦河西岸的行动表示关切，暴力升级', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1097, 'App\\Models\\News', 220, 'cn', 'summary', '英国政府对以色列在被占领的约旦河西岸的军事行动表示深切关切，呼吁紧急降级和克制。自与哈马斯的冲突开始以来，局势恶化，导致显著的伤亡和地区紧张局势加剧。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1098, 'App\\Models\\News', 220, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1099, 'App\\Models\\News', 220, 'cn', 'comment_left', NULL, '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1100, 'App\\Models\\News', 220, 'cn', 'comment_right', NULL, '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1101, 'App\\Models\\News', 221, 'cn', 'title', '美国军事加强与菲律宾关系应对中国日益紧张局势', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1102, 'App\\Models\\News', 221, 'cn', 'summary', '在美军两艘航母战斗群在印度洋巡航以威慑伊朗之际，美国印太司令部在马尼拉召开第35届军事法律与行动会议，菲律宾与中国在争议礁石上的紧张关系不断升温。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1103, 'App\\Models\\News', 221, 'cn', 'comment_neutral', '南海的持续紧张局势凸显了该地区复杂的地缘政治动态。美国对菲律宾的军事支持表明其对盟友的承诺，但这也可能加剧与中国的敌对关系。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1104, 'App\\Models\\News', 221, 'cn', 'comment_left', '美国再次以保护盟友的名义展示其军事力量，但这种做法只是在该地区加剧冲突。菲律宾应优先考虑和平谈判，而不是依赖美国的干预。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1105, 'App\\Models\\News', 221, 'cn', 'comment_right', '美国必须坚定应对中国在南海的侵略。支持菲律宾对于维护航行自由和保护美国在该地区的利益至关重要。我们不能表现出软弱。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1106, 'App\\Models\\News', 222, 'cn', 'title', '洪都拉斯总统卡斯特罗在美国关切之际威胁退出引渡条约', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1107, 'App\\Models\\News', 222, 'cn', 'summary', '洪都拉斯总统西奥玛拉·卡斯特罗宣布计划退出与美国的长期引渡条约，称该条约被用来恐吓她的政府，近日在洪都拉斯与委内瑞拉军事官员的 controversial 会议后，两国紧张关系加剧。美国呼吁洪都拉斯重新考虑这一决定，认为这会削弱打击毒品贩运的合作。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1108, 'App\\Models\\News', 222, 'cn', 'comment_neutral', '洪都拉斯和美国之间的外交紧张局势突显了现代国际关系的复杂性，各国之间的条约和协议往往会受到国内政治和安全关切的影响。未来如何发展，以及这一情况将对毒品贩运合作产生怎样的影响还有待观察。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1109, 'App\\Models\\News', 222, 'cn', 'comment_left', '西奥玛拉·卡斯特罗重新考虑引渡条约的决定是朝向主权迈出的勇敢一步，反映了对美国在拉丁美洲干涉主义的必要反击。美国长期以来支持右派政权，出于自身地缘政治利益而剥削这些国家。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1110, 'App\\Models\\News', 222, 'cn', 'comment_right', '卡斯特罗威胁退出引渡条约揭示了她政府对执法的令人不安的忽视，以及明显与反美政权的勾结。美国必须在打击毒品贩运的问题上保持坚定，不应允许洪都拉斯陷入混乱。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1111, 'App\\Models\\News', 223, 'cn', 'title', '德国左翼领袖竞选集会上遭遇粉红油漆袭击', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1112, 'App\\Models\\News', 223, 'cn', 'summary', '德国萨赫拉·瓦根肯特联盟(BSW)领袖萨赫拉·瓦根肯特在图林根的竞选集会上遭遇粉红油漆袭击，就在州议会选举前几天。安保人员迅速逮捕了袭击者，而瓦根肯特则敦促支持者不要感到威胁。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
