	(1117, 'App\\Models\\News', 224, 'cn', 'summary', 'Telegram首席执行官帕维尔·杜罗夫因涉嫌在消息平台上协助非法活动而在法国被捕。此事件导致法俄关系紧张，杜罗夫的律师称这些指控荒谬。此案件反映出对科技公司在在线内容监管中作用的日益审查。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
