	(1122, 'App\\Models\\News', 225, 'cn', 'summary', '超级游艇贝叶斯的沉没导致科技企业家迈克·林奇及其他六人遇难，行业估计保险赔偿额可能至少为1.5亿美元。有关灾难发生情况的调查仍在进行中。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
