	(1126, 'App\\Models\\News', 226, 'cn', 'title', '俄罗斯炮击造成科斯季扬蒂夫卡一人死亡，冲突持续', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1127, 'App\\Models\\News', 226, 'cn', 'summary', '根据当地当局的消息，最近一次俄罗斯炮击造成科斯季扬蒂夫卡一人死亡，另外六人受伤。该镇位于前线远处，频繁遭受攻击，导致居民区严重受损。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1128, 'App\\Models\\News', 226, 'cn', 'comment_neutral', '乌克兰的持续冲突继续升级，影响到科斯季扬蒂夫卡等平民区。这一事件突显了远离前线地区居民所面临的持续危险。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
