	(1131, 'App\\Models\\News', 227, 'cn', 'title', '俄罗斯堪察加半岛海域发生5.9级地震', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1132, 'App\\Models\\News', 227, 'cn', 'summary', '据欧洲地中海地震中心报道，周五俄罗斯堪察加半岛东海岸发生了一次5.9级地震，震源深度为51公里。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1133, 'App\\Models\\News', 227, 'cn', 'comment_neutral', '堪察加地区的这次地震提醒我们该地区的地震活动，强调了在这些地区做好应急准备的必要性。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1134, 'App\\Models\\News', 227, 'cn', 'comment_left', '这次地震凸显了政府在灾害响应和基础设施方面需要进行更多投资，以保护易受地震影响的弱势群体。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1135, 'App\\Models\\News', 227, 'cn', 'comment_right', '这种自然灾害如同这次地震重申了俄罗斯人民的韧性，他们继续应对恶劣环境带来的挑战。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1136, 'App\\Models\\News', 228, 'cn', 'title', '东帝汶庆祝独立25周年，反思冲突解决过程', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1137, 'App\\Models\\News', 228, 'cn', 'summary', '联合国秘书长安东尼奥·古特雷斯在东帝汶独立25周年之际赞扬了该国的独立，强调其通过谈判解决冲突的表现。当天在帝力举行了纪念活动，回顾了该国从印尼统治到自我治理的历程。古特雷斯强调了东帝汶抵抗者的勇气以及该国作为联合国维和行动贡献者的演变。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1138, 'App\\Models\\News', 228, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1139, 'App\\Models\\News', 228, 'cn', 'comment_left', NULL, '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1140, 'App\\Models\\News', 228, 'cn', 'comment_right', NULL, '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1141, 'App\\Models\\News', 229, 'cn', 'title', 'NASA在审查后将推进星际飞船的脱离', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1142, 'App\\Models\\News', 229, 'cn', 'summary', 'NASA宣布无人驾驶波音星际飞船将在最早9月6日脱离。经过审查，太空局认为推进系统问题对于载人返回风险过高，导致决定让星际飞船上的宇航员明年初通过SpaceX航天器返回地球。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1143, 'App\\Models\\News', 229, 'cn', 'comment_neutral', '延迟星际飞船载人返回的决定凸显了太空行动中安全的重要性。在继续进行未来任务之前，NASA确保解决推进系统问题至关重要。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1144, 'App\\Models\\News', 229, 'cn', 'comment_left', '这一事件突显了与私营太空旅行相关的固有风险。安全的关键因素不应外包给波音和SpaceX等公司，因为追求利润可能会危及宇航员的福利。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1145, 'App\\Models\\News', 229, 'cn', 'comment_right', 'NASA等待脱离的决定反映了政府机构中日益增加的官僚主义。高效的运营决策正被过度谨慎所掩盖，延误了美国太空探索目标的进展。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1146, 'App\\Models\\News', 230, 'cn', 'title', '奥斯卡获奖导演在新纪录片中审视特朗普有争议的家庭分离政策', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1147, 'App\\Models\\News', 230, 'cn', 'summary', '埃罗尔·莫里斯在威尼斯电影节上首映了他的纪录片《分开》，探讨特朗普政府在美墨边界的家庭分离政策。该影片揭示了对儿童和家庭的影响，同时提出了关于该政策背后政府逻辑的问题。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1148, 'App\\Models\\News', 230, 'cn', 'comment_neutral', '《分开》的发布突显了美国移民政策的一个关键问题，强调了对家庭情感和心理造成的影响。这部纪录片可以作为对决策者重要提醒，说明他们的决定对人类的后果。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1149, 'App\\Models\\News', 230, 'cn', 'comment_left', '这部纪录片清晰地展示了特朗普政府政策的残酷性。这是美国历史上一个可耻的篇章，反映了移民实践中根深蒂固的系统性问题。迫切需要改革，以防止进一步的人权侵犯。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1150, 'App\\Models\\News', 230, 'cn', 'comment_right', '尽管这部纪录片强调了关键问题，但未能承认严格的边境政策对国家安全的必要性。对非法移民的担忧不应被忽视，采取的任何措施都是为了维护法律和秩序。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1151, 'App\\Models\\News', 231, 'cn', 'title', '美国海军救援伊朗水手于中东紧张局势中', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1152, 'App\\Models\\News', 231, 'cn', 'summary', '美国海军西奥多·罗斯福航母打击群于8月23日在国际水域救援了两名伊朗水手，此时中东紧张局势持续上升。这项行动展示了美国军方在地区战略存在的同时，致力于人道主义努力。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1153, 'App\\Models\\News', 231, 'cn', 'comment_neutral', '这次救援行动突显了美国海军在国际水域中军事存在与人道主义援助的双重角色，这在该地区地缘政治紧张局势加剧的时期尤为重要。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1154, 'App\\Models\\News', 231, 'cn', 'comment_left', NULL, '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
