	(1156, 'App\\Models\\News', 232, 'cn', 'title', '尼加拉瓜禁止169个非政府组织，继续打压公民社会', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1157, 'App\\Models\\News', 232, 'cn', 'summary', '尼加拉瓜政府因未能遵循法规而禁止了169个非政府组织，包括加拿大的救助儿童会。这一举措是奥尔特加总统政府打压被视为反对派组织的更大努力的一部分。自2018年以来，已有超过4000个非政府组织被关闭。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1158, 'App\\Models\\News', 232, 'cn', 'comment_neutral', '最近尼加拉瓜禁止169个非政府组织凸显了政府与公民社会之间的持续紧张关系，反映了独裁政权中制度性扼杀异议的更广泛趋势。', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1159, 'App\\Models\\News', 232, 'cn', 'comment_left', NULL, '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
