	(1161, 'App\\Models\\News', 233, 'cn', 'title', '利比亚中央银行行长因民兵威胁而逃离', '2024-09-02 00:44:43', '2024-09-02 00:44:43'),
	(1162, 'App\\Models\\News', 233, 'cn', 'summary', '利比亚中央银行行长萨迪克·阿尔-卡比尔因民兵对银行工作人员的威胁而逃离该国。他声称，这些民兵绑架员工的亲属以逼迫他们工作。他的声明表明中央银行控制权的危机更深，加上这个已经分裂的国家的日益不稳定，这对全球石油生产至关重要。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
