	(1167, 'App\\Models\\News', 234, 'cn', 'summary', '南非的新法律禁止圈养大猫繁殖和狮子商业化，饲养者对未来的商业前景感到焦虑，政府建议关闭繁殖行业，但未提供财政援助。该国的圈养狮子数量是世界上最多的，这使得这一发展争议更加复杂。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1168, 'App\\Models\\News', 234, 'cn', 'comment_neutral', '南非政府决定逐步淘汰圈养大猫繁殖反映了全球日益关注动物权利和保护问题。然而，缺乏对受影响养殖者的替代支持，对那些依赖这一行业谋生的人构成了重大挑战。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
