	(1172, 'App\\Models\\News', 235, 'cn', 'summary', '以色列向美国报告称，由于军队单位之间的沟通错误，世界粮食计划署（WFP）的一辆车辆在加沙遭到射击。美国敦促以色列承担责任并防止未来涉及联合国人员的事件。在此次袭击后，WFP已暂时暂停在加沙的运营。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
