	(1176, 'App\\Models\\News', 236, 'cn', 'title', '克里姆林宫不担心国际刑事法院的逮捕令，普京准备访问蒙古', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1177, 'App\\Models\\News', 236, 'cn', 'summary', '克里姆林宫表示，对于普京总统即将访问蒙古这一国际刑事法院成员国的逮捕令并不感到担忧。这次访问是自去年因与乌克兰有关的战争罪指控发出逮捕令后，普京首次访问国际刑事法院成员国。围绕战争罪指控和国际刑事法院成员国义务的讨论随之展开。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
