	(1182, 'App\\Models\\News', 237, 'cn', 'summary', '在布拉格的GLOBESEC安全会议上，欧盟委员会主席乌尔苏拉·冯德莱恩强调了中欧在建立更强大的欧洲防务部门中的重要性。她指出，尽管北约应作为集体防务的核心，但欧洲需要增强自身的防务能力。此次会议有来自70多个国家的约2000名代表参加。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
