	(1187, 'App\\Models\\News', 238, 'cn', 'summary', 'SpaceX的Starlink报告称，由于巴西最高法院法官亚历山大·德·莫拉斯与X首席执行官埃隆·马斯克之间在阻止极右账户方面的冲突，其在巴西的账户已被冻结。马斯克批评德·莫拉斯，称针对Starlink的行为是违宪的，而德·莫拉斯威胁如果X未能遵守法律要求，将在全国范围内关闭该平台。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1188, 'App\\Models\\News', 238, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
