	(1191, 'App\\Models\\News', 239, 'cn', 'title', '捷克共和国计划限制Airbnb租赁以应对当地反对声', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1192, 'App\\Models\\News', 239, 'cn', 'summary', '捷克政府已提出新规，以限制在布拉格等热门城市的短期游客住宿，如Airbnb。此举旨在解决因游客涌入导致的住房短缺和高租金问题，并希望确保当地居民不被迫迁离。此举跟随其他欧洲城市的类似趋势，预计将在2025年7月生效。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1193, 'App\\Models\\News', 239, 'cn', 'comment_neutral', '拟议的规定反映了对因短期租赁激增而受到影响的当地居民日益关注。在旅游与当地住房需求之间取得平衡对可持续城市发展至关重要。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
