	(1196, 'App\\Models\\News', 240, 'cn', 'title', '厄瓜多尔努力执行历史性的石油钻探禁令', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1197, 'App\\Models\\News', 240, 'cn', 'summary', '在厄瓜多尔进行历史性公投以结束雅苏尼国家公园的石油钻探一年后，政府只关闭了一口井，并寻求延长裁决。批评人士认为，这破坏了人民的意愿和土著社区的权利。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1198, 'App\\Models\\News', 240, 'cn', 'comment_neutral', '厄瓜多尔政府对公投的回应引发了对其是否真正履行人民意愿的担忧。在仅关闭一口井并请求延长期限的情况下，许多人可能会质疑其环保承诺的诚意。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
