	(1201, 'App\\Models\\News', 241, 'cn', 'title', '紧张局势升级：联合国警告中东可能发生全面战争', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1202, 'App\\Models\\News', 241, 'cn', 'summary', '在加沙停火协议陷入僵局之际，以色列与真主党之间的冲突加剧了中东更大冲突的恐惧。联合国外交官皮埃尔·拉克鲁瓦强调了该地区危机相互联系的紧迫性和减缓局势的必要性。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
