	(1206, 'App\\Models\\News', 242, 'cn', 'title', '卡马拉·哈里斯的气候记录与选举策略受审视', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1207, 'App\\Models\\News', 242, 'cn', 'summary', '在一次独家采访中，副总统卡马拉·哈里斯重申了她对气候行动的承诺，但却因其在化石燃料问题上的立场转变而受到批评。在与唐纳德·特朗普的竞选对决中，她的记录，尤其是关于《通货膨胀削减法案》和她对水力压裂的态度，正受到审视。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1208, 'App\\Models\\News', 242, 'cn', 'comment_neutral', '卡马拉·哈里斯在气候政策上不断演变的立场反映了政治决策的复杂性，特别是在一个注重平衡进步理想与务实治理的政府内。虽然她倡导《通货膨胀削减法案》等举措，但批评者指出她早期环境立场的不一致，尤其是在水力压裂问题上的摇摆不定。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1209, 'App\\Models\\News', 242, 'cn', 'comment_left', '哈里斯最近关于气候行动的评论与她真正致力于环境正义的信念不符，因为她与拜登政府更倾向企业的政策相吻合。许多活动人士担心，她对清洁能源的推动在没有像禁止水力压裂这样的严格法规的情况下，无法有效挑战化石燃料行业。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1210, 'App\\Models\\News', 242, 'cn', 'comment_right', '卡马拉·哈里斯的环境政策只是民主党在不必要的监管上越界的又一例证，这威胁到美国已实现的能源独立。她应该优先考虑创造就业和经济增长，而不是将不成熟的绿色倡议置于水力压裂等合理的能源生产之上。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1211, 'App\\Models\\News', 243, 'cn', 'title', '年轻旅客抛弃派对假期，追求文化体验', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1212, 'App\\Models\\News', 243, 'cn', 'summary', '最近的一项调查显示，大多数18至32岁的年轻人选择低调、文化丰富的假期，而非传统的派对旅行，明显偏离了以夜生活闻名的目的地。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
