	(1217, 'App\\Models\\News', 244, 'cn', 'summary', '最近的一项研究表明，周末额外睡眠可以将心脏病风险降低多达20%。这项由中国国家心血管病中心的研究人员进行的研究分析了近91,000名参与者的数据，显示在周末补充睡眠的人会享受显著的健康益处。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
