	(1221, 'App\\Models\\News', 245, 'cn', 'title', '欧元区通胀降至三年低点2.2%，核心通胀依然顽固', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1222, 'App\\Models\\News', 245, 'cn', 'summary', '2024年8月，欧元区年通胀降至2.2%，为三年内最低，但核心通胀仍保持在2.8%，受到服务成本上升的影响。欧洲央行的伊莎贝尔·施纳贝尔警告不要急于降息。欧元区失业率也略有下降。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1223, 'App\\Models\\News', 245, 'cn', 'comment_neutral', '欧元区通胀降至2.2%表明经济环境有所缓和，但持续的核心通胀指向潜在挑战，尤其是在服务行业，欧洲央行需要谨慎应对这些问题。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
