	(1227, 'App\\Models\\News', 246, 'cn', 'summary', '以色列对一支由美国慈善机构领导的加沙救援车队发起导弹袭击，造成多人死亡，招致华盛顿的谴责。此次袭击是在以色列对世界粮食计划署车辆的攻击发生后不久。随着人道主义关切加剧，地区内已宣布暂停行动，以便进行小儿麻痹症疫苗接种活动。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
