	(1232, 'App\\Models\\News', 247, 'cn', 'summary', '著名左派政治家莎赫拉·瓦根克特在埃尔福特的一次竞选活动中遭到红色液体喷洒。这一事件引发了对德国政治暴力上升的担忧，并发生在右翼政党日益强劲的州级选举前夕。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1233, 'App\\Models\\News', 247, 'cn', 'comment_neutral', '对瓦根克特的攻击突显了德国政治暴力的令人担忧的趋势，迫切需要加强对政治家的安全措施。相关方必须冷静而有效地应对这一对民主进程日益增长的威胁。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
