	(1237, 'App\\Models\\News', 248, 'cn', 'summary', '妮可·基德曼的电影《小女孩》在威尼斯电影节首映，引发了对欲望、权力和女性主义主题的讨论。这部由哈莉娜·赖恩执导的电影探讨了一位高管的婚外情，以现代的性积极叙事展现。基德曼表示，希望这部电影被视为对女性经历的解放和真实的表现。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
