	(1241, 'App\\Models\\News', 249, 'cn', 'title', '重磅毒品打击：波兰和乌克兰查获近200公斤结晶美沙酮', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1242, 'App\\Models\\News', 249, 'cn', 'summary', '波兰和乌克兰的执法机构 dismantled 重大的毒品生产基地，查获近200公斤结晶美沙酮。这次行动涉及38次协调突袭，造成七人被捕，并摧毁了波兰最大的合成阿片类药物实验室。欧洲刑警组织强调跨国合作在打击有组织毒品犯罪中的重要性。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
