	(1246, 'App\\Models\\News', 250, 'cn', 'title', '乌尔苏拉·冯德莱恩批评对乌克兰的不当指责，呼吁捍卫主权', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1247, 'App\\Models\\News', 250, 'cn', 'summary', '在最近的布拉格GLOBSEC论坛演讲中，乌尔苏拉·冯德莱恩谴责那些将责任错误归咎于乌克兰的政客，呼吁清晰的叙述，承认乌克兰的主权以及克里姆林宫的非法行为。她强调了欧盟国防改革和对乌克兰军事支持的重要性。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1248, 'App\\Models\\News', 250, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
