	(1251, 'App\\Models\\News', 251, 'cn', 'title', '矿产资源首席执行官因办公室政策面临强烈反对', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1252, 'App\\Models\\News', 251, 'cn', 'summary', '澳大利亚矿业公司矿产资源的董事总经理克里斯·埃利森引发争议，宣布计划延长员工在办公室的工作时间。他旨在营造一个良好的工作环境，并明确反对远程工作，与疫情后越来越灵活的工作安排形成对比。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1253, 'App\\Models\\News', 251, 'cn', 'comment_neutral', '克里斯·埃利森采取的方式凸显了关于远程工作政策和员工福祉的持续辩论。随着公司在疫情后恢复运营，找到生产力与员工自主权之间的平衡仍然至关重要。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1254, 'App\\Models\\News', 251, 'cn', 'comment_left', '埃利森的言论凸显了管理层对员工工作环境施加控制的令人担忧趋势，这让人想起了优先考虑利润而非人文关怀的过时企业文化。员工理应拥有灵活性，以平衡个人生活和职业生涯。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1255, 'App\\Models\\News', 251, 'cn', 'comment_right', '看到像埃利森这样的领导者致力于传统工作伦理和生产力，令人感到振奋。让员工留在办公室的举动可以带来更好的结果，并在许多人习惯于在家工作而变得懒散的时代增强公司文化。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1256, 'App\\Models\\News', 252, 'cn', 'title', '尼克·凯夫的《野神》：穿越悲伤与灵性之旅', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1257, 'App\\Models\\News', 252, 'cn', 'summary', '尼克·凯夫与坏种乐队发行他们的第18张录音室专辑《野神》，探索悲伤和灵性主题，背景是欢乐与宗教意象。该专辑标志着凯夫在经历个人悲剧后情感上的重大演变。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1258, 'App\\Models\\News', 252, 'cn', 'comment_neutral', '尼克·凯夫的最新作品《野神》深刻地反映了悲伤与灵性主题。他愿意拥抱这些主题展现了他作为艺术家的演变，同时仍然保持定义他漫长职业生涯的经典声音。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
