	(1261, 'App\\Models\\News', 253, 'cn', 'title', '投资可持续森林实践：行动的呼吁', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1262, 'App\\Models\\News', 253, 'cn', 'summary', '在毁林速率惊人下，欧盟的新森林毁灭法规（EUDR）旨在保护热带森林，这对生物多样性和生计至关重要。专家呼吁支持农民适应可持续实践，超越合规，强调需要更好的经济激励。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1263, 'App\\Models\\News', 253, 'cn', 'comment_neutral', '对EUDR及其潜在益处的重视突显出在可持续管理森林资源方面的重要一步。解决小农户面临的经济压力对于长期成功防止毁林至关重要。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1264, 'App\\Models\\News', 253, 'cn', 'comment_left', '对经济激励的呼吁反映出一个重要的认识：仅仅规定毁林而不解决农民贫困的问题，只会导致系统性剥削。需要向土地改革和对边缘化社区的直接支持进行更激进的转变。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1265, 'App\\Models\\News', 253, 'cn', 'comment_right', '欧盟的毁林法规代表着对国家主权和土地所有者权利的另一层官僚干预。与其施加外部规定，我们应当赋予地方社区自由管理其资源的权力。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1266, 'App\\Models\\News', 254, 'cn', 'title', '卡玛拉·哈里斯首次电视采访中辩护向温和立场转变', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1267, 'App\\Models\\News', 254, 'cn', 'summary', '在被提名后的首次电视采访中，副总统卡玛拉·哈里斯回应了之前对她立场的批评，表示对任命一名共和党人进入其内阁持开放态度，同时拒绝回应唐纳德·特朗普的种族攻击。哈里斯强调她对两党的对话的承诺，并介绍了她的“机会经济”框架。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1268, 'App\\Models\\News', 254, 'cn', 'comment_neutral', '哈里斯向温和立场的转变可能是为了在选举前吸引更广泛的选民基础的战略举措。她愿意考虑任命两党的内阁成员可能表明对合作的承诺，这在当今高度对立的政治环境中至关重要。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1269, 'App\\Models\\News', 254, 'cn', 'comment_left', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1270, 'App\\Models\\News', 254, 'cn', 'comment_right', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1271, 'App\\Models\\News', 255, 'cn', 'title', '欧洲股市因通胀回落而大幅上涨', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1272, 'App\\Models\\News', 255, 'cn', 'summary', '欧洲股市在通胀回落以及对欧洲央行降息预期的推动下继续上涨，DAX创下新高。受Nvidia财报不佳影响，美国市场表现不一，科技股承压。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1273, 'App\\Models\\News', 255, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
