	(1275, 'App\\Models\\News', 255, 'cn', 'comment_right', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1276, 'App\\Models\\News', 256, 'cn', 'title', '德国自塔利班掌权以来首次驱逐阿富汗国民，安全问题日益严重', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1277, 'App\\Models\\News', 256, 'cn', 'summary', '德国驱逐了28名阿富汗国民，这是自塔利班在2021年8月重新掌权以来的首次驱逐。此举是在一名与叙利亚寻求庇护者有关的致命刀刺事件后进行的，提升了紧迫的安全问题。内政部长南希·法泽指出，随着反移民政党在地区选举中获得势头，有必要加强移民政策。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1278, 'App\\Models\\News', 256, 'cn', 'comment_neutral', '德国最近的驱逐标志着移民政策的重大变化，引发了关于安全与人道保护之间平衡的质疑。随着公众对与移民相关犯罪的担忧加剧，有必要务实地解决这些问题。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1279, 'App\\Models\\News', 256, 'cn', 'comment_left', '这些驱逐反映了欧洲日益严重的将移民作为安全问题替罪羊的趋势。政府没有解决系统性原因，而是对脆弱群体进行打击，破坏了庇护和人道援助的基本原则。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1280, 'App\\Models\\News', 256, 'cn', 'comment_right', '驱逐阿富汗国民表明德国致力于保护其公民免受与失控移民相关的犯罪影响。随着ISIS等组织的威胁增加，强有力的措施是确保公众安全所必需的。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1281, 'App\\Models\\News', 257, 'cn', 'title', '巴塞尔被选为2025年欧洲歌唱大赛主办城市', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1282, 'App\\Models\\News', 257, 'cn', 'summary', '巴塞尔已被确认为2025年欧洲歌唱大赛的主办城市，此前瑞士凭借Nemo的歌曲《The Code》获胜。这将是比赛首次在德语区瑞士举办，地点设在圣雅各大酒店（St. Jacobshalle）.', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1283, 'App\\Models\\News', 257, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1284, 'App\\Models\\News', 257, 'cn', 'comment_left', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1285, 'App\\Models\\News', 257, 'cn', 'comment_right', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1286, 'App\\Models\\News', 258, 'cn', 'title', '德国家庭承受着不断上涨的学用品费用', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1287, 'App\\Models\\News', 258, 'cn', 'summary', '德国家庭感受到学用品费用上涨的压力，像笔和书籍等物品的价格与去年相比上涨了5%至13%。家长可以获得有限的学用品财务支持，但许多人感到这不足以满足需求。随着生活费用上涨，教育和学校相关费用的成本也在不断变化。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1288, 'App\\Models\\News', 258, 'cn', 'comment_neutral', '学用品费用的上涨反映出影响德国家庭的经济大趋势。由于政府支持有限，家长们发现管理开学费用越来越困难，这可能会影响到教育决策。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1289, 'App\\Models\\News', 258, 'cn', 'comment_left', '这一局面突显了德国政府未能充分支持家庭和应对生活费用上涨的失败。是时候全面重新评估教育资金的结构，以确保每个孩子都能平等获取必要的学用品。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1290, 'App\\Models\\News', 258, 'cn', 'comment_right', '学用品费用上涨可归因于移民涌入造成的经济压力。至关重要的是，德国的资源应优先考虑本国家庭而非外来家庭，以确保我们子女的未来。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1291, 'App\\Models\\News', 259, 'cn', 'title', '蒂森克虏伯钢铁部门在兼并风波中面临领导层动荡', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1292, 'App\\Models\\News', 259, 'cn', 'summary', '在与捷克亿万富翁丹尼尔·克雷廷斯基的争夺战中，蒂森克虏伯的钢铁部门首席执行官伯纳德·奥斯堡及多位关键高管辞职。关于母公司对该部门的财务支持的担忧加剧，因竞争和经济情况威胁着钢铁单位的稳定性。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1293, 'App\\Models\\News', 259, 'cn', 'comment_neutral', '蒂森克虏伯钢铁部门关键人物的离职突显了正在进行的重组和收购投标带来的挑战，反映出欧洲许多传统工业面临的更大问题。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1294, 'App\\Models\\News', 259, 'cn', 'comment_left', '在重组中辞职的现象凸显了在企业贪婪下工人权利的恶化。管理层未能为钢铁部门提供足够支持，暴露了优先考虑利润而非人民的更广泛资本主义危机。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1295, 'App\\Models\\News', 259, 'cn', 'comment_right', '蒂森克虏伯的领导层动荡揭示了严重的管理失误，这威胁到德国工业的根基。必须重新评估外国投资者在我们的战略产业中的角色，以保护国家利益。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1296, 'App\\Models\\News', 260, 'cn', 'title', '研究者警告教育中对AI工具的过度依赖', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1297, 'App\\Models\\News', 260, 'cn', 'summary', '隆德大学的研究者们的研究表明，虽然像ChatGPT这样的AI工具可以帮助有执行功能障碍的学生，但过度依赖可能会阻碍认知发展。该研究强调了在教育环境中整合AI的必要平衡。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1298, 'App\\Models\\News', 260, 'cn', 'comment_neutral', 'AI在课堂的整合呈现出双刃剑的效果。虽然它为那些有执行功能障碍的学生提供支持，教育工作者必须仔细监控其使用，以防止阻碍认知成长。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1299, 'App\\Models\\News', 260, 'cn', 'comment_left', '在教育中依赖AI是更广泛新自由主义议程的症状，旨在商品化学习。我们应该专注于维持以人为本的教学方法，而不是用数字工具取代它们。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1300, 'App\\Models\\News', 260, 'cn', 'comment_right', '在课堂上使用AI削弱传统学习价值观，并培养学生的依赖性。我们必须将个人责任和努力工作置于技术捷径之上。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1301, 'App\\Models\\News', 261, 'cn', 'title', '保加利亚提名首批性别平衡的欧盟执行委员会候选人', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1302, 'App\\Models\\News', 261, 'cn', 'summary', '保加利亚提名埃卡特里娜·扎哈里耶娃和朱利安·波波夫为欧盟执行委员会的候选人，成为唯一响应乌尔苏拉·冯·德莱恩在8月30日截止日期前呼吁提名男女候选国的国家。这一提名是在保加利亚政治不稳定和过渡政府的背景下进行的，该国将在10月27日举行选举。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
