	(1306, 'App\\Models\\News', 262, 'cn', 'title', '2024年7月欧盟失业率下降，难民挑战依然存在', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1307, 'App\\Models\\News', 262, 'cn', 'summary', '欧盟统计局报告显示，2024年7月欧盟和欧元区失业率下降，欧盟失业人数为1310.8万，欧元区为1099万。青年失业略有下降，但依然令人担忧，乌克兰难民对劳动力市场的影响仍然显著。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1308, 'App\\Models\\News', 262, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
