	(1311, 'App\\Models\\News', 263, 'cn', 'title', '阿富汗难民在美国大选前要求得到认可', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1312, 'App\\Models\\News', 263, 'cn', 'summary', '随着美国撤军阿富汗三周年的临近，倡导者呼吁总统候选人关注害怕塔利班压迫的阿富汗难民的处境，并呼吁提供足够的合法途径以确保他们在美国的安全。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1313, 'App\\Models\\News', 263, 'cn', 'comment_neutral', '阿富汗难民的持续斗争突显了美国总统候选人需要将全面移民改革纳入其政策中，以确保脆弱群体得到他们所需的保护。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1314, 'App\\Models\\News', 263, 'cn', 'comment_left', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
