	(1316, 'App\\Models\\News', 264, 'cn', 'title', '令人悲痛的哈卡夫袭击造成六人遇难，包括一名儿童', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1317, 'App\\Models\\News', 264, 'cn', 'summary', '一次俄罗斯对哈卡夫的袭击导致六人遇难，包括一名14岁女孩，另有55人受伤。此次袭击特别针对平民，乌克兰官员急呼盟友提供更多军事支持。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1318, 'App\\Models\\News', 264, 'cn', 'comment_neutral', '乌克兰持续的冲突继续导致平民伤亡，突显出国际支持和人道援助的迫切需要。哈卡夫最近的袭击事件凸显了普通市民在交火中所面临的严峻形势。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1319, 'App\\Models\\News', 264, 'cn', 'comment_left', '这一悲惨事件体现了帝国主义战争的残酷以及对无辜生命造成的附带损害。国际社会必须对侵略者采取立场，并为乌克兰的被压迫者提供必要的资源以进行反击。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1320, 'App\\Models\\News', 264, 'cn', 'comment_right', '尽管平民伤亡确实令人悲痛，但责任在于乌克兰煽动了俄罗斯。西方的介入只会加剧局势，关注的重点应该是谈判和平而不是升级军事支持。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1321, 'App\\Models\\News', 265, 'cn', 'title', '普京将访问蒙古，尽管面临国际刑事法院逮捕令', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1322, 'App\\Models\\News', 265, 'cn', 'summary', '俄罗斯总统普京计划于9月3日访问蒙古，尽管面临国际刑事法院（ICC）发出的逮捕令，该逮捕令指控他犯下战争罪。这次访问是他自2023年3月颁布令之后首次访问ICC成员国。乌克兰呼吁蒙古遵守逮捕令，在普京访期间逮捕他。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1323, 'App\\Models\\News', 265, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
