	(1326, 'App\\Models\\News', 266, 'cn', 'title', '俄罗斯记者谢尔盖·米哈伊洛夫因报道战争罪被判处八年监禁', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1327, 'App\\Models\\News', 266, 'cn', 'summary', '批评俄罗斯军队在乌克兰行动的记者谢尔盖·米哈伊洛夫因被指控传播虚假信息而被判处八年监禁。法庭认为他出于“政治仇恨”动机。米哈伊洛夫坚称自己无辜，表示他的报道旨在揭示真相，以对抗国家宣传。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1328, 'App\\Models\\News', 266, 'cn', 'comment_neutral', '谢尔盖·米哈伊洛夫的判刑突显了俄罗斯对记者的压制环境令日益严重，特别是在乌克兰入侵之后。这一事件引发了关于新闻自由和国家对媒体叙述的影响的重要讨论。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1329, 'App\\Models\\News', 266, 'cn', 'comment_left', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
