	(1331, 'App\\Models\\News', 267, 'cn', 'title', '以色列在加沙完成地面行动，暴力仍持续', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1332, 'App\\Models\\News', 267, 'cn', 'summary', '以色列军方宣布在加沙地带部分地区完成地面行动，同时在其他地区继续进行攻击。军方声称已经击毙250名战斗人员，并允许来自汗尤尼斯某些社区的流离失所的巴勒斯坦人返回，尽管面临人道组织的持续批评。自10月7日以来，以色列的攻势已导致超过4万名巴勒斯坦人死亡和大规模的流离失所。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1333, 'App\\Models\\News', 267, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
