	(1336, 'App\\Models\\News', 268, 'cn', 'title', '委内瑞拉在政治动荡中面临全国性停电', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1337, 'App\\Models\\News', 268, 'cn', 'summary', '在委内瑞拉，继上月的争议总统选举后，全国范围内发生停电，官员们将责任归咎于反对派团体的破坏活动。通讯部长弗雷迪·纳涅斯表示，几乎全国，包括卡拉卡斯在内，均出现了电力损失。随着政治紧张局势的升级，居民的反应各异。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1338, 'App\\Models\\News', 268, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
