	(1341, 'App\\Models\\News', 269, 'cn', 'title', '罗纳尔多在欧洲国家联赛前保留在葡萄牙队的名额', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1342, 'App\\Models\\News', 269, 'cn', 'summary', '尽管在2024年欧洲杯表现平平，克里斯蒂亚诺·罗纳尔多依然被纳入葡萄牙国家队25人名单，参加欧洲国家联赛。主教练罗伯托·马丁内斯继续支持这位老将，罗纳尔多希望能帮助国家队。名单中还包含年轻人才，展现了经验与年轻的结合。', '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
	(1343, 'App\\Models\\News', 269, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:44', '2024-09-02 00:44:44'),
