	(1346, 'App\\Models\\News', 270, 'cn', 'title', '气旋威胁卡拉奇：历史会重演吗？', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1347, 'App\\Models\\News', 270, 'cn', 'summary', '卡拉奇面临气旋Asna的潜在威胁，该气旋正在从阿拉伯海靠近。尽管当局警告居民遭受大雨和建议，但历史模式表明类似的风暴往往绕过该市。当地信仰将此归因于苏菲圣人阿卜杜拉·沙赫·加齐的保护。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1348, 'App\\Models\\News', 270, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
