	(1351, 'App\\Models\\News', 271, 'cn', 'title', '小额捐款推动卡玛拉·哈里斯创纪录的竞选筹款', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1352, 'App\\Models\\News', 271, 'cn', 'summary', '在成为民主党总统候选人后，卡玛拉·哈里斯在短时间内筹集了大约5.4亿美元的创纪录金额，其中小额捐款约占42%。哈里斯在整体和小额捐款方面明显超越了主要对手唐纳德·特朗普，标志着政治竞选融资的转变。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1353, 'App\\Models\\News', 271, 'cn', 'comment_neutral', '小额捐款的激增反映了竞选融资方式的重大转变，强调了草根支持和参与。这可能增强候选人对普通选民的响应能力。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1354, 'App\\Models\\News', 271, 'cn', 'comment_left', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
