	(1356, 'App\\Models\\News', 272, 'cn', 'title', '共和党副候选人JD Vance在总统竞选中强调家庭毒瘾挣扎', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1357, 'App\\Models\\News', 272, 'cn', 'summary', '在他竞选副总统期间，JD Vance强调了他家庭的毒瘾历史，特别是聚焦于阿片危机。虽然他分享了个人故事，旨在与选民建立联系，并将毒品政策作为关键议题，但批评者认为他的提案缺乏深度，可能无法解决毒瘾的复杂性。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1358, 'App\\Models\\News', 272, 'cn', 'comment_neutral', 'JD Vance与毒瘾的个人联系为阿片危机叙事增添了人性元素，展示了对直接受影响家庭的影响。然而，他提出的政策有效性依然受到质疑，因为专家对其对实际解决方案的潜在影响表达了担忧。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1359, 'App\\Models\\News', 272, 'cn', 'comment_left', 'Vance对毒瘾的叙述严重简化了一个更为复杂的问题。与其延续对边缘化社区产生不成比例影响的惩罚措施，不如采用更具同情心和全面的毒瘾治疗方式。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1360, 'App\\Models\\News', 272, 'cn', 'comment_right', 'JD Vance的做法反映了对毒品危机的强硬立场，主张更严厉的惩罚措施以威慑毒品交易。这种强硬的爱心理念对维护我们社区的法治至关重要，并展示了解决阿片流行病的决心。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1361, 'App\\Models\\News', 273, 'cn', 'title', '以色列空袭袭击加沙人道车队，造成生命损失', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1362, 'App\\Models\\News', 273, 'cn', 'summary', '一枚以色列导弹袭击了前往加沙一所阿联酋医院的人道援助车队，造成数人死亡。援助组织Anera表示，攻击是在没有警告的情况下进行的，以色列则声称枪手已夺取其中一辆车。这一事件引发了人道行动安全性的重要质疑。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1363, 'App\\Models\\News', 273, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
