	(1366, 'App\\Models\\News', 274, 'cn', 'title', '委内瑞拉面临全国性停电，政府指责破坏活动', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1367, 'App\\Models\\News', 274, 'cn', 'summary', '委内瑞拉经历了全国范围的停电，政府官员称破坏活动是原因。总统尼古拉斯·马杜罗与反对派就最近选举结果发生争执，同时居民为电力不稳定做准备。一些地区恢复供电，但出现了恐慌性抢购。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1368, 'App\\Models\\News', 274, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
