	(1371, 'App\\Models\\News', 275, 'cn', 'title', '以色列发起数十年来最大规模的军事行动', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1372, 'App\\Models\\News', 275, 'cn', 'summary', '以色列军队在约旦河西岸发起了一项重大军事行动，标志着紧张局势的重大升级。在无人机袭击和部队部署的情况下，以色列声称其目标是武装分子，而巴勒斯坦人则争辩说民用基础设施正在受到破坏。这引发了人们对冲突可能超出加沙的担忧。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1373, 'App\\Models\\News', 275, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1374, 'App\\Models\\News', 275, 'cn', 'comment_left', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
