	(1376, 'App\\Models\\News', 276, 'cn', 'title', '泽连斯基解雇空军指挥官，因F-16战机坠毁', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1377, 'App\\Models\\News', 276, 'cn', 'summary', '乌克兰总统弗拉基米尔·泽连斯基在一架F-16战斗机在俄罗斯轰炸期间坠毁并导致飞行员死亡的四天后，解雇了空军指挥官米科拉·奥列什丘克。奥列什丘克的解职与他公开批评立法者关于战机是被爱国者导弹击落的说法同时发生。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1378, 'App\\Models\\News', 276, 'cn', 'comment_neutral', '奥列什丘克指挥官的解职反映了乌克兰空军面临的运营挑战的重大的回应。这突显了持续敌对行动中军事战略的复杂性以及指挥决策的责任。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1379, 'App\\Models\\News', 276, 'cn', 'comment_left', '泽连斯基解雇指挥官的决定表明，将军队领导作为替罪羊的令人担忧的趋势，而不是解决军队采购和支持过程中存在的系统性问题，这些问题极度依赖于西方军火制造商。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1380, 'App\\Models\\News', 276, 'cn', 'comment_right', '这一解职又是乌克兰政府如何未能保护其武装力量的一个例子，表现为在没有改善军事基础设施和防御能力的情况下做出草率判断并指责个人。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1381, 'App\\Models\\News', 277, 'cn', 'title', '巴西最高法院下令立即暂停社交媒体平台X', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1382, 'App\\Models\\News', 277, 'cn', 'summary', '巴西最高法院法官已下令该国立即暂停社交媒体平台X，原因是未遵守法院命令，特别是未指定法律代表和支付罚款。这标志着该法院与X的拥有者埃隆·马斯克之间法律斗争中的重大进展。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1383, 'App\\Models\\News', 277, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1384, 'App\\Models\\News', 277, 'cn', 'comment_left', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1385, 'App\\Models\\News', 277, 'cn', 'comment_right', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1386, 'App\\Models\\News', 278, 'cn', 'title', '波皮林震惊德约科维奇，终结历史大满贯之路', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1387, 'App\\Models\\News', 278, 'cn', 'summary', '在美国公开赛中，澳大利亚选手亚历克斯·波皮林以震惊的方式击败了世界排名第二的诺瓦克·德约科维奇，终结了德约科维奇争取创纪录的第25个大满贯头衔的机会。波皮林以6-4、6-4、2-6、6-4赢得比赛，首次晋级16强，而德约科维奇则首次在2017年以来结束赛季没有任何大满贯头衔。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1388, 'App\\Models\\News', 278, 'cn', 'comment_neutral', '这场比赛突显了体育比赛不可预测的特性，即使是最有经验的冠军也可能遭遇意外失败。波皮林的胜利提醒人们，网球界正在涌现新人才，尤其是当像德约科维奇这样的老将面临挑战时。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1389, 'App\\Models\\News', 278, 'cn', 'comment_left', '德约科维奇的失利可以看作是精英运动员面临压力的更广泛评论。随着比赛的竞争越来越激烈，我们必须考虑体育行业如何把利润和表现置于运动员福祉之上，这可能导致这种心理压力。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1390, 'App\\Models\\News', 278, 'cn', 'comment_right', '像波皮林这样的选手崛起代表了对网球传统等级制度的挑战。德约科维奇的失利可能预示着运动内部权力动态的变化，新人挑战既定秩序，表现出对历届冠军统治的反叛形式。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1391, 'App\\Models\\News', 279, 'cn', 'title', '巴西因虚假信息斗争下令暂停X平台', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1392, 'App\\Models\\News', 279, 'cn', 'summary', '巴西已下令立即和完全暂停社交媒体平台X（原推特），理由是其未能遵守关于虚假信息的法庭命令。这一决定引发了X的所有者埃隆·马斯克的批评，他称法官的行动对言论自由构成威胁。X被指控允许与前总统贾伊尔·博尔索纳罗的支持者相关的虚假信息传播。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1393, 'App\\Models\\News', 279, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1394, 'App\\Models\\News', 279, 'cn', 'comment_left', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1395, 'App\\Models\\News', 279, 'cn', 'comment_right', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1396, 'App\\Models\\News', 280, 'cn', 'title', '贾登·桑乔的未来不确定，切尔西交易在即', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1397, 'App\\Models\\News', 280, 'cn', 'summary', '贾登·桑乔在曼联的状态不佳，正准备租借加盟切尔西，明年夏天有买断义务。尽管他在老特拉福德有着早期的良好表现，但与教练埃里克·滕哈赫的关系恶化，限制了他的首发机会。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1398, 'App\\Models\\News', 280, 'cn', 'comment_neutral', '桑乔加盟切尔西似乎对球员和曼联都是必要的一步，让他获得新的开始，同时曼联也妥善处理了复杂的局面。这笔转会有可能重新点燃他的职业生涯。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1399, 'App\\Models\\News', 280, 'cn', 'comment_left', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1400, 'App\\Models\\News', 280, 'cn', 'comment_right', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1401, 'App\\Models\\News', 281, 'cn', 'title', '阿森纳签下拉希姆·斯特林，租借一季', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1402, 'App\\Models\\News', 281, 'cn', 'summary', '阿森纳以一个赛季的租借合同签下了拉希姆·斯特林，这标志着这位前锋在切尔西面临黯淡前景后实现了重大逆转。这桩转会将他与此前在曼城执教过他的米凯尔·阿尔特塔重新结合，使斯特林有机会在切尔西混乱的转会策略中恢复他的职业生涯。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1403, 'App\\Models\\News', 281, 'cn', 'comment_neutral', '拉希姆·斯特林转会阿森纳凸显了足球转会的不可预测性。斯特林有潜力在米凯尔·阿尔特塔的带领下重新振兴他的职业生涯。此举能够为竞争英超冠军的阿森纳进攻注入急需的活力。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1404, 'App\\Models\\News', 281, 'cn', 'comment_left', '此次转会突出揭示了现代足球的剥削性质，球员被视为商品。斯特林在切尔西的经历揭示了比赛的阴暗面，天赋横溢的人也可能因管理者的意愿而被边缘化。阿森纳的这一举动是一次救援，但反映了一种需要改变的破碎体系。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1405, 'App\\Models\\News', 281, 'cn', 'comment_right', '拉希姆·斯特林的签约证明了才能可以战胜逆境。他在阿尔特塔这样的信任他的经理带下适应并茁壮成长的能力，展示了足球的精英主义特征。这提醒我们，努力和奉献可以扭转球员的运气，无论过去的失误如何。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1406, 'App\\Models\\News', 282, 'cn', 'title', '科科·高夫在艰苦的胜利后晋级，瞄准卫冕', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1407, 'App\\Models\\News', 282, 'cn', 'summary', '科科·高夫在美国公开赛上与埃琳娜·斯维托丽娜进行了一场紧张的较量，最终反弹获胜，继续争取成为自2014年塞雷娜·威廉姆斯以来首位卫冕的女性。高夫将接下来对阵另一位美国选手。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1408, 'App\\Models\\News', 282, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1409, 'App\\Models\\News', 282, 'cn', 'comment_left', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1410, 'App\\Models\\News', 282, 'cn', 'comment_right', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1411, 'App\\Models\\News', 283, 'cn', 'title', '斯科蒂·舍夫勒领跑联邦快递杯，强势表现争夺首个冠军', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1412, 'App\\Models\\News', 283, 'cn', 'summary', '斯科蒂·舍夫勒在联邦快递杯季后赛中保持领先，在第二轮以21杆低于标准杆的佳绩结束比赛。尽管舍夫勒此前从未赢得过联邦快递杯，但他出色的表现使他在周末的比赛中处于良好位置，而科林·莫里卡瓦和赞德·肖夫勒紧随其后。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1413, 'App\\Models\\News', 283, 'cn', 'comment_neutral', '斯科蒂·舍夫勒在联邦快递杯季后赛的前几轮中展现了出色的技能，他的稳定表现突显了他在这个周末赢得首个冠军的潜力。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1414, 'App\\Models\\News', 283, 'cn', 'comment_left', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1415, 'App\\Models\\News', 283, 'cn', 'comment_right', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1416, 'App\\Models\\News', 284, 'cn', 'title', '古斯·阿特金森打出精彩的118分，闪耀英格兰测试胜利', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1417, 'App\\Models\\News', 284, 'cn', 'summary', '古斯·阿特金森打出令人瞩目的118分，成为11年来首位为英格兰打出测试世纪的8号选手，帮助英格兰在第二场测试中对斯里兰卡建立了强大的优势。阿特金森的此局是他职业生涯中的首次一流世纪，且在投球方面做出了重要贡献。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1418, 'App\\Models\\News', 284, 'cn', 'comment_neutral', '古斯·阿特金森的成就是他努力和才能的证明。他在比赛中的全面表现突显了英格兰板球的潜在深度和未来成功的可能性。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1419, 'App\\Models\\News', 284, 'cn', 'comment_left', '虽然阿特金森的表现值得称赞，但这也引发了对体育优先于真正社会问题（如体育的包容性和代表性）的质疑。体育应该进化以反映我们社会的多样性。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1420, 'App\\Models\\News', 284, 'cn', 'comment_right', '阿特金森的精彩表现提醒我们板球的传统价值观。他的成功巩固了在体育界应依靠功绩而非不必要的政治正确性的想法。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1421, 'App\\Models\\News', 285, 'cn', 'title', '英超转会窗口创纪录支出，策略各异', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1422, 'App\\Models\\News', 285, 'cn', 'summary', '英超在最新转会窗口中创下空前支出，俱乐部总投资超过意甲的两倍。包括曼联和切尔西在内的多支球队进行了重要交易，而布莱顿和刚升入英超的伊普斯维奇在净支出方面领跑。伯明翰则以签下杰伊·斯坦斯菲尔德创下联赛一转会纪录。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1423, 'App\\Models\\News', 285, 'cn', 'comment_neutral', '这个转会窗口突显了足球中日益扩大的财政差距，英超俱乐部继续主导支出。像布莱顿这样的球队进行了明智的投资，而切尔西则专注于扩大阵容深度及未来成功的潜力。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1424, 'App\\Models\\News', 285, 'cn', 'comment_left', '英超的过度支出体现了一个将利润置于社区和基层投资之上的系统的缺陷。这强烈提醒我们，财富不平等在足球行业中反映得淋漓尽致，导致对小俱乐部和地方倡议缺乏支持。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1425, 'App\\Models\\News', 285, 'cn', 'comment_right', '英超的大规模支出是外资收购和传统英式足球丧失的标志。对华丽签约和商业利润的关注损害了运动的遗产，使其成为财富的竞技场，而不是公平竞争的场所。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1426, 'App\\Models\\News', 286, 'cn', 'title', '开创性的可再生能源倡议宣布', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1427, 'App\\Models\\News', 286, 'cn', 'summary', '今天宣布了一项新的可再生能源倡议，旨在减少碳排放并促进可持续实践，预计政府支持将增强其在各个领域的实施。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1428, 'App\\Models\\News', 286, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1429, 'App\\Models\\News', 286, 'cn', 'comment_left', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1430, 'App\\Models\\News', 286, 'cn', 'comment_right', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1431, 'App\\Models\\News', 287, 'cn', 'title', '哈伊尔夫的悲惨轰炸造成年轻人和平民的生命损失', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1432, 'App\\Models\\News', 287, 'cn', 'summary', '乌克兰哈伊尔夫的一枚俄罗斯制导炸弹袭击造成一名14岁女孩遇难，数十人受伤，泽伦斯基总统呼吁国际社会对俄罗斯的攻击加大反击力度。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1433, 'App\\Models\\News', 287, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1434, 'App\\Models\\News', 287, 'cn', 'comment_left', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1435, 'App\\Models\\News', 287, 'cn', 'comment_right', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1436, 'App\\Models\\News', 288, 'cn', 'title', 'NHL明星约翰尼·古德罗与兄弟遭遇车祸不幸身亡', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1437, 'App\\Models\\News', 288, 'cn', 'summary', 'NHL球员约翰尼·古德罗和他的兄弟马修在新泽西州骑自行车时遭遇车祸不幸身亡。司机肖恩·希金斯因涉嫌酒驾被逮捕，并面临两项汽车过失致死指控。古德罗家族此行是为参加婚礼。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1438, 'App\\Models\\News', 288, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1439, 'App\\Models\\News', 288, 'cn', 'comment_left', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1440, 'App\\Models\\News', 288, 'cn', 'comment_right', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1441, 'App\\Models\\News', 289, 'cn', 'title', '意大利逃犯在阿根廷被捕，潜逃数十年后落网', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1442, 'App\\Models\\News', 289, 'cn', 'summary', '前左翼红色旅成员莱昂纳多·贝尔图拉齐在布宜诺斯艾利斯被捕，此人潜逃近44年。因涉及1970年代对一名海军工程师的绑架案而在意大利面临27年监禁。在新任右派政府解除其在阿根廷的难民身份后，他的引渡程序得以进行。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1443, 'App\\Models\\News', 289, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1444, 'App\\Models\\News', 289, 'cn', 'comment_left', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1445, 'App\\Models\\News', 289, 'cn', 'comment_right', NULL, '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1446, 'App\\Models\\News', 290, 'cn', 'title', '挪威公主玛莎·路易丝与萨满教士杜雷克·维雷特即将结婚，备受争议', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1447, 'App\\Models\\News', 290, 'cn', 'summary', '挪威公主玛莎·路易丝与美国萨满教士杜雷克·维雷特即将举行私人婚礼，庆祝活动已持续几天。由于其不传统的生活方式和缺乏典型的王室举止，这对皇室夫妇面临了公众和媒体的重大批评，激起了混合的反应。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1448, 'App\\Models\\News', 290, 'cn', 'comment_neutral', '玛莎·路易丝公主即将举行的婚礼展示了王室传统的转变，凸显了现代王室在面对公众对不传统生活方式的审查时，如何努力应对个人选择。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
