	(1452, 'App\\Models\\News', 291, 'cn', 'summary', '前总统唐纳德·特朗普宣布，他将在佛罗里达州对保护堕胎权的公投措施投反对票，尽管早些时候他曾表示支持。此番态度的反转引发了反堕胎活动家的批评，突显了他在保守派支持者面前所承受的政治压力。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
