	(1457, 'App\\Models\\News', 292, 'cn', 'summary', '以色列最近在努尔沙姆斯难民营的军事行动导致重大破坏和生命损失，令家庭感到绝望。居民们尽管面临危险，仍表达了坚持留在这里的决心，揭示了冲突对平民生活的影响。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1458, 'App\\Models\\News', 292, 'cn', 'comment_neutral', '努尔沙姆斯的情况突显了以色列-巴勒斯坦冲突的持续复杂性，军事行动往往对平民群体造成不成比例的影响。这次行动中的破坏和生命损失引发了关于军事战略和人道考虑的重大问题。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
