	(1462, 'App\\Models\\News', 293, 'cn', 'summary', '肯尼亚网红艾尔莎·马金博（Elsa Majimbo）因批评“黑税”而在社交媒体上引发辩论——成功的非洲人被期望经济支持大家族。尽管一些人支持她的观点，但另一些人认为这种共同义务是至关重要的。专家表示，这种做法源于殖民主义造成的系统性不平等。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
