	(1472, 'App\\Models\\News', 295, 'cn', 'summary', 'Oasis于2025年的重聚音乐会消息引发了全球粉丝的兴奋，范围从英国到俄罗斯。年轻和年长的粉丝们都对Britpop时代充满怀旧，希望加拉赫兄弟之间的关系得到恢复。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1473, 'App\\Models\\News', 295, 'cn', 'comment_neutral', 'Oasis的重聚发生在90年代怀旧氛围浓厚的时刻，反映了一种文化上的渴望和通过音乐团结的希望。令人期待的是，新一代粉丝将如何与乐队的遗产互动。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
