	(1477, 'App\\Models\\News', 296, 'cn', 'summary', '总共有215名运动员将代表英国残奥会参加2024年巴黎残奥会，目标为100-140枚奖牌。此次比赛将于8月28日至9月8日举行，涵盖广泛的项目，英国团队希望在东京2020年的成功基础上继续前进。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1478, 'App\\Models\\News', 296, 'cn', 'comment_neutral', '英国代表团积极参加2024年巴黎残奥会令人鼓舞，因为这展示了该国对残疾运动员的支持。其目标设定为100-140枚奖牌，反映了竞争体育领域日益提高的包容性。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
