	(1482, 'App\\Models\\News', 297, 'cn', 'summary', '索马里与埃及建立的军事联盟，伴随埃及军队抵达摩加迪沙，已加剧了与埃塞俄比亚的紧张关系。索马里的举动在尚未解决的大埃塞俄比亚复兴大坝争端和涉及索马里兰的军事担忧背景下加剧。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
