	(1487, 'App\\Models\\News', 298, 'cn', 'summary', '美国中央司令部报道，在与伊拉克安全部队的联合行动中，15名伊斯兰国武装分子在伊拉克西部被击毙。此次行动是在德国和奥地利近期与ISIS有关的攻击加剧的背景下进行的。没有报告平民伤亡，尽管据称有七名美国军人受伤。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
