	(1492, 'App\\Models\\News', 299, 'cn', 'summary', '乌克兰总统泽连斯基因F-16战机坠毁而解雇了奥列什丘克中将，该事件导致一名飞行员死亡。尽管坠毁发生在俄罗斯导弹袭击中，乌克兰声称并非直接由敌方火力造成。泽连斯基强调需要强有力的军事领导以保护乌克兰军队，内部关于事件责任的争论浮出水面。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
