	(1497, 'App\\Models\\News', 300, 'cn', 'summary', '在意外的事件中，24次大满贯冠军诺瓦克·德约科维奇在美国公开赛第三轮中被澳大利亚第28号种子亚历克斯·波皮林击败，这标志着他在18年来首次在该比赛中早早出局。德约科维奇在比赛中出现了惊人的14个双误和49个非受迫性失误，结束了2017年以来首次没有赢得大满贯的赛季。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1498, 'App\\Models\\News', 300, 'cn', 'comment_neutral', '德约科维奇在波皮林手中的意外出局突显了网球的不确定性。尽管德约科维奇仍是一位强大的选手，但他的表现凸显了最近比赛，包括奥运会任务所带来的身体和心理压力。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
