	(1502, 'App\\Models\\News', 301, 'cn', 'summary', '研究人员认为，减缓衰老的药物赛马鲁肽（用于2型糖尿病和肥胖症）可能也有此功效。在2024年欧洲心脏病学会议上发布的新研究表明，它可以改善多种健康状况，并降低使用者的死亡率。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
