	(1507, 'App\\Models\\News', 302, 'cn', 'summary', '索拉吉·切鲁卡特（Sooraj Cherukat），以Hanumankind闻名，因其独特的嘻哈风格而在全球范围内获得认可，这种风格反映了他的印度根源和国际经历。他最近的歌曲赢得了大量播放和观看，同时也因其风格和语言选择在多元音乐场景中受到批评。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
	(1508, 'App\\Models\\News', 302, 'cn', 'comment_neutral', 'Hanumankind的经历展示了现代音乐中文化认同的复杂性。他风格的融合反映了全球化的世界，尽管他面临批评，但理解他作品的多样解读是很重要的。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
