	(1512, 'App\\Models\\News', 303, 'cn', 'summary', '在图林根州和萨克森州即将举行的重要选举中，德国另类党（AfD）的支持率飙升，而总理阿尔夫·肖尔茨的联盟面临严厉批评和可能的失败。对移民和重聚后地区差异的不满推动选民转向AfD，该党还与另一左翼政党萨哈·瓦根克特联盟（BSW）竞争。这些选举的结果将预示着明年联邦选举之前更广泛的全国趋势。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
