	(1517, 'App\\Models\\News', 304, 'cn', 'summary', 'Telegram因创始人帕维尔·杜罗夫在法国被控而面临审查，该平台被指控为非法活动的工具。执法部门批评该应用缺乏有效监控，报告指出其被用于毒品走私、诈骗和儿童剥削，提出了隐私和问责之间平衡的问题。', '2024-09-02 00:44:45', '2024-09-02 00:44:45'),
