	(1522, 'App\\Models\\News', 305, 'cn', 'summary', '在吉隆坡，一名印度女性维贾雅·拉克希米·加利在掉入一个天坑后失踪，已经进行了八天的广泛搜救工作，但因强水流和杂物的挑战，搜救工作面临显著困难。救援人员只发现了一双拖鞋，导致潜水行动的停止。这一事件引发了安全问题，并促使政府进行审计。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
