	(1531, 'App\\Models\\News', 307, 'cn', 'title', '卡马拉·哈里斯为与特朗普的重要辩论做好准备', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1532, 'App\\Models\\News', 307, 'cn', 'summary', '卡马拉·哈里斯将于9月10日与唐纳德·特朗普进行重要辩论，她希望纠正其之前总统竞选期间的传播问题。哈里斯以其战略性辩论风格而闻名，她需要在避免陷阱的同时，利用自己的优势对抗这位不可预测的对手。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1533, 'App\\Models\\News', 307, 'cn', 'comment_neutral', '卡马拉·哈里斯即将与唐纳德·特朗普的辩论代表了她竞选中的关键时刻。清晰表达自己政策的能力将是关键，因为过去的辩论已经显示出在这种高风险环境中清晰的重要性。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1534, 'App\\Models\\News', 307, 'cn', 'comment_left', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1535, 'App\\Models\\News', 307, 'cn', 'comment_right', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1536, 'App\\Models\\News', 308, 'cn', 'title', '北约秘书长支持乌克兰在边境入侵中的自我防卫权', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1537, 'App\\Models\\News', 308, 'cn', 'summary', '北约秘书长延斯·斯托尔滕贝格重申乌克兰合法的自我防卫权，表示这一权利超越其国界。他的言论是针对乌克兰最近向俄罗斯领土的军事进攻，旨在创建一道防护区以防止进一步的攻击。斯托尔滕贝格澄清，北约事先并未获悉此次入侵的计划。俄罗斯称此行动为“重大挑衅”。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1538, 'App\\Models\\News', 308, 'cn', 'comment_neutral', '延斯·斯托尔滕贝格的言论突出了围绕军事行动和自我防卫的复杂法律和伦理考量。虽然乌克兰保护其主权的权利是明确的，但越境进入俄罗斯领土的影响深远，可能进一步加剧冲突。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1539, 'App\\Models\\News', 308, 'cn', 'comment_left', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1540, 'App\\Models\\News', 308, 'cn', 'comment_right', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1541, 'App\\Models\\News', 309, 'cn', 'title', '以色列-哈马斯冲突加剧，卡恩尤尼斯的破坏与悲剧', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1542, 'App\\Models\\News', 309, 'cn', 'summary', '随着以色列-哈马斯冲突升级，居民重返加沙地带的卡恩尤尼斯，发现家园被毁，死与绝望依然笼罩。持续的军事行动导致双方重大伤亡，平民承受了最大的痛苦。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1543, 'App\\Models\\News', 309, 'cn', 'comment_neutral', '加沙的局势依旧严峻，人道主义危机加剧。对平民生活的影响是灾难性的，急需国际干预来促进和平。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1544, 'App\\Models\\News', 309, 'cn', 'comment_left', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1545, 'App\\Models\\News', 309, 'cn', 'comment_right', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1546, 'App\\Models\\News', 310, 'cn', 'title', '西岸局势升级：以色列军队击毙哈马斯领袖及两名战士', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1547, 'App\\Models\\News', 310, 'cn', 'summary', '以色列在西岸的军事行动加剧，空袭导致三名哈马斯战士，包括該组在珍宁的领导人遭遇致命打击。英国外交部对该地区的平民伤亡表示深切关注。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1548, 'App\\Models\\News', 310, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1549, 'App\\Models\\News', 310, 'cn', 'comment_left', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1550, 'App\\Models\\News', 310, 'cn', 'comment_right', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1551, 'App\\Models\\News', 311, 'cn', 'title', '澳大利亚弗里曼特尔港STS Leeuwin II遭新加坡籍船撞击，船员受伤', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1552, 'App\\Models\\News', 311, 'cn', 'summary', '8月30日，澳大利亚帆船训练船STS Leeuwin II在弗里曼特尔港被新加坡籍的Maersk Shekou撞击，导致两名船员受伤。此事件对两艘船只造成了重大损害，目前新加坡海事与港口管理局正在进行调查。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1553, 'App\\Models\\News', 311, 'cn', 'comment_neutral', '此事件引发了关于繁忙港口船舶安全实践的重要问题。调查对于理解如何避免未来类似碰撞至关重要。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1554, 'App\\Models\\News', 311, 'cn', 'comment_left', '此次碰撞突显出需要对海洋操作实施更严格的监管，以保护工人的安全。这提醒我们，利润不应以人类生命和福祉为代价。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1555, 'App\\Models\\News', 311, 'cn', 'comment_right', '像Maersk Shekou这样的外国船只应该对在澳大利亚水域发生的事件负责。这是一个清楚的警示，我们需要优先考虑澳大利亚的海洋利益。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1556, 'App\\Models\\News', 312, 'cn', 'title', '德东极右政党AfD即将在选举中创造历史胜利', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1557, 'App\\Models\\News', 312, 'cn', 'summary', '极右政党德国选择党（AfD）预计将在德东两州中的至少一场选举中名列第一，对总理奥拉夫·朔尔茨的联盟施加压力。尽管可能获胜，该党不太可能组建政府，但这标志着自第二次世界大战以来，极右政党首次在德国州议会中获得最多席位。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1558, 'App\\Models\\News', 312, 'cn', 'comment_neutral', 'AfD在德东的崛起反映出该国政治格局的日益分化。许多公民对当前政府在移民和经济稳定问题上的处理感到沮丧，这表明未来可能会出现政治力量的重新调整。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1559, 'App\\Models\\News', 312, 'cn', 'comment_left', '对AfD日益增长的支持显示出主流政党未能满足普通民众的关切。对执政者而言，这是一个警钟，提醒他们认真反思自己的政策和民众的真实需求，而不是专门迎合精英。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1560, 'App\\Models\\News', 312, 'cn', 'comment_right', 'AfD的成功清楚地传达了德国公众对政治正确和无效治理的疲倦。该党对移民和经济管理等问题的关注与许多感到被传统政党抛弃的选民的共鸣。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1561, 'App\\Models\\News', 313, 'cn', 'title', '巴西最高法院威胁封锁X平台，激发与马斯克的紧张关系', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1562, 'App\\Models\\News', 313, 'cn', 'summary', '巴西最高法院法官亚历山德雷·德莫拉斯即将下令封锁社交媒体平台X，因总统卢拉要求遵守当地法律。该平台因未在巴西指定法律代表而受到审查。在紧张局势中，马斯克称这位法官为“独裁者”，并为其业务辩护，坚称Starlink将继续在巴西提供服务。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1563, 'App\\Models\\News', 313, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1564, 'App\\Models\\News', 313, 'cn', 'comment_left', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1565, 'App\\Models\\News', 313, 'cn', 'comment_right', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1566, 'App\\Models\\News', 314, 'cn', 'title', '大规模停电袭击加拉加斯，马杜罗指责破坏活动', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1567, 'App\\Models\\News', 314, 'cn', 'summary', '加拉加斯及委内瑞拉大部分地区遭遇大规模停电，马杜罗总统将此事件归咎于破坏活动。这次停电影响了包括国有石油公司PDVSA在内的主要运营。政府报告称有24个州受到影响，引发了对国家电力基础设施恶化的担忧。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1568, 'App\\Models\\News', 314, 'cn', 'comment_neutral', '最近在加拉加斯发生的停电突显了委内瑞拉电力基础设施的持续问题。尽管政府将停电归咎于破坏活动，但缺乏证据引发了对这一说法可靠性的质疑，并指出国家能源政策需要系统性的改善。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1569, 'App\\Models\\News', 314, 'cn', 'comment_left', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1570, 'App\\Models\\News', 314, 'cn', 'comment_right', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1571, 'App\\Models\\News', 315, 'cn', 'title', '美国就数字服务税启动与加拿大的争议咨询', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1572, 'App\\Models\\News', 315, 'cn', 'summary', '美国已就其新数字服务税请求与加拿大进行咨询，称该税对美国公司存在歧视，并与贸易协议不一致。如果在75天内无法解决，美国可能会升级至争议解决小组，这可能导致对加拿大进口的关税。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1573, 'App\\Models\\News', 315, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1574, 'App\\Models\\News', 315, 'cn', 'comment_left', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1575, 'App\\Models\\News', 315, 'cn', 'comment_right', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1576, 'App\\Models\\News', 316, 'cn', 'title', 'NASA因国际空间站挑战调整即将发射的SpaceX航天员队伍', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1577, 'App\\Models\\News', 316, 'cn', 'summary', 'NASA已从即将到来的SpaceX任务中撤回宇航员Zena Cardman和Stephanie Wilson，以便为其他被困在国际空间站的宇航员腾出空间。Nick Hague和Aleksandr Gorbunov将于九月发射，计划在二月份返回。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1578, 'App\\Models\\News', 316, 'cn', 'comment_neutral', 'NASA调整宇航员队伍的决定反映了太空任务的复杂性及优先考虑安全的必要性。该机构必须在人员资源与技术挑战之间取得平衡。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1579, 'App\\Models\\News', 316, 'cn', 'comment_left', '这一事件突显了太空旅行私有化的缺陷。NASA应该专注于增强自己的项目，而不是依赖SpaceX等公司，这些公司可能没有宇航员的最佳利益。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1580, 'App\\Models\\News', 316, 'cn', 'comment_right', '依赖俄罗斯和私人公司进行宇航员运输可能会危及国家安全以及我们在全球太空竞赛中的地位。我们应该优先确保美国发射的可靠性，而不是依赖外国实体。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1581, 'App\\Models\\News', 317, 'cn', 'title', '俄罗斯空袭哈尔科夫住宅楼导致七人死亡', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1582, 'App\\Models\\News', 317, 'cn', 'summary', '俄罗斯对哈尔科夫一栋住宅楼的空袭造成七人死亡，包括一名14岁的女孩，至少77人受伤。这次攻击涉及精确制导的炸弹，导致公寓楼发生大火。乌克兰总统泽伦斯基呼吁西方盟友提供远程武器，以应对此类袭击。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1583, 'App\\Models\\News', 317, 'cn', 'comment_neutral', '这一悲惨事件凸显了乌克兰持续的暴力，强调了国际支持保护平民的迫切需要。平民继续承受着冲突的严重后果，对先进军事援助的呼声愈加高涨。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1584, 'App\\Models\\News', 317, 'cn', 'comment_left', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1585, 'App\\Models\\News', 317, 'cn', 'comment_right', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1586, 'App\\Models\\News', 318, 'cn', 'title', '澳航对票价错误的务实回应：顾客满意度的平衡之道', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1587, 'App\\Models\\News', 318, 'cn', 'summary', '澳航因编码错误错误地发布重价折扣的公务舱机票，促使其迅速反应，承诺将受影响的顾客升级到公务舱。这个决定在顾客满意度与航空公司财务限制之间取得平衡，反映了竞争激烈的航空行业中的战略性做法。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1588, 'App\\Models\\News', 318, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1589, 'App\\Models\\News', 318, 'cn', 'comment_left', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1590, 'App\\Models\\News', 318, 'cn', 'comment_right', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1591, 'App\\Models\\News', 319, 'cn', 'title', '理解社交媒体时代的寄生社交关系', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1592, 'App\\Models\\News', 319, 'cn', 'summary', '随着社交媒体的普及，寄生社交关系变得更加普遍，个人与媒体人物形成单方面的联系。最近的研究揭示了这些关系如何提供亲密感和归属感，尽管没有相互回应。社交媒体互动的便利性和潜在的情感投资既带来好处，也对粉丝构成风险。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1593, 'App\\Models\\News', 319, 'cn', 'comment_neutral', '寄生社交关系是一种引人入胜的心理现象，反映了我们社交动态的演变，特别是在数字互动主导的时代。虽然它们可以促进联系和社区的感觉，但个人必须意识到这些关系的单向性。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1594, 'App\\Models\\News', 319, 'cn', 'comment_left', '寄生社交关系的上升强调了我们社会在提供真实联系方面的失败。在资本主义框架下，媒体人物被商品化，导致粉丝依赖单方面关系，而不是形成真正的社区纽带。这一现象凸显了进行系统性变革以培养真实关系的必要性。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1595, 'App\\Models\\News', 319, 'cn', 'comment_right', '这些寄生社交关系展示了对名人依赖的令人不安的趋势，而不是个人成就和社区参与。这反映出当今年轻人缺乏自立，他们应该将重心放在建立有意义的现实关系上，而不是崇拜遥远的人物。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1596, 'App\\Models\\News', 320, 'cn', 'title', '争议中的皇室：玛莎·路易斯公主将与萨满教士结婚', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1597, 'App\\Models\\News', 320, 'cn', 'summary', '挪威的玛莎·路易斯公主将与美国萨满教士杜雷克·维尔瑞特结婚，此时皇室正面临公众批评和不断增加的丑闻，包括她的继子因身体伤害被指控。这个因非传统信念而备受关注的情侣，因违反先前协议而将其皇室身份商业化而遭到强烈反对。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1598, 'App\\Models\\News', 320, 'cn', 'comment_neutral', '即将举行的婚礼对玛莎·路易斯公主具有个人重要意义，但围绕的争议展示了现代皇室面临的复杂动态。公众情绪似乎对这场婚姻及其后续丑闻日益批判，这暗示着社会对君主制看法的潜在变化。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1599, 'App\\Models\\News', 320, 'cn', 'comment_left', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1600, 'App\\Models\\News', 320, 'cn', 'comment_right', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1601, 'App\\Models\\News', 321, 'cn', 'title', '太平洋岛国论坛在中国压力下删除与台湾的相关内容', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1602, 'App\\Models\\News', 321, 'cn', 'summary', '在汤加举行的地区首脑会议上，太平洋岛国论坛在中国特使的强烈反应后撤回了与台湾相关的声明。该集团由18个国家组成，其中三个承认台湾，15个承认中国，中国通过发展资金在该地区寻求扩大影响力。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1603, 'App\\Models\\News', 321, 'cn', 'comment_neutral', '这一发展凸显了太平洋地区复杂的外交格局，像中国这样的大国的影响力可能在很大程度上左右地区决策。撤回提及台湾的声明说明了围绕台湾国际地位的持续紧张局势。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
