	(1606, 'App\\Models\\News', 322, 'cn', 'title', '巴塞罗那十年的转变：一个对比之城', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1607, 'App\\Models\\News', 322, 'cn', 'summary', '在过去十年里，巴塞罗那经历了显著变化，成为主要旅游目的地，拥有众多重要景点，同时也成为了过度旅游和生活成本上升的受害者。尽管改善绿色生活和食品场景的努力值得注意，但该市面临气候变化和经济压力的挑战。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
