	(1611, 'App\\Models\\News', 323, 'cn', 'title', '欧盟假期不平等：29%人群无法负担假期', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1612, 'App\\Models\\News', 323, 'cn', 'summary', '一份新报告揭示了欧盟假期获取的显著差异，有29%的公民无法负担一周的假期。像罗马尼亚和保加利亚这样的国家在经济上最受限制，而挪威等富裕国家的比例则显著较低。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
