	(1616, 'App\\Models\\News', 324, 'cn', 'title', '德国在刀击事件后驱逐阿富汗国民', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1617, 'App\\Models\\News', 324, 'cn', 'summary', '德国在索林根发生致命刀击事件后，驱逐了28名阿富汗国民，这是自塔利班在2021年掌权以来首次进行此类行动。总理奥拉夫·肖尔茨和内政部长南希·法泽强调，外国出生的罪犯将不会逃脱驱逐，安全问题依然紧迫。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
