	(1621, 'App\\Models\\News', 325, 'cn', 'title', '波兰在抗议后促进堕胎访问的自由化', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1622, 'App\\Models\\News', 325, 'cn', 'summary', '波兰政府宣布新指南以促进合法堕胎的访问，允许在某些医疗建议下进行堕胎，此前几年制定了限制性法律。卫生部长伊莎贝拉·莱申娜强调需要遵循卫生指令以保护女性权益。这一发展是在针对以前限制堕胎访问的保守政策的大规模抗议之后出现的。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
