	(1626, 'App\\Models\\News', 326, 'cn', 'title', '西根公交刺伤事件造成六人受伤，嫌疑人被捕', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1627, 'App\\Models\\News', 326, 'cn', 'summary', '一名32岁的德国女性在西根的公交车上刺伤了六人，其中三人伤势危急。警方正在调查动机，但不认为这是恐怖袭击。此事件发生在最近索伦根一起造成三人死亡的刀伤袭击后，促使政府对刀具携带实施新限制并恢复对阿富汗的遣返。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
