	(1637, 'App\\Models\\News', 328, 'cn', 'summary', 'Euronews Business的一份报告概述了企业家在欧洲建立中小企业的最佳国家。报告强调爱尔兰、保加利亚、荷兰、瑞典和英国作为有吸引力的地点，强调了低税率、支持商业环境和快速设立公司的因素。欧洲的单一市场计划和地平线欧洲等计划正在帮助这些企业的发展。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
