	(1642, 'App\\Models\\News', 329, 'cn', 'summary', '这个周末，欧洲各地将举办多样的文化活动，包括法国的沉浸式香水展览、伦敦的静态动画艺术展示，以及罗马尼亚和荷兰的热闹地方节日。亮点还包括吸引观众的新电影和音乐专辑发行。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1643, 'App\\Models\\News', 329, 'cn', 'comment_neutral', '欧洲周末的活动反映了丰富的文化场景，展示了该地区丰富的艺术遗产和当代创意。这些活动邀请当地居民和游客参与沉浸式体验。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
