	(1647, 'App\\Models\\News', 330, 'cn', 'summary', '妮可·基德曼主演的《Babygirl》是一部交织着欲望、脆弱和权力动态主题的电影。故事讲述了作为成功首席执行官的罗米，如何开始一段热烈的 affair，迫使她面对压抑的欲望。该电影在第81届威尼斯电影节首映。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1648, 'App\\Models\\News', 330, 'cn', 'comment_neutral', '妮可·基德曼在《Babygirl》中的表演是对女性未竟欲望和亲密关系中权力复杂性的迷人探索。影片对这些主题的处理抵制道德判断，邀请观众反思自己对欲望的看法。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1649, 'App\\Models\\News', 330, 'cn', 'comment_left', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
