	(1651, 'App\\Models\\News', 331, 'cn', 'title', '水资源相关暴力激增 呼吁全球紧急行动', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1652, 'App\\Models\\News', 331, 'cn', 'summary', '一项新研究显示，2023年水资源相关暴力事件显著增加，达到347起，较2022年的231起增长150%。太平洋研究所强调，随着气候变化加剧全球紧张局势，迫切需要公平的水政策。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1653, 'App\\Models\\News', 331, 'cn', 'comment_neutral', '太平洋研究所提供的数据强调了水资源冲突的复杂性和国际合作、有效政策在减轻与水资源短缺相关的暴力中的迫切需要。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1654, 'App\\Models\\News', 331, 'cn', 'comment_left', '水资源相关暴力的惊人激增是资本主义对资源剥削的直接后果。只有系统性改变和水资源的公平分配才能解决这些冲突的根本原因。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1655, 'App\\Models\\News', 331, 'cn', 'comment_right', '水资源相关暴力的上升是所有国家优先保障自身水安全和对共享资源主权的警钟，特别是在全球紧张局势上升和资源变得稀缺的情况下。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1656, 'App\\Models\\News', 332, 'cn', 'title', '乌克兰在加强的俄罗斯攻击中首次失去F-16战斗机', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1657, 'App\\Models\\News', 332, 'cn', 'summary', '乌克兰报告在俄罗斯大规模导弹和无人机袭击期间首次失去一架F-16战斗机，造成飞行员死亡。泽连斯基总统已解雇空军指挥官米科拉·奥莱什丘克中将。与此同时，哈尔科夫的另一起袭击造成多名伤亡，进一步加大了对西方盟友加强军事支持的呼声。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1658, 'App\\Models\\News', 332, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
