	(1661, 'App\\Models\\News', 333, 'cn', 'title', '匈牙利移民法引发欧盟安全担忧，乌克兰冲突持续', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1662, 'App\\Models\\News', 333, 'cn', 'summary', '匈牙利决定放宽对俄罗斯和白俄罗斯国籍人士的移民法律，引发欧盟国家，特别是北欧和波罗的海国家的重大安全担忧。随着乌克兰冲突中俄罗斯导弹袭击的升级，欧盟官员正在评估匈牙利政策的影响，并担心可能的间谍活动。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1663, 'App\\Models\\News', 333, 'cn', 'comment_neutral', '匈牙利的移民调整反映了国家利益与欧盟安全动态之间复杂的平衡。虽然匈牙利声称其行动符合欧盟框架，但其他成员国的担忧对申根区的整体安全和完整性提出了关键问题。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
