	(1666, 'App\\Models\\News', 334, 'cn', 'title', '欧盟与塞尔维亚准备进行改革讨论，推动新增长计划', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1667, 'App\\Models\\News', 334, 'cn', 'summary', '欧洲委员会主席乌尔苏拉·冯·德莱恩与塞尔维亚总统亚历山大·武契奇将讨论与欧盟新增长计划相关的塞尔维亚改革议程。在法国总统马克龙的访问之后，此次会谈旨在提升塞尔维亚加入欧盟的前景，包括军事销售和能源问题的讨论。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1668, 'App\\Models\\News', 334, 'cn', 'comment_neutral', '欧盟与塞尔维亚之间的持续讨论强调了改革在入盟过程中的重要性。塞尔维亚实施必要改革的承诺将决定其获得财政援助和最终加入欧盟的资格。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
