	(1672, 'App\\Models\\News', 335, 'cn', 'summary', '俄军在哈尔科夫的空袭造成至少六人死亡，数十人受伤，滑翔炸弹袭击了住宅区。泽伦斯基总统呼吁西方国家加强军事支持，同时最近一架F-16在战斗中的损失引发了对乌克兰空中防御和指挥的质疑。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
