	(1676, 'App\\Models\\News', 336, 'cn', 'title', '巴西最高法院因与马斯克的言论自由争执下令暂停X平台', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1677, 'App\\Models\\News', 336, 'cn', 'summary', '巴西最高法院因首席执行官埃隆·马斯克未能在国内任命法律代表而下令暂停社交媒体平台X，此举加剧了关于言论自由和虚假信息的紧张关系。法院要求对使用VPN访问该平台的行为处以每日罚款，法律合规仍在等待中。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
