	(1682, 'App\\Models\\News', 337, 'cn', 'summary', '随着俄罗斯军队在离城市10公里的地方推进，波克罗夫斯克的数百名居民每天都在逃离。这座在战争前人口为60,000的城市是一个重要的交通枢纽。其被捕获可能会显著削弱乌克兰在顿涅茨克地区的防御力量。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
