	(1686, 'App\\Models\\News', 338, 'cn', 'title', 'ABBA要求特朗普停止在竞选中使用他们的音乐', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1687, 'App\\Models\\News', 338, 'cn', 'summary', '瑞典流行组合ABBA要求唐纳德·特朗普停止在竞选集会上使用他们的音乐，称其为未授权使用。特朗普的团队声称他们已获得使用这些歌曲的许可，且在历史上很多艺术家对此表示反对。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1688, 'App\\Models\\News', 338, 'cn', 'comment_neutral', '政治活动中的音乐使用法律问题复杂。虽然ABBA声称未经授权使用，但特朗普竞选团队表示他们持有合法许可，展示了艺术家在政治背景中的权利争论。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1689, 'App\\Models\\News', 338, 'cn', 'comment_left', '特朗普利用艺术家的音乐为其分裂的政治议程服务是不可接受的。ABBA的立场反映了音乐家们对他们的作品被用来促进仇恨与分裂的普遍担忧。', '2024-09-02 00:44:46', '2024-09-02 00:44:46'),
	(1690, 'App\\Models\\News', 338, 'cn', 'comment_right', '这只是“自由菁英”试图压制他们不同意的声音的另一种尝试。特朗普的竞选团队合法获得使用ABBA音乐的权利，抱怨这点似乎是削弱他支持的策略。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1691, 'App\\Models\\News', 339, 'cn', 'title', '低价票助力英国国家影院日', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1692, 'App\\Models\\News', 339, 'cn', 'summary', '英国国家影院日将于周六举行，超过630家影院推出低至4英镑的票价。此举旨在提升影院入场率，票房收入达520万英镑，售票量达到156万张。该活动持续受欢迎，推动了全国范围内对电影的热爱。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1693, 'App\\Models\\News', 339, 'cn', 'comment_neutral', '国家影院日的延续反映了该行业为适应和吸引观众而做出的努力，尤其是在日益增长的数字环境中。这是降低观影门槛的战略举措，尤其是在经济困难时期。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1694, 'App\\Models\\News', 339, 'cn', 'comment_left', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
