	(1696, 'App\\Models\\News', 340, 'cn', 'title', '基米·安东内利加盟梅赛德斯 汉密尔顿转投法拉利', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1697, 'App\\Models\\News', 340, 'cn', 'summary', '梅赛德斯已签下18岁的基米·安东内利，以替代路易斯·汉密尔顿，后者将在获得六个冠军头衔后加盟法拉利。安东内利今年在二级方程式赛车中赢得了两场比赛，将在2025年与乔治·拉塞尔搭档。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1698, 'App\\Models\\News', 340, 'cn', 'comment_neutral', '基米·安东内利晋升一级方程式赛车表明了车队对引入新人才的承诺。他在二级方程式赛车中的经验使他有能力与乔治·拉塞尔共同迎接未来的挑战。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1699, 'App\\Models\\News', 340, 'cn', 'comment_left', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
