	(1701, 'App\\Models\\News', 341, 'cn', 'title', '斋藤知事承认严格管理风格 面临职场霸凌指控', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1702, 'App\\Models\\News', 341, 'cn', 'summary', '兵库县知事斋藤知事在向调查委员会作证时承认自己被认为是“严格的老板”。尽管他没有直接承认对两名地方官员死亡后提出的职场霸凌指控，斋藤的言论引发了人们对其领导风格的担忧。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1703, 'App\\Models\\News', 341, 'cn', 'comment_neutral', '斋藤知事承认其严格的管理风格反映了政府机关工作文化的更广泛讨论。这引发了关于行政领导权威与支持之间平衡的重要问题。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1704, 'App\\Models\\News', 341, 'cn', 'comment_left', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
