	(1706, 'App\\Models\\News', 342, 'cn', 'title', '日本食品价格飙升：超过1000种产品将在9月提价', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1707, 'App\\Models\\News', 342, 'cn', 'summary', '日本调研公司帝国数据库的最新调查显示，195家主要食品制造商的1392种产品将在9月涨价，这标志着自4月以来首次出现超过1000种产品提价。尽管这一数字比去年下降了35.2%，但制造商面临着原材料成本上涨和日元贬值带来的压力，涨价决策困难重重。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1708, 'App\\Models\\News', 342, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
