	(1711, 'App\\Models\\News', 343, 'cn', 'title', '在中央银行政策信号的影响下，日元兑美元升值3.5%', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1712, 'App\\Models\\News', 343, 'cn', 'summary', '自七月底以来，由于日本银行和美联储关于货币政策的信号，日元兑美元升值了3.5%。一些分析师预测，至年底日元可能达到135，超出大型出口商的预期。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1713, 'App\\Models\\News', 343, 'cn', 'comment_neutral', '日元最近的表现反映了主要中央银行货币政策的重大变化。观察这将如何影响日本的出口商及更广泛的经济状况将是非常有趣的。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1714, 'App\\Models\\News', 343, 'cn', 'comment_left', '日元的升值突显了全球经济中的不平等，因为像丰田和本田等大企业可能优先考虑利润，而忽视普通日本工人的挣扎。我们需要保护工人的政策，而不是支持大企业。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1715, 'App\\Models\\News', 343, 'cn', 'comment_right', '在中央银行的操作中，日元的突然上升可能对日本的经济主权构成威胁。我们必须优先考虑国家利益，确保我们的货币保持竞争力，以保护本地就业。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1716, 'App\\Models\\News', 344, 'cn', 'title', 'Alimentation Couche-Tard寻求加拿大养老金基金支持收购7-Eleven', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1717, 'App\\Models\\News', 344, 'cn', 'summary', 'Alimentation Couche-Tard正在为收购7-Eleven母公司Seven & i Holdings Co.探索融资选项，并联系了包括加拿大养老金计划投资委员会和安大略教师养老金计划在内的主要加拿大养老金基金寻求股权支持。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1718, 'App\\Models\\News', 344, 'cn', 'comment_neutral', 'Alimentation Couche-Tard联系加拿大养老金基金的举措突显了该公司在为重大收购寻求资金支持方面的战略性方法。这反映出一个日益增长的趋势，即大型零售商依赖机构投资者来促进扩张。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1719, 'App\\Models\\News', 344, 'cn', 'comment_left', 'Couche-Tard这种看似 opportunistic 的做法加深了连必要零售商都受到金融精英影响的现状。对养老金基金的依赖可能表明一个令人担忧的趋势，即利润动机遮蔽了社区需求和员工福祉。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1720, 'App\\Models\\News', 344, 'cn', 'comment_right', 'Alimentation Couche-Tard努力吸引加拿大养老金基金以支持其收购计划，展现了一种强大的商业战略。这反映了资本主义的真正本质，即企业寻求投资以实现增长，提升股东的价值。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1721, 'App\\Models\\News', 345, 'cn', 'title', '特朗普因试管受精提案遭保守派强烈反对', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1722, 'App\\Models\\News', 345, 'cn', 'summary', '前总统唐纳德·特朗普在宣布如果连任将支持免费试管受精后，正在受到保守派的批评。这一立场引发了紧张局势，因为特朗普还批评了佛罗里达州的六周堕胎禁令，暗示其过于严格。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1723, 'App\\Models\\News', 345, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
