	(1726, 'App\\Models\\News', 346, 'cn', 'title', '普京即将访问蒙古，面临国际刑事法院逮捕令', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1727, 'App\\Models\\News', 346, 'cn', 'summary', '俄罗斯总统普京将于周二访问国际刑事法院（ICC）成员国蒙古，这是他首次在ICC发出逮捕令后访问。该逮捕令与非法驱逐乌克兰儿童有关。克里姆林宫表示对蒙古在访问期间不会拘留他充满信心。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1728, 'App\\Models\\News', 346, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
