	(1731, 'App\\Models\\News', 347, 'cn', 'title', '巴西禁止X平台 因埃隆·马斯克在假新闻战中拒绝服从', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1732, 'App\\Models\\News', 347, 'cn', 'summary', '巴西最高法院禁止社交媒体平台X（前身为Twitter），原因是CEO埃隆·马斯克未能在巴西任命法律代表，导致与法院的长期冲突。大法官亚历山德雷·德·莫拉斯指出X对假新闻和仇恨言论的传播做出贡献，损害了国家的民主。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1733, 'App\\Models\\News', 347, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
