	(1736, 'App\\Models\\News', 348, 'cn', 'title', '日本出生率暴跌，2024年1月至6月创下历史低点', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1737, 'App\\Models\\News', 348, 'cn', 'summary', '日本卫生部报告显示，2024年上半年的出生人数与去年相比下降了5.7%，达到350,074的历史最低点。如果这一趋势持续，年出生人数可能首次降到70万以下。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1738, 'App\\Models\\News', 348, 'cn', 'comment_neutral', '日本下降的出生率是经济和社会的重要问题，反映了社会价值观和经济不稳定等深层次问题。政策制定者需关注这些根本原因。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
