	(1741, 'App\\Models\\News', 349, 'cn', 'title', '岸田将缺席联合国辩论演讲以参加领导选举', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1742, 'App\\Models\\News', 349, 'cn', 'summary', '日本即将卸任的首相岸田文雄将缺席联合国大会的演讲，成为自2007年以来第一位缺席的日本首相。岸田计划在9月27日之前返回日本，这正值他执政的自由民主党的领导选举。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1743, 'App\\Models\\News', 349, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
