	(1746, 'App\\Models\\News', 350, 'cn', 'title', '哈里斯在日益紧张的局势中采取温和应对中国的策略', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1747, 'App\\Models\\News', 350, 'cn', 'summary', '美国副总统卡马拉·哈里斯提倡对中国采取平衡策略，强调负责任的竞争比全面对抗更为重要，而大多数美国人则希望采取更严格的措施。她的立场与前总统唐纳德·特朗普更为激进的态度形成鲜明对比。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1748, 'App\\Models\\News', 350, 'cn', 'comment_neutral', '哈里斯的策略反映出对外交政策动态的细致理解。虽然公众情绪倾向于对中国采取更强硬的立场，但激烈措施可能会使重要经济关系不稳定。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1749, 'App\\Models\\News', 350, 'cn', 'comment_left', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
