	(1751, 'App\\Models\\News', 351, 'cn', 'title', '太平洋领导人在中国施压后重发声明', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1752, 'App\\Models\\News', 351, 'cn', 'summary', '在中国批评太平洋领导人声明的先前版本中提到台湾后，新的版本被发布，删除了对台湾的提及。这是经过在汤加进行五天讨论后进行的。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1753, 'App\\Models\\News', 351, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1754, 'App\\Models\\News', 351, 'cn', 'comment_left', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1755, 'App\\Models\\News', 351, 'cn', 'comment_right', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1756, 'App\\Models\\News', 352, 'cn', 'title', '热带风暴闪闪对日本中部造成毁灭性降雨', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1757, 'App\\Models\\News', 352, 'cn', 'summary', '热带风暴闪闪正在和歌山县缓慢移动，导致日本大部分地区出现大范围的倾盆大雨。这场风暴已造成六人死亡、一人失踪，导致131人受伤，同时超过140万人被发布非强制疏散命令。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1758, 'App\\Models\\News', 352, 'cn', 'comment_neutral', '热带风暴闪闪的影响凸显出日本在灾害准备和应对系统方面的加强需求。当前的情况需要立即对受影响地区提供援助，并彻底评估损失。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1759, 'App\\Models\\News', 352, 'cn', 'comment_left', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1760, 'App\\Models\\News', 352, 'cn', 'comment_right', NULL, '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1761, 'App\\Models\\News', 353, 'cn', 'title', '德约科维奇在美国公开赛的震惊出局引发未来担忧', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1762, 'App\\Models\\News', 353, 'cn', 'summary', '卫冕冠军诺瓦克·德约科维奇在美国公开赛第三轮意外输给阿列克谢·波皮林，创下18年来最早出局的纪录。这位37岁选手出现了不寻常的失误，并承认自己打出了“职业生涯最糟的网球”，这引发了对他未来的质疑。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1763, 'App\\Models\\News', 353, 'cn', 'comment_neutral', '德约科维奇最近在美国公开赛的表现凸显了即使是最成功的运动员在年龄增长时面临的挑战。如此高的无谓失误表明状态可能下降，但球迷们应记住，这种波动在体育赛事中是很常见的。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1764, 'App\\Models\\News', 353, 'cn', 'comment_left', '德约科维奇的失利可能象征着精英体育体系的衰退，展现出该体系在多大程度上偏袒年轻人才，而老将们则在现代竞技的无情节奏下苦苦挣扎。是时候重新评估我们如何庆祝体育成就了。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1765, 'App\\Models\\News', 353, 'cn', 'comment_right', '德约科维奇的早期出局为那些重视经验和传统在体育中作用的人敲响了警钟。这表明也许比赛正在向前发展，优先考虑新一代，遗留给传奇人物的只是回忆。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1766, 'App\\Models\\News', 354, 'cn', 'title', 'NHL明星约翰尼·古德罗与其兄弟在车祸中遇难', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1767, 'App\\Models\\News', 354, 'cn', 'summary', '31岁的哥伦布蓝夹克队左翼球员约翰尼·古德罗在新泽西州发生悲惨的自行车事故中去世，兄弟马修也不幸遇难。这个家庭正为一场婚礼而在镇上聚集。来自他们叔叔的声明强调了家庭和亲人感受到的深刻损失。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
