	(1792, 'App\\Models\\News', 359, 'cn', 'summary', '前台湾反对党领导人柯文哲在与其担任台北市长期间的地产开发丑闻有关的19小时审问后被捕。由于担心合谋，他在拒绝继续审问后被拘留。柯文哲正在寻求对逮捕决定的司法审查。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
