	(1797, 'App\\Models\\News', 360, 'cn', 'summary', '由于与俄罗斯军队的冲突加剧，乌克兰总统弗拉基米尔·泽连斯基的支持率从接近90%降至55%，像奥莱娜·塞缪基娜这样的市民对未能实现和平的承诺感到失望。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
