	(1802, 'App\\Models\\News', 361, 'cn', 'summary', '兵库县的一组议员计划向县议会提交对知事斋藤基彦的不信任动议，理由是涉嫌权力骚扰。该动议旨在争取在九月获得四分之三以上议员的支持，反映了居民日益加深的不信任。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
