	(1806, 'App\\Models\\News', 362, 'cn', 'title', '乌克兰空军指挥官因 F-16 坠毁被解职，冲突仍在继续', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1807, 'App\\Models\\News', 362, 'cn', 'summary', '乌克兰总统泽伦斯基在一架 F-16 战斗机坠毁导致飞行员死亡四天后解雇了空军指挥官奥列什丘克中将。此次事件发生在俄罗斯对乌克兰的攻击期间，泽伦斯基强调需要强化军事指挥。与此同时，俄罗斯在哈尔科夫的袭击导致平民伤亡，而乌克兰则据报对别尔哥罗德进行反击。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1808, 'App\\Models\\News', 362, 'cn', 'comment_neutral', '奥列什丘克中将的解雇引发了对战争期间军事领导问责制的质疑。对坠毁事件的调查可能也将揭示乌克兰防空系统的有效性和整体军事战略的复杂性。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1809, 'App\\Models\\News', 362, 'cn', 'comment_left', '这一情况揭示了依赖西方军事化乌克兰的陷阱。F-16的坠毁是更广泛的军事战略失败的症状，这种战略不仅危害平民，还未能通过武装冲突实现和平。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1810, 'App\\Models\\News', 362, 'cn', 'comment_right', '乌克兰的领导层通过将责任推卸给外部因素，而不是解决其武装部队内部的系统性弱点，正在辜负其军队和人民。应专注于增强乌克兰的主权，而不是过度依赖外部军事支持。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1811, 'App\\Models\\News', 363, 'cn', 'title', '欧元区通胀降至2.2%，欧洲央行准备降息', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1812, 'App\\Models\\News', 363, 'cn', 'summary', '欧元区的通胀率在8月份降至2.2%，使欧洲中央银行（ECB）考虑降息以促进经济增长。能源价格的下降促成了这一降幅，使通胀接近ECB设定的2%的目标。经济学家预测在即将召开的ECB会议上将会降息，因为对维持经济稳定的担忧加剧。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
