	(1817, 'App\\Models\\News', 364, 'cn', 'summary', '台风山山导致日本多个地区，尤其是东京和神奈川县严重洪水。暴雨影响交通，造成财产损失和伤亡，持续发出未来降雨和潜在泥石流的警告。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
