	(1821, 'App\\Models\\News', 365, 'cn', 'title', '因藏匿于狗笼而臭名昭著的囚犯约翰·曼德在监狱去世', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1822, 'App\\Models\\News', 365, 'cn', 'summary', '约翰·曼德，这位因藏匿于狗笼而逃亡而闻名的囚犯，在亚利桑那州的拉帕尔马监狱去世，彼时他正因谋杀而正在服无期徒刑。他的死是在一个动荡的人生之后，他与一位女性的恋情使其逃出监狱，并成为了一本书和一部电影的题材。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1823, 'App\\Models\\News', 365, 'cn', 'comment_neutral', '约翰·曼德的生命，从他悲惨的起点到戏剧性的逃脱和随后的去世，突显了监狱体系的复杂性以及在其中形成的关系。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1824, 'App\\Models\\News', 365, 'cn', 'comment_left', '虽然这是一个悲剧，但约翰·曼德的故事说明了惩罚性的监狱体系的失败，往往优先考虑惩罚而非康复，未能关注囚犯的人性。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1825, 'App\\Models\\News', 365, 'cn', 'comment_right', '曼德的逃脱展示了囚犯和普通人对法律的惊人漠视。这种行为破坏了我们的司法系统的完整性，并凸显了监狱程序中宽容所带来的危险。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1826, 'App\\Models\\News', 366, 'cn', 'title', '卡马拉·哈里斯在竞选中摒弃种族和性别的考量', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1827, 'App\\Models\\News', 366, 'cn', 'summary', '副总统卡马拉·哈里斯在她的总统竞选中没有强调自己的种族和性别，而是专注于经济等基础性问题。批评者认为她谨慎的策略是为了避免之前像希拉里·克林顿这样的候选人所遭遇的困境。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
