	(1831, 'App\\Models\\News', 367, 'cn', 'title', '高盛将进行绩效评审，裁员数百人', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1832, 'App\\Models\\News', 367, 'cn', 'summary', '高盛计划裁员数百人，作为其年度评审过程的一部分，重新实施与绩效相关的裁员。该银行在经营环境改善的情况下，预计2024年员工人数将超过2023年。虽然有报道称裁员幅度较大，但高盛对此数据表示质疑。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
