	(1837, 'App\\Models\\News', 368, 'cn', 'summary', '为应对一场导致四名佩珀代因大学学生丧生的悲惨事故，加州第1297号法案提议在一个危险的太平洋海岸公路路段安装测速摄像头，已通过立法并有望获得州长批准。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
