	(1841, 'App\\Models\\News', 369, 'cn', 'title', '斯蒂芬·库里与勇士签新合同，加入独家五亿美元收入俱乐部', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1842, 'App\\Models\\News', 369, 'cn', 'summary', 'NBA超级巨星斯蒂芬·库里在与金州勇士签署为期一年的续约后，正式超过5亿美元的职业生涯收入，使他成为NBA历史上第三位达到这一里程碑的球员。他的新合同将在2026-27赛季结束时让他赚取6260万美元。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1843, 'App\\Models\\News', 369, 'cn', 'comment_neutral', '斯蒂芬·库里职业生涯收入超过5亿美元的成就，证明了他在NBA中无与伦比的才华和持续的表现。这反映了职业篮球的财务地位不断提高。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1844, 'App\\Models\\News', 369, 'cn', 'comment_left', '尽管库里的经济成功值得称赞，但它突显了职业体育中收入差距日益扩大。如此高额的薪水并不反映低级别球员所做的贡献，以及许多运动员面临的社会经济挣扎。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1845, 'App\\Models\\News', 369, 'cn', 'comment_right', '库里天文数字的收入提醒我们当今体育界所创造的巨大财富。这应该激励年轻运动员追求卓越和盈利，同时反思自己的财务决策。', '2024-09-02 00:44:47', '2024-09-02 00:44:47'),
	(1846, 'App\\Models\\News', 370, 'cn', 'title', '49人队接球员布兰登·艾尤克签署1.2亿美元合同延期', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1847, 'App\\Models\\News', 370, 'cn', 'summary', '布兰登·艾尤克结束了他的隐性合同谈判，并与旧金山49人队达成了一份为期四年、价值1.2亿美元的合同延期，使他与泰里克·希尔并列成为NFL薪资最高的第五位接球员。ESPN的亚当·谢夫特提到的合同条款的分歧引发了艾尤克代理人的澄清。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1848, 'App\\Models\\News', 370, 'cn', 'comment_neutral', '布兰登·艾尤克的合同延期反映了49人队对维持强大阵容的承诺，同时承认了球员在市场中的价值。这份协议也表明了沟通和谈判在职业体育中的重要性。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1849, 'App\\Models\\News', 370, 'cn', 'comment_left', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1850, 'App\\Models\\News', 370, 'cn', 'comment_right', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1851, 'App\\Models\\News', 371, 'cn', 'title', '加州家长警惕：移民试图登上校车', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1852, 'App\\Models\\News', 371, 'cn', 'summary', '加州圣地亚哥附近的一个社区在本周发生两起移民企图登上校车的事件后高度警惕。目击者报告称，约20名移民试图进入一辆载有小学生的校车，另有一组男子试图拦下载有中学生的校车。圣地亚哥县警长办公室正在调查是否发生了任何刑事行为。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1853, 'App\\Models\\News', 371, 'cn', 'comment_neutral', '这些事件突显了美国日益紧张的移民问题，特别是在儿童安全和社区关注方面的交集。对于当局来说，确保学生的安全而不加剧事态发展是很重要的。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1854, 'App\\Models\\News', 371, 'cn', 'comment_left', '这一情况明显表明了如何对脆弱群体使用误信息和恐惧。与其审视移民，应该将注意力转向解决推动移民的系统性问题。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1855, 'App\\Models\\News', 371, 'cn', 'comment_right', '这些事件证实了许多公民对于失控移民的担忧。家长们有权保护自己的孩子，是时候让政府采取强有力的行动，确保我们的学校安全。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1856, 'App\\Models\\News', 372, 'cn', 'title', '加州法案助力无证移民申请住房贷款待纽瑟姆签署', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1857, 'App\\Models\\News', 372, 'cn', 'summary', '加州第1840号法案旨在为无证移民提供住房贷款援助，已通过立法机关并等待纽瑟姆州长的批准。该法案允许符合条件的申请者获得最高15万美元的首付款援助，引发了关于根据移民身份分配州资金的全国辩论。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1858, 'App\\Models\\News', 372, 'cn', 'comment_neutral', '加州第1840号法案的通过标志着加州住房政策的重要一步，满足了无证移民在经济中做出重要贡献的需求。关于基于移民身份的州资金援助的辩论反映了更广泛的国家移民改革讨论。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1859, 'App\\Models\\News', 372, 'cn', 'comment_left', '该法案代表了对无证移民对我们社会贡献的长期认可。提供住房援助不仅是道德责任，也是实现包容性经济增长的必要步骤。无证工人让我们的经济运转，他们应该得到支持。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1860, 'App\\Models\\News', 372, 'cn', 'comment_right', '该法案背叛了辛勤工作的美国纳税人。为什么我们的纳税美元要用来帮助那些非法居留的人？优先为无证移民提供援助而不是公民是不公平的，这是对州资源的滥用。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1861, 'App\\Models\\News', 373, 'cn', 'title', '加利福尼亚州在打击走私行动中查获创纪录的芬太尼数量', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1862, 'App\\Models\\News', 373, 'cn', 'summary', '加利福尼亚州当局报告称，芬太尼的查获量显著增加，2024年查获了880万颗药丸和4638磅粉末。加利福尼亚州州长加文·纽森表示，州政府的工作旨在通过打击走私根源来对抗阿片类药物流行，主要集中在美墨边境。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1863, 'App\\Models\\News', 373, 'cn', 'comment_neutral', '芬太尼查获量的增加是执法部门加大打击毒品走私力度的积极迹象。然而，这也引发了对芬太尼供应和需求高企背后根本原因的质疑。这需要采取全面的方法。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1864, 'App\\Models\\News', 373, 'cn', 'comment_left', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1865, 'App\\Models\\News', 373, 'cn', 'comment_right', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1866, 'App\\Models\\News', 374, 'cn', 'title', '两名嫌疑人在Kohl\'s商店因盗窃被捕', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1867, 'App\\Models\\News', 374, 'cn', 'summary', '加州坎贝尔市的警察逮捕了两名嫌疑人KC Vernon Pries和Mary Jo Devera，因在Kohl\'s商店盗窃。两人当时正在从衣物上拆除安全传感器，并试图逃跑，随后被发现藏匿在楼顶。德维拉则在附近被捕。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1868, 'App\\Models\\News', 374, 'cn', 'comment_neutral', '这一事件突显了该区域零售盗窃和犯罪行为的持续问题，引发了关于安全措施和执法有效性的讨论。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1869, 'App\\Models\\News', 374, 'cn', 'comment_left', '这个案件反映了许多人面临的社会经济困境，绝望导致犯罪，暗示着需要更多的社区支持和社会项目，而不是严厉的惩罚。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1870, 'App\\Models\\News', 374, 'cn', 'comment_right', '这次逮捕突显了我们社区日益严重的犯罪问题，呼吁加强执法并恢复传统价值观，以保护我们的社区。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1871, 'App\\Models\\News', 375, 'cn', 'title', '加利福尼亚记者批评与谷歌达成的2.5亿美元地方新闻合作协议', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1872, 'App\\Models\\News', 375, 'cn', 'summary', '加利福尼亚记者批评最近达成的2.5亿美元协议，声称该协议本意是增强地方新闻的资金支持，但实际上却演变成了一项“密室交易”，主要是惠及大型科技公司，特别是谷歌，而非媒体自身。预计该立法在第一年只会产生1500万美元，远低于最初的讨论额。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1873, 'App\\Models\\News', 375, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1874, 'App\\Models\\News', 375, 'cn', 'comment_left', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1875, 'App\\Models\\News', 375, 'cn', 'comment_right', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1876, 'App\\Models\\News', 376, 'cn', 'title', '马自达因发动机缺陷面临集体诉讼', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1877, 'App\\Models\\News', 376, 'cn', 'summary', '美国司机马特·考勒在加利福尼亚州对马自达提起了一项集体诉讼，声称该汽车制造商在未妥善披露的情况下出售了具有危险发动机缺陷的车辆。诉讼指控马自达的SKYACTIV-G 2.5T发动机用于多款车型，可能导致冷却液泄漏并造成灾难性发动机故障，侵害消费者权益及违反贸易实践。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1878, 'App\\Models\\News', 376, 'cn', 'comment_neutral', '针对马自达的集体诉讼突显了有关车辆安全和制造商透明度的重要关注。如果证实，这个案件可能为汽车行业的问责制树立一个先例。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1879, 'App\\Models\\News', 376, 'cn', 'comment_left', '这一情况体现了对汽车行业公司加强监管的需求。像马自达这样的公司必须因优先考虑利润而非消费者安全而承担责任，政府应介入以保护公众。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1880, 'App\\Models\\News', 376, 'cn', 'comment_right', '虽然这项诉讼可能有其合理性，但也引发了关于个人责任的问题。消费者在购买之前应该更加警惕，主动研究产品，而不是仅仅依赖制造商披露潜在缺陷。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1881, 'App\\Models\\News', 377, 'cn', 'title', '加利福尼亚的洗手间访问法案：公民的新权利', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1882, 'App\\Models\\News', 377, 'cn', 'summary', '歌剧歌手泰迪·西格尔在纽约市遭遇洗手间使用拒绝，这促使她创建了一个社交媒体资源。与此同时，加利福尼亚的洗手间访问法案要求商家为有特定医疗条件的人提供洗手间设施的使用权。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1883, 'App\\Models\\News', 377, 'cn', 'comment_neutral', '洗手间使用权的问题反映了更大社会挑战，涉及公共健康和个人权利。加利福尼亚的洗手间访问法案是保护有医疗条件者的重要一步，但商家理解法律以避免不必要的冲突至关重要。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1884, 'App\\Models\\News', 377, 'cn', 'comment_left', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1885, 'App\\Models\\News', 377, 'cn', 'comment_right', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1886, 'App\\Models\\News', 378, 'cn', 'title', '加州拟在学校禁止流行食品染料', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1887, 'App\\Models\\News', 378, 'cn', 'summary', '加州立法者已将一项法案提交给加州州长加文·纽瑟姆，旨在禁止学校销售或分发含有六种合成食品染料的零食，包括流行的Cheetos和Doritos。如果通过，该法案将于2028年生效，仅适用于州内的公立学校和特许学校。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1888, 'App\\Models\\News', 378, 'cn', 'comment_neutral', '加州学校对合成食品染料的拟禁令突显了对食品安全和儿童健康的持续关注。虽然一些研究表明可能存在风险，但关于这些措施必要性和有效性的讨论仍然复杂而细腻。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1889, 'App\\Models\\News', 378, 'cn', 'comment_left', '这项法案早就该通过了！儿童的健康至关重要，合成食品染料只是食品行业追求利润而忽视安全的又一个例子。我们需要主动将有害物质从儿童饮食中移除，而不是等着研究来告诉我们我们已经知道的事情。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1890, 'App\\Models\\News', 378, 'cn', 'comment_right', '尽管该法案背后的意图可能良好，但这又是政府过度干预的经典案例。家长应该有选择确定孩子吃什么的权利。此外，禁止染料的努力可能只会导致学校成本上升和不必要的复杂情况。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1891, 'App\\Models\\News', 379, 'cn', 'title', '加州保险公司因拒绝性别确认护理而被罚款', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1892, 'App\\Models\\News', 379, 'cn', 'summary', '加州健康保险公司蓝十字加州合作计划和安泰蓝十字因非法拒绝性别确认护理的覆盖，面临合计85万美元的罚款，迫使他们修订患者治疗做法。超过150个被拒绝的案例将被审核，且要求雇佣专门的案例经理处理与性别焦虑相关的索赔。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1893, 'App\\Models\\News', 379, 'cn', 'comment_neutral', '这一裁决突显了对医疗保险覆盖的透明度和遵从州法律的需求。对被拒案件的审查强调了保险公司在确保所有患者（无论性别认同）获得公平待遇方面的责任。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1894, 'App\\Models\\News', 379, 'cn', 'comment_left', '这些罚款是在与医疗保健中系统性歧视的斗争中必要的一步。健康保险公司必须对其对LGBTQ+社区的偏见负责，并应采取更积极的措施，确保所有个人在没有污名的情况下获得他们应得的护理。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1895, 'App\\Models\\News', 379, 'cn', 'comment_right', '州政府干预私人公司如何管理医疗保健令人担忧。与其施加罚款，不如应关注促进个人对医疗保健决定的责任感，并允许保险公司在其政策中有更多灵活性。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1896, 'App\\Models\\News', 380, 'cn', 'title', '加利福尼亚州财务主管菲奥娜·马以纳税人的费用结束骚扰案件', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1897, 'App\\Models\\News', 380, 'cn', 'summary', '加利福尼亚州财务主管菲奥娜·马正在竞选2026年的副州长，她以纳税人的费用支付35万美元结算款，结束了针对她的骚扰案件，尽管她声称自己得到了清白。投诉人朱迪思·布莱克韦尔撤回了她的指控。马和她的律师批评了这一解决方案，强调他们寻求通过审判确定结果。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1898, 'App\\Models\\News', 380, 'cn', 'comment_neutral', '这一骚扰案件的解决揭示了涉及公众人物和纳税人的法律争议所面临的复杂性。尽管财务主管马认为自己得到了清白，但对纳税人的财政负担引发了对问责和公共职务影响的质疑。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1899, 'App\\Models\\News', 380, 'cn', 'comment_left', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1900, 'App\\Models\\News', 380, 'cn', 'comment_right', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1901, 'App\\Models\\News', 381, 'cn', 'title', '埃隆·马斯克的投票记录与他对邮寄投票的立场相悖', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1902, 'App\\Models\\News', 381, 'cn', 'summary', '埃隆·马斯克公开批评邮寄投票，称其为“疯癫”，并声称这会导致选举欺诈。然而，记录显示他在居住在加州期间曾在两次选举中通过邮寄投票。他的评论与邮寄投票的既定安全措施相悖。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1903, 'App\\Models\\News', 381, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1904, 'App\\Models\\News', 381, 'cn', 'comment_left', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1905, 'App\\Models\\News', 381, 'cn', 'comment_right', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1906, 'App\\Models\\News', 382, 'cn', 'title', '加州消防局首次展示C-130H灭火飞机以应对野火', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1907, 'App\\Models\\News', 382, 'cn', 'summary', '加州消防局首次推出其C-130H灭火飞机，这是其机队中最大的飞机，旨在增强其对抗加州野火的灭火能力。这架飞机可以携带超过4000加仑的灭火剂，并将与另外六架飞机一起加强空中灭火工作。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1908, 'App\\Models\\News', 382, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1909, 'App\\Models\\News', 382, 'cn', 'comment_left', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1910, 'App\\Models\\News', 382, 'cn', 'comment_right', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1911, 'App\\Models\\News', 383, 'cn', 'title', '图雷县咖啡壶大火蔓延，控制进展有所好转', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1912, 'App\\Models\\News', 383, 'cn', 'summary', '图雷县的咖啡壶大火在24小时内增加了1,311英亩，现总面积已达到6,994英亩，控制率为3%。消防官员报告在某些区域控制工作取得进展，同时对受影响区域发布了撤离命令。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1913, 'App\\Models\\News', 383, 'cn', 'comment_neutral', '咖啡壶大火的迅猛蔓延突显了加利福尼亚州野火的持续风险，尽管消防队竭尽全力进行控制并确保社区安全。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1914, 'App\\Models\\News', 383, 'cn', 'comment_left', NULL, '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
