	(1917, 'App\\Models\\News', 384, 'cn', 'summary', '由于缺乏保险覆盖，加州的非营利寄养家庭机构面临关闭的边缘，这威胁到近45,000名寄养儿童的照顾。目前为90%的这些机构提供保险的公司已撤回，导致人们对儿童福利领域的严重危机感到担忧。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
