	(1922, 'App\\Models\\News', 385, 'cn', 'summary', '国家气象局已为西北内华达州和东北加州的大部分地区发布了火灾天气警报，至周一中午有效。由于预计在劳动节周末期间将出现强风和低湿度，因此发布了这一提示，预计风速在15到25英里每小时之间，湿度降至9到15%。受影响地区包括沃肖、道格拉斯和斯托里县等。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1923, 'App\\Models\\News', 385, 'cn', 'comment_neutral', '这个警报为人们提供了一个重要的火灾安全提醒，特别是在劳动节周末这样高风险的时期。受影响地区的居民应采取预防措施以减少火灾隐患。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
