	(1927, 'App\\Models\\News', 386, 'cn', 'summary', '加州的第254号参议院法案旨在改善媒体对州监狱的访问和监督，现已提交给州长加文·纽森批准。该法案希望在多年有限的媒体报道之后恢复更大的透明度，并允许媒体代表在监狱内进行采访和使用录音设备。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
