	(1932, 'App\\Models\\News', 387, 'cn', 'summary', '两项旨在为加州黑人建立赔偿的法案在州立法机构截止日期临近之际面临加州州长加文·纽瑟姆的反对和潜在的变更。这些法案旨在创建一个新的机构和基金，但由于财政问题而停滞不前。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
