	(1937, 'App\\Models\\News', 388, 'cn', 'summary', '一项旨在惩罚社交媒体公司因对年轻用户造成伤害的加州法案在今年失败。尽管最初获得了两党的支持，并对青少年上瘾和心理健康的担忧日益加剧，但修正案显著削弱了该立法，导致法案被撤回。该法案的失败反映了加州民主党在监管强大的科技公司方面面临的持续挑战。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
