	(1947, 'App\\Models\\News', 390, 'cn', 'summary', '两位加州彩票中奖者被敦促在截止日期之前索取各自超过200万美元的奖金。一张价值215万1945美元的Mega Millions彩票将于8月30日到期，而一张价值246万2356美元的Powerball彩票必须在9月19日之前索取。如果未被索取，这些巨额奖金将贡献给加州的公共教育资金，延续自1985年以来的趋势。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
