	(1957, 'App\\Models\\News', 392, 'cn', 'summary', '在周四晚间的大学足球比赛中，分析师达里乌斯·沃克因专注于教练技巧而非萨克拉门托州立大学的迈克尔·约翰逊严重受伤而受到批评。约翰逊在一次开球回归中受伤，引发了球迷对沃克在瞬间缺乏敏感的担忧。所幸，约翰逊被报道意识清醒并能反应。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
