	(1962, 'App\\Models\\News', 393, 'cn', 'summary', '加州立法者撤回了一项旨在提供 modest 减免电费的提案，在立法会议结束前有效地杀死了第3121号法案。该法案计划为家庭提供一次性30到70美元的信用额度，但因削减低收入居民援助项目的资金而引发争议。立法领导人仍在寻求应对高电费和清洁能源要求的措施。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1963, 'App\\Models\\News', 393, 'cn', 'comment_neutral', '第3121号法案的撤回反映了在为消费者提供即时经济援助与实现清洁能源和公用事业支持计划长期目标之间取得平衡的复杂性。表明立法者在困难的经济形势中制定有效能源政策所面临的挑战。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
