	(1987, 'App\\Models\\News', 398, 'cn', 'summary', '加利福尼亚州农业部已确认中央谷地出现三例牛只禽流感病例。尽管消费者似乎没有直接威胁，官员们强调监测牲畜健康和保护农场员工免受潜在病毒传播的重要性。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
