	(1992, 'App\\Models\\News', 399, 'cn', 'summary', 'Interra Systems宣布其ORION内容监测套件进行了重大更新，重点提升OTT流媒体质量。新功能包括IPv6支持、增强的根本原因分析和端到端广告插入监测。这些进展将在IBC 2024上展示，突显了Interra在竞争激烈的流媒体领域优化的承诺。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1993, 'App\\Models\\News', 399, 'cn', 'comment_neutral', 'Interra的ORION监测套件的最新更新展示了视频内容质量管理的重要进展，满足现代流媒体服务的复杂需求。这项增强反映了行业向更高质量和可靠性内容交付的趋势，在吸引和留住观众方面变得愈发重要。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
