	(1997, 'App\\Models\\News', 400, 'cn', 'summary', '加利福尼亚州已要求所有公立学校为过渡幼儿园至12年级的学生提供免费的早餐和午餐，无论其经济状况如何。此举是州级普遍餐食计划的一部分，旨在减轻家庭经济负担，确保所有学生平等获得营养食品。', '2024-09-02 00:44:48', '2024-09-02 00:44:48'),
	(1998, 'App\\Models\\News', 400, 'cn', 'comment_neutral', '加利福尼亚州免费餐饮计划的扩展在解决学生食品不安全问题方面发挥了至关重要的作用。通过提供每日餐点而不考虑资格，这项举措不仅在经济上支持家庭，还促进了儿童的健康和学习成果。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(1999, 'App\\Models\\News', 400, 'cn', 'comment_left', '这项进步措施强调了教育中对普遍基本服务日益增长的必要性。通过确保每个孩子都能获得营养餐，加利福尼亚州为其他州树立了榜样，并朝着消除儿童贫困迈出了重要一步。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2000, 'App\\Models\\News', 400, 'cn', 'comment_right', '虽然免费餐的初衷是值得赞扬的，但这也引发了对政府福利依赖的质疑。应鼓励父母为自己的孩子提供食品，而不是依赖国家项目，这可能会无意中培养一种权利文化。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2001, 'App\\Models\\News', 401, 'cn', 'title', '林林兄弟与巴纳姆·巴利马戏团重塑无动物表演的《世界上最伟大的表演》', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
