	(2027, 'App\\Models\\News', 406, 'cn', 'summary', '桑尼维尔高速公路的所有车道已在一场车辆起火后恢复通行。加利福尼亚公路巡逻队发布了严重交通警报，并建议驾驶者预期延误并寻求替代路线。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2028, 'App\\Models\\News', 406, 'cn', 'comment_neutral', '加利福尼亚公路巡逻队的迅速反应确保了安全措施的有效实施，尽量减少了高速公路101上车辆起火造成的干扰。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
