	(2031, 'App\\Models\\News', 407, 'cn', 'title', '斯坦福红雀在2024赛季首场激战中迎战TCU', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2032, 'App\\Models\\News', 407, 'cn', 'summary', '斯坦福红雀在周五与TCU角蛙队的比赛中开启了2024赛季，尽管表现不够稳健，但仍顺利取得了早期达阵。四分卫阿什顿·丹尼尔斯作出了重要贡献，包括一记决定性的31码冲刺。比赛充满紧张时刻，斯坦福的不败领先很快被TCU的反击所挑战。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2033, 'App\\Models\\News', 407, 'cn', 'comment_neutral', '这场比赛展示了两支球队的优势和弱点。斯坦福有能力从错误中恢复，但TCU的得分韧性体现了他们的竞争精神。两支球队在接下来的赛季中都展现了极大的潜力。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2034, 'App\\Models\\News', 407, 'cn', 'comment_left', '尽管比赛引人入胜，但这反映了大学足球商业化的更广泛问题，盈利的重视常常掩盖了学生运动员的福祉。我们必须批判这项运动在核心价值观受损的情况下如何演变。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2035, 'App\\Models\\News', 407, 'cn', 'comment_right', '比赛期间的迅速得分和罚球展示了大学体育纪律的降低。必须维护传统价值观，培养竞争精神，而不是让比赛陷入混乱的得分狂潮。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2036, 'App\\Models\\News', 408, 'cn', 'title', '雷击导致亚美尼亚核电站停运', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2037, 'App\\Models\\News', 408, 'cn', 'summary', '亚美尼亚唯一的核电站因8月31日发生的雷击而停运。该电站的安全系统激活，确保了安全停运。工作人员正在进行复工的努力。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2038, 'App\\Models\\News', 408, 'cn', 'comment_neutral', '亚美尼亚核电站因雷击停运突显了关键基础设施对自然事件的脆弱性，以及能源部门中健全安全协议的重要性。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2039, 'App\\Models\\News', 408, 'cn', 'comment_left', '这一事件突显了依赖核能的风险，尤其是在容易发生极端天气的地区。政府必须考虑更环保、更安全的替代方案，以避免危及公民生命。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2040, 'App\\Models\\News', 408, 'cn', 'comment_right', '此次停运显示出必须对我们的能源基础设施进行更多投资，以防止此类故障。亚美尼亚必须优先考虑核电的可靠性和确保能源独立。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2041, 'App\\Models\\News', 409, 'cn', 'title', '乌克兰袭击别尔哥罗德导致五人死亡和46人受伤', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2042, 'App\\Models\\News', 409, 'cn', 'summary', '乌克兰对俄罗斯西南城市别尔哥罗德的袭击导致五人死亡和46人受伤，地方州长称。这起事件发生在周五晚，标志着乌克兰与俄罗斯之间持续冲突的重要升级。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
