	(2047, 'App\\Models\\News', 410, 'cn', 'summary', '马修·佩里因氟烷过量死亡而被控的五名嫌疑人之一，医生马尔克·查维斯被禁止执业，准备就阴谋指控认罪。此案引发了对名人吸毒问题的广泛关注。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
