	(2087, 'App\\Models\\News', 418, 'cn', 'summary', '8月31日，中国海军一艘调查船在日本鹿儿岛县附近的海域短暂进入日本领海，这是过去一年内的第十次侵入。该船在几个小时内被发现并离开，显示了中国与日本之间日益紧张的海洋局势。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2088, 'App\\Models\\News', 418, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2089, 'App\\Models\\News', 418, 'cn', 'comment_left', NULL, '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2090, 'App\\Models\\News', 418, 'cn', 'comment_right', NULL, '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2091, 'App\\Models\\News', 419, 'cn', 'title', '布基纳法索悲剧：数百人死于圣战者袭击', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2092, 'App\\Models\\News', 419, 'cn', 'summary', '在一起可怕的事件中，一名幸存者讲述了布基纳法索中部数百名村民的屠杀，阿尔盖达关联团体袭击了按军事命令挖沟壕的平民。目击者称至少有400人遇难。事件引发了对军方使用平民参与战斗以及政府对不断升级暴力行为的反应的质疑。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2093, 'App\\Models\\News', 419, 'cn', 'comment_neutral', '最近布基纳法索的悲惨事件突显了撒哈拉地区持续暴力的严重影响。随着平民卷入冲突，军方和政府的责任受到审视。保护脆弱群体的全面策略需求显而易见。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2094, 'App\\Models\\News', 419, 'cn', 'comment_left', '这一大屠杀凸显了国家未能保护其人民的失败，以及在一场他们未选择的战争中对平民的肆无忌惮的抛弃。通过强迫平民在军事命令下挖沟壕，政府实际上把他们置于危险之中，明显对其公民的安全表现出严重的不负责任。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2095, 'App\\Models\\News', 419, 'cn', 'comment_right', '这场悲惨的生命损失重申了对抗圣战分子威胁时加强军事回应的重要性。政府必须加强军队行动，采取果断行动消灭这些威胁国家安全的武装团体，而不是让没有训练的平民处于危险之中。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2096, 'App\\Models\\News', 420, 'cn', 'title', '孟加拉国在洪水肆虐社区之际面临健康危机', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2097, 'App\\Models\\News', 420, 'cn', 'summary', '孟加拉国当局正在努力提供干净饮用水和医疗援助，因洪水导致数百万民众被困，面临水源性疾病的风险，之前的灾难造成至少54人死亡。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2098, 'App\\Models\\News', 420, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2099, 'App\\Models\\News', 420, 'cn', 'comment_left', NULL, '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2100, 'App\\Models\\News', 420, 'cn', 'comment_right', NULL, '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2101, 'App\\Models\\News', 421, 'cn', 'title', '联合国呼吁对中国新疆报告采取行动两周年', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2102, 'App\\Models\\News', 421, 'cn', 'summary', '在一份声称新疆侵犯人权的联合国报告发布两周年之际，倡导者和联合国官员呼吁对中国采取更大行动，而中国已否认这些指控并为其记录辩护。受害者的家属对缺乏实质性变化表示失望。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2103, 'App\\Models\\News', 421, 'cn', 'comment_neutral', '对联合国报告的纪念突显了国际社会对新疆人权的持续关注。尽管联合国与北京的接触可能在长远内产生成果，但立即采取问责行动似乎是解决紧急局势的必要措施。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2104, 'App\\Models\\News', 421, 'cn', 'comment_left', NULL, '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2105, 'App\\Models\\News', 421, 'cn', 'comment_right', NULL, '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2106, 'App\\Models\\News', 422, 'cn', 'title', '热带风暴山山在日本造成灾难，至少六人死亡', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2107, 'App\\Models\\News', 422, 'cn', 'summary', '台风山山在日本造成严重破坏，至少六人遇难，伤者众多。此风暴在九州登陆，导致广泛的洪水和滑坡，继续给东移地区带来威胁。超过35,000户家庭停电，相关部门发布紧急警报。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2108, 'App\\Models\\News', 422, 'cn', 'comment_neutral', '台风山山对日本造成了严重影响，突显了在自然灾害因气候变化而频繁和强度增加的背景下，强大灾害准备和响应系统的必要性。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2109, 'App\\Models\\News', 422, 'cn', 'comment_left', '台风山山造成的破坏突显了政府在应对气候危机方面政策的失败，这对最脆弱的社区造成了不成比例的影响。我们必须采取立即的、全面的行动来对抗气候变化。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2110, 'App\\Models\\News', 422, 'cn', 'comment_right', '台风山山的影响提醒我们必须优先考虑国家安全和基础设施。我们必须确保我们的资源专注于增强应急服务，而不是将其转移到其他问题。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2111, 'App\\Models\\News', 423, 'cn', 'title', '以色列空袭加沙援助车队导致四名巴勒斯坦人死亡', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2112, 'App\\Models\\News', 423, 'cn', 'summary', '以色列对加沙一辆援助车队的空袭导致四名巴勒斯坦人死亡，援助组织Anera表示。此次事件发生在8月30日，车队刚离开以色列控制的克里姆-沙洛姆过境点。以色列声称这些人是武装袭击者，而Anera否认这些指控，称空袭前没有警告。这一事件突显了以色列-巴勒斯坦冲突中的人道主义危机。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2113, 'App\\Models\\News', 423, 'cn', 'comment_neutral', '这一悲剧事件引发了对冲突地区人道主义任务安全性的重要关切。尽管以色列声称他们针对的是武装袭击者，但缺乏沟通和警告对军事干预的操作程序和问责提出了关键问题。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2114, 'App\\Models\\News', 423, 'cn', 'comment_left', '这一事件例证了以色列军事行动下对巴勒斯坦生命的持续漠视。国际社会必须更果断地采取行动，让以色列为其对平民和人道工作者的攻击负责，这只会加剧加沙的人道主义危机。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2115, 'App\\Models\\News', 423, 'cn', 'comment_right', '在这种情况下，以色列的行动是对潜在威胁的必要防御。在车队中出现武装个人危及了以色列公民和该地区其他人的安全。国际社会应理解，以色列正在采取步骤确保其国家安全。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2116, 'App\\Models\\News', 424, 'cn', 'title', '宾夕法尼亚法院裁定不应取消邮寄选票', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2117, 'App\\Models\\News', 424, 'cn', 'summary', '宾夕法尼亚州的一项法院裁定，费城和阿尔根县不得因外包裹日期错误而取消邮寄选票。该裁定回应了近16,000张因小错误而被取消的选票，确认了即使存在文书差错，投票权依然有效。这一裁定出台之际，宾夕法尼亚州作为即将到来的美国总统选举的重要战场。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2118, 'App\\Models\\News', 424, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
