	(2121, 'App\\Models\\News', 425, 'cn', 'title', 'Telegram首席执行官帕维尔·杜罗夫在法国面临刑事调查', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2122, 'App\\Models\\News', 425, 'cn', 'summary', 'Telegram首席执行官帕维尔·杜罗夫因涉嫌儿童剥削和毒品贩运而受到巴黎网络犯罪单位的正式调查。这一案件标志着全球科技监管的转变，因为当局越来越多地追究平台高管对非法内容的责任。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2123, 'App\\Models\\News', 425, 'cn', 'comment_neutral', '对杜罗夫的调查显示了科技公司监管环境的演变，政府寻求对于其平台上托管的内容负责。这也可能为未来涉及科技首席执行官的案件树立先例。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
