	(2127, 'App\\Models\\News', 426, 'cn', 'summary', '北约秘书长延斯·斯托尔滕贝格表示，乌克兰对俄罗斯库尔斯克地区的军事入侵在国际法下是合法的，强调了乌克兰的自卫权。他警告称，尽管这种进攻带来了风险，但如何进行军事行动最终是乌克兰的决定。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
