	(2131, 'App\\Models\\News', 427, 'cn', 'title', 'FDA批准紧急使用更新版Novavax COVID疫苗', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2132, 'App\\Models\\News', 427, 'cn', 'summary', '美国FDA已批准给12岁及以上人群使用一款更新版的Novavax COVID疫苗，该疫苗针对JN.1变种，预计将在下周可用，因为COVID住院人数正在上升。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
