	(2136, 'App\\Models\\News', 428, 'cn', 'title', '美伊联军联合突袭，15名ISIS武装分子被击毙', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2137, 'App\\Models\\News', 428, 'cn', 'summary', '美国中央指挥部报告称，8月29日美国与伊拉克安全部队在西伊拉克联合进行的一次突袭导致15名ISIS武装分子被击毙。七名美国军人受伤，其中五人在行动中受伤。没有报告平民伤亡。伊拉克外交部以最新事态为由推迟了关于结束美国主导的联军任务的声明。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2138, 'App\\Models\\News', 428, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
