	(2141, 'App\\Models\\News', 429, 'cn', 'title', '教堂屋顶倒塌，累西腓悲剧发生，两人遇难', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2142, 'App\\Models\\News', 429, 'cn', 'summary', '星期五在巴西累西腓，一座教堂的屋顶倒塌，造成至少两人遇难。大约20人获得医疗救助。事故发生时，教堂正在用于食物分发。有关部门正在寻找其他可能的伤亡者。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2143, 'App\\Models\\News', 429, 'cn', 'comment_neutral', '累西腓的这起悲剧事件凸显了建筑维护和结构完整性方面的安全问题，尤其是对于公共服务设施。这引发了人们对安全施工实践的监督和规范的质疑。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2144, 'App\\Models\\News', 429, 'cn', 'comment_left', '这次倒塌是对服务最贫困社区的结构系统性忽视的直接结果。这提醒我们需要加大对公共基础设施的投资，以确保弱势群体的安全。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2145, 'App\\Models\\News', 429, 'cn', 'comment_right', '这个悲惨事件强调了个人在社区空间安全方面应承担的责任。过度依赖政府监管往往导致这样的悲剧。', '2024-09-02 00:44:49', '2024-09-02 00:44:49'),
	(2146, 'App\\Models\\News', 430, 'cn', 'title', '俄国人在杜罗夫被捕的背景下面临选择压力', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2147, 'App\\Models\\News', 430, 'cn', 'summary', '在乌克兰持续冲突的背景下，杰出的俄国人物呼吁国民选择对故乡的忠诚否则将面临西方的迫害。Telegram的帕维尔·杜罗夫在法国被捕，加剧了这种情绪，领导人坚称中立不再是一个选项。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
