	(2151, 'App\\Models\\News', 431, 'cn', 'title', '哈瓦那在资源短缺中抗击Oropouche病毒', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2152, 'App\\Models\\News', 431, 'cn', 'summary', '古巴卫生当局已在哈瓦那启动了fumigation工作，以应对自5月检测以来超过500例的Oropouche病毒病例激增。雨季和资源短缺带来了重大挑战。值得指出的是，尽管该病毒已在古巴各地传播，但尚未报告死亡病例。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2153, 'App\\Models\\News', 431, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2154, 'App\\Models\\News', 431, 'cn', 'comment_left', NULL, '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2155, 'App\\Models\\News', 431, 'cn', 'comment_right', NULL, '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2156, 'App\\Models\\News', 432, 'cn', 'title', '导弹在也门海岸附近袭击船只，胡塞武装继续攻击', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2157, 'App\\Models\\News', 432, 'cn', 'summary', '根据英国海事贸易行动的消息，两枚导弹在也门海岸附近的一艘船只旁发生爆炸。尽管胡塞武装对商业航运展开了一场导弹和无人机攻势，船员安全报告，但目前船只未受损。胡塞武装声称他们的行为是为了表达对巴勒斯坦的支持。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2158, 'App\\Models\\News', 432, 'cn', 'comment_neutral', '最近的导弹事件反映了红海日益紧张的局势，突显出该地区商业航运面临的风险。海事安全正日益成为航运公司和国际利益相关者的首要任务。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2159, 'App\\Models\\News', 432, 'cn', 'comment_left', '尽管胡塞武装的攻击令人震惊，但这源于在加沙遭受压迫者的绝望处境。国际社会必须解决根本原因，而不仅仅是谴责那些反击帝国主义侵略的行为。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2160, 'App\\Models\\News', 432, 'cn', 'comment_right', '胡塞武装对商业船只的袭击代表了对全球贸易的直接威胁，必须以压倒性的军事力量应对。像英国这样的国家必须采取更为强硬的立场来保护其航运利益。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2161, 'App\\Models\\News', 433, 'cn', 'title', '加密货币投资者在筹款活动中支持哈里斯', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2162, 'App\\Models\\News', 433, 'cn', 'summary', '加密货币投资者正在为副总统卡马拉·哈里斯组织筹款活动，目标是筹集至少10万美元以支持她的竞选活动。该草根活动计划于9月13日举行，旨在吸引多样化的捐助者，并强调为加密行业提供支持性监管环境的重要性。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
