	(2167, 'App\\Models\\News', 434, 'cn', 'summary', '乌克兰军队在击退俄罗斯在乌克兰东部的攻击的同时，已向俄罗斯库尔斯克地区推进2公里。这一大胆行动是保护边界定居点的战略的一部分，战争持续进行中。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
