	(2172, 'App\\Models\\News', 435, 'cn', 'summary', '一架正在执行灭火任务的直升机在北葡萄牙的杜罗河坠毁，导致至少四人遇难，一人失踪。飞行员受伤被救援，相关部门正在该地区进行搜救工作。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
