	(2176, 'App\\Models\\News', 436, 'cn', 'title', '乌克兰呼吁蒙古在国际刑事法庭逮捕普京', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2177, 'App\\Models\\News', 436, 'cn', 'summary', '乌克兰呼吁蒙古在即将于9月3日访问期间逮捕俄罗斯总统普京，理由是国际刑事法庭（ICC）发出的逮捕令，指控他涉及非法驱逐乌克兰儿童的战争罪。克里姆林宫淡化了对ICC逮捕令的担忧，强调与蒙古的密切关系。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2178, 'App\\Models\\News', 436, 'cn', 'comment_neutral', '围绕国际刑事法庭逮捕令的情况凸显了国际法和外交关系的复杂性，对于像蒙古这样的国家来说，这提出了在履行国际条约义务的同时维持双边关系的重大挑战。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2179, 'App\\Models\\News', 436, 'cn', 'comment_left', '这一国际刑事法庭的逮捕令代表了更广泛的努力，以追究有权势领导人的责任，挑战对弱势群体（如乌克兰儿童）实施战争罪的压迫政权。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2180, 'App\\Models\\News', 436, 'cn', 'comment_right', '乌克兰要求蒙古逮捕普京的呼吁反映了西方的偏见，意图破坏俄罗斯主权，表明国际机构如何被操纵为政治目的而非真正的正义。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2181, 'App\\Models\\News', 437, 'cn', 'title', 'NASA因波音星际航天器问题更换SpaceX航班的机组人员', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2182, 'App\\Models\\News', 437, 'cn', 'summary', 'NASA宣布由于波音星际航天器存在问题而更换即将进行的SpaceX任务的两名宇航员，认为该航天器不适合按计划返回。该航班原定于8月份发射，现在重新安排在9月24日，标志着波音运营的重大挫折。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2183, 'App\\Models\\News', 437, 'cn', 'comment_neutral', 'NASA决定让SpaceX负责宇航员的返回，突显出在波音等传统航空公司面临挑战时，对商业航天的日益依赖。这标志着太空探索和合作关系动态的潜在变化。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2184, 'App\\Models\\News', 437, 'cn', 'comment_left', '波音星际航天器的持续问题反映了私人化太空探索的危险。NASA应该更多关注促进公共航空航天项目，而不是依赖那些将利润置于安全之上的竞争私人公司。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2185, 'App\\Models\\News', 437, 'cn', 'comment_right', 'NASA转向使用SpaceX而非波音的举动证明了对美国航空航天卓越的背叛。这增强了对外国私营公司的竞争，可能危及美国在太空的技术领导地位。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2186, 'App\\Models\\News', 438, 'cn', 'title', '以色列军队在西岸冲突中打死两人', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2187, 'App\\Models\\News', 438, 'cn', 'summary', '以色列军方报道称在被占领的西岸发生的两个事件中，有两人被杀，暴力在该地区升级。一个人涉嫌闯入以色列定居点，另一个在车辆爆炸后被击毙。巴勒斯坦集团哈马斯称赞此次袭击为抵抗行动。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2188, 'App\\Models\\News', 438, 'cn', 'comment_neutral', '西岸最近的暴力事件凸显了该地区日益紧张的局势，双方面临着加剧的敌对行动。解决这一冲突的根本原因对于实现长期和平至关重要。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2189, 'App\\Models\\News', 438, 'cn', 'comment_left', NULL, '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
