	(2192, 'App\\Models\\News', 439, 'cn', 'summary', '美国三大药品分销商已达成3亿美元和解，以解决有关其在阿片类药物疫情中角色的索赔，相关信息在法庭文件中披露。该协议需司法批准，并且是在与各州和地方政府达成的210亿美元的先前和解基础上，尽管分销商并未承认任何错误。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2193, 'App\\Models\\News', 439, 'cn', 'comment_neutral', '这一和解突显了美国阿片类药物危机的持续后果，以及主要利益相关者为承担责任所做的努力。然而，这项财务协议是否会实质性地改变行业惯例仍然不确定。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
