	(2197, 'App\\Models\\News', 440, 'cn', 'summary', '联合国人权办公室将派遣一个事实调查团前往孟加拉国，调查最近暴力抗议活动中的人权侵犯，这些抗议活动导致超过1000人死亡。这些抗议活动最初是针对公共部门工作配额的，导致总理谢赫·哈西娜辞职并成立临时政府。联合国旨在分析动乱的根本原因，并提出长期改革的建议。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
