	(2202, 'App\\Models\\News', 441, 'cn', 'summary', '一名阿拉伯以色列游客与一名埃及酒店员工之间的口头争执在塔巴升级为肢体冲突，导致三名游客和两名酒店员工受伤。这场冲突据称与酒店服务争议有关，突出显示了自戈萨冲突以来以色列人和埃及人之间的紧张关系。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2203, 'App\\Models\\News', 441, 'cn', 'comment_neutral', '这一事件反映了游客与当地工作人员之间的紧张关系，同时加剧了因地区冲突而引发的更广泛紧张局势。需要采取明确措施，以确保当地人和游客的安全。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
