	(2207, 'App\\Models\\News', 442, 'cn', 'summary', '乌克兰电网运营商Ukrenergo的负责人Vadym Kudrytskyi在与总统泽伦斯基及高层官员的会议中被决定解雇后 reportedly拒绝辞职。该国有运营商在俄罗斯持续攻击能源部门的背景下，对于维持乌克兰电网的稳定至关重要。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
