	(2211, 'App\\Models\\News', 443, 'cn', 'title', '泽连斯基解除F-16坠毁后空军司令职务', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2212, 'App\\Models\\News', 443, 'cn', 'summary', '乌克兰总统泽连斯基解除空军司令奥列什丘克职务，此前一架F-16战斗机坠毁，造成飞行员死亡。尽管辞职的确切原因尚不明确，泽连斯基强调需要保护人员和加强指挥。安纳托利·克里沃诺日卡被任命为临时指挥官。该事件正由美国合作伙伴进行调查。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2213, 'App\\Models\\News', 443, 'cn', 'comment_neutral', '解除奥列什丘克司令职务引发对乌克兰空军领导责任的质疑，尤其是在如F-16坠毁这样悲惨事件后。泽连斯基的这一决定虽未明确原因，但可能反映了加强军中指挥结构的更广泛战略。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2214, 'App\\Models\\News', 443, 'cn', 'comment_left', NULL, '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
