	(2216, 'App\\Models\\News', 444, 'cn', 'title', '巴西法官因合规争议暂停埃隆·马斯克的社交媒体X', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2217, 'App\\Models\\News', 444, 'cn', 'summary', '巴西法官亚历山德雷·德·莫拉斯因埃隆·马斯克的社交媒体平台X未能遵守多个法庭命令而下令暂停该平台。莫拉斯认为，此项禁令对维护民主至关重要，而批评者则指责他的行为过度干预。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2218, 'App\\Models\\News', 444, 'cn', 'comment_neutral', '法官暂停X的决定凸显了全球范围内监管机构与社交媒体平台之间关于遵守当地法律的持续斗争。这一事件引发了关于权力平衡以及数字时代自由言论解读的重要问题。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2219, 'App\\Models\\News', 444, 'cn', 'comment_left', '莫拉斯法官的这一行动值得称赞，它突显了社交媒体传播错误信息的危险。这是确保像X这样的社交平台不会成为破坏民主的法西斯意识形态工具的必要干预。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2220, 'App\\Models\\News', 444, 'cn', 'comment_right', '莫拉斯法官是伪装的专制者，利用自己的位置来压制象埃隆·马斯克这样的 dissenting 声音。暂停X的决定明显是政府过度干预和对个人权利与自由言论的侵犯。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2221, 'App\\Models\\News', 445, 'cn', 'title', '乌克兰官员在华盛顿讨论紧急国防需求，攻击升级', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2222, 'App\\Models\\News', 445, 'cn', 'summary', '乌克兰高级官员已抵达华盛顿，与美国国防部长劳埃德·奥斯汀讨论紧急军事支持，强调在俄罗斯本周发射400多枚导弹和无人机的情况下，需要加强空中防御。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2223, 'App\\Models\\News', 445, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2224, 'App\\Models\\News', 445, 'cn', 'comment_left', NULL, '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2225, 'App\\Models\\News', 445, 'cn', 'comment_right', NULL, '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2226, 'App\\Models\\News', 446, 'cn', 'title', '欧盟拒绝基辅在乌克兰培训士兵的请求', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2227, 'App\\Models\\News', 446, 'cn', 'summary', '欧盟拒绝了乌克兰在其境内培训士兵的请求，选择在尽可能接近乌克兰领土的地方进行培训。欧盟外交政策负责人何塞普·博雷尔确认，欧盟计划在年底前培训额外的15,000名乌克兰士兵，但强调在乌克兰建立培训设施面临安全和后勤挑战。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2228, 'App\\Models\\News', 446, 'cn', 'comment_neutral', '欧盟拒绝乌克兰请求的决定反映出一种对持续冲突的谨慎态度，优先考虑其成员的安全，同时试图支持乌克兰的军事需求。在前线尽可能接近地点培训的构想是一个战略上的妥协，尽管这引发了有关后勤效率的问题。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2229, 'App\\Models\\News', 446, 'cn', 'comment_left', '欧盟不愿意直接在乌克兰培训士兵反映出其对充分支持乌克兰抵御俄罗斯侵略的缺乏承诺。这一决定不仅危及培训的有效性，还传达出对坚决抵抗外部威胁的犹豫信息。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2230, 'App\\Models\\News', 446, 'cn', 'comment_right', '欧盟选择在乌克兰以外培训乌克兰士兵反映出一种令人担忧的优柔寡断和缺乏决心的趋势。欧盟未能采取坚定措施捍卫盟友，而是选择了一种谨慎的方式，这可能会延长冲突并危及欧洲安全。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2231, 'App\\Models\\News', 447, 'cn', 'title', 'WhatsApp革命性改变津巴布韦作者的出版方式', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2232, 'App\\Models\\News', 447, 'cn', 'summary', '津巴布韦新兴作者如金斯顿·德瓦正在通过WhatsApp进行负担得起的自我出版和直接读者互动。这种新模式由于经济困难而挑战传统出版，使作者能够分享当地故事并扩大受众，尽管经济状况有限。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
