	(2237, 'App\\Models\\News', 448, 'cn', 'summary', '在巴西，最高法院的裁决导致社交媒体平台X（由埃隆·马斯克拥有）因未能遵守法律要求而暂停运营。该法院的决定是在关于虚假信息和审查的数月冲突后作出的，使数百万巴西用户面临失去访问权限的风险。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
