	(2261, 'App\\Models\\News', 453, 'cn', 'title', '萨比纳浅滩紧张升级：中国与菲律宾在海洋权利问题上冲突', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2262, 'App\\Models\\News', 453, 'cn', 'summary', '随着中国与菲律宾在南海争议的萨比纳浅滩上互相指责冲撞船只，紧张局势升级。中国海警声称，一艘“非法被搁浅”的菲律宾船只故意撞击了一艘中国船只，而菲律宾海警则报告了相反的情况。两国在国际法和近期仲裁裁决的背景下，强调他们对该地区的主权声索。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2263, 'App\\Models\\News', 453, 'cn', 'comment_neutral', '中菲之间持续的海上对抗凸显了南海领土争端的复杂性。两国必须寻求外交解决方案，以避免紧张局势升级，确保其船只在争议水域的安全。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
