	(2267, 'App\\Models\\News', 454, 'cn', 'summary', '一架载有22人的Mi-8直升机（包括19名游客）在俄罗斯喀山半岛失踪。有关部门报告在起飞后不久失去通讯，救援队正在该地区进行搜索。此事件凸显了对该偏远地区航空安全的持续担忧。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
	(2268, 'App\\Models\\News', 454, 'cn', 'comment_neutral', '直升机的失踪引起了人们对俄罗斯航空安全问题的关注，特别是在像喀山这样的偏远地区，恶劣的天气条件使救援行动变得复杂。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
