	(2272, 'App\\Models\\News', 455, 'cn', 'summary', '中国与菲律宾在南海的紧张局势升级，各自指责对方撞击海岸警卫队船只。最新事件发生在争议的萨比纳沙洲，进一步加剧领土争端。美国谴责中国的行为，使地缘政治局势进一步复杂化。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
