	(2277, 'App\\Models\\News', 456, 'cn', 'summary', '来自阿富汗的残奥会跆拳道运动员扎基亚·库达达迪在巴黎残奥会上K44 -47公斤级项目中获得铜牌，标志着她在塔利班统治下国家政治动荡后的非凡回归。她强调了自己的胜利对阿富汗女性的重要性，并表达了对美好未来的希望。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
