	(2282, 'App\\Models\\News', 457, 'cn', 'summary', '澳大利亚在酒吧和户外场所实施了严格的吸烟法规，导致吸烟率显著下降。随着英国政府考虑类似的举措，专家们评估了这些澳大利亚政策在保护公众健康方面的成功。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
