	(2287, 'App\\Models\\News', 458, 'cn', 'summary', '查韦斯医生在同意停止执业的情况下获得保释，因为他面临与演员马修·佩里死亡相关的指控。检方揭示了与佩里死亡有关的毒品分销网络，佩里体内含有高浓度的氟硝西泮。查韦斯承认参与分销氟硝西泮的阴谋，其他被控者也引发了对医疗道德和药物滥用的担忧。', '2024-09-02 00:44:50', '2024-09-02 00:44:50'),
