	(2292, 'App\\Models\\News', 459, 'cn', 'summary', '台风灿珊已在日本西南部登陆，导致至少六人死亡，超过100人受伤。这场风暴如今已降级为热带风暴，但仍在造成严重破坏和干扰，各受影响地区发出山体滑坡和洪水的警告。成千上万的人仍无电可用，恢复工作已经开始。', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
