	(2297, 'App\\Models\\News', 460, 'cn', 'summary', '以色列和黎巴嫩激进组织真主党之间爆发全面战争的恐惧有所缓解，双方在8月25日的激烈交火后已作出让步，尽管局势仍然紧张，特别是在冲突区域的居民中.', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(2298, 'App\\Models\\News', 460, 'cn', 'comment_neutral', '尽管最近的撤退是一个积极的迹象，但现在必须继续关注局势，因为以色列和真主党之间的潜在紧张关系依然存在，特别是考虑到双方动荡的历史.', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(2299, 'App\\Models\\News', 460, 'cn', 'comment_left', '国际社会必须对以色列持续的侵略采取更强有力的行动，并支持强调结束该地区军事行动的和平倡议.', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(2300, 'App\\Models\\News', 460, 'cn', 'comment_right', '以色列在面对真主党的挑衅时表现出的克制是值得赞扬的，但必须加强安全措施，以防止未来对其领土的任何攻击.', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
