	(2302, 'App\\Models\\News', 461, 'cn', 'summary', '以色列在被占领的西岸持续进行军事行动，导致包括武装分子在内的多名巴勒斯坦人丧生，且加沙战争仍在激烈进行中。尤以杰宁的冲突尤为严重，各国对暴力局势表示关注。', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
