	(2307, 'App\\Models\\News', 462, 'cn', 'summary', '随着欧盟委员会提名截止日期的临近，保加利亚、意大利和丹麦宣布了候选人，而比利时则因政治动荡而苦苦挣扎。保加利亚是唯一一个在截止日期前满足乌尔苏拉·冯德莱恩主席男女候选人要求的国家。提名反映出性别代表性方面持续存在的挑战。', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
