	(2312, 'App\\Models\\News', 463, 'cn', 'summary', 'Telegram的首席执行官帕维尔·杜罗夫因允许平台上存在非法内容（包括儿童性虐待材料和毒品贩运）而在法国面临指控。尽管Telegram被视为反政府抗议的工具，但在考虑遵守法国法律时，它在保持最小审查和用户隐私核心价值观的同时，面临着公众形象的挑战。', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
