	(2317, 'App\\Models\\News', 464, 'cn', 'summary', '日内瓦钟表周已进入第五届，汇聚52个奢侈钟表品牌和数千名收藏家以及记者。该活动是在疫情期间启动的，采用分散式设计，为钟表行业提供了充满创新和多样性的非正式环境。', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(2318, 'App\\Models\\News', 464, 'cn', 'comment_neutral', '日内瓦钟表周已成为钟表日历上一个重要事件，反映出在后疫情时代，行业的韧性和适应能力。它汇聚了众多品牌和爱好者，突显出奢侈品行业内消费者参与的演变。', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(2319, 'App\\Models\\News', 464, 'cn', 'comment_left', NULL, '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(2320, 'App\\Models\\News', 464, 'cn', 'comment_right', NULL, '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(2321, 'App\\Models\\News', 465, 'cn', 'title', '萨克森州和图林根州即将举行的选举引发对极右翼崛起的担忧', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(2322, 'App\\Models\\News', 465, 'cn', 'summary', '萨克森州和图林根州的选民将在本周日投票参加地方选举，这对评估公众对德国联合政府的情绪至关重要。极右翼政党德国选择党（AfD）的表现预计将强劲，可能会使传统政党如基督教民主联盟（CDU）在极端分子袭击后日益高涨的反移民情绪中面临联合执政的困境。', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(2323, 'App\\Models\\News', 465, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
