	(2326, 'App\\Models\\News', 466, 'cn', 'title', '日本政府考虑对芯片制造商Rapidus进行投资以提升信誉和吸引投资', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(2327, 'App\\Models\\News', 466, 'cn', 'summary', '日本政府正在考虑对芯片制造商Rapidus Corp.进行投资，该公司计划在2027年开始大规模生产下一代半导体。此举旨在提升公司的信誉，从而可能鼓励私营部门的投资和贷款，因为它正在北海道建设一座新工厂。', '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
	(2328, 'App\\Models\\News', 466, 'cn', 'comment_neutral', NULL, '2024-09-02 00:44:51', '2024-09-02 00:44:51'),
